var book = {
	"name": "၃ မိစ့ၭ",
	"numChapters": 27,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ယဟိဝၩကိၭထၪ့စမိစ့ၭတၭ, ချဲၩ့ထၪ့ဝ့ၫ လၧဆၧ",
			"2": "<sup>2</sup> အီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့နီၪ, စံၭဝ့ၫဒၪ,- ချဲၩ့ဆၧ လၧၦအံၫစရ့လၭဖိၪတၭ, လီၩဘၪအဝ့ၫၥံၪၦလဂၩဂၩ လၧနၥံၪအကျၩအ့ၪဂဲၫဆိၬဆၧမၩဘိၪ့ လၧယဟိဝၩ အအီၪတၭ, နၥံၪဘၪဂဲၫဆိၬ ဆၧမၩဘိၪ့လၧဆၧဖိၪဆၧ ဎါအဒိၩ့, လၧချီ, ဒဲၥိၪ ဒဲဘ့ၪအကျၩလီၫ.",
			"3": "<sup>3</sup> အဆၧမၩဘိၪ့နီၪ အ့ၪမွဲဆၧလုမ့ၪလၧချီအကျၩတၭ, မွဲအဘၪမၩဘိၪ့ အဖၫအလၧၫ့အဎွ့ၩ လဒုၩနီၪဆံၭ. ဘၪမၩဘိၪ့ဝ့ၫဘဲၫၥိၭ အမိဘၪဆၧအၥၭထီး ဆၧအီၪ ကီၪ့ အတဲၩဆံၫ့ဎံၪအတရၫ့ လၧယဟိဝၩအမ့ၬယၫ",
			"4": "<sup>4</sup> လီၫ.- ဘၪအီၪက့ၪအစူၪလၧဆၧလုမ့ၪအခိၪတၭ, မိဘၪ ဆၧအၥၭလၧအဂး, ဘဲၫၥိၭအမိမၩဆၧဖီၩ့ဖျ့ၭလၧအ",
			"5": "<sup>5</sup> ဂးလီၫ.- ဘၪမၩၥံၫချီဖၫလဒုၩနီၪ လၧယဟိဝၩအမ့ၬ ယၫတၭ, ၦလုဆၧစအၫရၧၫ့အဖိၪခွၫလဖၪ ဘၪဂဲၫဆိၬ အၥွံၪတၭ, ဎွံၪဝၬဖီၩ့ဝ့ၫလၧဆၧလုလးအဖၫ့ခိၪလၧအ အီၪလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအတရၫ့ ထံၭနီၪ",
			"6": "<sup>6</sup> လီၫ.- တၭဘၪဘျူၭလၩ့ခွံၬဆၧလုနီၪအဖံၭ, ဒဲဒၪ့ထ့ၬ",
			"7": "<sup>7</sup> လကုၭလကုၭလီၫ.- တၭၦလုဆၧစအၫရၧၫ့အဖိၪခွၫ လဖၪဘၪအီၪက့ၪမ့ၪ လၧဆၧလုလးအဖၫ့ခိၪတၭ,ၥီၩ့",
			"8": "<sup>8</sup> လၩ့ၥံၪ့မုလၧမ့ၪအဖၫ့ခိၪလီၫ.- တၭၦလုဆၧစအၫရၧၫ့ အဖိၪခွၫလဖၪ, ဘၪအီၪက့ၪအကုၭလဖၪ, အခိၪဎွံၪ, ဒဲအၥိၪလၧၥံၪ့မုအဖၫ့ခိၪ, လၧအအီၪ လၧမ့ၪအဖၫ့ခိၪ",
			"9": "<sup>9</sup> လၧဆၧလုလးအဖၫ့ခိၪလီၫ.- အ့ၪမွဲအဎွံၬ, ဒဲအခၪ့နီၪ ဘၪၥူၫဝၭဝ့ၫလၧထံၫတၭ, ၦလုဆၧဘၪဆူၭထၪ့ခွံၬ ထီးအလူၬလၧဆၧလုလးအဖၫ့ခိၪလီၫ. မွဲဆၧလုမ့ၪ, ဆၧလုမၩလၧမ့ၪ, ဆၧနၧၫ့မၧၫ့ မုၬလၧယဟိဝၩအဂး လီၫ.",
			"10": "<sup>10</sup> တၭဆၧလၧမ့ၪအဂးနီၪ အဆၧမၩဘိၪ့အ့ၪမွဲလၧဆၧ အဒီၪ့ၥံၪ, ၥိၪမွဲဂ့ၩ, ဘ့ၪမွဲဂ့ၩ, ဘၪဂဲၫဆိၬအဖၫအလၧၫ့",
			"11": "<sup>11</sup> အဎွ့ၩလဒုၩလီၫ.- ဘၪမၩၥံၫဝ့ၫလၧဆၧလုလးအနဲၩ့ လၧမုဖၩလခီၫ လၧယဟိဝၩအမ့ၬယၫတၭ, ၦလုဆၧ စအၫရၧၫ့အဖိၪခွၫလဖၪ, ဘၪဎွံၪအၥွံၪဝၬဖီၩ့ဝ့ၫလၧ",
			"12": "<sup>12</sup> ဆၧလုလးအဖၫ့ခိၪလီၫ.- ဘၪဒၪ့ထ့ၬဝ့ၫလကုၭလကုၭ တၭ,အခၪ့, ဒဲအခိၪနီၪ, ၦလုဆၧလဖၪဘၪအီၪက့ၪဎၩ့ ဝ့ၫလၧၥံၪ့မုအဖၫ့ခိၪ, လၧအအီၪလၧမ့ၪအဖၫ့ခိၪလၧအ",
			"13": "<sup>13</sup> အီၪလၧဆၧလုလးအဖၫ့ခိၪလီၫ.- အ့ၪမွဲအဎွံၬဒဲအခၪ့ နီၪဘၪၥူၫဝၭဆံၫ့ဝ့ၫလၧထံၫတၭ, ၦလုဆၧ လဂၩနီၪ ဘၪဂဲၫဆိၬထီးအလူၬတၭး ဆူၭထၪ့ခွံၬဝ့ၫလၧဆၧလု လးအဖၫ့ခိၪတၭ, မွဲဆၧလုမ့ၪ, ဆၧလုမၩလၧမ့ၪ, ဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂးလီၫ.",
			"14": "<sup>14</sup> အဆၧမၩဘိၪ့ဆၧလုမ့ၪ လၧယဟိဝၩအဂးနီၪ,အ့ၪ မွဲထိၪၥံၪလံၪၥံၪတၭ, လၧထိၪလွံမွဲဂ့ၩ, လၧကၪကဲၪဖိၪ",
			"15": "<sup>15</sup> မွဲဂ့ၩ, ဘၪဂဲၫဆိၬအဆၧမၩဘိၪ့နီၪလီၫ.- ၦလုဆၧလ ဂၩနီၪဘၪဂဲၫဆိၬဝ့ၫလၧဆၧလုလးတၭ, ဝံၬထ့ၬခွံၬအ ခိၬတၭ, ဆူၭထၪ့ခွံၬဝ့ၫလၧဆၧလုလးအဖၫ့ခိၪတၭ,အ",
			"16": "<sup>16</sup> ၥွံၪနီၪဘၪဝံၬခွံၬဝ့ၫ လၧဆၧလုလးအနဲၩ့ဖၩလီၫ.- ဘၪ ထုၭထၪ့ခွံၬအနံၫ့ဒဲအအ့ၪအဆီၪ့ၥံၪတၭ, ခွံၬၡိၭခွံၬဝ့ၫ လၧဆၧလုလးအနဲၩ့ထံၭ လၧမုထၪ့လခီၫ, လၧဖံၫ့ချၪ",
			"17": "<sup>17</sup> အလးနီၪလီၫ.- ဘၪဒၪ့ဖၭဝ့ၫအီၪလၧအဒံၭထီးအလူၬ လါနၫ့တၭ, ဒၪ့ထ့ၬခွံၬဘၪအ့ၬ. တၭၦလုဆၧလဂၩနီၪ ဘၪဆူၭထၪ့ခွံၬဝ့ၫ လၧဆၧလုလးအဖၫ့ခိၪ, လၧၥံၪ့မု အဖၫ့ခိၪလၧအအီၪ လၧမ့ၪအဖၫ့ခိၪလီၫ. မွဲဆၧလုမ့ၪ, ဆၧလုမၩလၧမ့ၪ, ဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂး လီၫ."
		},
		"2": {
			"1": "<sup>1</sup> ထီးၦၡၩလဂၩဂၩမိမၩဘိၪ့ ဆၧမၩဘိၪ့ကိၪမုၬလၧ ယဟိဝၩအဂးတၭ, ဘၪမၩန့ကိၪမုၬ ဒဲဘၪဂါလၩ့ၥိၪ လၧအဖၫ့ခိၪ, ဒဲအီၪက့ၪလီဘၫ့ လၧအဖၫ့ခိၪလီၫ.",
			"2": "<sup>2</sup> ဘၪဂဲၫဆိၬဝ့ၫလၧၦလုဆၧစအၫရၧၫ့ အဖိၪခွၫလဖၪအ အီၪတၭ, အဝ့ၫဒၪမိဘၪမၩန့ထၪ့ကိၪမုၬနီၪလစူၪ, ဒဲအ ၥိၪ, ဒဲလီဘၫ့ထီးအလူၬတၭ, ၦလုဆၧလဂၩနီၪဘၪ ဆူၭထၪ့ခွံၬဝ့ၫလၧဆၧနၪ့ထၪ့ထဲၩ့အဂး လၧဆၧလုလး အဖၫ့ခိၪ, ဆၧလုမၩလၧမ့ၪ, ဆၧနၧၫ့မၧၫ့မုၬလၧယဟိ",
			"3": "<sup>3</sup> ဝၩအဂးလီၫ.- တၭဆၧအီၪလၩ့ထး လၧဆၧမၩဘိၪ့ ကိၪမုၬနီၪမိကဲၪထၪ့ စအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪအဆၧ လီၫ. မွဲဆၧဆံၫ့ဎံၪထုၬ လၧဆၧမၩဘိၪ့ယဟိဝၩလၧမ့ၪ လဖၪအကျၩနီၪလီၫ.",
			"4": "<sup>4</sup> နအ့ၪဂဲၫဆိၬ ဆၧမၩဘိၪ့ကိၪမုၬအၪ့ဎူဝ့ၫ လၧဖံၫ့ချၪ ဖၧၩ့တၭ, မွဲကိၪမုၬလဲၩဎုၬလၧၥိၪဒဲလအီၪဘၪလၧမံၪ, အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ကိၪလလဲၩဎုၬဘၪလၧမံၪအ ဘၧၩ့ဖျၪဒၪဘၪဆၧဂုၪဝ့ၫ လၧၥိၪလီၫ.",
			"5": "<sup>5</sup> နမၩဘိၪ့ဆၧနီၪ အ့ၪမွဲဆၧမၩဘိၪ့ကိၪမုၬ အၪ့ဎူဝ့ၫ လၧထၭပၪပဲၪအလီၩ့တၭ, မိမွဲကိၪမုၬလအီၪဘၪ လၧ",
			"6": "<sup>6</sup> မံၪ,လဲၩဎုၬလၧၥိၪလီၫ.- နဘၪဘိၭဖၭဝ့ၫလလီၪ့လလီၪ့ တၭ,ဂါလၩ့ၥိၪလၧအဖၫ့ခိၪလီၫ. မွဲဆၧမၩဘိၪ့ကိၪမုၬ လီၫ.",
			"7": "<sup>7</sup> နမၩဘိၪ့ဆၧနီၪ အ့ၪမွဲဆၧမၩဘိၪ့ကိၪမုၬတၭ, ကိၪ မုၬနီၪမိဘၪလဲၩဎုၬလၧၥိၪ ဒဲအၪ့ဆ့ၭလၧဖၧၩ့ဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> တၭနဘၪဂဲၫဆိၬဆၧမၩဘိၪ့ကိၪမုၬ လၧအဘၪဆၧမၩ ဝ့ၫလၧဆၧလဖၪနီၪလၧယဟိဝၩ အအီၪလီၫ. ထီးအ ထီၩ့လၧ ၦလုဆၧလဂၩနီၪအအီၪတၭ, အဝ့ၫဒၪဘၪဂဲၫ",
			"9": "<sup>9</sup> ဆိၬဝ့ၫလၧဆၧလုလးလီၫ.- ၦလုဆၧလဂၩနီၪဘၪမၩ န့ထၪ့ဝ့ၫလၧဆၧမၩဘိၪ့ကိၪမုၬအဖၧၩ့ လၧဆၧနၪ့ထၪ့ ထဲၩ့အဂးတၭ, ဘၪဆူၭထၪ့ခွံၬဝ့ၫလၧဆၧ လုလးအ ဖၫ့ခိၪလီၫ. မွဲဆၧလုမၩလၧမ့ၪ, ဆၧနၧၫ့မၧၫ့မုၬလၧယ",
			"10": "<sup>10</sup> ဟိဝၩအဂးလီၫ.- တၭဆၧအီၪလၩ့ထး လၧဆၧမၩ ဘိၪ့ကိၪမုၬနီၪမိကဲၪထၪ့စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪအ ဆၧတၭး မွဲဆၧဆံၫ့ဎံၪထုၬ လၧဆၧလုလဖၪ အကျၩ မၩလၧမ့ၪ လၧဆၧမၩဘိၪ့ ယဟိဝၩနီၪလီၫ.",
			"11": "<sup>11</sup> တၭဆၧမၩဘိၪ့ကိၪမုၬ လၧနၥံၪဂဲၫဆိၬဝ့ၫလၧယ ဟိဝၩအအီၪနီၪ, ဘၪမၩလၧမံၪနးမံၩ့အ့ၬ. အဂဲးဘဲၫ ယီၩမံၪမွဲဂ့ၩ, န့ၫစၩ့မွဲဂ့ၩ, နၥံၪဆူၭထၪ့လၧ ဆၧလုမၩ လၧမ့ၪအဖၧၩ့ လၧယဟိဝၩအဂး နးမံၩ့အ့ၬ.",
			"12": "<sup>12</sup> ဆၧဘၪဆဲၫ့လၧဆၧဘိၪ့ၥၪဆိၫနီၪ နၥံၪဘၪဖ့ၪလၫ့ လၧယဟိဝၩအဂးလီၫ. မွဲလါနၫ့ ဆူၭထၪ့ဘၪဝ့ၫလၧ ဆၧလုလးအဖၫ့ခိၪ လၧဆၧနၧၫ့မၧၫ့မုၬ အဂးအ့ၬ.",
			"13": "<sup>13</sup> တၭကယဲနမၩဘိၪ့ဆၧလၧနမၩ ဘိၪ့ကိၪမုၬအကျၩ နီၪ, နဘၪဒုၭဂၫ့ဝ့ၫလၧ ထံၫလၪကိၭအမံၩ့ဒ့ၭလီၫ. တၭ ထံၫလၪဘၪဆဲၫ့လၧယွၩ အဆၧအုၩ့လၩ့အ့ၪလအီၪ ဘၪတၭ, ဒုၭအီၪနဆၧမၩဘိၪ့ကိၪမုၬလဂ့ၩ, နဘၪမၩ ထံၫလၪလၧနဆၧမၩဘိၪ့ ထီးအလူၬအဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> နအ့ၪမၩဘိၪ့ယဟိဝၩ လၧဆၧမၩဘိၪ့နဆၧၥၪဆိၫ တၭ, နဘၪမၩဘိၪ့နဆၧၥၪဆိၫ လၧဘုၪဆဲၩၥံၪ အၥံၫ့ ဆ့ၬတၭ မၩဎဲၫ့ဝ့ၫလၧမ့ၪဂီၩ့တၭ, အဆဲၩအလၧၫ့အ",
			"15": "<sup>15</sup> ဎွ့ၩနီၪဖူၬန့အၥၪလီၫ.- နဘၪအီၪက့ၪၥိၪ လၧအလီၩ့ တၭအီၪက့ၪလီဘၫ့ လၧအဖၫ့ခိၪလီၫ. မွဲဆၧမၩဘိၪ့",
			"16": "<sup>16</sup> ကိၪမုၬလီၫ.- တၭၦလုဆၧလဂၩနီၪ ဘၪဆူၬထၪ့ခွံၬဝ့ၫ လၧဆၧနၪ့ထၪ့ထဲၩ့အဂး, ဘုၪလၧအဘၪဆၧဖူၬန့ဝ့ၫ လနၩ့, ဒဲၥိၪလနၩ့, ဒဲလီဘၫ့ထီးအလူၬလီၫ. မွဲဝ့ၫဆၧ လုမၩလၧမ့ၪလၧယဟိဝၩအဂးလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> အဆၧမၩဘိၪ့နီၪ အ့ၪမွဲဆၧလုဘၪလိၬအိၭလိၬတၭ, အ့ၪမၩဘိၪ့ချီလဒုၩတၭအမိမွဲဂ့ၩ, အဖၫမွဲဂ့ၩ, ဘၪမၩ ဘိၪ့ဆၧအလၧၫ့အဎွ့ၩ လၧယဟိဝၩအမ့ၬယၫလီၫ.",
			"2": "<sup>2</sup> ဘၪအီၪက့ၪအစူၪလၧအဆၧမၩဘိၪ့အခိၪတၭ, ဘၪ မၩၥံၫဝ့ၫထီးဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအတရၫ့လီၫ. တၭၦလုဆၧစအၫရၧၫ့အဖိၪခွၫလဖၪ ဘၪဎွံၪအၥွံၪဝၬ",
			"3": "<sup>3</sup> ဖီၩ့ဝ့ၫလၧဆၧလုလးအဖၫ့ခိၪလီၫ.- တၭလၧဆၧလု ဘၪလိၬအိၭလိၬ အဆၧမၩဘိၪ့နီၪ ဘၪဂဲၫဆိၬလၧဆၧ လုမၩလၧမ့ၪလၧယဟိဝၩအဂး, ဆၧၥိၪလၧအဖိၭဘံၭ အဎွံၬလဖၪ, ဒဲကယဲဆၧၥိၪ လၧအအီၪလၧအဎွံၬၥံၪ",
			"4": "<sup>4</sup> အလီၩ့,- ဒဲအလ့နံၫဖျိၪ့, ဒဲဆၧၥိၪအီၪလၧအလီၩ့, လၧအအီၪလၧအယးဒံၩ့အနဲၩ့, ဒဲဒံၩလၧအအီၪလၧ အၥုၪ့အဖၫ့ခိၪနီၪ ဒဲအလ့လဖၪ ဘၪဆၧမၩန့ထၪ့ခွံၬ",
			"5": "<sup>5</sup> ဝ့ၫလီၫ.- တၭစအၫရၧၫ့အဖိၪခွၫလဖၪ ဘၪဆူၭထၪ့ခွံၬ ဝ့ၫလၧဆၧလုလးအလီၩ့ လၧဆၧလုလးအဖၫ့ခိၪလၧ အအီၪလၧၥံၪ့မုအဖၫ့ခိၪ, လၧအအီၪလၧမ့ၪအဖၫ့ခိၪ လီၫ. မွဲဆၧလုမၩလၧမ့ၪ, ဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩ အဂးလီၫ.",
			"6": "<sup>6</sup> တၭအဆၧမၩဘိၪ့ယဟိဝၩ လၧဆၧလုမၩဘၪလိၬ အိၭလိၬဆၧအဂးနီၪ, အ့ၪမွဲလၧၥိၪအဒီၪ့နီၪ, အမိမွဲ ဂ့ၩ, အဖၫမွဲဂ့ၩ, ဘၪမၩဘိၪ့ လၧဆၧအလၧၫ့အဎွ့ၩ",
			"7": "<sup>7</sup> လီၫ.- အဝ့ၫဒၪအ့ၪဂဲၫဆိၬၥိၪဖိၪလဒုၩ လၧအဆၧမၩ ဘိၪ့အဂးတၭ, ဘၪဂဲၫဆိၬဝ့ၫ လၧယဟိဝၩအမ့ၬယၫ",
			"8": "<sup>8</sup> လီၫ.- ဘၪအီၪက့ၪအစူၪ လၧအဆၧမၩဘိၪ့အဖၫ့ခိၪ တၭ, ဘၪမၩၥံၫဝ့ၫလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအ မ့ၬယၫလီၫ. တၭစအၫရၧၫ့အဖိၪခွၫလဖၪ ဘၪဎွံၪအၥွံၪ",
			"9": "<sup>9</sup> ဝၬဖီၩ့ဝ့ၫ လၧဆၧလုအလးအဖၫ့ခိၪလီၫ.- လၧဆၧလု ဘၪလိၬအိၭလိၬ အဆၧမၩဘိၪ့နီၪ ဘၪဂဲၫဆိၬဆၧလု မၩလၧမ့ၪလၧယဟိဝၩအဂး, အဆၧၥိၪ, ဒဲအမ့ထၧၫ့ ဘီၩ့ယၫဘၪဒၪ့ထ့ၬဝ့ၫဘူၭလၧအချိၫ့ခိၪ, ဒဲဆၧၥိၪလၧ အဖိၭဘံၭအဎွံၬလဖၪ, ဒဲဆၧၥိၪအီၪဝ့ၫ လၧဎွံၬၥံၪအ",
			"10": "<sup>10</sup> လီၩ့ထီးအလူၬ,- ဒဲအလ့နံၫဖျိၪ့, ဒဲဆၧၥိၪလၧအအီၪ လၧအလီၩ့ လၧအအီၪလၧအယးဒံၩ့အနဲၩ့ထံၭ ဒဲဒံၩ အီၪလၧအၥုၪ့အဖၫ့ခိၪနီၪ ဒဲအလ့လဖၪဘၪမၩန့ထၪ့",
			"11": "<sup>11</sup> ခွံၬဝ့ၫလီၫ.- တၭၦလုဆၧလဂၩနီၪ ဘၪဆူၭထၪ့ခွံၬဝ့ၫ လၧဆၧလုလးအဖၫ့ခိၪလီၫ. မွဲဆၧလုမၩလၧမ့ၪလၧ",
			"12": "<sup>12</sup> ယဟိဝၩအဂးအဆၧအၪ့လီၫ.- အဆၧမၩဘိၪ့နီၪအ့ၪ မွဲဘ့ၪလဒုၩတၭ, ဘၪဂဲၫဆိၬဝ့ၫလၧယဟိဝၩအမ့ၬယၫ",
			"13": "<sup>13</sup> လီၫ.- ဘၪအီၪက့ၪအစူၪလၧအခိၪအလီၩ့တၭ, ဘၪမၩ ၥံၫဝ့ၫလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အမ့ၬယၫလီၫ. တၭစအၫရၧၫ့ အဖိၪခွၫလဖၪ ဘၪဎွံၪအၥွံၪဝၬဖီၩ့ဝ့ၫ",
			"14": "<sup>14</sup> လၧဆၧလုလးအဖၫ့ခိၪလီၫ.- တၭလၧအမၩဘိၪ့ဆၧ နီၪဘၪဂဲၫဆိၬ ဆၧလုမၩလၧမ့ၪ လၧယဟိဝၩအဂး, ဆၧၥိၪလၧအဖိၭဘံၭအဎွံၬလဖၪ, ဒဲကယဲဆၧၥိၪလၧ",
			"15": "<sup>15</sup> အဎွံၬၥံၪအလီၩ့,- ဒဲအလ့နံၫဖျိၪ့ ဒဲဆၧၥိၪလၧအအီၪ လၧအလီၩ့လၧအယးဒံၩ့အနဲၩ့ထံၭ, ဒဲဒံၩအီၪလၧအ ၥုၪ့အဖၫ့ခိၪနီၪ, ဒဲအလ့လဖၪဘၪမၩန့ထၪ့ခွံၬဝ့ၫလီၫ.",
			"16": "<sup>16</sup> တၭၦလုဆၧလဂၩနီၪဘၪဆူၭထၪ့ခွံၬဝ့ၫ လၧဆၧလုလး အဖၫ့ခိၪလီၫ. မွဲဆၧလုမၩလၧမ့ၪ အဆၧအၪ့လၧဆၧ နၧၫ့မၧၫ့မုၬအဂးလီၫ. ကယဲဆၧၥိၪနီၪမွဲယဟိဝၩအဆၧ",
			"17": "<sup>17</sup> ထီးအလူၬလီၫ.- ဆၧမၪလူၬအဆိၩအကၠၪလၩ့လၧန ၥံၪအဆၨၩအဆၬ လဆၨၩဘၪလဆၨၩ လၧနၥံၪအီၪ လစီၪ့လါလါနီၪ, ဆၧၥိၪမွဲဂ့ၩ, ဆၧၥွံၪမွဲဂ့ၩ, နၥံၪအၪ့ ဘၪအ့ၬ."
		},
		"4": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ချဲၩ့ ထၪ့ဘၪနဝ့ၫ လၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ, ၦလဂၩ ဂၩအ့ၪမၩဆၧဒဲၩဘၭ လၧအလၥ့ၪယၫဘၪဝ့ၫအကၠီၩ့ တၭ, မၪဘၪယဟိဝၩအဆၧမၪလူၬ လထံၪထံၪလၧ",
			"3": "<sup>3</sup> အလဂ့ၩမၩဘၪ, ဒဲမၩမၪဘၪဝ့ၫလထံၪထံၪတၭ,- ၦလု ဆၧလဂၩလၧအဒိၭဂုၪအၥၭနီၪ, အ့ၪမၩမၪဘၪဆၧ ဘဲၫၦခမျၧး မၩမၪဘၪဆၧအၥိၭတၭ, ဘၪဂဲၫဆိၬချီ ဖၫဖိၪအလၧၫ့အဎွ့ၩလဒုၩ လၧအဆၧဒဲၩဘၭ လၧအ မၩဘၪဝ့ၫအကၠီၩ့ လၧယဟိဝၩအအီၪ လၧဆၧလုဆၧ",
			"4": "<sup>4</sup> ဒဲၩဘၭလီၫ.- ဘၪဂဲၫဆိၬချီဖၫနီၪ လၧဆၧအီၪကီၪ့အ တဲၩဆံၫ့ဎံၪအတရၫ့ လၧယဟိဝၩအမ့ၬယၫတၭ, ဘၪ အီၪက့ၪအစူၪ လၧချီဖၫအခိၪနီၪ ဘၪမၩၥံၫချီဖၫ လၧ",
			"5": "<sup>5</sup> ယဟိဝၩအမ့ၬယၫလီၫ.- ၦလုဆၧလဂၩလၧအဒိၭဂုၪ အၥၭနီၪဘၪမၩန့ချီဖၫအၥွံၪတၭ ဆိၬဝ့ၫလၧဆၧအီၪ",
			"6": "<sup>6</sup> ကီၪ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့နီၪလီၫ.- တၭၦလုဆၧလ ဂၩဘၪဘၧၩ့လၩ့အစူၪနိၩ့လဘီၩ့ လၧဆၧၥွံၪဖၧၩ့, ဒဲ ဎွံၪအၥွံၪနီၪနွ့ၫဖၧၫ့ လၧယဟိဝၩအမ့ၬယၫ လၧဆၧအ",
			"7": "<sup>7</sup> လးဆံၫ့ဎံၪ အကလကၫအမ့ၬယၫလီၫ.- ၦလုဆၧလ ဂၩနီၪဘၪအီၪက့ၪအၥွံၪ လၧဆၧလုဆူၭခဲၩနၧၫ့မၧၫ့အ နိၩ့လဖၪအလီၩ့ လၧယဟိဝၩအမ့ၬယၫ, လၧအအီၪ လၧဆၧအီၪကီၪ့တဲၩဆံၫ့ဎံၪအဖၧၩ့လီၫ. ဘၪဂါလၩ့ချီဖၫ အၥွံၪထီးအလူၬ လၧဆၧလုမ့ၪလးအခၪ့ထံၭ, လၧအ အီၪလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအတရၫ့နီၪလီၫ.",
			"8": "<sup>8</sup> တၭဘၪမၩန့ချီဖၫအၥိၪ ထီးအလူၬ လၧဆၧလု ဆၧ ဒဲၩဘၭအဂး, ဆၧၥိၪလၧအဖိၭဘံၭအဎွံၬလဖၪ, ဒဲဆၧ",
			"9": "<sup>9</sup> အၥိၪအီၪလၧအဎွံၬၥံၪအလီၩ့,- ဒဲအလ့နံၫဖျိၪ့ဒဲအၥိၪ လၧအအီၪလၧအလီၩ့ လၧအအီၪလၧအယးဒံၩ့အနဲၩ့ ထံၭနီၪ, ဒဲဒံၩအီၪလၧအၥုၪ့အဖၫ့ခိၪနီၪ ဒဲအလ့လဖၪ",
			"10": "<sup>10</sup> ဘၪမၩန့ထၪ့ခွံၬဝ့ၫ,- ဘဲၫၦမၩန့ထၪ့ခွံၬဆၧလုဘၪလိၬ အိၭလိၬအချီဖၫအၥိၭနီၪလီၫ. တၭၦလုဆၧလဂၩနီၪ",
			"11": "<sup>11</sup> ဘၪဆူၭခဲၩဝ့ၫလၧဆၧလုမ့ၪလးအဖၫ့ခိၪလီၫ.- ချီဖၫအ ဖံၭ,ဒဲအယၪထီးအလူၬ, ဒဲအခိၪ,ဒဲအခၪ့, ဒဲအဎွံၬ,ဒဲအ",
			"12": "<sup>12</sup> အ့ၪ,- တၭချီဖၫထီးအလူၬနီၪ ဘၪလ့ၩဆိၬထၪ့ခွံၬဝ့ၫ လၧၦၥုၪ့တဲၩအလးလၧခီၫ့, ထီၩ့လၧအလးဆံၫ့, ထီး အလးလၧၦဂါလၩ့ဖံၫ့ချၪတၭ, ဘၪဆူၭခွံၬဝ့ၫလၧမ့ၪ လၧၥံၪ့မုအဖၫ့ခိၪလီၫ. ထီးၦဂါလၩ့ဖံၫ့ချၪနီၪၦၡၩဘၪ ဆူၭထၪ့ခွံၬထီးနီၪလီၫ.",
			"13": "<sup>13</sup> ကယဲၦအံၫစရ့လၭ အဆၧအီၪကီၪ့ ထီးအလူၬနီၪ အ့ၪမၩမၪဘၪဆၧ လမံၩ့မံၩ့ လၧအလၥ့ၪယၫဘၪဝ့ၫ အကၠီၩ့တၭ, ဆၧလမံၩ့နီၪအ့ၪအီၪဘံၭခွံၬ လၧဆၧအီၪ ကီၪ့အမ့ၬယၫတၭ, အ့ၪမၪဘၪ ယဟိဝၩ အဆၧမၪ လူၬလထံၪထံၪ လၧအလဂ့ၩမၩဘၪတၭ, အဆၧဒဲၩ",
			"14": "<sup>14</sup> ဘၭအီၪတၭ,- ထီးဆၧဒဲၩဘၭလၧအမၩဝ့ၫနီၪအ့ၪဖျီၪ ထၪ့တၭ, ထီးနီၪလဖၧၫ့ ဆၧအီၪကီၪ့ဘၪမၩဘိၪ့ချီဖၫ ဖိၪလၧဆၧဒဲၩဘၭ အဂးတၭ, ဂဲၫဆိၬဝ့ၫလၧ ဆၧအီၪ",
			"15": "<sup>15</sup> ကီၪ့အတဲၩဆံၫ့ဎံၪအမ့ၬယၫ,- တၭဆၧအီၪကီၪ့အၥုၪ့ က့ၭအၥၭၡါလဖၪ ဘၪအီၪက့ၪအစူၪ လၧချီဖၫအခိၪ လၧယဟိဝၩအမ့ၬယၫတၭ, ၦၡၩဘၪမၩၥံၫချီဖၫလၧ",
			"16": "<sup>16</sup> ယဟိဝၩအမ့ၬယၫလီၫ.- တၭၦလုဆၧလဂၩလၧအ ဒိၭဂုၪအၥၭနီၪဘၪဂဲၫဆိၬချီဖၫအၥွံၪ လၧဆၧအီၪကီၪ့",
			"17": "<sup>17</sup> အတဲၩဆံၫ့ဎံၪဖၧၩ့,- ၦလုဆၧလဂၩနီၪဘၪဘၧၩ့လၩ့ အစူၪနိၩ့လဘီၩ့ လၧဆၧၥွံၪဖၧၩ့တၭ, ဎွံၪဝ့ၫနွ့ၫဖၧၫ့ လၧယဟိဝၩအမ့ၬယၫ, လၧကလကၫအမ့ၬယၫလီၫ.",
			"18": "<sup>18</sup> တၭဘၪအီၪက့ၪဆၧၥွံၪ လၧဆၧလုလးအနိၩ့လဖၪအ လီၩ့လၧယဟိဝၩအမ့ၬယၫ, လၧအအီၪလၧဆၧအီၪ ကီၪ့ အတဲၩဆံၫ့ဎံၪဖၧၩ့လီၫ. တၭဘၪဂါလၩ့ဆၧၥွံၪ ထီးအလူၬ လၧဆၧလုမ့ၪအလးအခၪ့ထံၭ လၧအအီၪ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့ထံၭနီၪလီၫ.",
			"19": "<sup>19</sup> ဘၪမၩန့အဆၧၥိၪထီးအလူၬတၭ, ဆူၭထၪ့ခွံၬဝ့ၫလၧ",
			"20": "<sup>20</sup> ဆၧလုလးအဖၫ့ခိၪလီၫ.- တၭဘၪမၩချီဖၫနီၪဘဲၫအမၩ ချီဖၫ လၧဆၧလုဆၧဒဲၩဘၭအဂးအၥိၭလီၫ. ဘၪမၩ အယီၩဘဲၫနီၪအၥိၭလီၫ. တၭၦလုဆၧလဂၩနီၪဘၪမၩ ဆၧဖီၩ့ဖျ့ၭ လၧအဂးတၭ, ဆၧမိဖျါခွံၬအဝ့ၫၥံၪလီၫ.",
			"21": "<sup>21</sup> ဘၪဆိၬထၪ့ခွံၬချီဖၫနီၪ လၧၦၥုၪ့တဲၩအလး လၧခီၫ့ တၭ, ဆူၭထၪ့ခွံၬဝ့ၫ ဘဲၫအဆူၭထၪ့ခွံၬချီဖၫ လၧအခၪ့ ထံၭလဒုၩ အၥိၭနီၪလီၫ. အနီၪမွဲဆၧအီၪကီၪ့အဆၧ လုဆၧဒဲၩဘၭလီၫ.",
			"22": "<sup>22</sup> ထီးၦဒိၪလဂၩအ့ၪမၩဆၧဒဲၩဘၭ လၧအလၥ့ၪယၫ ဘၪဝ့ၫအကၠီၩ့တၭ, မၩဘၪယဟိဝၩအယွၩအဆၧမၪ လူၬလထံၪထံၪ လၧအလဂ့ၩမၩဘၪနီၪ အဆၧဒဲၩဘၭ",
			"23": "<sup>23</sup> အီၪ,- တၭဆၧအ့ၪလီၩဘၪၥ့ၪယၫ လၧအဆၧဒဲၩဘၭ လၧအမၩဝ့ၫနီၪ, ဘၪဂဲၫဆိၬအဆၧမၩဘိၪ့, ဘ့ၪဖိၪအ",
			"24": "<sup>24</sup> ဖၫအလၧၫ့အဎွ့ၩလဒုၩလီၫ.- ဘၪအီၪက့ၪအစူၪလၧ ဘ့ၪအခိၪတၭ, ဘၪမၩၥံၫဝ့ၫထီးအလး လၧအမၩၥံၫ ဆၧလုမ့ၪ လၧယဟိဝၩအမ့ၬယၫလီၫ. အနီၪမွဲဆၧလု",
			"25": "<sup>25</sup> ဆၧဒဲၩဘၭလီၫ.- ၦလုဆၧလဂၩနီၪ ဘၪမၩန့ဆၧလု ဆၧဒဲၩဘၭအၥွံၪ လၧအစူၪနိၩ့လဘီၩ့တၭ, အီၪက့ၪ လၧဆၧလုမ့ၪလးအနိၩ့လဖၪအလီၩ့တၭ, ဘၪဂါလၩ့",
			"26": "<sup>26</sup> အၥွံၪနီၪ လၧဆၧလုမ့ၪလး အခၪ့ထံၭလီၫ.- ဘၪဆူၭ ထၪ့ခွံၬအခိၪထီးအလူၬ လၧဆၧလုလးအဖၫ့ခိၪ ဘဲၫ မၩဘိၪ့အဆၧလုဘၪလိၬအိၭလိၬ အၥိၪအၥိၭနီၪတၭ, ၦလုဆၧလဂၩနီၪ ဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧအဂးလၧအ ဆၧဒဲၩဘၭအကၠီၩ့တၭ, ဆၧမိဖျါခွံၬအဝ့ၫဒၪလီၫ.",
			"27": "<sup>27</sup> တၭၦခးဖိၪလဂၩဂၩ အ့ၪမၩဆၧဒဲၩဘၭလၧအလၥ့ၪ ယၫဘၪဝ့ၫအကၠီၩ့ မၩယဟိဝၩအဆၧမၪလူၬလထံၪ ထံၪလၧအလဂ့ၩမၩဘၪတၭ, အဆၧဒဲၩဘၭအီၪလၧ",
			"28": "<sup>28</sup> အလီၩ့နီၪ,- တၭအဆၧဒဲၩဘၭလၧအမၩဝ့ၫအ့ၪဖျီၪ ထၪ့ ထီးအၥ့ၪယၫဝ့ၫတၭ, ဘၪဂဲၫဆိၬအဆၧမၩဘိၪ့ ဘ့ၪဖိၪအမိအလၧၫ့အဎွ့ၩလဒုၩ လၧအဆၧဒဲၩဘၭလၧ",
			"29": "<sup>29</sup> အမၩဝ့ၫအကၠီၩ့လီၫ.- ဘၪအီၪက့ၪအစူၪ လၧဆၧလု ဆၧဒဲၩဘၭအခိၪတၭ, မၩၥံၫဆၧလုဆၧဒဲၩဘၭနီၪထီး",
			"30": "<sup>30</sup> အဆၧလုမ့ၪအလးလီၫ.- ၦလုဆၧလဂၩနီၪ ဘၪမၩန့ အၥွံၪလၧအစူၪနိၩ့လဘီၩ့တၭ, အီၪက့ၪလၧဆၧလုမ့ၪ အလး အနိၩ့လဖၪအလီၩ့တၭ, ဘၪဂါလၩ့အၥွံၪထီး",
			"31": "<sup>31</sup> အလူၬလၧဆၧလုလးအခၪ့ထံၭလီၫ.- ဘၪမၩန့ခွံၬအ ၥိၪထီးအလူၬ ဘဲၫၦမၩန့ထၪ့ခွံၬ ဆၧလုဘၪလိၬအိၭ လိၬအၥိၭနီၪတၭ, ၦလုဆၧလဂၩနီၪဘၪဆူၭထၪ့ခွံၬဝ့ၫ လၧဆၧလုလးအဖၫ့ခိၪ လၧဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိ ဝၩအဂးလီၫ. တၭၦလုဆၧလဂၩနီၪ ဘၪမၩဆၧဖီၩ့ ဖျ့ၭလၧအဂးတၭ, ဆၧမိကွဲၪဖျါခွံၬ အဝ့ၫဒၪလီၫ.",
			"32": "<sup>32</sup> အဝ့ၫဒၪအ့ၪဂဲၫဆိၬၥိၪဖိၪ လၧဆၧလုဆၧဒဲၩဘၭအ",
			"33": "<sup>33</sup> ဂးတၭ, ဘၪဂဲၫဆိၬအမိအလၧၫ့အဎွ့ၩလဒုၩလီၫ.- ဘၪ အီၪက့ၪအစူၪ လၧဆၧလုဆၧဒဲၩဘၭအခိၪတၭ, ဘၪ မၩၥံၫဝ့ၫလၧဆၧလုဆၧဒဲၩဘၭအဂး, ထီးၦၡၩမၩၥံၫ",
			"34": "<sup>34</sup> ဆၧလုမ့ၪအလးနီၪလီၫ.- ၦလုဆၧလဂၩနီၪဘၪမၩန့ ဆၧလုဆၧဒဲၩဘၭအၥွံၪ လၧအစူၪနိၩ့လဘီၩ့တၭ, အီၪ က့ၪလၧဆၧလုမ့ၪအလးအနိၩ့လဖၪအလီၩ့တၭ, ဘၪ ဂါလၩ့ဆၧၥွံၪထီးအလူၬ လၧဆၧလုလးအခၪ့ထံၭလီၫ.",
			"35": "<sup>35</sup> ဘၪမၩန့ခွံၬအၥိၪထီးအလူၬ, ဘဲၫၥိၪဖိၪအၥိၪဘၪဆၧ မၩန့ထၪ့ခွံၬဝ့ၫ လၧဆၧလုမၩဘၪလိၬအိၭလိၬ အၥိၭ နီၪတၭ, ၦလုဆၧဘၪဆူၭထၪ့ခွံၬဝ့ၫ လၧဆၧလုလးအ ဖၫ့ခိၪ, ဘဲၫဆၧလုမၩလၧမ့ၪ လၧယဟိဝၩအဂးအၥိၭ နီၪလီၫ. ၦလုဆၧလဂၩနီၪ ဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧအ ဆၧဒဲၩဘၭလၧအမၩဝ့ၫအကၠီၩ့တၭ, ဆၧမိကွဲၪဖျါခွံၬ အဝ့ၫဒၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ၦလဂၩဂၩအ့ၪမၩဆၧဒဲၩဘၭ လၧအနါဂၧၫ့ဆၧဆိၪ လၩ့အၥၭအလူတၭ, ကဲၪထၪ့ၦထိးအၥၭနီၪ, ဒၪဘၪ ဆၧမွဲဂ့ၩ, ၥ့ၪယၫဆၧမွဲဂ့ၩ, အ့ၪလလီၩဘၪအဂဲးတၭ,",
			"2": "<sup>2</sup> မိဘၪဆၧဒဲၩဘၭလီၫ.- လၧနီၪအမ့ၬယၫ ၦလဂၩဂၩ အ့ၪထိၭဘၪဆၧလဆံၫ့ဘၪ လမံၩ့မံၩ့, ဆၧဖိၪဆၧဎါ အမံၩ့ လဆံၫ့ဘၪ အစွၪမွဲဂ့ၩ, ဆၧဖိၪဆၧဎါအဒိၩ့လ ဆံၫ့ဘၪအစွၪမွဲဂ့ၩ, ဆၧအစွၩလဆံၫ့ဘၪ အစွၪမွဲဂ့ၩ တၭ, အ့ၪအီၪဘံၭလၧအနၫ့ဆါလါနၫ့, အဝ့ၫဒၪနီၪမွဲ လဆံၫ့ဘၪဆ့တၭ, အဆၧဒဲၩဘၭအီၪလၧအလီၩ့လီၫ.",
			"3": "<sup>3</sup> လၧနီၪအမ့ၬယၫအ့ၪထိၭဘၪၦၡၩ အဆၧလဆံၫ့ဘၪ, ကယဲဆၧလၧအလဆံၫ့ဘၪလမံၩ့မံၩ့ လၧၦဘၪစံၪစၪဝ့ၫ အကၠီၩ့တၭ, အ့ၪအီၪဘံၭလၧအဝ့ၫတၭ, ထီးအၥ့ၪယၫ",
			"4": "<sup>4</sup> ဝ့ၫနီၪ, အဆၧဒဲၩဘၭမိအီၪလၧအလီၩ့လီၫ.- ၦလဂၩ ဂၩအ့ၪဆိၪလၩ့အၥၭတၭ, အ့ၪစံၭလၧအနိၭလၧအမိ မၩဆၧအၧၩ့မွဲဂ့ၩ, မၩဆၧဂ့ၩမွဲဂ့ၩ, ကယဲဆၧလၧၦၡၩ မိစံၭလၧဆၧဆိၪလၩ့အၥၭ လမံၩ့မံၩ့တၭ,အ့ၪအီၪဘံၭ လၧအဝ့ၫနီၪ, ထီးအ့ၪၥ့ၪယၫဝ့ၫတၭ, အဆၧဒဲၩဘၭမိ",
			"5": "<sup>5</sup> အီၪလၧဆၧနီၪလဖၪအကျၩ လမံၩ့အကၠီၩ့လီၫ.- ထီး ဆၧဒဲၩဘၭ အ့ၪအီၪလၧအလီၩ့, လၧဆၧလဖၪနီၪအ ကၠီၩ့လမံၩ့မံၩ့တၭ, ဆၧမိမၩအၥၭလၧအဘၪလီၩလၩ့",
			"6": "<sup>6</sup> အမၩဆၧဒဲၩဘၭလၧဆၧနီၪလမံၩ့လီၫ.- ဘၪဂဲၫဆိၬ အဆၧလမၪဘၪ ဆၧလၧအဆၧဒဲၩဘၭ လၧအမၩဝ့ၫ အကၠီၩ့လၧယဟိဝၩအအီၪ, ၥိၪဖိၪမွဲဂ့ၩ, ဘ့ၪဖိၪမွဲဂ့ၩ, အမိလဒုၩလၧအဆၧဒဲၩဘၭအဂးလီၫ. တၭၦလုဆၧ လဂၩနီၪ ဘၪမၩဆၧဖီၩ့ဖျ့ၭလၧအဂး လၧအဆၧဒဲၩ ဘၭအကၠီၩ့လီၫ.",
			"7": "<sup>7</sup> အဝ့ၫဒၪဂဲၫဆိၬၥိၪဖိၪနီၪအ့ၪလၥ့ၪဘၪတၭ, ထီးနီၪ လဖၧၫ့ထိၪလွံနံၫဘံၪ့မွဲဂ့ၩ, ကၪကဲၪဖိၪနံၫဘံၪ့မွဲဂ့ၩ လၧ အမၪဘၪ ဆၧလၧအမၩဝ့ၫအကၠီၩ့နီၪ ဘၪဂဲၫဆိၬလၧ ယဟိဝၩအအီၪလီၫ. လၧဆၧလုဆၧဒဲၩဘၭအဂးလ",
			"8": "<sup>8</sup> ဘံၪ့,ဒဲလၧဆၧလုမ့ၪအဂးလဘံၪ့လီၫ.- ဘၪဂဲၫဆိၬဝ့ၫ လၧၦလုဆၧလဂၩနီၪအအီၪတၭ, အဝ့ၫဒၪဘၪလုထၪ့ ဆိၫဝ့ၫလၧဆၧဒဲၩဘၭအဂးလဘံၪ့နီၪတၭ, ဝံၬခါအခိၪ",
			"9": "<sup>9</sup> ဎွံၪလၧအခိၬလီၩ့, လါနၫ့မၩထ့ၬခွံၬဘၪအ့ၬ.- ဘၪဎွံၪ ဆၧလုဆၧဒဲၩဘၭအၥွံၪ လၧဆၧလုလးအပၪအလီၩ့ တၭ,ဆၧၥွံၪလၧအအီၪလၩ့ထးနီၪ ဘၪဝံၬခွံၬဝ့ၫလၧဆၧ",
			"10": "<sup>10</sup> လုလးအခၪ့ထံၭ, အနီၪမွဲဆၧလုဆၧဒဲၩဘၭလီၫ.- နံၫ ဘံၪ့လဘံၪ့နီၪ ဘၪလုထၪ့လၧဆၧလုမ့ၪဘဲၫဆၧစ့ၩရၫ့ အၥိၭတၭ, ၦလုဆၧလဂၩနီၪ ဘၪမၩဆၧဖီၩ့ဖျ့ၭလၧ အဂးလၧအဆၧဒဲၩဘၭ လၧအမၩဝ့ၫအကၠီၩ့လီၫ. တၭ ဆၧမိကွဲၪဖျါခွံၬအဝ့ၫဒၪလီၫ.",
			"11": "<sup>11</sup> ထိၪလွံနံၫဘံၪ့မွဲဂ့ၩ, ကၪကဲၪဖိၪနံၫဘံၪ့မွဲဂ့ၩ,ဂဲၫဆိၬ အ့ၪလၥ့ၪဘၪတၭ, လၧအမၩဘိၪ့ဆၧအဂးနီၪ ၦလၧအ မၩဆၧဒဲၩဘၭလဂၩ ဘၪဂဲၫဆိၬကိၪမုၬလအ့ဖၭ ဎလနၬၭ ဆံၫပိၩ့လပိၩ့နီၪ လၧဆၧလုဆၧဒဲၩဘၭအဂးလီၫ. ၥိၪ မွဲဂ့ၩ,လီဘၫ့မွဲဂ့ၩ, ဆၧအီၪက့ၪဘၪလၧအဖၫ့ခိၪအ့ၬ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩအနီၪမွဲဆၧလုဆၧဒဲၩဘၭလီၫ.- ထီးနီၪ လဖၧၫ့ဘၪဂဲၫဆိၬဝ့ၫ လၧၦလုဆၧလဂၩနီၪအအီၪတၭ, ၦလုဆၧလဂၩနီၪ ဘၪမၩန့ဆၧနီၪ လစူၪလၧအဆၧနၪ့ ထၪ့ထဲၩ့တၭ, ဆူၭခဲၩထၪ့ခွံၬဝ့ၫလၧဆၧလုလးအဖၫ့ခိၪ, ဘဲၫဆၧလုမၩလၧမ့ၪ လၧယဟိဝၩအဂးအၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> အနီၪမွဲဆၧလုဆၧဒဲၩဘၭလီၫ.- ၦလုဆၧလဂၩနီၪဘၪ မၩဆၧဖီၩ့ဖျ့ၭလၧအဆၧဒဲၩဘၭ လၧအမၩဝ့ၫအကၠီၩ့ လၧဆၧလဖၪနီၪ လမံၩ့မံၩ့လီၫ. တၭဆၧမိကွဲၪဖျါခွံၬ အဝ့ၫဒၪလီၫ. တၭဆၧအီၪလၩ့ထးမိကဲၪထၪ့ၦလုဆၧ လဂၩနီၪအဆၧ, ဘဲၫဆၧမၩဘိၪ့ကိၪမုၬ အၥိၭနီၪလီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ၦလ ဂၩဂၩအ့ၪမၩမၪဆၧလၧအအၪ့လီၫဆၧ, ဒဲမၩဆၧဒဲၩ ဘၭလၧအလၥ့ၪယၫဘၪဝ့ၫအကၠီၩ့ လၧယဟိဝၩအဆၧ ဆံၫ့ဎံၪလဖၪအဖၧၩ့နီၪ, ဘၪဂဲၫဆိၬဆၧအဖၫအလၧၫ့ အဎွ့ၩလဒုၩလၧၥိၪဒဲဘ့ၪအကျၩ လၧအမၪဘၪဆၧအ ကၠီၩ့, ထီးနအီၪက့ၪအဎွ့ၩ လၧၡက့လၭစ့ၩ ဎလဘၭၭ ဘဲၫဆၧအလးဆံၫ့ဎံၪၡက့လၭအၥိၭနီၪ, လၧအဆၧလု",
			"16": "<sup>16</sup> မၪဘၪဆၧအဂးလီၫ.- အဝ့ၫဘၪဖ့ၪထဲၩ့ဆၧလၧအမၩ မၪဆၧလၧဆၧဆံၫ့ဎံၪလဖၪအဖၧၩ့အဂးတၭ, ဘၪအီၪ က့ၪအၪထၪ့အဆၧယဲပိၩ့လပိၩ့တၭ, ဖ့ၪလၫ့ၦလုဆၧ လဂၩနီၪအဂးတၭ, ၦလုဆၧလဂၩနီၪ ဘၪမၩဆၧဖီၩ့ ဖျ့ၭလၧအဂး, လၧဆၧလုမၪဘၪဆၧအဖၫလဒုၩအၥိၪ ဒဲဘ့ၪအကျၩလီၫ. တၭဆၧမိကွဲၪဖျါခွံၬ အဝ့ၫဒၪလီၫ.",
			"17": "<sup>17</sup> ၦလဂၩဂၩအ့ၪမၩဆၧဒဲၩဘၭတၭ မၩဆၧလမံၩ့မံၩ့ လၧယဟိဝၩမၪလူၬဝ့ၫ မၩလဂ့ၩနီၪတၭ, အ့ၪလၥ့ၪ ယၫဘၪလါနၫ့နီၪ, အဆၧဒဲၩဘၭအီၪလၧအလီၩ့တၭ,",
			"18": "<sup>18</sup> ဘၪထိး အဆၧအၧၩ့လီၫ.- ဘၪဂဲၫဆိၬ ဆၧအဖၫအ လၧၫ့အဎွ့ၩလဒုၩ လၧၥိၪဒဲဘ့ၪအကျၩ, ထီးနအီၪက့ၪ အဎွ့ၩလၧဆၧလုမၪဘၪဆၧအဂး, လၧၦလုဆၧလဂၩ နီၪအအီၪတၭ, ၦလုဆၧလဂၩနီၪ ဘၪမၩဆၧဖီၩ့ဖျ့ၭလၧ အဂး လၧအဆၧလၥ့ၪယၫဘၪ အကၠီၩ့နီၪလီၫ. တၭ",
			"19": "<sup>19</sup> ဆၧမိကွဲၪဖျါခွံၬအဝ့ၫဒၪလီၫ.- အနီၪမွဲဆၧမၪဘၪဆၧ အဆၧလုလီၫ. အဝ့ၫဒၪမၩမၪဘၪတၡါယဟိဝၩလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ၦလ ဂၩဂၩအ့ၪမၩဆၧဒဲၩဘၭ, ဒဲမၩမၪဘၪယဟိဝၩတၭ, အ့ၪချဲၩ့ဘျံၭချဲၩ့ဘျၪလၧၦၡၩ လၧအနဲၩ့ထံၭလၧဆၧ အီၪလၧအစူၪဖၧၩ့ အဂဲးအကၠီၪ့မွဲဂ့ၩ, လၧဆၧမၩန့ ဆီၪ့ အဂဲးအကၠီၪ့မွဲဂ့ၩ, ဒဲအ့ၪအၪ့လီၫန့ ၦလၧအနဲၩ့",
			"3": "<sup>3</sup> ထံၭမွဲဂ့ၩ,- အ့ၪဒၪန့ဆၧလၧအလၩ့မါ, ဒဲချဲၩ့ဘျံၭချဲၩ့ ဘျၪဆၧလၧအဂဲးအကၠီၪ့, ဒဲဆိၪလၩ့အၥၭလၧဆၧက ဘျံၭကဘျၪမွဲဂ့ၩ, ကယဲဆၧနီၪလမံၩ့မံၩ့ လၧၦၡၩမၩ",
			"4": "<sup>4</sup> တၭမၩမၪဘၪဆၧနီၪ,- အဝ့ၫမၩမၪဘၪဆၧ, ဒဲအဆၧ ဒဲၩဘၭအီၪတၭဆၧမိမၩအၥၭ လၧအဘၪဖ့ၪထဲၩ့ဆၧ လၧအမၩန့ဆီၪ့မွဲဂ့ၩ, ဆၧလၧအမၩန့လၧအအၪ့လီၫ ဆၧမွဲဂ့ၩ, ဆၧလၧအအီၪက့ၪလၧအစူၪဖၧၩ့မွဲဂ့ၩး ဆၧ",
			"5": "<sup>5</sup> လၧအလၩ့မါတၭဒၪန့ဘၪဝ့ၫမွဲဂ့ၩ,- ကယဲဆၧလၧအ ဆိၪလၩ့အၥၭ ကဘျံၭကဘျၪ လၧအဂဲးအကၠီၪ့မွဲဂ့ၩ, ဘၪဖ့ၪထဲၩ့ဆၧနီၪလၧအမိၡါဒၪဝ့ၫ, ဒဲဘၪအီၪက့ၪအၪ ထၪ့ယဲပိၩ့လပိၩ့လီၫ. တၭမုနံၩလၧအမၩဘိၪ့အဆၧ လုမၪဘၪဆၧနီၪ, ဘၪဖ့ၪထဲၩ့ဝ့ၫလၧၦၡၩ လၧအမွဲအ",
			"6": "<sup>6</sup> ဆၧလီၫ.- အဝ့ၫဘၪဂဲၫဆိၬ အဆၧလုမၪဘၪဆၧနီၪ, ဆၧအဖၫ အလၧၫ့အဎွ့ၩလဒုၩ လၧၥိၪဒဲဘ့ၪအကျၩ လၧယဟိဝၩအအီၪ, ထီးနအီၪက့ၪအဎွ့ၩလၧအဆၧ",
			"7": "<sup>7</sup> လုမၪဘၪဆၧအဂးလၧၦလုဆၧအအီၪလီၫ.- ၦလုဆၧ ဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧအဂးလၧယဟိဝၩ အမ့ၬယၫ တၭ, ဆၧမိဖျါခွံၬကယဲဆၧလမံၩ့မံၩ့ လၧအမၩမၪဆၧ လၧအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, မၪလူၬ စအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪ, စံၭ, အယီၩမွဲၥနိၫဘၪဆဲၫ့ လၧဆၧလုမ့ၪနီၪ, မွဲဆၧလုမ့ၪလၧမ့ၪအၪ့ဆၧ လၧဆၧ လုလး အဖၫ့ခိၪၥၫ့နၩချီၩ့ ထီးဆၧဖၩ့ထၪ့အကၠီၩ့တၭ,",
			"10": "<sup>10</sup> ဆၧလုလးအမ့ၪနီၪ ၦၡၩဘၪဒုၭခဲၩထၪ့ဝ့ၫလီၫ.- တၭ ၦလုဆၧနီၪ ဘၪၥိၭအဆဲၫ့ဘွၩဖျ့ၫလံၬကံၭတၭ, ဒဲအ ဆၧဖျၪ့ခဲၫ့ဘွၩဖျ့ၫလံၬကံၭ, လၧအယၪလီၩ့တၭ, ဘၪ မၩန့ဖံၫ့ချၪလၧမ့ၪအၪ့ခွံၬဝ့ၫနီၪ, ဒဲဆၧလုမ့ၪလၧဆၧလု လးအဖၫ့ခိၪတၭ, ဘၪအီၪက့ၪဝ့ၫလၧဆၧလုလးအနဲၩ့",
			"11": "<sup>11</sup> ထံၭလီၫ.- တၭဘၪဘဲၪ့လၩ့ခွံၬအကီၩ့အၥိၭ, ဒဲၥိၭထၪ့ အဂူၫဂၩလဖၪတၭ, ဆိၬထၪ့ခွံၬဖံၫ့ချၪ လၧၥုၪ့တဲၩအ",
			"12": "<sup>12</sup> လးလၧခီၫ့ထီးအလးဆံၫ့လီၫ.- တၭမ့ၪလၧဆၧလုလး အဖၫ့ခိၪဘၪခဲၩဝ့ၫနီၪ, ၦမၩလၩ့ဖံၬဘၪအ့ၬ. တၭၦလု ဆၧဘၪဖျႃၭလၩ့ခဲၩၥံၪ့မုလၧအဖၫ့ခိၪ ကိၭဂီၩဒ့ၭတၭ, ဘၪဆူၭခဲၩထၪ့ ဆၧဘၪလိၬအိၭလိၬ အဆၧလုအၥိၪ",
			"13": "<sup>13</sup> လၧအဖၫ့ခိၪလီၫ.- တၭမ့ၪဘၪခဲၩဝ့ၫလထံၪဎးဘီၩ့ဎး တၭ, လၩ့ဖံၬဘၪနးဆိၭအ့ၬ.",
			"14": "<sup>14</sup> တၭအယီၩမွဲၥနိၫဘၪဆဲၫ့ လၧဆၧမၩဘိၪ့ကိၪမုၬ နီၪ,စအၫရၧၫ့အဖိၪခွၫလဖၪ ဘၪမၩဘိၪ့ဝ့ၫလၧယဟိ",
			"15": "<sup>15</sup> ဝၩအမ့ၬယၫလၧဆၧလုလးအမ့ၬယၫလီၫ.- တၭဘၪ မၩန့ဆၧမၩဘိၪ့အကိၪမုၬလစူၪ, ဒဲအၥိၪ, ဒဲလီဘၫ့ လၧအအီၪလၧဆၧမၩဘိၪ့ကိၪမုၬအဖၫ့ခိၪ ထီးအလူၬ တၭ, ဘၪဆူၭခဲၩထၪ့ဝ့ၫလၧဆၧလုလးအဖၫ့ခိၪ, ဆၧ နၧၫ့မၧၫ့မုၬ ဆၧနၪ့ထၪ့ထဲၩ့ လၧယဟိဝၩ အဂးလီၫ.",
			"16": "<sup>16</sup> တၭဆၧအီၪလၩ့ထးနီၪ စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪမိ အၪ့ဘၪဝ့ၫလီၫ. ဘၪအၪ့ဝ့ၫလၧကိၪလအီၪဘၪ လၧမံၪ လၧဆၧဆံၫ့ဎံၪအလးအဖၧၩ့လီၫ. ဘၪအၪ့ဝ့ၫလၧဆၧ",
			"17": "<sup>17</sup> အီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဝၩ့ဖၧၩ့လီၫ.- တၭအၪ့ဎူဘၪ လၧမ့ၪအ့ၬ. ယဖ့ၪလၫ့ဝ့ၫလၧအဝ့ၫၥံၪအဂး, လၧအမွဲ ယဆၧလုမၩလၧမ့ၪလီၫ. မွဲဆၧဆံၫ့ဎံၪထုၬ, ဘဲၫဆၧ လုဆၧဒဲၩဘၭအၥိၭ, ဒဲဘဲၫဆၧလုမၪဘၪဆၧအၥိၭနီၪ",
			"18": "<sup>18</sup> လီၫ.- တၭကယဲၦခွၫ လၧစအၫရၧၫ့အဖိၪအကျၩမိအၪ့ ဘၪဝ့ၫကိၭအဂၩဒ့ၭတၭ, မွဲဆၧအထူၫအရူၫ အဆိၩ အကၠၪလၩ့လၧနၥံၪအဆၨၩအဆၬ လဆိၩဘၪလဆိၩ ဘၪဆဲၫ့ လၧဆၧလုမ့ၪလၧယဟိဝၩအဂးတၭး ကယဲ ၦလၧအထိၭဘၪဝ့ၫနီၪ မိမွဲၦလၧအဆံၫ့ဎံၪဝ့ၫကိၭဂၩ ဒ့ၭလီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"19": "<sup>19</sup> အယီၩ မွဲစအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪ အဆၧမၩဘိၪ့လၧအဘၪ မၩဘိၪ့ယဟိဝၩလၧမုနံၩလၧအဒိၭဂုၪအၥၭ, ကိၪမုၬ လအ့ဖၭ ဎလနၬၭ ဆံၫပိၩ့လပိၩ့လၧဆၧမၩဘိၪ့ကိၪမုၬ အဂးလၩ့ဆိၩလၩ့ကၠၪ, လၧဂီၩလခီၫဖိၭဖၫ့ဝ့ၫနီၪ, ဒဲလၧ",
			"21": "<sup>21</sup> ဂၪလခီၫဖိၭဖၫ့ဝ့ၫနီၪဆ့လီၫ.- ဘၪမၩဝ့ၫလၧၥိၪလၧ ဆၧပၪပဲၪအလီၩ့အၪ့ဎူဂီၩ့တၭ, နဘၪဂဲၫဆိၬလီၫ. ဆၧ မၩဘိၪ့ကိၪမုၬ အကုၭလဖၪ လၧအအၪ့ဎူအၥၭနီၪ, နဘၪမၩဘိၪ့ဝ့ၫလၧဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂး",
			"22": "<sup>22</sup> လီၫ.- လၧၦလုဆၧအဖိၪခွၫလဖၪအကျၩ ၦလၧအဒိၭ ဂုၪအၥၭလၧအလးလဂၩနီၪ ဘၪမၩဘိၪ့ဝ့ၫလီၫ. မွဲဆၧ အထူၫအရူၫ အဆိၩအကၠၪ လၧယဟိဝၩ အဂးလီၫ.",
			"23": "<sup>23</sup> ဘၪဆူၭခဲၩခွံၬထီးအလူၬလီၫ.- တၭကယဲဆၧမၩဘိၪ့ ကိၪမုၬလၧၦလုဆၧအဂးနီၪ ဘၪဆူၭခဲၩခွံၬထီးအလူၬ လီၫ. ၦအၪ့ဘၪဝ့ၫအ့ၬ.",
			"24": "<sup>24</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လီၩ ဘၪစအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪတၭ, စံၭ, အယီၩမွဲၥနိၫ ဘၪဆဲၫ့လၧဆၧလုဆၧဒဲၩဘၭနီၪး ထီးၦမၩၥံၫဆၧလု မ့ၪအလးနီၪ, ၦဘၪမၩၥံၫဆၧလုဆၧဒဲၩဘၭထီးအလး နီၪလၧယဟိဝၩအမ့ၬယၫလီၫ. မွဲဆၧဆံၫ့ဎံၪထုၬလီၫ.",
			"26": "<sup>26</sup> တၭၦလုဆၧလဂၩ လၧအမၩဖီၩ့ဖျ့ၭဆၧဒဲၩဘၭလၧ အဝ့ၫနီၪဘၪအၪ့ဝ့ၫလီၫ. ဘၪအၪ့ဝ့ၫ လၧဆၧအလး ဆံၫ့ဎံၪလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အဝၩ့ဖၧၩ့လီၫ.",
			"27": "<sup>27</sup> တၭကယဲဆၧလၧအထိၭဘၪအယၪနီၪ မိမွဲၦလၧအဆံၫ့ ဎံၪဝ့ၫလီၫ. ထီးအၥွံၪအ့ၪဎွံၪဘၪ လၧဆၧကီၩ့ဆၧၥိၭ လဘံၪ့ဘံၪ့အလီၩ့တၭ, နဘၪအၪ့ဆူၫဝၭ ဆၧလၧအ",
			"28": "<sup>28</sup> ဘၪဎွံၪဝ့ၫလၧအလးဆံၫ့ဎံၪအဖၧၩ့လီၫ.- အ့ၪမွဲဖၧၩ့ဂၪ့ ခိၪလၧအအၪ့ဎွံဆၧလၧအဖၧၩ့နီၪ မိဘၪဆၧမၩထ့ဖၭ ခွံၬဝ့ၫတၭ, အ့ၪအၪ့ဎွံဝ့ၫလၧဖၧၩ့ ထီးဝီၩအဖၧၩ့တၭ,ၦ",
			"29": "<sup>29</sup> ဘၪထူၭခွံၬဝ့ၫတၭ ၥူၫဝၭခွံၬဝ့ၫလၧထံၫလီၫ.- တၭကယဲ ၦခွၫလၧၦလုဆၧလဖၪအကျၩနီၪ မိအၪ့ဘၪဝ့ၫကိၭအ",
			"30": "<sup>30</sup> ဂၩဒ့ၭလီၫ. မွဲဆၧဆံၫ့ဎံၪထုၬလီၫ.- တၭဆၧလုဆၧဒဲၩ ဘၭလၧၦၡၩဂဲၫဆိၬအၥွံၪ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ ဎံၪဖၧၩ့လၧအမိမၩဖီၩ့ဖျ့ၭဆၧ လၧအလးဆံၫ့ဎံၪအဖၧၩ့ နီၪ, ၦၡၩအၪ့ဘၪနးမံၩ့အ့ၬး မိဘၪဆၧဆူၭထၪ့ခွံၬလၧ မ့ၪလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> တၭအယီၩမွဲၥနိၫဘၪဆဲၫ့ လၧဆၧလုမၪဘၪဆၧ,မွဲ",
			"2": "<sup>2</sup> ဆၧဆံၫ့ဎံၪထုၬလီၫ.- ထီးအလးလၧအမၩၥံၫဆၧလု မ့ၪနီၪ, ၦဘၪမၩၥံၫဆၧလုမၪဘၪ ဆၧထီးအလးနီၪဆ့ လီၫ. တၭဘၪဎွံၪအၥွံၪဝၬဖီၩ့ဝ့ၫ လၧဆၧလုလးအဖၫ့",
			"3": "<sup>3</sup> ခိၪလီၫ.- တၭဘၪမၩန့ဆၧၥိၪထီးအလူၬ, အမ့, ဒဲၥိၪ",
			"4": "<sup>4</sup> လၧအဖိၭဘံၭအဎွံၬလီၩ့,- ဒဲအလ့နံၫဖျိၪ့, ဒဲဆၧၥိၪ လၧအအီၪလၧအလီၩ့လၧအအီၪ လၧအယးဒံၩ့အနဲၩ့, ဒဲဒံၩအီၪလၧအၥုၪ့အဖၫ့ခိၪနီၪ ဒဲအလ့လဖၪဘၪမၩန့",
			"5": "<sup>5</sup> ထၪ့ခွံၬဝ့ၫလီၫ.- တၭၦလုဆၧနီၪဘၪဆူၭခဲၩထၪ့ခွံၬဝ့ၫ, လၧဆၧလုလးအဖၫ့ခိၪ, လၧဆၧလုမၩလၧမ့ၪလၧယ",
			"6": "<sup>6</sup> ဟိဝၩအဂးလီၫ. မွဲဆၧလုမၪဘၪဆၧလီၫ.- ကယဲၦခွၫ လၧၦလုဆၧလဖၪ အကျၩနီၪ မိအၪ့ဘၪဝ့ၫလီၫ. ဘၪ အၪ့ဝ့ၫ လၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့လီၫ. မွဲဆၧဆံၫ့",
			"7": "<sup>7</sup> ဎံၪထုၬလီၫ.- ဘဲၫဆၧလုဆၧဒဲၩဘၭအၥိၭနီၪ, ဆၧလု မၪဘၪဆၧမွဲဘဲၫနီၪအၥိၭလီၫ. အၥနိၫမွဲလမံၩ့ဎးလီၫ. ၦလုဆၧလၧအမၩဖီၩ့ဖျ့ၭဆၧ လၧအဝ့ၫနီၪ မိန့ဘၪဝ့ၫ လီၫ.",
			"8": "<sup>8</sup> တၭၦလုဆၧလဂၩ လၧအလုထၪ့ၦလဂၩအဆၧလု မ့ၪ, ၦလုဆၧလဂၩနီၪ မိန့ဘၪဆၧလုမ့ၪလၧအလုထၪ့",
			"9": "<sup>9</sup> ဝ့ၫအဖံၭလၧအဂးဒၪဝ့ၫနီၪလီၫ.- တၭကယဲဆၧမၩဘိၪ့ ကိၪမုၬလၧအအၪ့ဎူဝ့ၫလၧဖံၫ့ချၪဖၧၩ့, ဒဲလၧဆၧပၪပဲၪ အဖၫ့ခိၪမွဲဂ့ၩ, ဒဲလၧဖၧၩ့ပၪပဲၪအဖၧၩ့မွဲဂ့ၩ, မိကဲၪထၪ့",
			"10": "<sup>10</sup> ၦလုဆၧလၧအမၩဘိၪ့ဝ့ၫအဆၧလီၫ.- တၭကယဲဆၧ မၩဘိၪ့ကိၪမုၬလဲၩဎုၬလၧၥိၪ, ဒဲဆၧအဎဲၫ့ ထီးအလူၬ နီၪစအၫရၧၫ့အဖိၪခွၫၥံၪ မိန့ဘၪကိၭအဂၩဒ့ၭ, လဂၩ ဘဲၫအလဂၩဒၪအၥိၭ န့ၫဎီၩ့လိၬအၥၭနီၪလီၫ.",
			"11": "<sup>11</sup> တၭအယီၩမွဲၥနိၫဘၪဆဲၫ့ လၧဆၧလုဘၪလိၬအိၭ",
			"12": "<sup>12</sup> လိၬလၧအမိမၩဘိၪ့ယဟိဝၩ,- အ့ၪမၩဘိၪ့ဝ့ၫလၧဆၧ စံၭထၪ့အၪ့အူၭအဂးတၭ, ဘၪမၩဘိၪ့ဝ့ၫလၧဆၧစံၭ ထၪ့အၪ့အူၭအဆၧလုလၧကိၪလအီၪဘၪ လၧမံၪလဲၩ ဎုၬလၧၥိၪ, ဒဲကိၪလၧအပၪပဲၪ ဘၧၩ့ဖျၪဒၪလအီၪဘၪ လၧမံၪဂုၪဝ့ၫလၧၥိၪ, ဒဲကိၪပၪပဲၪမၩဝ့ၫလၧကိၪမုၬလဲၩ",
			"13": "<sup>13</sup> ဎုၬလၧၥိၪဒဲအၪ့ဆ့ၭဝ့ၫလီၫ.- လၧကိၪပၪပဲၪအမ့ၬယၫ နီၪ ဘၪမၩဘိၪ့ကိၪအီၪလၧမံၪ အီၪဝ့ၫလၧအဆၧဘၪ",
			"14": "<sup>14</sup> လိၬအိၭလိၬ အဆၧလုစံၭထၪ့အၪ့အူၭလီၫ.- ဘၪမၩ ဘိၪ့ကိၪလဘံၪ့လၧဆၧမၩဘိၪ့ ထီးအလူၬအကျၩလၧ ဆၧမၩဘိၪ့ဆိၬထၪ့ဝါဝ့ၫ လၧယဟိဝၩအဂးတၭ, မိ ကဲၪထၪ့ၦလုဆၧလဂၩ လၧအဎွံၪဆၧလုဘၪလိၬအိၭ",
			"15": "<sup>15</sup> လိၬအၥွံၪအဆၧလီၫ.- တၭအဆၧဘၪလိၬအိၭလိၬ အဆၧလုစံၭထၪ့အၪ့အူၭအယၪနီၪ ဆၧဘၪအၪ့ဝ့ၫလၧ မုလနံၩဎး လၧအမၩဘိၪ့ဝ့ၫနီၪလီၫ. ဒုၭအီၪလၩ့ထး",
			"16": "<sup>16</sup> ဘၪဝ့ၫထီးလၧဆၧဖၩ့ထၪ့နးဆံၭအ့ၬ.- အဆၧမၩဘိၪ့ အဆၧလုနီၪ အ့ၪမွဲဆၧဘၪဆဲၫ့ လၧဆိၪလၩ့အၥၭမွဲ ဂ့ၩ, ဆၧမၩဘိၪ့ထီးဒၪအၥၭမွဲဂ့ၩတၭ, မုလနံၩလၧအ မၩဘိၪ့အဆၧလုနီၪအၪ့ဘၪဝ့ၫတၭ, ဆၧဖၩ့ထၪ့လနံၩ",
			"17": "<sup>17</sup> နီၪဆၧလၧအအီၪလၩ့ထးဝ့ၫနီၪ အၪ့ဘၪဝ့ၫဆ့လီၫ.-အ့ၪ မွဲၥၧၫ့နံၩလနံၩနီၪ ဆၧလုအယၪလၧအအီၪလၩ့ထးနီၪ",
			"18": "<sup>18</sup> မိဘၪဆၧဆူၭထၪ့ခွံၬလၧမ့ၪလီၫ.- လၧၥၧၫ့နံၩလနံၩ နီၪၦၡၩအ့ၪအၪ့ဆၧလၧ ဆၧဘၪလိၬအိၭလိၬအဆၧလု အယၪတၭ, ဆၧထိးဆၧၫ့ဝ့ၫအ့ၬး တၭဆၧအီၪက့ၪဝ့ၫ လၧၦလၧအမၩဘိၪ့ဝ့ၫအဂးအ့ၬ, မိကဲၪထၪ့ဆၧၥၭလိၪ",
			"19": "<sup>19</sup> ၦလၧအအၪ့ဝ့ၫနီၪ မိဘၪထိးအဆၧအၧၩ့လီၫ.- တၭ ဆၧယၪလၧအဘၪထံၭ ဆၧလၧအလဆံၫ့ဘၪ လမံၩ့ မံၩ့နီၪၦၡၩအၪ့ဘၪဝ့ၫအ့ၬ. မိဘၪဆၧဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪလီၫ. တၭကယဲၦလၧအဆံၫ့လဂၩ လါလါနီၪ",
			"20": "<sup>20</sup> မိအၪ့ဘၪအယၪနီၪလီၫ.- တၭၦလၧအအီၪလၧအဆၧ လဆံၫ့ဘၪ လၧအလီၩ့လဂၩဂၩ လၧအအၪ့ဆၧဘၪ လိၬအိၭလိၬအဆၧလုအယၪ လၧအဘၪဆဲၫ့လၧယဟိ ဝၩနီၪမိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧအၡၩလဆၨၩဒၪဝ့ၫ",
			"21": "<sup>21</sup> အကျၩနီၪလီၫ.- ၦၡၩအဆၧလဆံၫ့ဘၪမွဲဂ့ၩ, ဆၧဖိၪ ဆၧဎါအဆၧလဆံၫ့ဘၪမွဲဂ့ၩ, ဆၧဘၪၥၭလိၪလၧအ လဆံၫ့ဘၪမွဲဂ့ၩ, ၦလၧအထိၭဆၧလဆံၫ့ဘၪလမံၩ့မံၩ့ နီၪ, ဒဲအၪ့ဆၧဘၪလိၬအိၭလိၬ အဆၧလုအယၪလၧအ ဘၪဆဲၫ့ယဟိဝၩနီၪ အဝ့ၫဒၪလဂၩ မိဘၪဆၧဒၪ့ထ့ၬ ခွံၬဝ့ၫလၧအၡၩလဆၨၩဒၪဝ့ၫ အကျၩနီၪလီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"22": "<sup>22</sup> ချဲၩ့ထၪ့ လၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ, ချီဖၫမွဲဂ့ၩ, ၥိၪမွဲဂ့ၩ,",
			"24": "<sup>24</sup> ဘ့ၪမွဲဂ့ၩ, ထီးအၪ့အၥိၪနးမံၩ့လဂ့ၩ,- တၭဆၧဖိၪဆၧ ဎါလၧအၥံၫဒၪဆၧအၥိၪ, ဒဲဆၧလၧဆၧဖိၪဆၧဎါအဲၪ့ ၥံၫဘၪဝ့ၫအၥိၪနီၪ, နၥံၪမၩဆၧဂူၫဂၩ အလးအ့ၪအီၪ,",
			"25": "<sup>25</sup> နၥံၪမိမၩဘၪတၭ, အ့ၪမွဲနၥံၪထီးအၪ့လဂ့ၩ.- အဂဲး ဘဲၫယီၩ ကယဲၦလၧအအၪ့ဆၧဖိၪဆၧဎါအၥိၪ လၧၦ ၡၩလုထၪ့လၧဆၧလုမၩလၧမ့ၪ လၧယဟိဝၩအဂးနီၪ, ၦလၧအအၪ့ဝ့ၫနီၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလၧအၡၩလ",
			"26": "<sup>26</sup> ဆၨၩဒၪဝ့ၫအကျၩလီၫ.- တၭထိၪၥံၪလံၪၥံၪမွဲဂ့ၩ, ဆၧ ဖိၪဆၧဎါမွဲဂ့ၩ, ထီးအၪ့အၥွံၪ လၧနၥံၪအီၪအလးနး",
			"27": "<sup>27</sup> စီၪ့နးမံၩ့လဂ့ၩ.- ကယဲၦလၧအအၪ့ဆၧၥွံၪလမံၩ့မံၩ့နီၪ အဝ့ၫလဂၩ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧအၡၩလဆၨၩ ဒၪဝ့ၫအကျၩနီၪလီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"28": "<sup>28</sup> ချဲၩ့ထၪ့ လၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ, ၦလၧအမၩဘိၪ့ယဟိ ဝၩလၧအဆၧလုဘၪလိၬအိၭလိၬနီၪ ဘၪဂဲၫဆိၬအဆၧ မၩဘိၪ့အဆၧလုဘၪလိၬအိၭလိၬ လၧယဟိဝၩအအီၪ",
			"30": "<sup>30</sup> လီၫ.- တၭမွဲအဘၪဂဲၫဆိၬဆၧလုမၩလၧမ့ၪလၧယဟိ ဝၩအဂးလၧအစူၪဒၪဝ့ၫလီၫ. ဘၪဂဲၫဆိၬအၥိၪဒဲအၥၭ နၫၡါ, ဘဲၫၥိၭအၥၭနၫၡါ မိဘၪဆၧဝါဝ့ၫ, ဆၧမၩဘိၪ့",
			"31": "<sup>31</sup> ဝါဝ့ၫလၧယဟိဝၩအမ့ၬယၫလီၫ.- ၦလုဆၧလဂၩနီၪ ဘၪဆူၭထၪ့ခွံၬဆၧအၥိၪ လၧဆၧလုလးအဖၫ့ခိၪလီၫ. အ့ၪမွဲအၥၭနၫၡါနီၪ မိကဲၪထၪ့စအၫရၧၫ့ဒဲအဖိၪခွၫလ",
			"32": "<sup>32</sup> ဖၪအဆၧလီၫ.- တၭအခိၬထံၭခိၪအထွ့ၪနီၪ, နၥံၪဘၪ ဖ့ၪလၫ့ဝ့ၫလၧၦလုဆၧလဂၩနီၪ, မွဲဆၧမၩဘိၪ့ဆိၬထၪ့ ဝါဝ့ၫဘၪဆဲၫ့လၧနၥံၪအဆၧလုဘၪလိၬအိၭလိၬလီၫ.",
			"33": "<sup>33</sup> ၦလၧစအၫရၧၫ့အဖိၪခွၫၥံၪအကျၩ လၧအမၩဘိၪ့နၥံၪ အဆၧမၩဘၪလိၬအၥွံၪ, ဒဲအၥိၪလဂၩနီၪ မိန့ဘၪအ",
			"34": "<sup>34</sup> ခိၬထံၭခိၪအထွ့ၪလၧအဂးဒၪဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩ, ၥၭနၫၡါအဆၧဝါဝ့ၫ ဒဲခိၬထံၭခိၪ အဆၧဆိၬထၪ့ဝါဝ့ၫ နီၪယမၩန့လၧၦအံၫစရ့လၭဖိၪ လၧဆၧလုဘၪလိၬအိၭ လိၬအဖၧၩ့တၭ, ယဖ့ၪလၫ့ဝ့ၫလၧၦလုဆၧစအၫရၧၫ့, ဒဲအဖိၪခွၫၥံၪလၧဆၧအထူၫအရူၫ အဆိၩအကၠၪလၧ",
			"35": "<sup>35</sup> ၦအံၫစရ့လၭဖိၪအကျၩလီၫ.- တၭအနီၪမွဲစအၫရၧၫ့ အဆၧဘၪဆဲၫ့လၧအဒိၭဂုၪအၥၭ, ဒဲအဖိၪခွၫလဖၪအ ဆၧဒိၭဂုၪအၥၭ လၧဆၧလုၦမၩလၧမ့ၪအကျၩလၧယ ဟိဝၩအဂး, လၧမုနံၩလၧအအီၪက့ၪဝ့ၫလၧအမိမၩၦ",
			"36": "<sup>36</sup> လုဆၧအဆၧမၩလၧယဟိဝၩအဂးလီၫ.- မုနံၩလၧအ ဒိၭဂုၪဝ့ၫနီၪ ယဟိဝၩမၪလူၬဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ ဘၪဖ့ၪလၫ့ဝ့ၫလီၫ. မွဲဆၧအထူၫအရူၫလၧအဆၨၩအ ဆၬအဆိၩအကၠၪ လဆိၩဘၪလဆိၩလီၫ.",
			"37": "<sup>37</sup> အနီၪမွဲၥနိၫဘၪဆဲၫ့လၧဆၧလုမ့ၪ, ဒဲဆၧမၩဘိၪ့ကိၪ မုၬ, ဒဲဆၧလုဆၧဒဲၩဘၭ, ဒဲဆၧလုမၪဘၪဆၧအဂး, ဒဲ",
			"38": "<sup>38</sup> အီၪက့ၪဆံၫ့ဎံၪ ဆၧလဖၪအဂး,- ဒဲအဆၧလုဘၪလိၬ အိၭလိၬအဂးလၧယဟိဝၩ မၪလူၬစမိစ့ၭလၧခိၪလီၩ့စဲ နၫအလီၩ့, မုလနံၩလၧအမၪလူၬၦအံၫစရ့လၭဖိၪလၧ အဘၪမၩဘိၪ့ယဟိဝၩ လၧအဆၧမၩဘိၪ့လၧမံၩ့လၬ ကျၩလၧစဲနၫနီၪလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> မၩန့ စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪလၧအၥိၭ, ဒဲဆၧအကီၩ့အ ၥိၭ,ဒဲၥိၪဂုၪဆၧ, ဒဲချီဖၫလၧဆၧလုဆၧဒဲၩဘၭအဂးလ ဒုၩ,ဒဲၥိၪဖၫနံၫဒုၩ, ဒဲဒၩ့လဖျိၪ့အီၪလၧကိၪလအီၪဘၪ",
			"3": "<sup>3</sup> လၧမံၪ,- တၭဒုၭအီၪကိၩ့အီၪကီၪ့ဆၧအီၪကီၪ့ထီးအ လူၬ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့ထံၭနီၪ",
			"4": "<sup>4</sup> ဆံၭ,- စမိစ့ၭမၩဘဲၫယဟိဝၩမၪလူၬဝ့ၫ အၥိၭနီၪတၭ, ဆၧအီၪကီၪ့နီၪ အီၪကိၩ့အီၪကီၪ့ ထီးဆၧအီၪကီၪ့ အ တဲၩဆံၫ့ဎံၪ အတရၫ့ထံၭနီၪလီၫ.",
			"5": "<sup>5</sup> တၭစမိစ့ၭစံၭဆၧအီၪကီၪ့နီၪ, ဆၧလၧယဟိဝၩမၪ",
			"6": "<sup>6</sup> လူၬလၧပဘၪမၩနီၪ, မွဲအယီၩ, စမိစ့ၭမၩန့စအၫရၧၫ့",
			"7": "<sup>7</sup> ဒဲအဖိၪခွၫလဖၪတၭ, ၥူၫဝၭဆံၫ့ဝ့ၫလၧထံၫလီၫ.- ဒုၭ ၥိၭဝ့ၫအဆဲၫ့ ဒဲခဲးထူၬအယးဒံၩ့လၧခၧၩ့ယး, ဒဲဒုၭၥိၭ ဝ့ၫဆဲၫ့ဖၭထီၫ, ဒဲအီၪက့ၪအ့ဖိၭလၧအလီၩ့တၭ, ခဲးထူၬ ဝ့ၫလၧအ့ဖိၭအခၧၩ့ယးကံၪကဲၩ့တၭ, မၩထၬအ့ဖိၭ",
			"8": "<sup>8</sup> လၧအဝ့ၫ,- အီၪက့ၪဆၧၥၭနၫပဒၩ့ လၧအၥၭနၫၡါတၭ,",
			"9": "<sup>9</sup> အီၪက့ၪယုရံၫ့ဒဲၥုၪ့မံၫ့ လၧၥၭနၫပဒၩ့အဖၧၩ့,- ဒုၭခဲးဝ့ၫ အခိၪခဲးတၭအီၪက့ၪဆၧပၪပဲၪ ထီၫ့လၧခိၪခဲးအမ့ၬယၫ, ၥရဖူၩဆံၫ့ဎံၪနီၪ, ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪ လီၫ.",
			"10": "<sup>10</sup> စမိစ့ၭမၩန့ၥိၪဂုၪဆၧတၭ, ဂုၪတဲၩဆံၫ့ဎံၪ, ဒဲကယဲ",
			"11": "<sup>11</sup> ဆၧအီၪလၧအဖၧၩ့တၭမၩဆံၫ့ဎံၪဝ့ၫလီၫ.- ဎွံၪဝ့ၫလၧ ဆၧလုလးအဖၫ့ခိၪနွ့ၫဖၧၫ့တၭ, ဂုၪဆၧလုလးဒဲအဆၧ ဖိၪဆၧလံၩထီးအလူၬ အံၪ့ဒိၫ့ဒဲအခၪ့, ဘဲၫၥိၭအမိမၩ",
			"12": "<sup>12</sup> ဆံၫ့ဎံၪဝ့ၫလီၫ.- ဂါလၩ့ၥိၪဂုၪဆၧလၧစအၫရၧၫ့အခိၪ",
			"13": "<sup>13</sup> တၭ,ဂုၪဝ့ၫဘဲၫၥိၭအမိမၩဆံၫ့ဎံၪဝ့ၫလီၫ.- စမိစ့ၭဒုၭဂဲၫ စအၫရၧၫ့အဖိၪခွၫလဖၪတၭ, ဒုၭၥိၭဝ့ၫလၧဆဲၫ့ဒဲခဲးထူၬ အယးဒံၩ့လၧခၧၩ့ယးတၭ, ဖုၪ့အခိၪလၧခိၪဖုၪ့ဘဲၫယ ဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ.",
			"14": "<sup>14</sup> အဝ့ၫဒၪဂဲၫဆိၬ ချီဖၫလၧဆၧလုဆၧဒဲၩဘၭအဂးလ ဒုၩတၭ, စအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪနီၪ အီၪက့ၪအစူၪ လၧချီဖၫအခိၪ လၧအဆၧလုဆၧဒဲၩဘၭ အဂးလီၫ.",
			"15": "<sup>15</sup> မၩၥံၫဝ့ၫတၭ, စမိစ့ၭမၩန့အၥွံၪလၧအစူၪနိၩ့တၭ, အီၪ က့ၪဝ့ၫလၧဆၧလုလး အနိၩ့လဖၪအလီၩ့ဝၬဖီၩ့ဝ့ၫတၭ, မၩဆံၫ့ထၪ့ဆၧလုလးတၭ, ဂါလၩ့ဆၧၥွံၪ လၧဆၧလု လးအခၪ့ထံၭတၭ, မၩဆံၫ့ဎံၪဝ့ၫဘဲၫၥိၭ အမိမၩဖီၩ့",
			"16": "<sup>16</sup> မၩဖျ့ၭဆၧလၧအဖၫ့ခိၪလီၫ.- တၭအဝ့ၫမၩန့ဆၧၥိၪ လၧအဖိၭဘံၭအဎွံၬထီးအလူၬ, ဒဲဒံၩအီၪလၧအၥုၪ့အ ဖၫ့ခိၪဒဲအလ့နံၫဖျိၪ့ ဒဲအၥိၪတၭ, စမိစ့ၭဆူၭခဲၩခွံၬဝ့ၫ",
			"17": "<sup>17</sup> လၧဆၧလုလးအဖၫ့ခိၪလီၫ.- အ့ၪမွဲချီဖၫဒဲအဖံၭ, ဒဲအ ယၪ, ဒဲအအ့ၪနီၪဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪလၧၦၥုၪ့တဲၩအ လးလၧခီၫ့လခီၫ, ဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪ လီၫ.",
			"18": "<sup>18</sup> အဝ့ၫဒၪဂဲၫဆိၬၥိၫဖၫလဒုၩ လၧဆၧလုမ့ၪအဂးတၭ, စအၫရၧၫ့, ဒဲအဖိၪခွၫလဖၪနီၪအီၪက့ၪအစူၪ လၧၥိၪဖၫ",
			"19": "<sup>19</sup> လဒုၩအခိၪလီၫ.- ဆၧမၩၥံၫဝ့ၫတၭ, စမိစ့ၭဎွံၪအၥွံၪ",
			"20": "<sup>20</sup> လၧဆၧလုလးအလီၩ့ဝၬဖီၩ့ဝ့ၫလီၫ.- ဒၪ့ထ့ၬၥိၪဖၫလ ကုၭလကုၭတၭ, စမိစ့ၭဆူၭထၪ့ခွံၬအခိၪ, ဒဲအကုၭလ",
			"21": "<sup>21</sup> ဖၪ, ဒဲအၥိၪလီၫ.- အဝ့ၫဒၪၥူၫဝၭအဎွံၬဒဲအခၪ့လၧထံၫ တၭ, စမိစ့ၭဆူၭထၪ့ခွံၬၥိၪဖၫ ထၧၫ့ဒုၩယၫလၧဆၧလု လးအလီၩ့လီၫ. မွဲဆၧလုမ့ၪလၧဆၧနၧၫ့မၧၫ့မုၬအဂး, ဆၧလုမၩလၧမ့ၪလၧယဟိဝၩအဂး, ဘဲၫယဟိဝၩမၪ လူၬစမိစ့ၭအၥိၭနီၪလီၫ.",
			"22": "<sup>22</sup> အဝ့ၫဒၪဂဲၫဆိၬၥိၪဖၫအဂူၫဂၩလဒုၩ, ၥိၪဖၫလၧအ ဘၪဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫနီၪတၭ, စအၫရၧၫ့ ဒဲအဖိၪ",
			"23": "<sup>23</sup> ခွၫလဖၪအီၪက့ၪအစူၪ လၧၥိၪဖၫနီၪအခိၪ,- မၩၥံၫဝ့ၫ တၭ,စမိစ့ၭမၩန့အၥွံၪတၭ, အီၪက့ၪလၧစအၫရၧၫ့အ နါကျူၩခိၪအထွ့ၪအဖၫ့ခိၪ, ဒဲလၧအစူၪမုအထွ့ၪအဖၫ့",
			"24": "<sup>24</sup> ခိၪ,ဒဲလၧအခၪ့မုအထွ့ၪအဖၫ့ခိၪလီၫ.- ဒုၭဂဲၫစအၫရၧၫ့ အဖိၪခွၫလဖၪတၭ, အီၪက့ၪဆၧၥွံၪလၧအနါကျူၩခိၪ အထွ့ၪအဖၫ့ခိၪ, ဒဲလၧအစူၪမုအထွ့ၪအဖၫ့ခိၪ, ဒဲလၧအ ခၪ့မုအထွ့ၪအဖၫ့ခိၪလီၫ. တၭစမိစ့ၭဎွံၪဆၧၥွံၪလၧဆၧ",
			"25": "<sup>25</sup> လုလးအဖၫ့ခိၪဝၬဖီၩ့ဝ့ၫလီၫ.- တၭမၩန့ဆၧၥိၪ,ဒဲအမ့, ဒဲအၥိၪလၧအဖိၭဘံၭအဎွံၬထီးအလူၬ, ဒဲဒံၩအီၪလၧ အၥုၪ့အဖၫ့ခိၪ, ဒဲအလ့နံၫဖျိၪ့, ဒဲအၥိၪ, ဒဲအခိၬထံၭခိၪ",
			"26": "<sup>26</sup> အထွ့ၪ,- တၭလၧဒၩ့ဖၧၩ့အီၪလၧကိၪ လအီၪဘၪလၧမံၪ လၧအအီၪလၧယဟိဝၩအမ့ၬယၫနီၪ, မၩန့ထၪ့ဝ့ၫကိၪ လအီၪဘၪလၧမံၪလဘံၪ့, ဒဲကိၪလၧၥိၪလဘံၪ့, ဒဲကိၪ ဘၧၩ့ဖျၪဒၪလဘံၪ့တၭ, အီၪက့ၪဝ့ၫ လၧၥိၪအဖၫ့ခိၪ,",
			"27": "<sup>27</sup> ဒဲလၧခိၬထံၭခိၪအထွ့ၪအဖၫ့ခိၪ,- တၭအီၪက့ၪဆၧထီး အလူၬလၧစအၫရၧၫ့အစူၪဖၧၩ့, ဒဲလၧအဖိၪခွၫလဖၪ အစူၪဖၧၩ့တၭ, ဝါဝ့ၫလၧဆၧမၩဘိၪ့ဝါဝ့ၫလၧယဟိဝၩ",
			"28": "<sup>28</sup> အမ့ၬယၫလီၫ.- စမိစ့ၭမၩန့ဝ့ၫလၧအဝ့ၫၥံၪအစူၪဖၧၩ့, တၭဆူၭထၪ့ခွံၬဝ့ၫလၧဆၧလုမ့ၪအလီၩ့ လၧဆၧလုလး အဖၫ့ခိၪတၭ, မွဲဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ လၧဆၧနၧၫ့ မၧၫ့မုၬအဂးတၭး မွဲဆၧလုမၩလၧမ့ၪ လၧယဟိဝၩအ",
			"29": "<sup>29</sup> ဂးလီၫ.- စမိစ့ၭမၩန့အၥၭနၫၡါတၭ, ဝါဝ့ၫလၧဆၧမၩ ဘိၪ့ဝါဝ့ၫလၧယဟိဝၩ အမ့ၬယၫ, ဆၧဘၪဆဲၫ့လၧၥိၪ ဖၫလၧအဘၪဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫနီၪ, မွဲလၧစမိစ့ၭ အဂးဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ.",
			"30": "<sup>30</sup> စမိစ့ၭမၩန့ၥိၪဂုၪဆၧ, ဒဲဆၧၥွံၪအီၪလၧဆၧလုလးအ ဖၫ့ခိၪတၭ, ဎွံၪဝ့ၫလၧစအၫရၧၫ့အလီၩ့ဒဲလၧအကီၩ့အ ၥိၭအလီၩ့, ဒဲလၧအဖိၪခွၫလဖၪအလီၩ့, ဒဲလၧအဖိၪ ခွၫလဖၪ လၧအအီၪလၧအၥိၭ အကီၩ့အၥိၭ အလီၩ့ တၭ, မၩဆံၫ့ဎံၪစအၫရၧၫ့, အကီၩ့အၥိၭ, ဒဲအဖိၪခွၫ လဖၪလၧအအီၪ လၧအၥိၭ, အကီၩ့အၥိၭလီၫ.",
			"31": "<sup>31</sup> တၭစမိစ့ၭစံၭစအၫရၧၫ့ဒဲအဖိၪခွၫၥံၪ, အၪ့ဎွံဆၧယၪ ထီးဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့ထံၭနီၪး အၪ့ ဝ့ၫထီးနီၪ ဒဲကိၪအီၪလၧဒၩ့ဖၧၩ့ဘၪဆဲၫ့ လၧဆၧအီၪ က့ၪဆံၫ့ဎံၪဝ့ၫ, ဘဲၫယမၪလူၬဆၧအၥိၭတၭ, စံၭ,စအၫ",
			"32": "<sup>32</sup> ရၧၫ့ဒဲအဖိၪခွၫလဖၪဘၪအၪ့ဝ့ၫဆံၭ.- တၭဆၧလၧအ အီၪလၩ့ထးနီၪ ဆၧယၪဒဲကိၪနီၪ နၥံၪဘၪဆူၭထၪ့ခွံၬ",
			"33": "<sup>33</sup> လၧမ့ၪလီၫ.- မုနံၩလဖၪလၧဆၧအီၪက့ၪဆံၫ့ဎံၪ နၥံၪ နွ့ၫနံၩၥံၪ လချႃၭဎွ့ၩထၪ့ဒံၭဘၪနီၪ, နၥံၪထီးစဲၪ့ထၪ့ ခွံၬလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့နီၪလဂ့ၩး အဂဲးဘဲၫယီၩနွ့ၫနံၩအထးဖၧၩ့လဖၪနီၪ မွဲဆၧအီၪက့ၪ",
			"34": "<sup>34</sup> ဆံၫ့ဎံၪနၥံၪလီၫ.- ဘဲၫဆၧမၩလၧလနံၩယီၩအၥိၭနီၪ ယဟိဝၩမၪလူၬ လၧၦမိဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧနၥံၪအ",
			"35": "<sup>35</sup> ဂးလီၫ.- နၥံၪဘၪအီၪလၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့ၥံၫ့ၥံၫ့နံၩၥၫ့ၥၫ့နၩ နွ့ၫနံၩအထးဖၧၩ့တၭ, ထီး န့ယဟိဝၩအဆၧမၪလူၬ ဘဲၫၥိၭနၥံၪထီးၥံၫလဂ့ၩ, အ ဂဲးဘဲၫယီၩ ဆၧမၪလူၬယၧၩဘဲၫနီၪလီၫ.",
			"36": "<sup>36</sup> တၭစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪ မၩကယဲဆၧလၧယ ဟိဝၩမၪလူၬဝ့ၫ လၧစမိစ့ၭအစူၪဖၧၩ့လီၫ."
		},
		"9": {
			"1": "<sup>1</sup> တၭဎိၭနံၩလနံၩနီၪ ဆၧမၩအၥၭ လၧစမိစ့ၭကိၭန့ စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪ, ဒဲၦအံၫစရ့လၭဖိၪအၥုၪ့",
			"2": "<sup>2</sup> က့ၭအၥၭၡါလဖၪလီၫ.- တၭစံၭစအၫရၧၫ့မၩန့ချီဖိၪ လဒုၩ လၧဆၧလုဆၧဒဲၩဘၭအဂး, ၥိၪဖၫအလၧၫ့အ ဎွ့ၩလဒုၩ လၧဆၧလုမ့ၪအဂးတၭ, လုထၪ့လၧယဟိ",
			"3": "<sup>3</sup> ဝၩအမ့ၬယၫဆံၭ.- နဘၪချဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪ တၭ,စံၭ, မၩန့ဘ့ၪဖိၪလၧဆၧလုဆၧဒဲၩဘၭအဂး, ဒဲ ချီဖိၪ, ဒဲၥိၪဖိၪအလၧၫ့အဎွ့ၩ, ဆၧလနံၪ့ဖိၪလၧဆၧလု",
			"4": "<sup>4</sup> မ့ၪအဂး,- ဒဲချီလဒုၩ, ဒဲၥိၪဖၫလဒုၩလၧဆၧလုဘၪလိၬ အိၭလိၬအဂး, အီၪလၧဆၧမၩဘိၪ့ကိၪမုၬလဲၩဎုၬလၧ ၥိၪ,ဘဲၫၥိၭ နၥံၪမိလုထၪ့ဝ့ၫ လၧယဟိဝၩ အမ့ၬယၫ ဆံၭ.အဂဲးဘဲၫယီၩ ဆၧလၧမုလနံၩယီၩ ယဟိဝၩမိအီၪ ဖျီၪထၪ့လၧနၥံၪအမ့ၬယၫလီၫ.",
			"5": "<sup>5</sup> ဆၧလၧစမိစ့ၭမၪလူၬဝ့ၫနီၪ အဝ့ၫၥံၪဂဲၫဆိၬလၧဆၧ အီၪကီၪ့အတဲၩဆံၫ့ဎံၪအမ့ၬယၫတၭ, ကယဲၦအီၪကီၪ့ ဖိၪၥုၭဘူၭအၥၭတၭ ဆၧၫ့ထုၪ့လၧယဟိဝၩအမ့ၬယၫ",
			"6": "<sup>6</sup> လီၫ.- တၭစမိစ့ၭစံၭအဝ့ၫဒၪ, အယီၩမွဲဆၧလၧယဟိဝၩ မၪလူၬနၥံၪဘၪမၩတၭ, ယဟိဝၩ အလၩအဖၩ့မိအီၪ ဖျီၪထၪ့လၧနၥံၪအမ့ၬယၫလီၫ.",
			"7": "<sup>7</sup> စမိစ့ၭ စံၭစအၫရၧၫ့, လ့ၩလၧဆၧလုလး အအီၪ တၭ, လုထၪ့နဆၧလုဆၧဒဲၩဘၭ, ဒဲနဆၧလုမ့ၪ, ဒဲမၩ ဆၧဖီၩ့ဖျ့ၭလၧနဂးဒၪနဝ့ၫ, ဒဲလၧၦခမျၧးအဂး, ဒဲလုထၪ့ ၦခမျၧးအဆၧတၭ, မၩဆၧဖီၩ့ဖျ့ၭ လၧအဝ့ၫၥံၪအဂး, ဘဲၫယဟိဝၩ မၪလူၬဝ့ၫအၥိၭနီၪဆံၭ.",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫနီၪတၭ စအၫရၧၫ့လ့ၩလၧဆၧလုလးအ အီၪတၭ, မၩၥံၫဆၧလုဆၧဒဲၩဘၭအချီဖိၪ လၧအဂးဒၪ",
			"9": "<sup>9</sup> ဝ့ၫလီၫ.- တၭစအၫရၧၫ့ အဖိၪခွၫလဖၪဂဲၫဆိၬ ဆၧၥွံၪ လၧအအီၪတၭ, အဝ့ၫဒၪ ဘၧၩ့လၩ့အစူၪနိၩ့ လၧဆၧ ၥွံၪဖၧၩ့တၭ, အီၪက့ၪဝ့ၫလၧဆၧလုလး အနိၩ့လဖၪအ လီၩ့လီၫ. တၭဂါလၩ့ခွံၬ အၥွံၪနီၪ လၧဆၧလုလးအ",
			"10": "<sup>10</sup> ခၪ့ထံၭလီၫ.- အ့ၪမွဲဆၧလုဆၧဒဲၩဘၭအဆၧၥိၪ, ဒဲအ လ့လဖၪ, ဒဲဒံၩအီၪလၧအၥုၪ့အဖၫ့ခိၪနီၪဆူၭခဲၩခွံၬဝ့ၫ လၧဆၧလုလးအဖၫ့ခိၪ, ဘဲၫယဟိဝၩမၪလူၬစမိစ့ၭအ",
			"11": "<sup>11</sup> ၥိၭနီၪလီၫ.- တၭအယၪ, ဒဲအဖံၭနီၪဆူၭထၪ့ခွံၬဝ့ၫလၧ",
			"12": "<sup>12</sup> မ့ၪလၧၦၥုၪ့တဲၩအလးလၧခီၫ့လခီၫလီၫ.- မၩၥံၫဆၧ လုမ့ၪတၭ, စအၫရၧၫ့အဖိၪခွၫလဖၪ ဖ့ၪလၫ့အၥွံၪတၭ, အဝ့ၫဒၪဎွံၪဝ့ၫ လၧဆၧလုလးအဖၫ့ခိၪဝၬဖီၩ့ဝ့ၫလီၫ.",
			"13": "<sup>13</sup> အဝ့ၫၥံၪဖ့ၪလၫ့ဆၧလုမ့ၪ, ဒဲအကုၭလဖၪ, ဒဲအခိၪတၭ,",
			"14": "<sup>14</sup> အဝ့ၫဒၪ ဆူၭထၪ့ဝ့ၫလၧဆၧလုလးအဖၫ့ခိၪလီၫ.- ၥူၫ ဝၭဆံၫ့ခွံၬအဎွံၬဒဲအခၪ့တၭ, ဆူၭခဲၩခွံၬဝ့ၫလၧဆၧလု မ့ၪအလးအဖၫ့ခိၪလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪဂဲၫဆိၬၦခမျၧးအဆၧလုတၭ, မၩန့ဘ့ၪလၧ အမွဲဆၧလုဆၧဒဲၩဘၭလၧ ၦခမျၧးအဂးတၭ, မၩၥံၫဝ့ၫ တၭလုထၪ့ဝ့ၫလၧဆၧဒဲၩဘၭအဂး, ဘဲၫဆၧအခၪ့ထံၭ",
			"16": "<sup>16</sup> အၥိၭနီၪလီၫ.- အဝ့ၫဒၪဂဲၫဆိၬဆၧလုမ့ၪတၭ, လုထၪ့",
			"17": "<sup>17</sup> ဝ့ၫ ဘဲၫဆၧစ့ၩရၫ့အၥိၭနီၪလီၫ.- အဝ့ၫဒၪဂဲၫဆိၬဆၧ မၩဘိၪ့ကိၪမုၬတၭ မၩန့ထၪ့လစူၪလၧအဖၧၩ့တၭ, ဆူၭ ထၪ့ခွံၬဝ့ၫ လၧဆၧလုလးအဖၫ့ခိၪ လၧဆၧလုမ့ၪလၧ",
			"18": "<sup>18</sup> ဂီၩအဆၧလုမ့ၪ အနဲၩ့ထံၭနီၪလီၫ.- အဝ့ၫဒၪမၩၥံၫချီ ဖၫလဒုၩဆ့, ဒဲၥိၪဖၫလဒုၩ, ဆၧဘၪလိၬအိၭလိၬ အ ဆၧလုလၧ အမွဲလၧၦခမျၧးအဂးလီၫ. တၭစအၫရၧၫ့ အဖိၪခွၫလဖၪ ဖ့ၪလၫ့အဝ့ၫဆၧၥွံၪနီၪတၭ, အဝ့ၫဒၪဎွံၪ",
			"19": "<sup>19</sup> ဝ့ၫလၧဆၧလုလးအဖၫ့ခိၪဝၬဖီၩ့ဝ့ၫ,- ဒဲချီဖၫ ဒဲၥိၪဖၫ အၥိၪ, ဒဲအမ့, ဒဲဆၧအီၪလၧအဎွံၬအဖၫ့ခိၪ, ဒဲအလ့",
			"20": "<sup>20</sup> လဖၪ, ဒဲဒံၩအီၪလၧအၥုၪ့အဖၫ့ခိၪလီၫ.- အဝ့ၫၥံၪအီၪ က့ၪအၥိၪ လၧအၥၭနၫၡါ အဖၫ့ခိၪတၭ, ဆူၭထၪ့ခွံၬ",
			"21": "<sup>21</sup> ဆၧၥိၪလၧဆၧလုလးအလီၩ့လီၫ.- တၭအၥၭနၫၡါ, ဒဲအခိၬထံၭခိၪအထွ့ၪနီၪ စအၫရၧၫ့ဝါဝ့ၫလၧဆၧလုဝါ ဝ့ၫလၧယဟိဝၩအမ့ၬယၫ ဘဲၫစမိစ့ၭမၪလူၬဝ့ၫအၥိၭ နီၪလီၫ.",
			"22": "<sup>22</sup> စအၫရၧၫ့ ယူၬထၪ့အစူၪ လၧၦခမျၧးအအီၪတၭ, ဆိၪဂ့ၩဝ့ၫတၭ, ဂဲၫလၩ့ဝ့ၫ လၧအလုထၪ့ ဆၧလုဆၧ ဒဲၩဘၭ, ဒဲဆၧလုမ့ၪ, ဒဲဆၧလုဘၪလိၬအိၭလိၬလဖၪအ",
			"23": "<sup>23</sup> လးနီၪလီၫ.- စမိစ့ၭဒဲစအၫရၧၫ့ လ့ၩနုၬလၧဆၧအီၪ ကီၪ့အတဲၩဆံၫ့ဎံၪ အဖၧၩ့တၭ, ဂဲၫထဲၩ့ထၪ့လၧခီၫ့ တၭ, ဆိၪဂ့ၩၦခမျၧးတၭ, ယဟိဝၩအလၩအဖၩ့အီၪ",
			"24": "<sup>24</sup> ထၪ့လၧၦခမျၧးထီးအလူၬအမ့ၬယၫလီၫ.- မ့ၪဂဲၫလၩ့ ဝ့ၫလၧယဟိဝၩအမ့ၬယၫနီၪတၭ, အၪ့ခွံၬဆၧလုမ့ၪ, ဒဲဆၧၥိၪလၧဆၧလုလးအဖၫ့ခိၪလီၫ. တၭၦခမျၧးဒၪ ဘၪဝ့ၫတၭ, ကိၭၡၭထၪ့ဒဲထွံၩလၩ့ဝ့ၫ လၧအမ့ၬလီၩ့ လီၫ."
		},
		"10": {
			"1": "<sup>1</sup> တၭစအၫရၧၫ့အဖိၪခွၫစနၫဒၭ, ဒဲစအဘဲဟုၫမၩန့ ဖၧၩ့မ့ၪဂၩဖျိၪ့ဂၩဖျိၪ့အီၪက့ၪမ့ၪ လၧအဖၧၩ့တၭ, အီၪ က့ၪဆၧနၧၫ့မၧၫ့ ဆူၭခဲၩလၧအဖၫ့ခိၪတၭ, မၩဘိၪ့ယ ဟိဝၩ လၧမ့ၪလၩ့မဲၩဒၪဆၧလၧ ဆၧလမၪလူၬဘၪဝ့ၫ",
			"2": "<sup>2</sup> တၭ,- မ့ၪဂဲၫလၩ့လၧ ယဟိဝၩအအီၪတၭ, အၪ့ခွံၬအ",
			"3": "<sup>3</sup> ဝ့ၫၥံၪတၭ, ၥံၫဝ့ၫလၧယဟိဝၩအမ့ၬယၫလီၫ.- ထီးနီၪ လဖၧၫ့စမိစ့ၭစံၭစအၫရၧၫ့, အယီၩမွဲဆၧလၧယဟိဝၩ မၪလူၬဆၧတၭ, စံၭဝ့ၫ, ယမိဒိၭဆၧအီၪက့ၪ ဆံၫ့ဎံၪ ယၧၩလၧၦလၧအၥုၭဘူၭအၥၭ လၧယအီၪ, ဒဲလၧက ယဲၦခမျၧးအမ့ၬယၫနီၪ ယမိဒိၭဆၧမၩလၩဖၩ့ယၧၩ",
			"4": "<sup>4</sup> လီၫ. တၭစအၫရၧၫ့အီၪလၩ့မါပံၭလီၫ.- တၭစမိစ့ၭကိၭ န့စအၫရၧၫ့အမၩ့ စအၧၭဇအ့လၭ အဖိၪခွၫ စမၡၫ လၭ, ဒဲစအ့လဇၫဖၫ့တၭ, စံၭဝ့ၫ, ဂဲၫစိၩဘီၪ, ဆိၬခွံၬန ၥံၪအထၧၫ့ဖုဝဲ လၧဆၧအလးဆံၫ့ဎံၪ အမ့ၬယၫလၧၦ",
			"5": "<sup>5</sup> ၥုၪ့တဲၩအလးလၧခီၫ့နီၪဆံၭ.- တၭအဝ့ၫၥံၪ ၥုၭဘူၭ အၥၭတၭ, ဆိၬထၪ့ခွံၬအဝ့ၫၥံၪအီၪလၧအဆဲၫ့, လၧၦ ၥုၪ့တဲၩအလးလၧခီၫ့, ဘဲၫစမိစ့ၭ စံၭဝ့ၫအၥိၭနီၪလီၫ.",
			"6": "<sup>6</sup> တၭစမိစ့ၭ စံၭစအၫရၧၫ့ဒဲအဖိၪခွၫၥံၪ, စအံၫလအ့ ဇၫ, ဒဲစအံၥမၫ, ထီးမၩအီၪဘိၪ့နၥံၪအခိၪလဂ့ၩ, ထီး ၡၫ့နၥံၪအဆဲၫ့လဂ့ၩ, မွဲဘဲၫၥိၭနၥံၪထီးၥံၫလဂ့ၩတၭ, ဘဲၫၥိၭၦခမျၧးထီးဘၪဆၧၥၭထၪ့ဝ့ၫလဂ့ၩတၭး အ့ၪ မွဲနၥံၪအထၧၫ့ဖုဝဲ ၦအံၫစရ့လၭဖိၪ ထၧၫ့ဂံၪ့ယၫဂၪ့ဆၧ ယၧၩ့ဆၧ လၧမ့ၪလၧယဟိဝၩ ဆူၭခဲၩဝ့ၫအကၠီၩ့နီၪ",
			"7": "<sup>7</sup> ဆံၭ.- တၭဘဲၫၥိၭနၥံၪထီးၥံၫလဂ့ၩတၭ, စဲၪ့ထၪ့လၧ ဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအတရၫ့နီၪလဂ့ၩး အဂဲး ဘဲၫယီၩ ယဟိဝၩအၥိၪဂုၪဆၧအီၪဝ့ၫ လၧနၥံၪအလီၩ့ လီၫ. တၭအဝ့ၫၥံၪမၩဝ့ၫဘဲၫစမိစ့ၭ အဆၧချဲၩ့အၥိၭနီၪ လီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩ ချဲၩ့ဆၧလၧစအၫရၧၫ့တၭ, စံၭဝ့ၫဒၪ,",
			"9": "<sup>9</sup> ဘဲၫၥိၭနၥံၪ ထီးၥံၫလဂ့ၩတၭ, ထီးနၥံၪလ့ၩနုၬ လၧ ဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဖၧၩ့နီၪ, စဘံၭထံၫမွဲဂ့ၩ, ၥံၭထံၫဂၬထံၫမွဲဂ့ၩ, နဝ့ၫဒၪဒဲနဖိၪခွၫလဖၪနီၪ ထီးအီၩ လဂ့ၩ, မွဲဆၧအထူၫအရူၫ အဆိၩအကၠၪထီၩ့လၩ့လၧ",
			"10": "<sup>10</sup> နၥံၪအဆၨၩအဆၬ လဆိၩဘၪလဆိၩလီၫ.- တၭမွဲ ဘဲၫၥိၭနၥံၪမိအၪ့နၩ့ဖၭဆၧဆံၫ့ဎံၪ, ဒဲဆၧလဆံၫ့ဎံၪ ဘၪအဆၧၫ့, ဒဲဆၧအဆံၫ့, ဒဲဆၧလဆံၫ့ဘၪအဆၧၫ့,",
			"11": "<sup>11</sup> ဒဲဘဲၫၥိၭနၥံၪမိၥီၪ့လိၪ ၦအံၫစရ့လၭဖိၪလၧကယဲဆၧ မၪလူၬလၧယဟိဝၩလီၩဘၪဝ့ၫ လၧစမိစ့ၭအစူၪဖၧၩ့ နီၪဆ့လီၫ.",
			"12": "<sup>12</sup> တၭစမိစ့ၭစံၭစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪလၧအအီၪ လၩ့ထး, စအံၫလအ့ဇၫ, ဒဲစအံၥမၫ, မၩန့ဆၧမၩဘိၪ့ ကိၪမုၬလၧအအီၪလၩ့ထး, ယဟိဝၩအဆၧလုမၩလၧ မ့ၪနီၪတၭ, လၧမံၪလအီၪဘၪအၪ့ဝ့ၫ လၧဆၧလုလးအ နဲၩ့ထံၭနီၪဆံၭ. အဂဲးဘဲၫယီၩမွဲဆၧဆံၫ့ဎံၪထုၬလီၫ.",
			"13": "<sup>13</sup> တၭနၥံၪဘၪအၪ့ဝ့ၫလၧ အလးဆံၫ့ဎံၪဖၧၩ့လီၫ. အဂဲး ဘဲၫယီၩ မွဲနဂး ဒဲနဖိၪခွၫလဖၪအဂး လၧဆၧလုၦမၩ လၧမ့ၪလၧယဟိဝၩအဂးအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ",
			"14": "<sup>14</sup> ဆၧမၩလူၬယၧၩဘဲၫနီၪလီၫ.- တၭၥၭနၫၡါဝါဝ့ၫ, ဒဲခိၬ ထံၭခိၪအဆိၬထၪ့ဝါဝ့ၫနီၪ နၥံၪဘၪအၪ့လၧဆၧအလး ဆံၫ့, နဝ့ၫဒၪ ဒဲနဖိၪခွၫၥံၪ, ဒဲနဖိၪမုၪၥံၪ အီၪလၧနၥိၭ လီၫ. အဂဲးဘဲၫယီၩ မွဲလၧနဂး ဒဲနဖိၪခွၫၥံၪ အဂးလၧ ဆၧဖ့ၪလၫ့ၦအံၫစရ့လၭဖိၪ အဆၧလုဘၪလိၬအိၭလိၬ အကျၩလီၫ.",
			"15": "<sup>15</sup> ခိၬထံၭခိၪအဆိၬထၪ့ဝါဝ့ၫ, ဒဲၥၭနၫၡါအဆၧဝါဝ့ၫနီၪ ၦဘၪဂဲၫဆိၬ ဒဲဆၧလုမ့ၪလၧဆၧၥိၪ, ဘဲၫၥိၭအမိဝါဝ့ၫ လၧဆၧမၩဘိၪ့ဝါဝ့ၫ လၧယဟိဝၩအမ့ၬယၫလီၫ. တၭ မိကဲၪထၪ့နဆၧ ဒဲနဖိၪခွၫၥံၪလၧအအီၪ လၧနၥိၭအဆၧ လီၫ. မွဲဆၧအထူၫအရူၫ အဆိၩအကၠၪဘဲၫယဟိဝၩမၪ လူၬဝ့ၫအၥိၭနီၪလီၫ.",
			"16": "<sup>16</sup> စမိစ့ၭအၪ့ဎၬတၡါဆၧလုဆၧဒဲၩဘၭအဘ့ၪလဒုၩ တၭ, ယိခွါ, မ့ၪအၪ့ခွံၬယူၭတၭအၥၭထၪ့ဘၪစအၫ ရၧၫ့အဖိၪခွၫ လၧအအီၪလၩ့ထး, စအံၫလအ့ဇၫ ဒဲစ",
			"17": "<sup>17</sup> အံၥမၫတၭ, စံၭဝ့ၫဒၪ,- ဆၧလုဆၧဒဲၩဘၭ, မွဲဆၧဆံၫ့ ဎံၪထုၬအကၠီၩ့တၭ, ဆၧဖ့ၪလၫ့နၥံၪဘဲၫၥိၭနၥံၪမိဆိၬ ဆၧအီၪကီၪ့အဆၧဒဲၩဘၭ, ဒဲမၩဆၧဖီၩ့ဖျ့ၭလၧအဝ့ၫ ၥံၪအဂးလၧယဟိဝၩအမ့ၬယၫနီၪ, မွဲဘၪနီၫလၧနၥံၪ",
			"18": "<sup>18</sup> လအၪ့ဘၪလၧလးဆံၫ့ဎံၪအဖၧၩ့နီၪလဲၪ.- ယိခွါ,ၦၡၩ ဂဲၫဆိၬဘၪအၥွံၪလၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့အ့ၬ. န ၥံၪဂ့ၩအၪ့လၧဆၧအလး ဆံၫ့ဎံၪအဖၧၩ့, ဘဲၫယမၪ",
			"19": "<sup>19</sup> လူၬဆၧအၥိၭနီၪလီၫ.- စအၫရၧၫ့စံၭစမိစ့ၭ, ယိခွါ,ဆၧ လၧမုဆၫလနံၩယီၩ အဝ့ၫၥံၪလုထၪ့အဆၧလုဆၧဒဲၩ ဘၭဒဲဆၧလုမ့ၪလၧယဟိဝၩအမ့ၬယၫတၭ, ဆၧဘၪ ယၧၩဘဲၫဆၧနီၪလဖၪအၥိၭတၭ, ယအ့ၪအၪ့ဘၪဆၧ လုဆၧဒဲၩဘၭ လၧမုဆၫလနံၩယီၩတၭ, မွဲအဂ့ၩလၧ ယဟိဝၩအမ့ၬယၫဆ့ဧၪး",
			"20": "<sup>20</sup> စမိစ့ၭခိလၧ အမ့ၬယၫလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭဒဲစအၫရၧၫ့တၭ, စံၭအ",
			"2": "<sup>2</sup> ဝ့ၫၥံၪ,- ချဲၩ့ထၪ့လၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ, အယီၩ မွဲဆၧဖိၪဆၧဎါ လၧနၥံၪမိအၪ့ဘၪဝ့ၫ လၧကယဲဆၧဖိၪ",
			"3": "<sup>3</sup> ဆၧဎါလၧဂၪ့ခိၪချိၫ့အကျၩနီၪ,- ကယဲဆၧလၧအခၪ့ မံၪထ့ဖၭ ဒဲအခၪ့ထ့ဖၭ, ဒဲအဲၪ့ယဲၩအဆၪလၧဆၧဖိၪ ဆၧဎါလမံၩ့လါလါနီၪ နၥံၪအၪ့ဘၪအဝ့ၫနီၪလီၫ.",
			"4": "<sup>4</sup> မွဲလါနၫ့အယီၩ မွဲဆၧလၧအအဲၪ့ယဲၩအဆၪမွဲဂ့ၩ, ဆၧ အခၪ့မံၪထ့ဖၭမွဲဂ့ၩ, လၧနၥံၪအၪ့ဘၪဝ့ၫနီၪ, မွဲကလအူၭ နီၪ, အဂဲးဘဲၫယီၩ အဲၪ့ယဲၩအဆၪလါနၫ့တၭ, မၩထ့ဖၭ",
			"5": "<sup>5</sup> အခၪ့အ့ၬ. မွဲလဆံၫ့ဘၪလၧနၥံၪအဂးလီၫ. ဒဲၡၫဖၫ့နီၪ ဆ့း အဂဲးဘဲၫယီၩ အဲၪ့ယဲၩအဆၪလါနၫ့တၭ, မၩထ့ ဖၭအခၪ့အ့ၬ. အဝ့ၫနီၪမွဲလဆံၫ့ဘၪလၧနၥံၪအဂးလီၫ.",
			"6": "<sup>6</sup> ဒဲပဒဲၩနီၪဆ့, အဂဲးဘဲၫယီၩ အဲၪ့ယဲၩအဆၪလါနၫ့တၭ, မၩထ့ဖၭအခၪ့အ့ၬ. အနီၪမွဲဆၧလဆံၫ့ဘၪလၧနၥံၪအ",
			"7": "<sup>7</sup> ဂးလီၫ.- ဒဲထိၭနီၪဆ့, အဂဲးဘဲၫယီၩ မၩထ့ဖၭအခၫ့မံၪ, ဒဲအခၪ့ထ့ဖၭလါနၫ့တၭ, အဲၪ့ယဲၩအဆၪအ့ၬ. အနီၪ",
			"8": "<sup>8</sup> ဆံၫ့လၧနၥံၪအဂးအ့ၬ.- အယၪနီၪထီးအၪ့လဂ့ၩတၭ အမိၡါနီၪထီးထိၭလဂ့ၩ, မွဲလဆံၫ့ဘၪလၧနၥံၪအဂး လီၫ.",
			"9": "<sup>9</sup> အယီၩမွဲဆၧလၧနၥံၪမိအၪ့ဘၪ လၧဆၧလၧအအီၪ လၧထံၫကျၩထီးအလူၬအကျၩနီၪ, ကယဲဆၧအီၪလၧ အဒံၭဒဲအဘံၪ့လၧထံၫကျၩ လၧမၫဆမံၭအဖၧၩ့, ဒဲလၧ ထံၫချိၬလဖၪအဖၧၩ့ လမံၩ့လါလါနီၪ နၥံၪအၪ့ဘၪဝ့ၫ",
			"10": "<sup>10</sup> လီၫ.- ကယဲဆၧလၧအဒံၭလအီၪ အဘံၪ့လအီၪဘၪ လၧမၫဆမံၭဖၧၩ့, ဒဲလၧထံၫချိၬလဖၪအဖၧၩ့, လၧဆၧ လ့ၩဆၧလၧထံၫကျၩထီးအလူၬအကျၩ, ဒဲဆၧၥၭအီၪ လၧထံၫကျၩထီးအလူၬ အကျၩနီၪမွဲဆၧၥၭလိၪလၧန",
			"11": "<sup>11</sup> ၥံၪအဂးလီၫ.- မိကဲၪထၪ့ဆၧၥၭလိၪ လၧနၥံၪအဂးလီၫ. နၥံၪထီးအၪ့အယၪလဂ့ၩ, နၥံၪဘၪၥၭလိၪအစွၪလီၫ.",
			"12": "<sup>12</sup> ကယဲဆၧလၧအဒံၭလအီၪ, အဘံၪ့လအီၪဘၪလၧထံၫ ကျၩလမံၩ့လါလါနီၪ မွဲဆၧၥၭလိၪလၧနၥံၪအဂးလီၫ.",
			"13": "<sup>13</sup> အယီၩမွဲဆၧ လၧနၥံၪဘၪအီၪက့ၪ လၧဆၧၥၭလိၪ လၧထိၪအကျၩနီၪအၪ့လဂ့ၩ, မွဲဆၧၥၭလိၪလီၫ. လံၬ",
			"14": "<sup>14</sup> ကျီၫ့ကျီၫ့, လၫ့ကထၬခၪဆီၪ့, ဒဲလံၬထံၫ,- လံၬယၪအုၪ,",
			"15": "<sup>15</sup> ဒဲလၫ့ကထၬ ဘဲၫအဆၨၩအၥိၭ,- ကယဲကျၭဘဲၫအ",
			"16": "<sup>16</sup> ဆၨၩအၥိၭ,- ဒဲထိၪကလအူၭ, ဒဲထိၪဖါ, ဒဲထိၪၡၬဎၭ,",
			"17": "<sup>17</sup> ဒဲလံၬပီတ့ဘဲၫအဆၨၩအၥိၭ,- ဒဲထိၪပဂူၪ, ဒဲထိၪကံၪ",
			"18": "<sup>18</sup> မၫဆမံၭ, ဒဲထိၪဝီၩဖံၭ,- ဒဲကျီၩဝီၩလုၭ, ဒဲထိၪဖိၭမီၩ့,",
			"19": "<sup>19</sup> ဒဲလၫ့ကထၬဘွၩ,- ဒဲထိၪဖၭဒိၪဎၭစၭ, ဒဲထိၪလဲၫ့ဘွၩ ဘဲၫအဆၨၩအၥိၭ, ဒဲထိၪဆၫ့ဖၫ, ဒဲဖျၪၥံၪနီၪလီၫ.",
			"20": "<sup>20</sup> ကယဲဆၧလၧအယူၩ, ဒဲစဲၪ့လၧအခၪ့လံခီၫနီၪ,မိကဲၪ",
			"21": "<sup>21</sup> ထၪ့ဆၧဘၪၥၭလိၪလၧနၥံၪအဂးလီၫ.- မွဲလါနၫ့လၧက ယဲဆၧအယူၩဒဲစဲၪ့လၧအခၪ့လံခီၫလဖၪအကျၩနီၪနၥံၪ မိအၪ့ဘၪဆၧလဖၪယီၩ, ဆၧလၧအအီၪလၧအကံၪလၧ",
			"22": "<sup>22</sup> အခၪ့အဖၫ့ခိၪဘဲၫၥိၭ အမိဖုၫဝ့ၫလၧဂၪ့ခိၪချိၫ့လီၫ.- လၧ ဆၧလဖၪနီၪအကျၩ, နၥံၪမိအၪ့ဘၪထွ့ဘဲၫအဆၨၩအ ၥိၭ, ထွ့စ့လၫဘဲၫအဆၨၩအၥိၭ, ဒဲထွ့ဎတၭ, ဘဲၫအ ဆၨၩအၥိၭ, ဒဲထွ့ဎၫကၭ ဘဲၫအဆၨၩအၥိၭနီၪလီၫ.",
			"23": "<sup>23</sup> တၭကယဲဆၧဂူၫဂၩလၧအယူၩ ဒဲစဲၪ့လၧအခၪ့လံခီၫနီၪ မိကဲၪထၪ့ ဆၧဘၪၥၭလိၪ လၧနၥံၪအဂး ထီးအလူၬ",
			"24": "<sup>24</sup> လီၫ.- နၥံၪမိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ လၧအယီၩအကၠီၩ့ တၭ, ကယဲၦလၧအထိၭဘၪအစွၪ လဂၩလါလါနီၪမိ",
			"25": "<sup>25</sup> ကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- တၭကယဲ ၦလၧအဆိၬအစွၪနီၪ ဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭ,ဒဲမိ ကဲၪထၪ့ဆၧလဆံၫ့ဘၪ ထီးမုဂၪလၩ့လီၫ.",
			"26": "<sup>26</sup> ကယဲဆၧဖိၪဆၧဎါ လၧအလမၩထ့ဖၭဘၪအခၪ့မံၪ, ဒဲအခၪ့ လထ့ဖၭဘၪ, ဒဲလအဲၪ့ယဲၩဘၪအဆၪ လမံၩ့ လါလါအစွၪနီၪ မွဲလဆံၫ့ဘၪလၧနၥံၪအဂးတၭ, ကယဲ ၦလၧအထိၭဘၪဝ့ၫနီၪ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီး",
			"27": "<sup>27</sup> မုဂၪလၩ့လီၫ.- တၭလၧကယဲဆၧဖိၪဆၧဎါ လၧအစဲၪ့ လၧအခၪ့လံခီၫအကျၩနီၪ, ဆၧလၧအစဲၪ့လၧအခၪ့ယၫ ၥၭလမံၩ့လါလါနီၪ, မွဲဆၧလဆံၫ့ဘၪ လၧနၥံၪအဂး လီၫ. ကယဲၦလၧအထိၭဘၪအစွၪနီၪ, မိကဲၪထၪ့ဆၧလ",
			"28": "<sup>28</sup> ဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- တၭၦလၧအဆိၬအစွၪနီၪ ဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭ, တၭမိကဲၪထၪ့ဆၧလဆံၫ့ ဘၪထီးမုဂၪလၩ့လီၫ. အဝ့ၫနီၪ မွဲဆၧလဆံၫ့ဘၪလၧန ၥံၪအဂးလီၫ.",
			"29": "<sup>29</sup> အယီၩမွဲအလဆံၫ့ဘၪလၧနၥံၪအဂး လၧဆၧလၧအ စွၩဝ့ၫလၧအစွၩလၧဂၪ့ခိၪချိၫ့လဖၪအကျၩ, ဝံၩ, ဒဲဒၩ့ လဲး,ဘဲၫအဆၨၩအၥိၭ, ဒဲတီၭတဲ,ဒဲနီၩ့ခွ့ၫထံၫ, ဒဲဖျ့ၬ,",
			"30": "<sup>30</sup> ဒဲခွံၪယဲ,ဒဲခွံၪလီၫ.- အနီၪမွဲလဆံၫ့ဘၪလၧနၥံၪအဂး",
			"31": "<sup>31</sup> လၧကယဲဆၧလၧ အစွၩအကျၩလီၫ.- ထီးအၥံၫဝ့ၫ တၭ,ၦလၧအထိၭဘၪဝ့ၫ လဂၩလါလါနီၪ မိကဲၪထၪ့",
			"32": "<sup>32</sup> ဆၧလဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- လၧဆၧနီၪလမံၩ့ မံၩ့အ့ၪၥံၫဝ့ၫတၭ, ဆၧအ့ၪလၩ့ထ့ၬ လၧအလီၩ့လမံၩ့ လါလါနီၪ, မိကဲၪထၪ့လၧဆၧလဆံၫ့ဘၪလီၫ. ထွ့ၫၥံၪမွဲ ဂ့ၩ, ဆၧအကီၩ့အၥိၭမွဲဂ့ၩ, ဆၧဖံၭမွဲဂ့ၩ, ထိၪ့မွဲဂ့ၩ, ထီးဒၪၦၡၩမၩဆၧလၧအဖၧၩ့မွဲဂ့ၩ, ၦဘၪအီၪက့ၪလၩ့ ဝ့ၫလၧထံၫကျၩတၭ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ ထီးမု",
			"33": "<sup>33</sup> ဂၪလၩ့တၭ, မိဆံၫ့ထၪ့ထဲၩ့လီၫ.- တၭကယဲထွ့ၫဂၪ့ခိၪ ထီးဆၧနီၪလမံၩ့မံၩ့လၩ့ထ့ၬ လၧအဖၧၩ့နီၪဆၧအီၪလၧ အဖၧၩ့ထီးအလူၬ မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪတၭ, နၥံၪ",
			"34": "<sup>34</sup> ဘၪမၩထ့ဖၭဝ့ၫလီၫ.- ကယဲဆၧယၪလၧၦအၪ့ဝ့ၫ,လၧ ထံၫနီၪ အ့ၪဘၪလမံၩ့မံၩ့တၭ, မိကဲၪထၪ့ ဆၧလဆံၫ့ ဘၪးဆၧအီၩထီးအလူၬ လၧၦအီၩဝ့ၫလၧထွ့ၫလဖျိၪ့",
			"35": "<sup>35</sup> ဖျိၪ့အဖၧၩ့နီၪ မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪလီၫ.- တၭကယဲ ဆၧလၧအစွၪလၩ့ထ့ၬ လၧအလီၩ့နီၪမိကဲၪထၪ့ဆၧလ ဆံၫ့ဘၪထီးအလူၬလီၫ. ဖၧၩ့ဂၪ့ခိၪဖံၫ့ချၪမွဲဂ့ၩ, လိးၥူၫ မွဲဂ့ၩ,မိဘၪဆၧမၩဂၭဂီၩ့ဝ့ၫလီၫ. မွဲဆၧလဆံၫ့ဘၪ,ဒဲမိ",
			"36": "<sup>36</sup> ကဲၪထၪ့ဆၧလဆံၫ့ဘၪ လၧနၥံၪအဂးလီၫ.- မွဲလါနၫ့ ထံၫထၫ့ဖျိၭ, ဒဲထံၫဖၧၩ့လၧထံၫအီၪအၪအၪလ့ၬနီၪ မိ ဆံၫ့လီၫ. အ့ၪမွဲဆၧလၧအထိၭဘၪဆၧအစွၪနီၪမိကဲၪ",
			"37": "<sup>37</sup> ထၪ့ဆၧလဆံၫ့ဘၪလီၫ.- ဆၧအစွၪနီၪအ့ၪလၩ့ထ့ၬ လၧဆၧချံၫလၧအမိဘၪဎွံၪအၥၭ လၧၦမိဎွံၪဝ့ၫတၭ, ဆၧ",
			"38": "<sup>38</sup> မိဆံၫ့လီၫ.- အ့ၪမွဲဆၧချံၫနီၪ, အ့ၪဘၪထံၫတၭ, ဆၧ အစွၪအ့ၪလၩ့ထ့ၬလၧအလီၩ့တၭ မွဲဆၧလဆံၫ့ဘၪလၧ",
			"39": "<sup>39</sup> နၥံၪအဂးလီၫ.- ဆၧဖိၪဆၧဎါလၧနၥံၪအၪ့ဘၪဝ့ၫနီၪ အ့ၪၥံၫလဒုၩဒုၩတၭ, ၦလၧအထိၭအစွၪနီၪမိကဲၪထၪ့",
			"40": "<sup>40</sup> ဆၧလဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- ၦလၧအအၪ့အယၪ နီၪဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭတၭ, ကဲၪထၪ့ဆၧလ ဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ. ၦလၧအဆိၬအစွၪနီၪ ဘၪ အၪ့ဆူၫဝၭအကီၩ့အၥိၭဆ့တၭ, ကဲၪထၪ့ဆၧ လဆံၫ့",
			"41": "<sup>41</sup> ဘၪထီးမုဂၪလၩ့လီၫ.- တၭကယဲဆၧစွၩလၧဂၪ့ခိၪချိၫ့",
			"42": "<sup>42</sup> နီၪမွဲဆၧၥၭလိၪလီၫ. ထီးအၪ့ဝ့ၫလဂ့ၩ.- ကယဲဆၧစွၩ လၧအဂူၭဖိၫ့, ဒဲကယဲဆၧလၧအစဲၪ့ လၧအခၪ့လံခီၫ တၭ,ဆၧလၧအခၪ့အၪနဲၪ့အနီၪဒံၭ လၧဆၧစွၩလၧအ စွၩလၧဂၪ့ခိၪချိၫ့အကျၩလမံၩ့လါလါနီၪ ထီးအၪ့ဝ့ၫနး",
			"43": "<sup>43</sup> ဂၩလဂ့ၩ, အဂဲးဘဲၫယီၩမွဲဆၧဘၪၥၭလိၪလီၫ.- ထီးမၩ ဘၪၥၭလိၪနၥံၪ အနၫ့ဆါလၧဆၧစွၩ လၧအစွၩဝ့ၫနီၪ လဂ့ၩ,ဒဲမၩနၥံၪအနၫ့ဆါ လဆံၫ့ဘၪလၧအကျၩဘဲၫ ၥိၭနၥံၪမိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ လၧအဝ့ၫၥံၪလဂ့ၩ,",
			"44": "<sup>44</sup> အဂဲးဘဲၫယီၩ ယမွဲယဟိဝၩနၥံၪအယွၩလီၫ. နၥံၪဘၪ မၩဆံၫ့နၥံၪအၥၭတၭ ကဲၪထၪ့ၦဆံၫ့ဎံၪလီၫ. အဂဲးဘဲၫ ယီၩယမွဲယဝ့ၫဆၧဆံၫ့ဎံၪလီၫ. တၭနၥံၪဘၪမၩစံၪစၪ နၥံၪအနၫ့ဆါလၧဆၧစွၩ လၧဂၪ့ခိၪချိၫ့နးမံၩ့လဂ့ၩ.",
			"45": "<sup>45</sup> အဂဲးဘဲၫယီၩ ယမွဲယဟိဝၩလၧအဒုၭဂဲၫထၪ့နၥံၪလၧ ခးအံဇံၭအဖၧၩ့, ဘဲၫၥိၭယမိကဲၪထၪ့နၥံၪအယွၩလီၫ. တၭနၥံၪမိဆံၫ့ဎံၪထၪ့လီၫ. အဂဲးဘဲၫယီၩ ယမွဲယဝ့ၫ",
			"46": "<sup>46</sup> ဆၧဆံၫ့ဎံၪလီၫ.- အနီၪမွဲၥနိၫဘၪဆဲၫ့လၧဆၧဖိၪဆၧ ဎါ ဒဲထိၪၥံၪလံၪၥံၪ ဒဲကယဲဆၧၥၭဂဲၩ လၧထံၫကျၩ, ဒဲကယဲဆၧၥၭလၧအစွၩ လၧဂၪ့ခိၪချိၫ့ထီးအလူၬလီၫ.",
			"47": "<sup>47</sup> ဘဲၫၥိၭၦၡၩမိအၪ့နၩ့ဖၭ ဆၧအဆံၫ့ဒဲဆၧလဆံၫ့ဘၪအ ဆၧၫ့,ဒဲဆၧဖိၪဆၧဎါ လၧၦၡၩအၪ့ဘၪဝ့ၫဒဲဆၧဖိၪဆၧ ဎါလၧၦလအၪ့ဘၪဝ့ၫ အဂဲးလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လီၩဘၪ ၦအံၫစရ့လၭဖိၪတၭ, စံၭ,ၦမုၪလဂၩအ့ၪဒၧၩ့ထၪ့တၭ, အီၪဖျဲၪယူၭဖိၪၥၪအခွၫတၭ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ နွ့ၫနံၩလီၫ. ဘဲၫမုနံၩလၧအလၩ့မုလၩ့ဖၭ လၧအဆၧ ဆၫလဖၪအကၠီၩ့အၥိၭနီၪ ဘၪကဲၪထၪ့ဆၧလဆံၫ့ဘၪ",
			"3": "<sup>3</sup> လီၫ.- တၭဎိၭနံၩလနံၩနီၪ ဖိၪၥၪမိဘၪဒိၭဆၧကူၭတ",
			"4": "<sup>4</sup> ရံၭအဆၧခိၪဖံၭလီၫ.- တၭထီးနီၪလဖၧၫ့ၦမုၪနီၪဘၪ အီၪဒံၭလၧဆၧၥွံၪဘၪဆဲၫ့လၧ အဆၧမၩဆံၫ့အဖၧၩ့နီၪ ၥၧၫ့ဆံၫၥၧၫ့နံၩလီၫ. အဆၧလဆံၫ့ဘၪအမုနံၩလဖၪလ ချႃၭလၧၫ့ထၪ့ဎွ့ၩထၪ့ဘၪနီၪ, ထိၭဘၪဆၧဆံၫ့ဆၧ ဎံၪနးမံၩ့အ့ၬတၭ, ဂဲၫနုၬဘၪလၧဆၧအလးဆံၫ့ဎံၪအ ဖၧၩ့နီၪဆ့အ့ၬ.",
			"5": "<sup>5</sup> အ့ၪအီၪဖျဲၪယူၭ အဖိၪမုၪတၭ, ဘၪကဲၪထၪ့ဆၧလ ဆံၫ့ဘၪနံၫနွ့ၫ, ဘဲၫအလၩ့မုလၩ့ဖၭ ဆၧအၥိၭတၭ, ဘၪအီၪလၧဆၧၥွံၪဘၪဆဲၫ့ လၧအဆၧလဆံၫ့ဘၪနီၪ",
			"6": "<sup>6</sup> ဎူၫဆံၫ့ဎူၫနံၩလီၫ.- တၭလၧအဖိၪခွၫအကၠီၩ့မွဲဂ့ၩ, လၧ အဖိၪမုၪအကၠီၩ့မွဲဂ့ၩ, ထီးအမုနံၩဘၪဆဲၫ့ လၧအဆၧ မၩဆံၫ့နီၪဎွ့ၩထၪ့တၭ, ဘၪဂဲၫဆိၬၥိၪဖိၪလနံၪ့ဖိၪလၧ ဆၧလုမ့ၪအဂး, ဒဲကၪကဲၪဖိၪလဘံၪ့မွဲဂ့ၩ, ထိၪလွံလ ဘံၪ့မွဲဂ့ၩ, လၧဆၧလုဆၧဒဲၩဘၭအဂး ထီၩ့လၧဆၧ အီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့ထံၭ, လၧၦလုဆၧလ",
			"7": "<sup>7</sup> ဂၩအအီၪ,- တၭအဝ့ၫဒၪမိလုထၪ့ဝ့ၫလၧယဟိဝၩအမ့ၬ ယၫ, ဒဲမၩဆၧဖီၩ့ဖျ့ၭလၧအဂးတၭ, မိဆံၫ့ထၪ့လၧအ ၥွံၪထၪ့အဂဲးနီၪလီၫ. ၦလၧအအီၪဖျဲၪန့အဖိၪခွၫမွဲဂ့ၩ, အဖိၪမုၪမွဲဂ့ၩ, ၥနိၫမွဲအနီၪလီၫ.",
			"8": "<sup>8</sup> ၥိၪဖိၪနီၪဂဲၫဆိၬအ့ၪလၥ့ၪဘၪတၭ, ဘၪဂဲၫဆိၬထိၪ လွံနံၫဘံၪ့မွဲဂ့ၩ ကၪကဲၪဖိၪနံၫဘံၪ့မွဲဂ့ၩ, လဘံၪ့လၧဆၧ လုမ့ၪအဂး, ဒဲလဘံၪ့ဒၪ လၧဆၧလုဆၧဒဲၩဘၭ အဂး လီၫ. ၦလုဆၧလဂၩနီၪ ဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧအဂး တၭ,မိဆံၫ့ထၪ့ဝ့ၫလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ ဒဲစအၫရၧၫ့တၭ,စံၭဝ့ၫ",
			"2": "<sup>2</sup> ဒၪ,- ထီးၦလဂၩအ့ၪအီၪလၧ ဆၧၡိၪထၪ့လဖျိၪ့ဖျိၪ့မွဲ ဂ့ၩ,အလးလၧဆၧဖံၭလၩ့ကျိၭမွဲဂ့ၩ, အလးလၧအလၩ့ ဘွၩမွဲဂ့ၩ, လၧအယၪအဖံၭလီၩ့တၭ, အ့ၪအီၪလၧအ ဖံၭအယၪလီၩ့ ဘဲၫဆၧဆၫအၧၩ့အၥိၭး ၦဘၪဂဲၫဆိၬ လၧစအၫရၧၫ့အအီၪ, အ့ၪလမွဲဘၪဘဲၫနီၪတၭ လၧအ",
			"3": "<sup>3</sup> ဖိၪခွၫလဂၩဂၩ ၦလုဆၧလဂၩအအီၪလီၫ.- ၦလုဆၧ လဂၩနီၪဘၪယိဆၧကဲၪထၪ့ လၧအဖံၭအယၪလီၩ့တၭ အဆီၪ့လၧဆၧကဲၪထၪ့အလး အ့ၪထၪ့ဘွၩတၭ, ဆၧ ကဲၪထၪ့အလးအ့ၪလၩ့အိၪ့နဲၪ့အဖံၭအယၪတၭ, မွဲဆၧ ဆၫအၧၩ့ အဆၧကဲၪထၪ့လီၫ. တၭၦလုဆၧလဂၩနီၪ ဘၪယိဝ့ၫ, ဒဲဘၪအီၪက့ၪဝ့ၫ လၧဆၧလဆံၫ့ဘၪလီၫ.",
			"4": "<sup>4</sup> တၭအလးကျံၩ့ လၧအဖံၭထၪ့ဘွၩ လၧအဖံၭအယၪ လီၩ့, ဒဲအ့ၪလလၩ့အိၪ့နဲၪ့ဘၪအဖံၭလၧအလီၩ့, ဒဲအ ဆီၪ့လထၪ့ဘွၩဘၪတၭ, ၦလုဆၧလဂၩနီၪဘၪအီၪက့ၪ",
			"5": "<sup>5</sup> ထၬ ၦလၧဆၧကဲၪထၪ့လဂၩနွ့ၫနံၩလီၫ.- တၭနွ့ၫနံၩ လနံၩနီၪၦလုဆၧလဂၩဘၪယိဒီၭဝ့ၫတၭ, ယိခွါ,ဆၧ ကဲၪထၪ့လၧအလီၩ့ အ့ၪအီၪဒၪဆၧ, ဒဲဆၧကဲၪထၪ့အ လးအ့ၪလလဲထၪ့ဘၪလၧအဖံၭလီၩ့တၭ, ၦလုဆၧလ",
			"6": "<sup>6</sup> ဂၩနီၪဘၪအီၪက့ၪထၬဒံၭနွ့ၫနံၩနီၪလီၫ.- နွ့ၫနံၩလနံၩ နီၪၦလုဆၧလဂၩဘၪယိဒီၭဝ့ၫတၭ, ယိခွါ,ဆၧကဲၪထၪ့ အလးအ့ၪထၪ့ၥၧၫ့လဆံၭဆံၭ ဒဲဆၧကဲၪထၪ့အလးအ့ၪ လလဲထၪ့ဘၪ လၧအဖံၭလီၩ့နီၪတၭ, ၦလုဆၧဘၪအီၪ က့ၪဝ့ၫလၧအဆံၫ့လီၫ. မွဲအလးလၧအဖံၭလၩ့ကျိၭလီၫ. ဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭတၭ, မိဆံၫ့ထၪ့ဝ့ၫလီၫ.",
			"7": "<sup>7</sup> အ့ၪမွဲအလးလၧအဖံၭလၩ့ကျိၭနီၪ အ့ၪလဲထၪ့အၪအၪ လ့ၬ လၧၦလုဆၧလဂၩယိဝ့ၫ လၧအဆံၫ့ထၪ့အလးခဲၫ့",
			"8": "<sup>8</sup> နီၪတၭ, ၦလုဆၧလဂၩဘၪယိဒီၭလီၫ.- ၦလုဆၧလဂၩ နီၪအ့ၪယိတၭ, ယိခွါ, အလးလၧအဖံၭလၩ့ကျိၭနီၪ အ့ၪလဲထၪ့တၭ, ၦလုဆၧဘၪအီၪက့ၪဝ့ၫ လၧဆၧလဆံၫ့ ဘၪလီၫ. မွဲဆၧဆၫအၧၩ့လီၫ.",
			"9": "<sup>9</sup> ထီးဆၧဆၫအၧၩ့အ့ၪကဲၪထၪ့ဝ့ၫ လၧၦလဂၩအလီၩ့",
			"10": "<sup>10</sup> တၭ, ၦဘၪဂဲၫဆိၬဝ့ၫလၧၦလုဆၧအအီၪတၭ,- ၦလု ဆၧမိယိတၭ, ယိခွါ, ဆၧၡိၪထၪ့လဖျိၪ့အ့ၪဘွၩလၧ အဖံၭလီၩ့, ဒဲမၩဘွၩထၪ့အဆီၪ့တၭ ဆၧယၪမၧၫ့အ့ၪ",
			"11": "<sup>11</sup> အီၪလၧအဖၧၩ့လးတၭ,- မွဲဆၧဆၫအၧၩ့လးလံၩလၧ အယၪအဖံၭလီၩ့တၭ, ၦလုဆၧဘၪအီၪက့ၪဝ့ၫ လၧ ဆၧလဆံၫ့ဘၪဒဲအီၪက့ၪထၬဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩမွဲ",
			"12": "<sup>12</sup> ဆၧလဆံၫ့ဘၪလီၫ.- ဆၧဆၫအၧၩ့အ့ၪလဲထၪ့လၧအ ဖံၭလီၩ့, ဒဲဆၧဆၫအၧၩ့ အ့ၪအီၪလၧအဖံၭလီၩ့ထၧၫ့ ဂၩယၫ, ဆၧကဲၪထၪ့နီၪအီၪလၧအခိၪဖိး လၧအခၪ့,",
			"13": "<sup>13</sup> ထီးဒၪအလးၦလုဆၧယိဝ့ၫတၭ,- ၦလုဆၧဘၪယိဆီၫ့ မီၪ့ဝ့ၫနီၪ, ယိခွါ, ဆၧဆၫအၧၩ့အ့ၪအီၪလၧအယၪအ လီၩ့ထၧၫ့ဂၩယၫတၭ, ဘၪအီၪက့ၪဆၧထၪ့နီၪလၧဆၧ ဆံၫ့လီၫ. ဘွၩထၪ့ဝ့ၫထီးအလူၬတၭ, မွဲဆၧဆံၫ့လီၫ.",
			"14": "<sup>14</sup> မွဲလါနၫ့ မုလနံၩ လၧဆၧယၪမၧၫ့ အီၪဖျီၪထၪ့လၧအ",
			"15": "<sup>15</sup> လီၩ့နီၪမိကဲၪထၪ့ဆၧလဆံၫ့ဘၪလီၫ.- တၭၦလုဆၧ ဘၪယိအယၪမၧၫ့နီၪတၭ အီၪက့ၪဝ့ၫလၧဆၧလဆံၫ့ ဘၪလီၫ. ဆၧယၪမၧၫ့နီၪမွဲဆၧအဆံၫ့အ့ၬး မွဲဆၧဆၫ",
			"16": "<sup>16</sup> အၧၩ့လီၫ.- အ့ၪလမွဲဘၪဘဲၫနီၪတၭ ဆၧယၪမၧၫ့နီၪ အ့ၪကဒံၩကဒၩအၥၭ, ဒဲထၪ့ဘွၩတၭ, ဘၪဂဲၫဆိၬထဲၩ့",
			"17": "<sup>17</sup> လၧၦလုဆၧအအီၪတၭ,- ၦလုဆၧဘၪယိဝ့ၫတၭ, ယိ ခွါ, ဆၧကဲၪထၪ့နီၪအ့ၪထၪ့ဘွၩတၭ, ၦလုဆၧဘၪအီၪ က့ၪဆၧကဲၪထၪ့နီၪလၧဆၧဆံၫ့တၭ, မိဆံၫ့ထၪ့ဝ့ၫလီၫ.",
			"18": "<sup>18</sup> ၦၡၩအယၪလၧဆၧဝံၫ့အီၪယူၭ လၧအလီၩ့တၭ,ဘျၪ",
			"19": "<sup>19</sup> ယူၭ.- တၭလၧဝံၫ့အလးနီၪဆၧၡိၪထၪ့ဘွၩမွဲဂ့ၩ, ဆၧ အလးကျံၩ့ ဝီၩဝီၩဘွၩဘွၩမွဲဂ့ၩ အ့ၪအီၪတၭ, ၦအ့ၪ",
			"20": "<sup>20</sup> ဒုၭနဲၪဝ့ၫလၧၦလုဆၧ,- တၭထီးၦလုဆၧအ့ၪဒၪဘၪဝ့ၫ တၭ,ယိခွါ, အလးအ့ၪလၩ့အိၪ့နဲၪ့အဖံၭလီၩ့တၭ, အ ဆီၪ့အ့ၪထၪ့ဘွၩတၭ, ၦလုဆၧဘၪအီၪက့ၪဝ့ၫလၧဆၧ လဆံၫ့ဘၪ, မွဲဆၧဆၫအၧၩ့အဆၧကဲၪထၪ့အီၪထၪ့လၧ",
			"21": "<sup>21</sup> ဆၧဝံၫ့အဖၧၩ့လီၫ.- အ့ၪမွဲၦလုဆၧအ့ၪယိဝ့ၫတၭ, ယိ ခွါ, အဆီၪ့ဘွၩအီၪအ့ၬ, ဒဲအလးလလၩ့အိၪ့နဲၪ့ဘၪ အဖံၭ, ဒဲအ့ၪထၪ့ၥၧၫ့လဆံၭဆံၭ ၦလုဆၧဘၪအီၪက့ၪ",
			"22": "<sup>22</sup> ထၬနွ့ၫနံၩလီၫ.- အ့ၪလဲထၪ့အၪအၪလ့ၬ လၧအဖံၭလီၩ့ တၭ,ၦလုဆၧဘၪအီၪက့ၪဝ့ၫလၧအလဆံၫ့ဘၪ, မွဲဝ့ၫ",
			"23": "<sup>23</sup> လၧဆၧကဲၪထၪ့လီၫ.- အ့ၪမွဲအလးနီၪအ့ၪအီၪဒၪဆၧ ဒဲလလဲထၪ့ဘၪတၭ, မွဲဝ့ၫလၧဝံၫ့မ့ၪအၪ့လီၫ. တၭၦလု ဆၧဘၪအီၪက့ၪဝ့ၫလၧဆၧဆံၫ့လီၫ.",
			"24": "<sup>24</sup> အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ဆၧယၪလစီၪ့စီၪ့အီၪလၧ အဖံၭခိထၪ့ဝ့ၫ ဘဲၫမ့ၪအၪ့အၥိၭနီၪ ဆၧမၧၫ့လၧဆၧ ဆၫမ့ၪအၪ့အ့ၪၡိၪထၪ့ ဝီၩဝီၩမွဲဂ့ၩ, ဘွၩဘွၩမွဲဂ့ၩ,",
			"25": "<sup>25</sup> တၭၦလုဆၧဘၪယိဝ့ၫတၭ ယိခွါ, အဆီၪ့လၧဆၧအ လးကျံၩ့အ့ၪထၪ့ဘွၩ, ဒဲအလးလၩ့အိၪ့နဲၪ့အဖံၭတၭ, မွဲဆၧဆၫအၧၩ့ လၧအအီၪထၪ့ လၧဆၧဆၫခိထၪ့အ လးလီၫ. တၭၦလုဆၧဘၪအီၪက့ၪ လၧအလဆံၫ့ဘၪ,",
			"26": "<sup>26</sup> မွဲဝ့ၫလၧဆၧဆၫအၧၩ့ အဆၧကဲၪထၪ့လီၫ.- အ့ၪမွဲၦလု ဆၧအ့ၪယိဝ့ၫတၭ, ယိခွါ, အဆီၪ့ဘွၩလအီၪဘၪလၧ ဆၧအလးကျံၩ့, ဒဲလလၩ့အိၪ့နဲၪ့ဘၪအဖံၭ, ဒဲထၪ့ၥၧၫ့",
			"27": "<sup>27</sup> လဆံၭဆံၭတၭ, ၦလုဆၧဘၪအီၪက့ၪနွ့ၫနံၩလီၫ.- တၭ နွ့ၫနံၩလနံၩနီၪ ၦလုဆၧဘၪယိဝ့ၫတၭ, အ့ၪလဲထၪ့အၪ အၪလ့ၬလၧအဖံၭလီၩ့တၭ ၦလုဆၧဘၪအီၪက့ၪဝ့ၫလၧ ဆၧလဆံၫ့ဘၪ, မွဲဝ့ၫလၧဆၧဆၫအၧၩ့ အဆၧကဲၪထၪ့",
			"28": "<sup>28</sup> လီၫ.- အ့ၪမွဲဆၧအလးကျံၩ့ အ့ၪအီၪဒၪဆၧ, လလဲ ထၪ့ဘၪလၧအဖံၭလီၩ့ ဒဲထၪ့ၥၧၫ့လဆံၭဆံၭတၭ, မွဲဝ့ၫ လၧဆၧၡိၪထၪ့လၧဆၧဆၫ မ့ၪအၪ့အလးတၭ, ၦလု ဆၧဘၪအီၪက့ၪလၧဆၧဆံၫ့လီၫ. အဂဲးဘဲၫယီၩ မွဲဝ့ၫ",
			"29": "<sup>29</sup> လၧဆၧဆၫမ့ၪအၪ့အလးလီၫ.- ၦမုၪမွဲဂ့ၩ, ၦခွၫမွဲဂ့ၩ, လၧအခိၪမွဲဂ့ၩ, လၧအခၪဆီၪ့မွဲဂ့ၩ, အ့ၪအီၪလၧဆၧ",
			"30": "<sup>30</sup> ကဲၪထၪ့တၭ,- ၦလုဆၧဘၪယိဆၧကဲၪထၪ့နီၪတၭ, ယိ ခွါ, အလးအ့ၪလၩ့အိၪ့နဲၪ့အဖံၭ, ဒဲအဆီၪ့ဘၩ့ၡၩဘီၩ့ အ့ၪအီၪလၧအဖၧၩ့တၭ, ၦလုဆၧဘၪအီၪက့ၪဝ့ၫလၧ ဆၧလဆံၫ့ဘၪလီၫ. မွဲဆၧဆၫဎၬအၧၩ့ ဆၧဆၫအၧၩ့",
			"31": "<sup>31</sup> လၧခိၪမွဲဂ့ၩ လၧအခၪဆီၪ့မွဲဂ့ၩလီၫ.- အ့ၪမွဲၦလုဆၧ အ့ၪယိဆၧဎၬထၪ့တၭ, ယိခွါ, အလးလလၩ့အိၪ့နဲၪ့ ဘၪအဖံၭ, ဒဲဆီၪ့ၥၧၫ့လအီၪဘၪလၧအဖၧၩ့တၭ, ၦလု",
			"32": "<sup>32</sup> ဆၧဘၪအီၪက့ၪထၬ ဆၧကဲၪထၪ့နီၪနွ့ၫနံၩလီၫ.- တၭ နွ့ၫနံၩလနံၩနီၪ ၦလုဆၧဘၪယိဆၧကဲၪထၪ့တၭ, ယိခွါ, ဆၧဎၬထၪ့အ့ၪလလဲထၪ့ဘၪ, ဒဲဆီၪ့ဘၩ့ အ့ၪလအီၪ ဘၪတၭ, အလး အ့ၪလလၩ့အိၪ့နဲၪ့ဘၪ အဖံၭတၭ,",
			"33": "<sup>33</sup> ၦၡၩဘၪလိၩ့ဝ့ၫလီၫ. အ့ၪမွဲဆၧဎၬထၪ့အလးနီၪ လိၩ့ ဘၪဝ့ၫအ့ၬ. တၭၦလုဆၧဘၪအီၪက့ၪထၬ ဒံၭဆၧကဲၪ",
			"34": "<sup>34</sup> ထၪ့နီၪနွ့ၫနံၩဒံၭလီၫ.- နွ့ၫနံၩလနံၩနီၪ ၦလုဆၧဘၪယိ ဆၧဎၬတၭ, ယိခွါ, ဆၧဎၬအ့ၪလလဲထၪ့ဘၪ လၧအ ဖံၭလီၩ့ဒဲအလးအ့ၪလလၩ့အိၪ့နဲၪ့ဘၪအဖံၭတၭ, ၦလု ဆၧဘၪအီၪက့ၪဝ့ၫ လၧဆၧအဆံၫ့လီၫ. တၭအဝ့ၫဒၪ ဘၪအၪ့ဆူၫဝၭ အကီၩ့အၥိၭတၭ မိဆံၫ့ထၪ့ဝ့ၫလီၫ.",
			"35": "<sup>35</sup> လၧအဆံၫ့ထၪ့အလးခဲၫ့နီၪ ဆၧအဎၬအ့ၪလဲထၪ့တၡါ",
			"36": "<sup>36</sup> လၧအဖံၭလီၩ့တၭ,- ၦလုဆၧဘၪယိတၭ, ယိခွါ,ဆၧ ဎၬ အ့ၪလဲထၪ့လၧအဖံၭအလီၩ့တၭ, ၦလုဆၧနီၪအၪ့",
			"37": "<sup>37</sup> ဎၬဘၪဆီၪ့ဘၩ့အ့ၬ. မွဲဝ့ၫလၧဆၧလဆံၫ့ဘၪလီၫ.- အ့ၪ မွဲဆၧဎၬအလီၩ့ အ့ၪအီၪဒၪဆၧ, ဆီၪ့ၥၧၫ့အ့ၪထၪ့လၧ အဖၧၩ့ဒဲဆၧဎၬဘျၪယူၭတၭ, ဆံၫ့ထၪ့ယူၭဝ့ၫယူၭတၭ, ၦလုဆၧဘၪအီၪက့ၪလၧဆၧဆံၫ့လီၫ.",
			"38": "<sup>38</sup> တၭၦမုၪမွဲဂ့ၩ, ၦခွၫမွဲဂ့ၩ, အ့ၪအီၪလၧဆၫ့ဎွံၫဘွၩ",
			"39": "<sup>39</sup> လၧအဖံၭအယၪအလီၩ့တၭ,- ၦလုဆၧဘၪယိဝ့ၫတၭ, ယိခွါ, ဆၫ့ဎွံၫလၧအယၪအဖံၭလီၩ့အ့ၪဘွၩၥၧၫ့တၭ, မွဲဝ့ၫလၧဆၫ့ဎွံၫ လၧအအီၪထၪ့လၧအဖံၭလီၩ့လီၫ. မိ ဆံၫ့ဝ့ၫလီၫ.",
			"40": "<sup>40</sup> ၦလၧအခိၪၥွံၫလၩ့ခွံၬနီၪ မွဲအခိၪချၩလါနၫ့တၭ မိ",
			"41": "<sup>41</sup> ဆံၫ့ဝ့ၫလီၫ.- ၦလၧအခိၪၥွံၫတီၩလၧအမ့ၬလခီၫနီၪမွဲ ဝ့ၫလၧအခိၪချၩ လၧအမ့ၬတဒၧၩ့လခီၫလီၫ. မွဲလါနၫ့",
			"42": "<sup>42</sup> ဆံၫ့ဝ့ၫလီၫ.- အ့ၪချၩလၧအခိၪလီၩ့မွဲဂ့ၩ, အ့ၪချၩလၧ အမ့ၬတဒၧၩ့လခီၫမွဲဂ့ၩ, ဆၧဆၫဝီၩဘွၩအ့ၪအီၪတၭ, မွဲဆၧဆၫအၧၩ့လၧအအီၪထၪ့ လၧခိၪချၩမွဲဂ့ၩ, အခိၪ",
			"43": "<sup>43</sup> ချၩလၧအမ့ၬတဒၧၩ့လခီၫမွဲဂ့ၩလီၫ.- တၭၦလုဆၧဘၪ ယိဝ့ၫတၭ, ယိခွါ, ဆၧကဲၪထၪ့အၡိၪထၪ့လဖျိၪ့လၧအ ခိၪချၩအလီၩ့မွဲဂ့ၩ, လၧအခိၪချၩလၧအမ့ၬတဒၧၩ့လ ခီၫမွဲဂ့ၩ, အ့ၪဝီၩဘွၩမၩအၥၭ ဘဲၫဆၧဆၫအၧၩ့ လၧ",
			"44": "<sup>44</sup> အဖံၭအယၪအလီၩ့တၭ,- မွဲဝ့ၫလၧၦၡၩဘၪဆၧဆၫ အၧၩ့မွဲအဆံၫ့အ့ၬ. ၦလုဆၧဘၪအီၪက့ၪဝ့ၫလၧဆၧလ ဆံၫ့ဘၪတၡါလီၫ. အဆၧထၪ့နီၪ အီၪလၧအခိၪလီၩ့ လီၫ.",
			"45": "<sup>45</sup> တၭၦခံၫထူၬဆၫအၧၩ့လၧအအီၪ လၧဆၧကဲၪထၪ့ နီၪအဆဲၫ့မိဘၪၡၫ့ယၬ ဒဲအီၪဘိၪ့ခိၪ, ဒဲမၩဘံၭခွံၬအ နိၭဖံၭလၧထၭနီၪ, ဒဲဘၪကိၭၡၭထၪ့, ဆၧစံၪစၪ, ဆၧစံၪ",
			"46": "<sup>46</sup> စၪဖီၩၬ- လၧဆၧကဲၪထၪ့အီၪလၧအလီၩ့ ကိၭမုနံၩကိၭ မုနၩနီၪဆံၫ့ဝ့ၫအ့ၬ. မွဲဝ့ၫလၧဆၧလဆံၫ့ဘၪတၭ, ဘၪ အီၪဝ့ၫလဂၩဎးလီၫ. အီၪဝ့ၫအလးနီၪ မိဘၪအီၪလၧ ၦၥုၪ့တဲၩလၧခီၫ့လခီၫလီၫ.",
			"47": "<sup>47</sup> တၭဆၧအကီၩ့အၥိၭလၧအအီၪ လၧဆၧဆၫအၧၩ့",
			"48": "<sup>48</sup> နီၪ,ၥၭကလၭမွဲဂ့ၩ, ဆၧဘွၩမွဲဂ့ၩ,- လူၪအထုၪ့မွဲဂ့ၩ, လူၪအဎၩ့မွဲဂ့ၩ, လၧအမၩဝ့ၫလၧၥၭကလၭမွဲဂ့ၩ, လၧ ဆၧဘွၩမွဲဂ့ၩ, လၧဆၧဖံၭမွဲဂ့ၩ, လၧဆၧမၩလၧဆၧဖံၭ",
			"49": "<sup>49</sup> မွဲဂ့ၩ,- ဆၧကဲၪထၪ့အ့ၪယ့ၫမွဲဂ့ၩ, ဝီၩမွဲဂ့ၩ, လၧဆၧ ကီၩ့ဆၧၥိၭအလီၩ့မွဲဂ့ၩ, လၧဆၧဖံၭအလီၩ့မွဲဂ့ၩ, လၧ လူၪအထုၪ့မွဲဂ့ၩ, အဎၩ့မွဲဂ့ၩ, လၧဆၧလမံၩ့မံၩ့မၩဝ့ၫ လၧဆၧဖံၭမွဲဂ့ၩ, မွဲဆၧဆၫအၧၩ့အဆၧကဲၪထၪ့လီၫ.",
			"50": "<sup>50</sup> တၭၦဘၪဒုၭနဲၪဝ့ၫ လၧၦလုဆၧလီၫ.- တၭၦလုဆၧ ဘၪယိဆၧကဲၪထၪ့နီၪ, ဒဲအီၪက့ၪထၬဆၧကဲၪထၪ့နီၪ",
			"51": "<sup>51</sup> နွ့ၫနံၩလီၫ.- တၭနွ့ၫနံၩလနံၩနီၪ ဘၪယိဆၧကဲၪထၪ့ နီၪလီၫ. ဆၧကဲၪထၪ့နီၪ အ့ၪလဲထၪ့လၧဆၧကီၩ့ဆၧ ၥိၭအလီၩ့မွဲဂ့ၩ, လၧလူၪအထုၪ့မွဲဂ့ၩ, အဎၩ့မွဲဂ့ၩ, လၧဆၧဖံၭလီၩ့မွဲဂ့ၩ, လၧဆၧမၩလမံၩ့မံၩ့မၩဝ့ၫလၧ ဆၧဖံၭမွဲဂ့ၩ, ဆၧဆၫအၧၩ့အၪ့ဆၧနီၪ, မွဲဝ့ၫလၧဆၧ",
			"52": "<sup>52</sup> လဆံၫ့ဘၪလီၫ.- တၭဆၧလၧဆၧကီၩ့ဆၧၥိၭနီၪ, လၧ လူၪအထုၪ့မွဲဂ့ၩ, အဎၩ့မွဲဂ့ၩ, လၧၥၭကလၭမွဲဂ့ၩ, လၧဆၧဘွၩမွဲဂ့ၩ, ဆၧလမံၩ့မံၩ့မၩဝ့ၫလၧဆၧဖံၭမွဲဂ့ၩ, လၧဆၧနီၪအီၪလၧအဖၧၩ့တၭ, မွဲဆၧဆၫအၧၩ့အၪ့ဆၧ နီၪ, ၦဘၪဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪလီၫ.",
			"53": "<sup>53</sup> ၦလုဆၧဘၪယိတၭ, ယိခွါ, ဆၧကဲၪထၪ့နီၪအ့ၪလ လဲထၪ့ဘၪ လၧဆၧအကီၩ့အၥိၭအလီၩ့, လၧလူၪအ ထုၪ့မွဲဂ့ၩ, အဎၩ့မွဲဂ့ၩ, လၧဆၧလမံၩ့မံၩ့မၩဝ့ၫလၧဆၧ",
			"54": "<sup>54</sup> ဖံၭအလီၩ့မွဲဂ့ၩ,- ၦလုဆၧဘၪမၪလူၬလၧၦဘၪအၪ့ ဆူၫဝၭအဆၧအီၪလၧဆၧကဲၪထၪ့နီၪတၭ, ဘၪအီၪက့ၪ",
			"55": "<sup>55</sup> ထၬဒံၭနွ့ၫနံၩလီၫ.- လၧအဘၪဆၧအၪ့ဆူၫဝၭအလး ခဲၫ့နီၪ, ၦလုဆၧဘၪယိဆၧကဲၪထၪ့တၭ, ယိခွါ,ဆၧကဲၪ ထၪ့နီၪအလွ့အ့ၪလအၪ့လဲၩဘၪအၥၭ ဒဲဆၧကဲၪထၪ့ အ့ၪလလဲထၪ့ဘၪတၭ, မွဲလဆံၫ့ဘၪလီၫ. တၭနဘၪ ဆူၭထၪ့ခွံၬလၧမ့ၪလီၫ. ချၩဝ့ၫလၧအဖၫ့ခိၪမွဲဂ့ၩ, လၧ",
			"56": "<sup>56</sup> အဖၫ့လၬမွဲဂ့ၩ, မွဲဆၧအၪ့လၧအဖၧၩ့လီၫ.- ၦလုဆၧ အ့ၪယိတၭ, ယိခွါ, ဆၧကဲၪထၪ့လၧအအၪ့ဆူၫဝၭဝ့ၫ အလးခဲၫ့နီၪ, အ့ၪထၪ့ၥၧၫ့လဆံၭဆံၭတၭ, လၧဆၧအ ကီၩ့အၥိၭအဖၧၩ့မွဲဂ့ၩ, လၧဆၧဖံၭအဖၧၩ့မွဲဂ့ၩ, လၧ",
			"57": "<sup>57</sup> လူၪအထုၪ့မွဲဂ့ၩ, အဎၩ့မွဲဂ့ၩဘၪၡၫ့ခွံၬဝ့ၫလီၫ.- တၭ အ့ၪအီၪဖျီၪထၪ့ဒံၭ လၧဆၧအကီၩ့အၥိၭအဖၧၩ့, လၧ လူၪအထုၪ့မွဲဂ့ၩ, အဎၩ့မွဲဂ့ၩ, လၧဆၧလမံၩ့မံၩ့မၩဝ့ၫ လၧဆၧဖံၭတၭ, မွဲလၧအလဲထၪ့ဒၪဆၧလီၫ. နဘၪဆူၭ ထၪ့ခွံၬလၧအဆၧကဲၪထၪ့အီၪလၧအလီၩ့ လၧမ့ၪလီၫ.",
			"58": "<sup>58</sup> တၭဆၧအကီၩ့အၥိၭ အလူၪအထုၪ့မွဲဂ့ၩ, အဎၩ့မွဲ ဂ့ၩ, ထီးဒၪဆၧလၧဆၧမၩဝ့ၫ လၧဆၧဖံၭလမံၩ့မံၩ့ မွဲ ဂ့ၩ,လၧနအၪ့ဆူၫဝၭနီၪ ဆၧကဲၪထၪ့အ့ၪစဲၪ့ထၪ့ခွံၬလၧ အလီၩ့တၭ, ဘၪအၪ့ဆူၫဝၭဝ့ၫနံၫဘျၩ့လဘျၩ့တၭ မိ ဆံၫ့ထၪ့ဝ့ၫလီၫ.",
			"59": "<sup>59</sup> လၧဆၧအကီၩ့အၥိၭၥၭကလၭမွဲဂ့ၩ, ဆၧဘွၩမွဲဂ့ၩ, လၧလူၪအထုၪ့မွဲဂ့ၩ, အဎၩ့မွဲဂ့ၩ, လၧဆၧမၩဝ့ၫလၧ ဆၧဖံၭလမံၩ့မံၩ့မွဲဂ့ၩ, အနီၪမွဲဆၧၥနိၫဘၪဆဲၫ့ လၧ ဆၧဆၫအၧၩ့လၧအဖၧၩ့နီၪ, ဘဲၫၥိၭဆၧမိအီၪက့ၪဝ့ၫ လၧဆၧအဆံၫ့မွဲဂ့ၩ, လဆံၫ့ဘၪမွဲဂ့ၩလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, မုလ နံၩလၧဆၧခံၫထူၬဆၫအၧၩ့ဆံၫ့ထၪ့နီၪ, အယီၩမွဲဆၧ ၥနိၫဘၪဆဲၫ့လၧအဝ့ၫ, ၦမိဒုၭဂဲၫဝ့ၫ လၧၦလုဆၧအ",
			"3": "<sup>3</sup> အီၪ,- တၭၦလုဆၧဘၪလ့ၩထၪ့ လၧၦၥုၪ့တဲၩအလး လၧခီၫ့လခီၫတၭ, ၦလုဆၧဘၪယိတၭ, ယိခွါ, ဆၧဆၫ အၧၩ့အဆၧကဲၪထၪ့နီၪ အ့ၪဘျၪထဲၩ့ လၧၦခံၫထူၬဆၫ",
			"4": "<sup>4</sup> အၧၩ့အလီၩ့တၭ,- ၦလုဆၧဘၪမၪလူၬဆၧလၧၦလၧ အဆံၫ့ထၪ့ဝ့ၫအဂးနီၪ, အဆၧဘၪမၩန့ထိၪအဆံၫ့ နံၫ ဘံၪ့လၧအမၧၫ့ဝ့ၫ, ဒဲၥံၪ့ၡိၫအ့ရ့ၭ, ဒဲဆၧဝီၩ, ဒဲဟံစိၭ",
			"5": "<sup>5</sup> လီၫ.- တၭၦလုဆၧဘၪမၪလူၬ လၧၦၡၩမိမၩၥံၫထိၪနီၪ လဘံၪ့ လၧဖၧၩ့ဂၪ့ခိၪအဖၧၩ့ လၧထံၫယွၩလၩ့ဝ့ၫအ",
			"6": "<sup>6</sup> ဖၫ့ခိၪလီၫ.- ထိၪလၧအမၧၫ့ဝ့ၫလဘံၪ့နီၪ ဘၪမၩန့ဝ့ၫ, ဒဲၥံၪ့ၡိၫအ့ရ့ၭ, ဒဲဆၧဝီၩ, ဒဲဟံစိၭနီၪတၭ, ဘၪစုၪလၩ့ အဝ့ၫၥံၪဒဲထိၪမၧၫ့ဝ့ၫနီၪ လၧထိၪလဘံၪ့ဘၪဆၧမၩၥံၫ ဝ့ၫလၧထံၫယွၩလၩ့အဖၫ့ခိၪနီၪ လၧအၥွံၪအဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> ဘၪဎွံၪဆၧလၧၦလၧအဆံၫ့ထၪ့ လၧဆၧဆၫအၧၩ့လ ဂၩအလီၩ့နွ့ၩဘျၩ့တၭ, ဘၪအီၪက့ၪဝ့ၫ လၧဆၧဆံၫ့ တၭဘၪကွဲၪဖျါခွံၬ ထိၪလၧအမၧၫ့ဝ့ၫလဘံၪ့ လၧဆၧ ပျၩ့ဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> ၦလၧအဆံၫ့ထၪ့လဂၩနီၪ ဘၪအၪ့ဆူၫဝၭအကီၩ့အ ၥိၭတၭ, လိၩ့ခွံၬအခိၪၥူၫထီးအလူၬ, ဒဲၥူၫဝၭဆံၫ့အၥၭ လၧထံၫကျၩဘဲၫၥိၭအမိဆံၫ့ထၪ့လီၫ. လၧခဲၫ့ထဲၩ့တၭ မိဂဲၫထဲၩ့ လၧၦၥုၪ့တဲၩအလးဖၧၩ့တၭ, မိအီၪလၧအ",
			"9": "<sup>9</sup> တဲၩလၧခီၫ့လခီၫနွ့ၫနံၩလီၫ.- နွ့ၫနံၩလနံၩနီၪဘၪလိၩ့ အခိၪထၧၫ့ဖျိၪ့ယၫ, ဒဲအခၪဆီၪ့, ဒဲအမ့ၬထုးတၭ, ဘၪ လိၩ့ခွံၬအဆီၪ့ထီးအလူၬတၭ, ဘၪအၪ့ဆူၫဝၭအကီၩ့ အၥိၭတၭ ဘၪၥူၫဝၭဆံၫ့အယၪ လၧထံၫကျၩတၭ, မိ ဆံၫ့ထၪ့ဝ့ၫလီၫ.",
			"10": "<sup>10</sup> တၭဎိၭနံၩလနံၩနီၪ ဘၪမၩန့ ၥိၪဖၫဖိၪ နံၩဒုၩအ လၧၫ့အဎွ့ၩ, ဒဲကိၪမုၬၥၧၫ့အ့စရိၫလဲၩဎုၬ လၧၥိၪလၧ",
			"11": "<sup>11</sup> ဆၧမၩဘိၪ့ကိၪမုၬအဂး, ဒဲၥိၪလလီၭလီၫ.- တၭၦလု ဆၧလၧအအီၪက့ၪ ဆၧလၧအဆံၫ့ လဂၩနီၪ ဘၪအီၪ က့ၪၦလၧအဆံၫ့ထၪ့လဂၩ, ဒဲဆၧလဖၪနီၪလၧယဟိ ဝၩအမ့ၬယၫထီးဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့",
			"12": "<sup>12</sup> နီၪလီၫ.- ၦလုဆၧဘၪမၩန့ၥိၪဖၫဖိၪလဒုၩတၭ မၩဘိၪ့ ဝ့ၫလၧဆၧလုမၪဘၪဆၧအဂး, ဒဲၥိၪလလီၭနီၪတၭ, ဝါ ဝ့ၫလၧဆၧလုဝါဝ့ၫနီၪ လၧယဟိဝၩ အမ့ၬယၫလီၫ.",
			"13": "<sup>13</sup> တၭဘၪမၩၥံၫၥိၪဖိၪထီးအလး လၧအမိမၩၥံၫဆၧလု ဆၧဒဲၩဘၭဒဲဆၧလုမ့ၪ, လၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့ လီၫ. အဂဲးဘဲၫယီၩ ဘဲၫဆၧလုဆၧဒဲၩဘၭနီၪ, မွဲၦလု ဆၧအဆၧအၥိၭ, ဆၧလုမၪဘၪဆၧ မွဲဘဲၫနီၪၥိၭဆ့",
			"14": "<sup>14</sup> လီၫ. မွဲဆၧဆံၫ့ဎံၪထုၬလီၫ.- ၦလုဆၧဘၪမၩန့ဆၧ လုမၪဘၪဆၧအၥွံၪတၭ, ၦလုဆၧဘၪအီၪက့ၪဝ့ၫလၧ ၦလၧအဆံၫ့ထၪ့အနါကျူၩခိၪအထွ့ၪအဖၫ့ခိၪ, ဒဲလၧ အစူၪမုအထွ့ၪအဖၫ့ခိၪ, ဒဲလၧအခၪ့မုအထွ့ၪအဖၫ့ခိၪ",
			"15": "<sup>15</sup> လီၫ.- ၦလုဆၧဘၪမၩန့ဆၧလုမၪ ဘၪဆၧအၥွံၪတၭ, ၦလုဆၧဘၪမၩန့ၥိၪလလီၭတၭ, ဂါလၩ့ဝ့ၫလၧအစူၪ",
			"16": "<sup>16</sup> ယၫၥၭဒၪဝ့ၫအစ့ၪလခီၫလီၫ.- ၦလုဆၧဘၪဘၧၩ့လၩ့ အစူၪနိၩ့ အထွ့ၪလဘီၩ့ လၧၥိၪလၧအအီၪလၧအစူၪ စ့ၪဖၧၩ့အကျၩတၭ, ဘၪဎွံၪဆၧၥွံၪ လၧအစူၪနိၩ့လၧ",
			"17": "<sup>17</sup> ယဟိဝၩအမ့ၬယၫ နွ့ၫဘျၩ့လီၫ.- ၥိၪလၧအအီၪလၩ့ ထးလၧအစူၪဖၧၩ့နီၪ ၦလုဆၧဘၪအီၪက့ၪလၧၦအဆံၫ့ ထၪ့လဂၩအနါကျူၩခိၪအထွ့ၪအဖၫ့ခိၪ, ဒဲလၧအစူၪမု အထွ့ၪအဖၫ့ခိၪ, ဒဲလၧအခၪ့မုအထွ့ၪအဖၫ့ခိၪ, လၧဆၧ",
			"18": "<sup>18</sup> လုမၪဘၪဆၧအၥွံၪအဖၫ့ခိၪလီၫ.- ၥိၪလၧအအီၪလၩ့ ထးလၧၦလုဆၧအစူၪဖၧၩ့နီၪ ဘၪလူၫလၩ့ဝ့ၫလၧၦလၧ အဆံၫ့ထၪ့လဂၩအခိၪတၭ, ၦလုဆၧလဂၩဘၪမၩဆၧ",
			"19": "<sup>19</sup> ဖီၩ့ဖျ့ၭလၧအဂးလၧယဟိဝၩအမ့ၬယၫလီၫ.- ၦလုဆၧ ဘၪလုထၪ့ဆၧလုဆၧဒဲၩဘၭ, မၩဆၧဖီၩ့ဖျ့ၭလၧၦလၧ အဆံၫ့ထၪ့လၧအဆၧလဆံၫ့ဘၪအဂးလီၫ. လၧခဲၫ့ထဲၩ့",
			"20": "<sup>20</sup> တၭဘၪမၩၥံၫဆၧလုမ့ၪလီၫ.- ၦလုဆၧဘၪလုထၪ့ဆၧ လုမ့ၪဒဲဆၧမၩဘိၪ့ကိၪမုၬ လၧဆၧလုလးအဖၫ့ခိၪတၭ, ၦလုဆၧဘၪမၩဆၧဖီၩ့ဖျ့ၭလၧအဂးတၭ, မိဆံၫ့ထၪ့ဝ့ၫ လီၫ.",
			"21": "<sup>21</sup> အ့ၪၡၪ့အ့ၪယၬ မၩဆၧဎွ့ၩနီၪ အ့ၪလၥ့ၪဘၪတၭ, ဘၪမၩန့ ၥိၪဖိၪလဒုၩ လၧဆၧလုမၪဘၪဆၧအဂး, လၧၦမိဝါဝ့ၫ ဘဲၫၥိၭအမိမၩဆၧဖီၩ့ဖျ့ၭလၧအဂး, ဒဲ ကိၪမုၬလအ့စရိၫ လဲၩဎုၬလၧၥိၪ လၧဆၧမၩဘိၪ့ကိၪ",
			"22": "<sup>22</sup> မုၬအဂး,ဒဲၥိၪလလီၭ,- ဒဲထိၪလွံနံၫဘံၪ့မွဲဂ့ၩ,ကၪကဲၪ ဖိၪနံၫဘံၪ့မွဲဂ့ၩ, ဆၧလၧအမၩဝ့ၫၥ့ၪလီၫ. တၭအလ ဘံၪ့မိကဲၪထၪ့ ဆၧလုဆၧဒဲၩဘၭ, ဒဲအဝ့ၫလဘံၪ့လၧ",
			"23": "<sup>23</sup> ဆၧလုမ့ၪလီၫ.- တၭဎိၭနံၩလနံၩနီၪ ဘၪဂဲၫဆိၬဝ့ၫ လၧၦလုဆၧအအီၪ လၧအမိဆံၫ့ထၪ့အဂး, လၧဆၧ အီၪကီၪ့တဲၩဆံၫ့ဎံၪ အတရၫ့နီၪ လၧယဟိဝၩအမ့ၬ",
			"24": "<sup>24</sup> ယၫလီၫ.- ၦလုဆၧဘၪမၩန့ၥိၪဖိၪ, ဆၧလုမၪဘၪဆၧ, ဒဲၥိၪလလီၭနီၪတၭ, ၦလုဆၧဘၪဝါဝ့ၫ လၧဆၧလုဝါ",
			"25": "<sup>25</sup> ဝ့ၫလၧယဟိဝၩအမ့ၬယၫလီၫ.- ၦလုဆၧဘၪမၩၥံၫ ၥိၪဖိၪ, ဆၧလုမၪဘၪဆၧတၭ, ၦလုဆၧဘၪမၩန့ဆၧ လုမၪဘၪဆၧအၥွံၪတၭ, အီၪက့ၪဝ့ၫလၧၦလၧအဆံၫ့ ထၪ့အနါကျူၩခိၪ အထွ့ၪလခီၫအဖၫ့ခိၪ, ဒဲလၧအစူၪ မုအထွ့ၪလခီၫအဖၫ့ခိၪ, ဒဲလၧအခၪ့မုအထွ့ၪလခီၫအ",
			"26": "<sup>26</sup> ဖၫ့ခိၪလီၫ.- တၭၦလုဆၧဘၪလူၫလၩ့ဆၧၥိၪ လၧအ",
			"27": "<sup>27</sup> စူၪယၫၥၭဒၪဝ့ၫအစ့ၪလခီၫအဖၧၩ့လီၫ.- တၭၦလုဆၧ ဘၪဎွံၪဆၧလၧအစူၪနိၩ့ အထွ့ၪလဘီၩ့လၧၥိၪအီၪလၧ အစူၪစ့ၪဖၧၩ့နီၪ လၧယဟိဝၩအမ့ၬယၫ နွ့ၫဘျၩ့လီၫ.",
			"28": "<sup>28</sup> တၭၦလုဆၧ ဘၪအီၪက့ၪဆၧ ၥိၪအီၪလၧအစူၪဖၧၩ့ လၧၦလၧအဆံၫ့ထၪ့လဂၩ အနါကျူၩခိၪအထွ့ၪလခီၫ အဖၫ့ခိၪ, ဒဲလၧအစူၪမုအထွ့ၪလခီၫအဖၫ့ခိၪ, ဒဲလၧအ ခၪ့မုအထွ့ၪလခီၫအဖၫ့ခိၪ, လၧဆၧလုမၪဘၪဆၧအ",
			"29": "<sup>29</sup> ၥွံၪအလးအဖၫ့ခိၪနီၪလီၫ.- တၭၥိၪလၧအအီၪလၩ့ထး လၧၦလုဆၧအစူၪဖၧၩ့နီၪ ဘၪအီၪက့ၪဝ့ၫလၧၦလၧအ ဆံၫ့ထၪ့လဂၩအခိၪ, ဘဲၫၥိၭအမိမၩဆၧဖီၩ့ဖျ့ၭ လၧ",
			"30": "<sup>30</sup> အဂးလၧယဟိဝၩအမ့ၬယၫလီၫ.- တၭလၧထိၪလွံနံၫ ဘံၪ့နီၪဘၪမၩန့လဘံၪ့, အ့ၪလမွဲဘၪလၧကၪကဲၪဖိၪ နံၫဘံၪ့ဘၪမၩန့လဘံၪ့ လၧဆၧလၧအမၩဝ့ၫနီၪ, ဘၪ",
			"31": "<sup>31</sup> လုထၪ့လဘံၪ့,- ထီးဒၪဆၧလၧအမၩဝ့ၫၥ့ၪ, လဘံၪ့ လၧဆၧလုဆၧဒဲၩဘၭအဂး ဒဲလဘံၪ့လၧဆၧလုမ့ၪအ ဂးအီၪလၧဆၧမၩဘိၪ့ကိၪမုၬလီၫ. တၭၦလုဆၧဘၪ မၩဆၧဖီၩ့ဖျ့ၭ လၧၦလၧအဆံၫ့ထၪ့လဂၩအဂး, လၧ ယဟိဝၩအမ့ၬယၫလီၫ.",
			"32": "<sup>32</sup> အနီၪမွဲၥနိၫဘၪဆဲၫ့ လၧဆၧဆၫအၧၩ့ အဆၧကဲၪ ထၪ့အီၪလၧၦလဂၩ လၧအစူၪမၩန့ ဆၧဘၪဆဲၫ့လၧ ဆၧမိဆံၫ့ထၪ့ဝ့ၫနီၪ လၥ့ၪဘၪအကၠီၩ့လီၫ.",
			"33": "<sup>33</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ, ဒဲစအၫရၧၫ့တၭ,စံၭဝ့ၫ",
			"34": "<sup>34</sup> ဒၪ,- ထီးနၥံၪလ့ၩနုၬ လၧခးကၫနအၫ့အဖၧၩ့လၧယ မိဖ့ၪလၫ့နၥံၪ လၧအဆၧန့ၥၫအလးတၭ, ယအ့ၪအီၪ က့ၪဆၧဆၫအၧၩ့ အဆၧကဲၪထၪ့လၧဂံၪ့လဖျိၪ့အဖၧၩ့",
			"35": "<sup>35</sup> လၧခးလၧနၥံၪန့ဘၪအဖၧၩ့တၭ,- ဂံၪ့အကဆါမိဂဲၫ လီၩဘၪၦလုဆၧ, စံၭဝ့ၫ ယယိယဝ့ၫဆၧမၩအၥၭလၧ",
			"36": "<sup>36</sup> ဆၧကဲၪထၪ့အီၪဝ့ၫလၧဂံၪ့ဖၧၩ့နီၪတၭ,- ၦလုဆၧလ ဂၩနီၪဘၪမၪလူၬဆၧလၧ ၦလုဆၧလဂၩနီၪလချႃၭလ့ၩ နုၬယိဆၧဒံၭဘၪတၭ, ဘဲၫၥိၭကယဲဆၧအီၪ လၧဂံၪ့ ဖၧၩ့ထီးကဲၪထၪ့ ဆၧလဆံၫ့ဘၪလဂ့ၩနီၪဘၪဆိၬထၪ့ ခွံၬထီးအလူၬလီၫ. လၧခဲၫ့ထဲၩ့တၭ, ၦလုဆၧလဂၩနီၪ",
			"37": "<sup>37</sup> မိလ့ၩယိဂံၪ့နီၪလီၫ.- မိယိဆၧကဲၪထၪ့နီၪတၭ, ယိခွါ, ဆၧကဲၪထၪ့နီၪ အ့ၪအီၪလၧဂံၪ့အဒီၪ့အလီၩ့တၭ, အ လးလၩ့အိၪ့လဖၪ အ့ၪယ့ၫ လဆံၭဆံၭမွဲဂ့ၩ, ဝီၩလ ဆံၭဆံၭမွဲဂ့ၩ, ဆၧအလးလၩ့အိၪ့နဲၪ့ ဆၧအဒီၪ့လီၩ့",
			"38": "<sup>38</sup> တၭ,- ၦလုဆၧဘၪစဲၪ့ထၪ့လၧဂံၪ့အတရၫ့တၭ, ကၭ",
			"39": "<sup>39</sup> ဘံၭထၬအတရၫ့နွ့ၫနံၩလီၫ.- နွ့ၫနံၩလနံၩနီၪ ၦလုဆၧ ဘၪဂဲၫယိဒီၭတၭ, ယိခွါ, ဆၧကဲၪထၪ့နီၪအ့ၪလဲထၪ့",
			"40": "<sup>40</sup> လၧဂံၪ့အဒီၪ့လီၩ့တၭ,- ၦလုဆၧဘၪမၪလူၬ ဆၧလၧ ၦမိမၩန့ခွံၬ လိးလၧအအီၪလၧဆၧလဖၪနီၪတၭ, ဘၪ ခွံၬၡိၭခွံၬဝ့ၫလၧ အလးလဆံၫ့ဘၪလၧဒိၩ့လၧခီၫ့လခီၫ",
			"41": "<sup>41</sup> လီၫ.- ဘၪဒုၭကွၭခွံၬဂံၪ့ဝၬဖီၩ့တၭ, ဘၪဂါလၩ့ခွံၬအ မုၬလၧအမိကွၭခွံၬဝ့ၫနီၪ လၧဒိၩ့လၧခီၫ့လခီၫ လၧအ",
			"42": "<sup>42</sup> လးလဆံၫ့ဘၪလီၫ.- ဘၪမၩန့လိးအဂူၫဂၩလဖၪတၭ, အီၪက့ၪဝ့ၫလၧလိးလဖၪနီၪအလးတၭ, ဘၪမၩန့အၩ့",
			"43": "<sup>43</sup> ကထၨအၥၫ့တၭ, လံၬဂံၪ့နီၪလီၫ.- မၩန့ခွံၬလိးနီၪဂီၩ့ တၭ,ကွၭခွံၬဂံၪ့တၭ, လံၬလၧအၩ့ကထၨအၥၫ့အလး ခဲၫ့နီၪ, ဆၧကဲၪထၪ့အ့ၪဂဲၫထၪ့ဒီၭ, အီၪထၪ့လၧဂံၪ့လ",
			"44": "<sup>44</sup> ဖျိၪ့နီၪအဖၧၩ့တၭ,- ၦလုဆၧဘၪဂဲၫယိတၭ, ယိခွါ, ဆၧကဲၪထၪ့နီၪအ့ၪလဲထၪ့ လၧဂံၪ့နီၪအဖၧၩ့တၭ, မွဲဝ့ၫ ဆၧဆၫအၧၩ့အၪ့ဆၧလၧဂံၪ့ဖၧၩ့နီၪတၭ, မွဲဆၧလဆံၫ့",
			"45": "<sup>45</sup> ဘၪလီၫ.- ဘၪမၩလၫ့ဎီးခွံၬဂံၪ့နီၪအလိးလဖၪ, ဒဲအ ၥံၪ့လဖၪ, ဒဲဂံၪ့အအၩ့ကထၨထီးအလူၬတၭ, ဘၪဆိၬ ထၪ့ခွံၬဝ့ၫလၧဒိၩ့လၧခီၫ့လခီၫ, လၧအလးလဆံၫ့ဘၪ",
			"46": "<sup>46</sup> လီၫ.- တၭကယဲမုနံၩမုနၩ လၧဂံၪ့ကၭဘံၭ အၥၭအ ဘိၩ့ဘၭနီၪတၭ, ၦလၧအလ့ၩနုၬနီၪမိကဲၪထၪ့ ဆၧလ",
			"47": "<sup>47</sup> ဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- တၭၦလၧအမံၫလၧဂံၪ့ ဖၧၩ့နီၪ ဘၪအၪ့ဆူၫဝၭ အကီၩ့အၥိၭတၭ, ၦလၧအ အၪ့ဆၧလၧဂံၪ့ဖၧၩ့နီၪ ဘၪအၪ့ဆူၫဝၭ အကီၩ့အၥိၭ လီၫ.",
			"48": "<sup>48</sup> ၦလုဆၧအ့ၪဂဲၫယိဝ့ၫတၭ, ယိခွါ, ဆၧကဲၪထၪ့နီၪ အ့ၪလလဲထၪ့ ဘၪလၧဂံၪ့ဖၧၩ့ လၧအဘၪဆၧလံၬဝ့ၫ လၧအၩ့ကထၨအလးခဲၫ့နီၪတၭ, ၦလုဆၧဘၪအီၪက့ၪ ဂံၪ့လဖျိၪ့နီၪ လၧအဆံၫ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧကဲၪ",
			"49": "<sup>49</sup> ထၪ့နီၪဘျၪယူၭဝ့ၫယူၭ.- ဘဲၫၥိၭအမိမၩဆံၫ့ထၪ့ဂံၪ့ နီၪတၭ, ဘၪမၩန့ထိၪနံၫဘံၪ့, ဒဲၥံၪ့ၡိၫအ့ရ့ၭ, ဒဲဆၧဝီၩ,",
			"50": "<sup>50</sup> ဒဲဟံစိၭ,- တၭဘၪမၩၥံၫထိၪလဘံၪ့ လၧဖၧၩ့ဂၪ့ခိၪအ",
			"51": "<sup>51</sup> ဖၧၩ့လၧထံၫယွၩလၩ့ဝ့ၫအဖၫ့ခိၪလီၫ.- ဘၪမၩန့ၥံၪ့ၡိၫ အ့ရ့ၭ, ဒဲဟံစိၭ, ဒဲဆၧဝီၩ, ဒဲထိၪလၧအမၧၫ့ဝ့ၫလဘံၪ့ တၭ, စုၪလၩ့ဝ့ၫလၧထိၪ လၧအဘၪဆၧမၩၥံၫဝ့ၫ လ ဘံၪ့အၥွံၪဖၧၩ့, ဒဲလၧထံၫယွၩလၩ့အဖၧၩ့တၭ, ဎွံၪဂံၪ့",
			"52": "<sup>52</sup> နီၪနွ့ၫဘျၩ့လီၫ.- ဘၪမၩဆံၫ့ထၪ့ဂံၪ့လၧထိၪအၥွံၪ, ဒဲ ထံၫယွၩလၩ့ဒဲထိၪလၧအမၧၫ့ဝ့ၫ, ဒဲၥံၪ့ၡိၫအ့ရ့ၭ, ဒဲဟံ",
			"53": "<sup>53</sup> စိၭ,ဒဲဆၧဝီၩလီၫ.- အ့ၪမွဲထိၪလၧအမၧၫ့ဝ့ၫလဘံၪ့နီၪ, ဘၪဖျါလၩ့ခွံၬဝ့ၫ လၧဒိၩ့လၧခီၫ့လၧဆၧပျၩ့ဖၧၩ့လခီၫ တၭ, ဘၪမၩဆၧဖီၩ့ဖျ့ၭလၧဂံၪ့အဂးတၭ, မိဆံၫ့ထၪ့",
			"54": "<sup>54</sup> ဝ့ၫလီၫ.- အနီၪမွဲၥနိၫဘၪဆဲၫ့လၧကယဲဆၧဆၫအၧၩ့,",
			"55": "<sup>55</sup> ဒဲဆၧအဎၬအဆၧကဲၪထၪ့,- ဒဲဆၧအကီၩ့အၥိၭ,ဒဲဂံၪ့",
			"56": "<sup>56</sup> ၥံၪဎၫ့ၥံၪအဆၧဆၫအၧၩ့,- ဒဲဆၧၡိၪထၪ့ အဖံၭလၩ့",
			"57": "<sup>57</sup> ကျိၭအလး, အလးကျံၩ့,- ဘဲၫၥိၭအမိၥီၪ့လိၪဆၧလၧ မုနံၩလၧအလဆံၫ့ဘၪ, ဒဲမုနံၩလၧအဆံၫ့ထၪ့နီၪလီၫ. အနီၪမွဲၥနိၫ ဘၪဆဲၫ့လၧဆၧဆၫအၧၩ့နီၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ ဒဲစအၫရၧၫ့တၭ, စံၭ",
			"2": "<sup>2</sup> ဝ့ၫ,- လီၩဘၪၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫၥံၪ,ထီး ဒၪၦၡၩလဂၩဂၩအီၪလၧအဖၧၩ့လး အဖံၪထၪ့ယွၩလၩ့ ဘဲၫနီၪတၭ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪလၧအဖံၪထၪ့",
			"3": "<sup>3</sup> ယွၩလၩ့ဝ့ၫအကၠီၩ့လီၫ.- တၭအယီၩမွဲဆၧလဆံၫ့ဘၪ လၧအဖံၪထၪ့ယွၩလၩ့ဝ့ၫအကၠီၩ့, ဆၧယွၩလၩ့လၧအ ယၪလီၩ့လၧအဆၧယွၩလၩ့အကၠီၩ့မွဲဂ့ၩ, အယၪဘၪ ထၬဝ့ၫလၧအဆၧယွၩလၩ့မွဲဂ့ၩ, မွဲဝ့ၫလၧဆၧလဆံၫ့",
			"4": "<sup>4</sup> ဘၪလီၫ.- ကယဲလးမံၫလၧၦလၧအအီၪ လၧဆၧယွၩ လၩ့လဂၩ မံၫနၩ့ဝ့ၫလၧအလီၩ့နီၪ, မွဲဆၧလဆံၫ့ဘၪ လီၫ. တၭကယဲဆၧလၧအဆၧၫ့နၩ့ဘၪဝ့ၫ လၧအဖၫ့ခိၪ",
			"5": "<sup>5</sup> နီၪ, မွဲဆၧလဆံၫ့ဘၪဆ့လီၫ.- တၭကယဲၦလၧအထိၭ ဘၪအလးမံၫလဂၩလါလါနီၪ, ဘၪအၪ့ဆူၫဝၭအကီၩ့ အၥိၭ, ဒဲအၪ့လူထံၫတၭ, ကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီး",
			"6": "<sup>6</sup> မုဂၪလၩ့လီၫ.- ၦလၧအဆၧၫ့နၩ့ လၧဆၧလမံၩ့မံၩ့အ လီၩ့, လၧၦလၧအအီၪလၧဆၧယွၩလၩ့နီၪ ဆၧၫ့နၩ့ဘၪ ဝ့ၫတၭ, ဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭ, ဒဲအၪ့လူထံၫတၭ,",
			"7": "<sup>7</sup> ကဲၪထၪ့ဆၧလဆံၫ့ဘၪ ထီးမုဂၪလၩ့လီၫ.- ၦလၧအ ထိၭဘၪၦလၧအအီၪ လၧဆၧယွၩလၩ့လဂၩအယၪနီၪ ဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭ, ဒဲအၪ့လူထံၫတၭ, မိကဲၪ",
			"8": "<sup>8</sup> ထၪ့ဆၧလဆံၫ့ဘၪ ထီးမုဂၪလၩ့လီၫ.- ၦလၧအအီၪ လၧဆၧယွၩလၩ့ဝ့ၫနီၪ အ့ၪထိၪဖျံၭဘၪ လၧၦအဆံၫ့ အလီၩ့နီၪတၭ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ ထီးမုဂၪလၩ့",
			"9": "<sup>9</sup> လီၫ.- တၭကယဲပီၩ့လၧၦအီၪလၧ ဆၧယွၩလၩ့ဝ့ၫလဂၩ",
			"10": "<sup>10</sup> ထူၬဝ့ၫနီၪ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪလီၫ.- ကယဲၦလၧ အထိၭဘၪဆၧလမံၩ့မံၩ့ လၧအအီၪယူၭလၧအဖၫ့လၬ လဂၩလါလါနီၪ မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီးမုဂၪလၩ့ တၭ, ၦလၧအဆိၬထၪ့အဆၧ လမံၩ့မံၩ့နီၪဘၪအၪ့ဆူၫ ဝၭအကီၩ့အၥိၭ, ဒဲအၪ့လူထံၫတၭ, မိကဲၪထၪ့ဆၧလ",
			"11": "<sup>11</sup> ဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- ကယဲၦလၧအဘၪဆၧထိၭ ဝ့ၫ, လၧကယဲၦလၧအအီၪ လၧဆၧယွၩလၩ့ဝ့ၫတၭ,လ ၥူၫဝၭဘၪအစူၪလၧထံၫနီၪ ဘၪအၪ့ဆူၫဝၭအကီၩ့အ ၥိၭ, ဒဲအၪ့လူထံၫတၭ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီးမု ဂၪလၩ့လီၫ.",
			"12": "<sup>12</sup> တၭထွ့ၫဂၪ့ခိၪ လၧအဘၪဆၧထိၭဝ့ၫ လၧၦလၧအ အီၪလၧဆၧယွၩလၩ့ဝ့ၫနီၪ မိဘၪမၩထ့ဖၭတၭ, ကယဲ ထွ့ၫလဖၪနီၪ မိဘၪဆၧၥူၫဝၭ ဆံၫ့ခွံၬ လၧထံၫလီၫ.",
			"13": "<sup>13</sup> ထီးၦလၧအအီၪလၧဆၧယွၩလၩ့ဝ့ၫနီၪ အ့ၪဆံၫ့ထၪ့ဝ့ၫ လၧဆၧယွၩလၩ့တၭ, ဘၪဝံထၪ့နၬထၪ့ဝ့ၫ နွ့ၫနံၩလၧ အဂးဒၪဝ့ၫလၧအဆံၫ့ထၪ့အဂဲး, ဒဲအၪ့ဆူၫဝၭအကီၩ့ အၥိၭတၭ, ၥူၫဝၭဆံၫ့ထၪ့အယၪ လၧထံၫယွၩလၩ့ဝ့ၫ",
			"14": "<sup>14</sup> တၭ,မိဆံၫ့ထၪ့ဝ့ၫလီၫ.- ဎိၭနံၩလနံၩနီၪ ဘၪမၩန့ထိၪ လွံနံၫဘံၪ့မွဲဂ့ၩ, ကၪကဲၪဖိၪ နံၫဘံၪ့မွဲဂ့ၩ, လၧအဂး တၭ,လ့ၩလၧယဟိဝၩအမ့ၬယၫ, လၧဆၧအီၪကီၪ့အ တဲၩဆဲၫ့ဎံၪအတရၫ့တၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪလၧၦလုဆၧ",
			"15": "<sup>15</sup> လီၫ.- ၦလုဆၧဘၪလုထၪ့ဝ့ၫ လဘံၪ့လၧဆၧလုဆၧ ဒဲၩဘၭအဂး, ဒဲလဘံၪ့လၧဆၧလုမ့ၪအဂးလီၫ. တၭ ၦလုဆၧဘၪမၩဆၧဖီၩ့ဖျ့ၭလၧအဂး လၧယဟိဝၩအ မ့ၬယၫလၧဆၧယွၩလၩ့ဝ့ၫ အကၠီၩ့လီၫ.",
			"16": "<sup>16</sup> ၦခွၫအချံၫဘၪဆဲၫ့ လၧအမံၫဎုၬဆၧနီၪအ့ၪစဲၪ့ထၪ့ လၧအဖၧၩ့တၭ, ဘၪၥူၫဝၭဆံၫ့အယၪ လၧထံၫတၭမိ",
			"17": "<sup>17</sup> ကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- တၭကယဲ ဆၧအကီၩ့အၥိၭ, ဒဲကယဲဆၧဖံၭ လၧအအီၪလၧဆၧ ချံၫလၧအဘၪဆဲၫ့ လၧအမံၫဎုၬဆၧနီၪ, မိဘၪဆၧအၪ့ ဆူၫဝၭလၧထံၫတၭ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ ထီးမုဂၪ",
			"18": "<sup>18</sup> လၩ့လီၫ.- တၭၦမုၪလၧၦခွၫမံၫဎုၬလၧအဝ့ၫနီၪ, ဘၪအၪ့ လူထံၫနံၫဂၩလူၬတၭ, ကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီးမုဂၪ လၩ့လီၫ.",
			"19": "<sup>19</sup> ၦမုၪအ့ၪအီၪလၧဆၧယွၩလၩ့တၭ, ဆၧယွၩလၩ့လၧ အယၪအ့ၪမွဲၥွံၪတၭ, ၦဘၪအီၪက့ၪဝ့ၫလစီၪ့ဒၪနွ့ၫနံၩ လီၫ. တၭကယဲၦလၧအထိၭဘၪဝ့ၫ လဂၩလါလါနီၪ,",
			"20": "<sup>20</sup> မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- လၧအအီၪ လစီၪ့ဒၪအဘိၩ့ဘၭနီၪတၭ, ကယဲဆၧလၧအမံၫနၩ့ဘၪ ဝ့ၫလၧအဖၫ့ခိၪမိကဲၪထၪ့ဆၧလဆံၫ့ဘၪလီၫ. ဒဲကယဲ ဆၧလၧအဆၧၫ့နၩ့ဘၪဝ့ၫ လၧအဖၫ့ခိၪဆ့ မိကဲၪထၪ့",
			"21": "<sup>21</sup> ဆၧလဆံၫ့ဘၪလီၫ.- တၭကယဲၦလၧအထိၭဘၪအလး မံၫနီၪဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭ, ဒဲအၪ့လူထံၫတၭ,",
			"22": "<sup>22</sup> မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ ထီးမုဂၪလၩ့လီၫ.- ကယဲၦ လၧအထိၭဘၪဆၧလမံၩ့မံၩ့ လၧအဆၧၫ့နၩ့လၧအဖၫ့ ခိၪနီၪ ဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭ ဒဲအၪ့လူထံၫတၭ,",
			"23": "<sup>23</sup> မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- ဆၧအ့ၪ အီၪလၧလးမံၫအလီၩ့မွဲဂ့ၩ, ဆၧလၧအဆၧၫ့နၩ့လၧအ ဖၫ့ခိၪမွဲဂ့ၩ, ထီးအဝ့ၫဒၪထိၭဘၪတၭ, မိကဲၪထၪ့ဆၧ",
			"24": "<sup>24</sup> လဆံၫ့ဘၪထီးမုဂၪလၩ့လီၫ.- ၦခွၫလဂၩ အ့ၪမံၫဎုၬ လၧအဝ့ၫတၡါတၭ, ဆၧလၧအယွၩလၩ့လၧအဝ့ၫနီၪ အီၪလၧအလီၩ့တၭ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ နွ့ၫနံၩ လီၫ. တၭအလးမံၫမိကဲၪထၪ့ဆၧ လဆံၫ့ဘၪထၧၫ့ဘံၪ့",
			"25": "<sup>25</sup> ယၫလီၫ.- တၭၦမုၪအၥွံၪနီၪအ့ၪဂဲၫလၩ့ အၪနံၩအၪ ၥၫ့ လၧအလမွဲဘၪအဆၧၫ့အထီ လၧအအီၪလစီၪ့ဒၪ မွဲဂ့ၩ, အ့ၪဖီၩ့ခွံၬအအီၪလစီၪ့ဒၪ အဆၧၫ့အထီမွဲဂ့ၩ, အဆၧယွၩလၩ့လဆံၫ့ဘၪ ကိၭမုနံၩမုနၩ မိမၩအၥၭ ဘဲၫမုနံၩမုနၩ လၧအအီၪလစီၪ့ဒၪအၥိၭနီၪလီၫ. မွဲဝ့ၫ",
			"26": "<sup>26</sup> လဆံၫ့ဘၪလီၫ.- အဆၧယွၩလၩ့အမုနံၩ ထီးအလူၬ အဘိၩ့ဘၭနီၪ ကယဲလးမံၫလၧအမံၫဘၪ လၧအဖၫ့ခိၪ မိကဲၪထၪ့လၧအဂး, မၩအၥၭဘဲၫလးမံၫဘၪဆဲၫ့လၧ အအီၪလစီၪ့ဒၪ အၥိၭနီၪလီၫ. တၭကယဲဆၧလၧအ ဆၧၫ့နၩ့လၧအဖၫ့ခိၪ မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ, ဘဲၫဆၧ လဆံၫ့ဘၪ ဘၪဆဲၫ့လၧအအီၪလစီၪ့ဒၪ အၥိၭနီၪလီၫ.",
			"27": "<sup>27</sup> ကယဲၦလၧအထိၭဘၪဆၧလဖၪနီၪ, မိကဲၪထၪ့ဆၧလ ဆံၫ့ဘၪတၭ, ဘၪအၪ့ဆူၫဝၭ အကီၩ့အၥိၭ, ဒဲအၪ့လူ",
			"28": "<sup>28</sup> ထံၫ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ ထီးမုဂၪလၩ့လီၫ.-အ့ၪ ဆံၫ့ထၪ့လၧအဆၧယွၩလၩ့တၭ, ဘၪဝံထၪ့ဝ့ၫနွ့ၫနံၩ လၧအဂးဒၪဝ့ၫလီၫ. လၧခဲၫ့ထဲၩ့တၭမိဆံၫ့ထၪ့ဝ့ၫလီၫ.",
			"29": "<sup>29</sup> ဎိၭနံၩလနံၩနီၪ ဘၪမၩန့ထိၪလွံနံၫဘံၪ့မွဲဂ့ၩ, ကၪကဲၪ ဖိၪနံၫဘံၪ့မွဲဂ့ၩ, လၧအဂးတၭ, ဂဲၫဆိၬအဝ့ၫၥံၪလၧ ၦလုဆၧအအီၪ ထီးဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအတ",
			"30": "<sup>30</sup> ရၫ့နီၪလီၫ.- ၦလုဆၧဘၪလုထၪ့လဘံၪ့လၧဆၧလုဆၧ ဒဲၩဘၭအဂး, ဒဲလဘံၪ့လၧဆၧလုမ့ၪအဂးတၭ, ၦလု ဆၧဘၪမၩဆၧဖီၩ့ဖျ့ၭလၧအဂး, လၧယဟိဝၩအမ့ၬ ယၫ, လၧအဆၧယွၩလၩ့လဆံၫ့ဘၪအကၠီၩ့လီၫ.",
			"31": "<sup>31</sup> တၭနၥံၪဘၪမၩလၩ့မုလၩ့ဖၭ ၦအံၫစရ့လၭဖိၪလၧ အဆၧလဆံၫ့ဘၪ, ဘဲၫၥိၭ အထီးမၩၥၭလိၪယတဲၩ ဆံၫ့ဎံၪလၧအအီၪလၧအဝ့ၫၥံၪအကၠီၩ့နီၪ, မိၥံၫလၧအ ဆၧလဆံၫ့ဘၪအဖၧၩ့လဂ့ၩလီၫ.",
			"32": "<sup>32</sup> အနီၪမွဲၥနိၫဘၪဆဲၫ့ လၧၦလၧအအီၪ လၧဆၧယွၩ လၩ့, ဒဲၦလၧအချံၫစဲၪ့ထၪ့လၧအဖၧၩ့, လၧအကဲၪထၪ့",
			"33": "<sup>33</sup> ဆၧလဆံၫ့ဘၪလၧအကၠီၩ့,- ဒဲၦမုၪလၧအအၪ့ဆူၫဝၭ လၩ့အၥၭ, ဒဲၦၡၩလၧအအီၪ လၧဆၧယွၩလၩ့, ၦခွၫ ဒဲၦမုၪ, ဒဲၦခွၫလၧအမံၫဎုၬ လၧၦမုၪလၧအလဆံၫ့ဘၪ နီၪလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ လၧစအၫရၧၫ့အဖိၪခွၫ နံၫဂၩထီးအလုထၪ့ဆၧလၧယဟိဝၩ အမ့ၬယၫနီၪၥံၫ",
			"2": "<sup>2</sup> ဝ့ၫအလးခဲၫ့တၭ, ယဟိဝၩစံၭစမိစ့ၭ,- လီၩဘၪနထၧၫ့ ဖုဝဲစအၫရၧၫ့, လၧလးဆံၫ့ဎံၪအဖၧၩ့လၧကလကၫအ မ့ၬယၫ လၧဆၧယၫ့ၥၭအလး အီၪလၧတလၫအဖၫ့ခိၪ အမ့ၬယၫနီၪ, ဘဲၫၥိၭအထီးၥံၫလဂ့ၩတၭ, ထီးလ့ၩနုၬ ကိၭအဆၧၫ့အထီဒ့ၭလဂ့ၩ. အဂဲးဘဲၫယီၩ ယမိအီၪ ဖျီၪထၪ့လၧဆၧအုၪ့အဖၧၩ့ လၧဆၧယၫ့ၥၭအလးအဖၫ့",
			"3": "<sup>3</sup> ခိၪနီၪလီၫ.- စအၫရၧၫ့မိဘၪလ့ၩနုၬ လၧအလးဆံၫ့ဎံၪ အဖၧၩ့ဘဲၫယီၩ, လၧချီဖၫအၥၭဘၪ့လဒုၩ လၧဆၧလု ဆၧဒဲၩဘၭအဂး, ဒဲၥိၪဖၫ လၧဆၧလုမ့ၪ အဂးလီၫ.",
			"4": "<sup>4</sup> မိဘၪၥိၭဆဲၫ့ဘွၩဖျ့ၫလံၬကံၭဆံၫ့ဎံၪ, ဒဲမိဘၪအီၪလၧ အဆၧဖျၪ့ခဲၫ့ဘွၩဖျ့ၫလံၬကံၭ လၧအယၪလီၩ့တၭ, မိ အီၪခဲးထူၬအယးဒံၩ့ လၧခၧၩ့ယးဘွၩဖျ့ၫလံၬကံၭ ဒဲမိ အီၪလၧခိၪခဲးဘွၩဖျ့ၫလံၬကံၭလီၫ. ဆၧလဖၪနီၪမွဲဆၧ အကီၩ့အၥိၭ ဆံၫ့ဎံၪတၭ, ဘၪၥူၫဝၭဆံၫ့အယၪ လၧ",
			"5": "<sup>5</sup> ထံၫတၭ, ကီၩ့ၥိၭထၪ့ဝ့ၫလီၫ.- တၭဘၪမၩန့ဘ့ၪဖိၪနံၫ ဒုၩလၧၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ လၧဆၧလု ဆၧဒဲၩဘၭအဂး, ဒဲၥိၪဖၫလဒုၩ လၧဆၧလုမ့ၪအဂးလီၫ.",
			"6": "<sup>6</sup> စအၫရၧၫ့ဘၪလုထၪ့အချီဖၫလဒုၩ လၧဆၧလုဆၧ ဒဲၩဘၭအဂး လၧအဂးဒၪဝ့ၫတၭ, မၩဆၧဖီၩ့ဖျ့ၭ လၧ",
			"7": "<sup>7</sup> အဂးဒၪဝ့ၫ, ဒဲလၧအၡၩဂံၪ့ဖိၪအဂးလီၫ.- အဝ့ၫဒၪဘၪ မၩန့ဘ့ၪနံၫဒုၩတၭ, အီၪက့ၪဝ့ၫလၧယဟိဝၩအမ့ၬယၫ",
			"8": "<sup>8</sup> ထီးဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪ အတရၫ့နီၪလီၫ.- တၭ စအၫရၧၫ့ဘၪဖၭဆၧ လၧဘ့ၪနံၫဒုၩအဂး, လမံၩ့လၧ",
			"9": "<sup>9</sup> ယဟိဝၩအဂး, ဒဲလမံၩ့လၧဆၧဂၭဖျ့ၭအဂး,- တၭ စအၫရၧၫ့ဘၪဂဲၫဆိၬဘ့ၪ လၧအဆၧဖၭလၩ့ဘၪဝ့ၫလၧ ယဟိဝၩအဂးလဒုၩတၭ, လုထၪ့ဝ့ၫလၧဆၧလုဆၧဒဲၩ",
			"10": "<sup>10</sup> ဘၭအဂးလီၫ.- အ့ၪမွဲဘ့ၪလၧဆၧဖၭလၩ့ဘၪဝ့ၫလၧ ဆၧဂၭဖျ့ၭအဂး လဒုၩနီၪမိဘၪ ဆၧအီၪက့ၪမၧၫ့ဝ့ၫ လၧယဟိဝၩအမ့ၬယၫ, ဘဲၫၥိၭအဆၧမိမၩဆၧဖီၩ့ဖျ့ၭ လၧအဝ့ၫတၭ, ဖျါခွံၬဝ့ၫလၧၡါမုနၧၫ့ဖၫ လၧဆၧဂၭဖျ့ၭ အဂးလီၫ.",
			"11": "<sup>11</sup> စအၫရၧၫ့ဘၪဂဲၫဆိၬ ချီဖၫလၧဆၧလုဆၧဒဲၩဘၭအ ဂးလၧအမွဲ လၧအဂးဒၪဝ့ၫလဒုၩနီၪ, ဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧအဂးဒၪဝ့ၫ, ဒဲလၧအၡၩဂံၪ့ဖိၪအဂးတၭ, မိဘၪမၩ ၥံၫချီဖၫလဒုၩ လၧဆၧလုဆၧဒဲၩဘၭအဂး လၧအဂးဒၪ",
			"12": "<sup>12</sup> ဝ့ၫလီၫ.- ဘၪမၩဎွ့ၩဖၧၩ့မ့ၪလၧ မ့ၪအၧၩ့ဖၭလၧအမၩန့ လၧဆၧလုလးအဖၫ့ခိၪ အီၪလၧယဟိဝၩအမ့ၬယၫတၭ အစူၪဎွ့ၩ လၧဆၧနၧၫ့မၧၫ့ဆူၭခဲၩ လၧအထီးဝ့ၫလွံၩ",
			"13": "<sup>13</sup> ပွံၪတၭ, ဆိၬဝ့ၫလၧကလကၫ လၧယၫလခီၫလီၫ.-တၭ ဘၪအီၪက့ၪဆၧဆူၭခဲၩနၧၫ့မၧၫ့ လၧမ့ၪအဖၫ့ခိၪ လၧ ယဟိဝၩအမ့ၬယၫ, ဘဲၫၥိၭဆၧဆူၭခဲၩနၧၫ့မၧၫ့အခူၪ မိချႃၬဘံၭဆၧယၫ့ၥၭအလး လၧအအီၪလၧဆၧအုၩ့",
			"14": "<sup>14</sup> လၩ့အဖၫ့ခိၪ, ဘဲၫၥိၭအထီးၥံၫလဂ့ၩနီၪလီၫ.- ဘၪမၩ န့ချီဖၫလဒုၩအၥွံၪတၭ, ဎွံၪဝ့ၫလၧအစူၪနိၩ့လဘီၩ့လၧ ဆၧယၫ့ၥၭအလးအဖၫ့ခိၪ လၧမုထၪ့လခီၫတၭ, လၧ ဆၧယၫ့ၥၭအလး အမ့ၬယၫနီၪ ဘၪဎွံၪဆၧၥွံၪ လၧအ စူၪနိၩ့လဘီၩ့နွ့ၫဘျၩ့လီၫ.",
			"15": "<sup>15</sup> ဘၪမၩၥံၫဘ့ၪလၧဆၧလု ဆၧဒဲၩဘၭအဂးလၧအမွဲ လၧၦခမျၧးအဂးတၭ, ဆိၬနုၬအၥွံၪလၧကလကၫလၧ ယၫလခီၫတၭ, မၩအၥွံၪ ဘဲၫအမၩချီဖၫအၥွံၪအၥိၭ နီၪတၭ, ဎွံၪဝ့ၫလၧဆၧယၫ့ၥၭအလးအဖၫ့ခိၪ, ဒဲလၧဆၧ",
			"16": "<sup>16</sup> ယၫ့ၥၭအလးအမ့ၬယၫလီၫ.- တၭအဝ့ၫဒၪဘၪမၩဆၧ ဖီၩ့ဖျ့ၭလၧဆၧအလးဆံၫ့ဎံၪအဂး, လၧၦအံၫစရ့လၭ ဖိၪအဆၧလဆံၫ့ဘၪအကၠီၩ့, ဒဲလၧအဆၧမၪလၧအ ဆၧဒဲၩဘၭ ထီးအလူၬအကျၩအကၠီၩ့တၭ, မိဘၪမၩ ဘဲၫနီၪၥိၭ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဂး, လၧ အအီၪလၩ့ထးလၧအကျၩ, လၧအဆၧလဆံၫ့ဘၪအ",
			"17": "<sup>17</sup> ၥၭခံဖၧၩ့လီၫ.- ထီးအဝ့ၫဒၪလ့ၩနုၬဘဲၫၥိၭအမိမၩဆၧ ဖီၩ့ဖျ့ၭလၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့တၭ ၦၡၩအီၪဘၪ လၧဆၧအီၪကီၪ့အတဲၩဆံၫ့ဎံၪဖၧၩ့ နးဂၩအ့ၬ. ထီးအ မၩဆၧဖီၩ့ဖျ့ၭ လၧအဂးဒၪဝ့ၫ, ဒဲလၧအဂံၪ့ဖိၪအဂး, ဒဲလၧၦအံၫစရ့လၭအဆၧအီၪကီၪ့ ထီးအလူၬအဂးဂီၩ့",
			"18": "<sup>18</sup> တၭ, ဂဲၫထဲၩ့ထၪ့ဝ့ၫလီၫ.- ဘၪဂဲၫထၪ့လၧဆၧလုလး လၧအအီၪလၧယဟိဝၩအမ့ၬယၫတၭ, မၩဆၧဖီၩ့ဖျ့ၭ လၧအဂးတၭ, ဘၪမၩန့ချီဖၫအၥွံၪ, ဒဲဘ့ၪအၥွံၪတၭ, အီၪက့ၪဝ့ၫလၧဆၧလုလးအနိၩ့လဖၪ ဝၬဖီၩ့ဝ့ၫလီၫ.",
			"19": "<sup>19</sup> မွဲအဘၪဎွံၪဆၧၥွံၪ လၧအဖၫ့ခိၪ လၧအစူၪနိၩ့လဘီၩ့ နွ့ၫဘျၩ့တၭ, မၩဆံၫ့ဎံၪထၪ့ဝ့ၫ, ဒဲမၩဆံၫ့ထၪ့ဝ့ၫလၧၦ အံၫစရ့လၭဖိၪ အဆၧလဆံၫ့ဘၪအကၠီၩ့နီၪလီၫ.",
			"20": "<sup>20</sup> ထီးအမၩဆၧဖီၩ့ဖျ့ၭ လၧအလးဆံၫ့ဎံၪအဂး,ဒဲဆၧ အီၪကီၪ့အတဲၩဆံၫ့ဎံၪအဂး, ဒဲဆၧလုလးအဂး ဂီၩ့",
			"21": "<sup>21</sup> တၭ,ဘၪဂဲၫဆိၬဘ့ၪလၧအမၧၫ့လဒုၩလီၫ.- တၭစအၫ ရၧၫ့ဘၪအီၪက့ၪအစူၪနံၫခီၫ လၧဘ့ၪလၧအမၧၫ့ဝ့ၫလ ဒုၩအခိၪတၭ, လီၩဘၪၦအံၫစရ့လၭဖိၪ အဆၧအၧၩ့ ဆၧၥၫ့ထီးအလူၬ, ဒဲအဆၧမၪထီးအလူၬ လၧအဆၧ ဒဲၩဘၭအဖၧၩ့တၭ, အီၪက့ၪဝ့ၫလၧဘ့ၪအခိၪ, တၭဖျါ ခွံၬဝ့ၫလၧၦအကြၨၭလဂၩအစူၪဖၧၩ့ လၧၡါမုနၧၫ့ဖၫ",
			"22": "<sup>22</sup> လီၫ.- ဘ့ၪလဒုၩမိဆိၬထၪ့ခွံၬ ကယဲအဆၧၥူၭဆၧမၪ လၧခးအီၪယူလဘံၪ့တၭ, မိဘၪဖျါခွံၬဘ့ၪနီၪလၧၡါမု နၧၫ့ဖၫလီၫ.",
			"23": "<sup>23</sup> တၭစအၫရၧၫ့ ဘၪဂဲၫနုၬ လၧဆၧအီၪကီၪ့ အတဲၩ ဆံၫ့ဎံၪအဖၧၩ့, ဒဲအကီၩ့အၥိၭဘွၩဖျ့ၫလံၬကံၭ လၧအ ကီၩ့ထၪ့ၥိၭထၪ့ထီးအလ့ၩနုၬ လၧဆၧအလးဆံၫ့ဎံၪ နီၪ ဘၪဘဲၪ့လၩ့ခွံၬဝ့ၫ, ဒဲအီၪက့ၪလၩ့ထးဝ့ၫ ထီးနီၪ",
			"24": "<sup>24</sup> လီၫ.- ဘၪၥူၫဝၭဆံၫ့အယၪလၧထံၫ လၧဆၧအလးဆံၫ့ ဎံၪအဖၧၩ့, ဒဲကီၩ့ထၪ့ၥိၭထၪ့အကီၩ့အၥိၭတၭ, ဂဲၫ ထၪ့လုထၪ့အဆၧလုမ့ၪ, ဒဲၦခမျၧးအဆၧလုမ့ၪတၭ, မၩဆၧဖီၩ့ဖျ့ၭလၧအဂးဒၪဝ့ၫ ဒဲလၧၦခမျၧးအဂးလီၫ.",
			"25": "<sup>25</sup> ဘၪဆူၭထၪ့ခွံၬဆၧလုဆၧဒဲၩဘၭ အၥိၪနီၪလၧဆၧလု လးအဖၫ့ခိၪလီၫ.",
			"26": "<sup>26</sup> ၦၡၩလဂၩလၧအကွဲၪဖျါခွံၬ ဘ့ၪဂၭဖျ့ၭနီၪ ဘၪအၪ့ ဆူၫဝၭအကီၩ့အၥိၭ, ဒဲၥူၫဝၭဆံၫ့အယၪ လၧထံၫတၭ, လၧခဲၫ့ထဲၩ့နီၪ မိဂဲၫထဲၩ့နုၬဘၪ လၧၦၥုၪ့တဲၩအလး",
			"27": "<sup>27</sup> ဖၧၩ့လီၫ.- ချီဖၫလၧဆၧလုဆၧဒဲၩဘၭအဂးလဒုၩ ဒဲ ဘ့ၪ လၧဆၧလုဆၧဒဲၩဘၭ အဂးလဒုၩ, လၧၦဂဲၫဆိၬ အၥွံၪလၧဆၧအလးဆံၫ့ဎံၪ အဖၧၩ့ဘဲၫၥိၭအမိမၩဆၧ ဖီၩ့ဖျ့ၭနီၪ, ၦဘၪဆိၬထၪ့ခွံၬအၥွံၪ လၧၦၥုၪ့တဲၩအလး လၧခီၫ့တၭ, ဆူၭထၪ့ခွံၬအဖံၭဒဲအယၪ, ဒဲအအ့ၪလၧမ့ၪ",
			"28": "<sup>28</sup> လီၫ.- တၭၦလၧအဆူၭထၪ့ခွံၬလဂၩနီၪ ဘၪအၪ့ဆူၫ ဝၭအကီၩ့အၥိၭ ဒဲၥူၫဝၭဆံၫ့အယၪလၧထံၫလီၫ. လၧ ခဲၫ့ထဲၩ့တၭ မိလ့ၩနုၬဘၪလၧၦၥုၪ့တဲၩအလးဖၧၩ့လီၫ.",
			"29": "<sup>29</sup> အယီၩမွဲဆၧအထူၫအရူၫ အဆိၩအကၠၪလၧနၥံၪအ ဂး, လၧလၩနွ့ၫဘံၪ့လဘံၪ့ လၩထၪ့ဆံၫနံၩ လနံၩနီၪ နၥံၪဘၪဆၪ့လၩ့နၥံၪအၥၭတၭ, ၦလၧနၥံၪအဆၨၩဒၪ နၥံၪဝ့ၫမွဲဂ့ၩ, ၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪလၧနၥံၪအ",
			"30": "<sup>30</sup> ကျၩမွဲဂ့ၩ, မၩဘၪဆၧနးမံၩ့အ့ၬ.- အဂဲးဘဲၫယီၩဆၧ လၧမုလနံၩနီၪ ဆၧမိမၩဆၧဖီၩ့ဖျ့ၭ လၧနၥံၪမိဆံၫ့အ ဂး, ဘဲၫၥိၭနၥံၪမိဆံၫ့ထၪ့ လၧနၥံၪအဆၧဒဲၩဘၭ ထီး",
			"31": "<sup>31</sup> အလူၬလၧယဟိဝၩအမ့ၬယၫလီၫ.- မိကဲၪထၪ့မးၥံၫ အနံၩအဆၧအီၪပွံၭ လၧနၥံၪအဂးတၭ, နၥံၪဘၪဆၪ့ လၩ့နၥံၪအၥၭလၧဆၧအထူၫအရူၫ အဆိၩအကၠၪလီၫ.",
			"32": "<sup>32</sup> တၭၦလုဆၧလဂၩ လၧဆၧဂုၪဝ့ၫ ဒဲအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ ဘဲၫၥိၭအမိမၩၦလုဆၧအဆၧမၩ လၧအဖါအလးလ ဂၩနီၪဘၪမၩဆၧဖီၩ့ဖျ့ၭ, ဒဲကီၩ့ထၪ့ၥိၭထၪ့ဆၧအကီၩ့",
			"33": "<sup>33</sup> အၥိၭဖျ့ၫလံၬကံၭ, ဆၧအကီၩ့အၥိၭဆံၫ့ဎံၪလီၫ.- မွဲ အဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧလးဆံၫ့ဎံၪအဂး, ဒဲဘၪမၩ ဆၧဖီၩ့ဖျ့ၭလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအဂး, ဒဲလၧ ဆၧလုလးအဂး, ဒဲဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧၦလုဆၧလ ဖၪအဂး, လၧဆၧအီၪကီၪ့အၡၩခမျၧးထီးအလူၬအဂး",
			"34": "<sup>34</sup> လီၫ.- အနီၪမိကဲၪထၪ့ဆၧအထူၫအရူၫ အဆိၩအကၠၪ လၧနၥံၪအဂး, လၧအမိမၩဆၧဖီၩ့ဖျ့ၭ လၧၦအံၫစရ့ လၭဖိၪအဂး, လၧအဆၧဒဲၩဘၭ ထီးအလူၬအဂးလ နံၪ့လဖၧၫ့လနံၪ့လဖၧၫ့လီၫ. တၭအဝ့ၫဒၪမၩဝ့ၫဘဲၫယွၩ မၪလူၬစမိစ့ၭအၥိၭနီၪလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ,စံၭဝ့ၫ, လီၩဘၪ စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪဒဲၦအံၫစရ့လၭဖိၪ ထီးအ လူၬတၭး စံၭအဝ့ၫၥံၪ, အယီၩမွဲဆၧလၧယဟိဝၩမၪ",
			"3": "<sup>3</sup> လူၬဆၧတၭ, စံၭဝ့ၫ, ချီဖၫလဒုၩမွဲဂ့ၩ,ၥိၪဖိၪမွဲဂ့ၩ, ဘ့ၪ ဖိၪမွဲဂ့ၩ, ထီးဒၪၦလၧအံၫစရ့လၭအဂံၪ့ လၧအမၩၥံၫ အဝ့ၫလၧၦၥုၪ့တဲၩအလးဖၧၩ့မွဲဂ့ၩ, လၧအမၩၥံၫဝ့ၫ",
			"4": "<sup>4</sup> လၧၦၥုၪ့တဲၩအလး လၧခီၫ့လခီၫမွဲဂ့ၩ,- တၭလဂဲၫ ဆိၬဘၪလၧဆၧအီၪကီၪ့ အတဲၩဆံၫ့ဎံၪအတရၫ့, ဘဲၫ ၥိၭအမိမၩဘိၪ့ဆၧမၩဘိၪ့ လၧယဟိဝၩအဂး, လၧယ ဟိဝၩအတဲၩဆံၫ့ဎံၪ အမ့ၬယၫလဂၩဂၩနီၪ, ဆၧမိအီၪ က့ၪဆၧၥွံၪ လၧအဝ့ၫဒၪအလီၩ့ လၧအဂါလၩ့ဆၧၥွံၪ အကၠီၩ့တၭ, မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧအဆၨၩဒၪဝ့ၫ",
			"5": "<sup>5</sup> အကျၩနီၪလီၫ.- အဂဲးဘဲၫယီၩဘဲၫၥိၭၦအံၫစရ့လၭဖိၪ မိဂဲၫဆိၬအဆၧလုလဖၪ လၧအလုထၪ့ဝ့ၫလၧဆၧပျၩ့ ဖၧၩ့တၭ, ဂဲၫဆိၬဝ့ၫလၧယဟိဝၩအအီၪ ထီးဆၧအီၪ ကီၪ့အတဲၩဆံၫ့ဎံၪအတရၫ့, လၧၦလုဆၧလဂၩအအီၪ တၭလုထၪ့ဝ့ၫ လၧဆၧလုဘၪလိၬအိၭလိၬ လၧယဟိဝၩ",
			"6": "<sup>6</sup> အဂးလီၫ.- ၦလုဆၧလဂၩနီၪ ဘၪဎွံၪဆၧၥွံၪလၧယဟိ ဝၩအဆၧလုလးအဖၫ့ခိၪ, ထီးဆၧအီၪကီၪ့အတဲၩဆံၫ့ ဎံၪအတရၫ့တၭ, ဆူၭခဲၩဆၧၥိၪ လၧဆၧနၧၫ့မၧၫ့မုၬ",
			"7": "<sup>7</sup> လၧယဟိဝၩအဂးလီၫ.- တၭအဝ့ၫၥံၪဘၪလုထၪ့လၧၩ့ အဆၧလုလၧဆၧနၪလဖၪ, လၧၦၡၩမၩဆၧလဲးဆၧ ဘျၪဖိၬအဖၧၩ့ၥၭနီၪလဂ့ၩ. အနီၪမွဲဆၧမၪလူၬအဆိၩ အကၠၪလၧအဂး, ထီၩ့လၩ့လၧအဆၨၩအဆၬလဆိၩ ဘၪလဆိၩလီၫ.",
			"8": "<sup>8</sup> တၭနဘၪစံၭအဝ့ၫၥံၪ, ထီးဒၪၦလၧၦအံၫစရ့လၭအ ဂံၪ့ဖိၪအကျၩမွဲဂ့ၩ, လၧၦလခီၫဘၩ့မုးဖိၪလၧအအီၪ လၧနၥံၪအကျၩမွဲဂ့ၩ လၧအလုထၪ့ ဆၧလုမ့ၪ မွဲဂ့ၩ,",
			"9": "<sup>9</sup> ဆၧလုမွဲဂ့ၩ,- တၭလဂၩဂၩလဂဲၫဆိၬဘၪ လၧဆၧအီၪ ကီၪ့အတဲၩဆံၫ့ဎံၪအတရၫ့, ဘဲၫၥိၭအမိလုထၪ့ဝ့ၫလၧ ယဟိဝၩနီၪမိဘၪဆၧဒၪ့ထ့ၬခွံၬ လၧအၡၩလဆၨၩဒၪ ဝ့ၫအကျၩနီၪလီၫ.",
			"10": "<sup>10</sup> တၭၦၡၩ လၧၦအံၫစရ့လၭအဂံၪ့ဖိၪအကျၩမွဲဂ့ၩ, လၧၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪ လၧနၥံၪအကျၩမွဲ ဂ့ၩ,ထီးဒၪၦလၧအအၪ့ဆၧၥွံၪ လမံၩ့မံၩ့လဂၩဂၩနီၪ, ယမိအီၪက့ၪယမ့ၬထၫ့ဒုၪဒၩ ၦလၧအအၪ့ဆၧနီၪတၭ, ယမိဒၪ့ထ့ၬခွံၬဝ့ၫလၧအၡၩ လဆၨၩဒၪဝ့ၫ အကျၩနီၪ",
			"11": "<sup>11</sup> လီၫ.- အဂဲးဘဲၫယီၩ ဆၧယၪအၥၭအီၪလၧအၥွံၪဖၧၩ့ တၭ, ယဖ့ၪလၫ့နၥံၪလၧအဝ့ၫနီၪ လၧဆၧလုအဖၫ့ခိၪ, ဘဲၫၥိၭအမိမၩဆၧဖီၩ့ဖျ့ၭ လၧနၥံၪအၥၭၡီၩ့အဂးလီၫ. အဂဲးဘဲၫယီၩ ဆၧၥွံၪနီၪ မၩဆၧမၩဖီၩ့ဖျ့ၭ လၧၦၡၩ",
			"12": "<sup>12</sup> ၥၭၡီၩ့အဂးလီၫ.- မၩအၥၭဘဲၫနီၪတၭ ယစံၭၦအံၫစ ရ့လၭဖိၪ, ၦလၧနၥံၪအကျၩအၪ့ဘၪဆၧၥွံၪ နးဂၩအ့ၬ. တၭၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪလၧ နၥံၪအကျၩအၪ့ ဘၪဆၧၥွံၪနးဂၩဆ့အ့ၬ.",
			"13": "<sup>13</sup> ၦအံၫစရ့လၭဖိၪမွဲဂ့ၩ, ၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪ လၧနၥံၪအကျၩမွဲဂ့ၩ, ထီးဒၪၦၡၩလၧအကဲၪ ၦခိၭခၭ ဆၧတၭ, မၩန့ဆၧဖိၪဆၧဎါမွဲဂ့ၩ, ထိၪၥံၪလံၪၥံၪမွဲ ဂ့ၩ,လၧၦၡၩကြၨၭအၪ့ဘၪလမံၩ့မံၩ့, ဘၪဂါလၩ့ခွံၬ",
			"14": "<sup>14</sup> အၥွံၪဒဲမၩဘံၭခွံၬဝ့ၫ လၧဂၪ့ခိၪအမုၬလီၫ.- အဂဲးဘဲၫ ယီၩ ဆၧယၪထီးအလူၬအၥၭမွဲအၥွံၪတၭ, မွဲလၧအ ၥၭအဂးလီၫ. တၭယစံၭၦအံၫစရ့လၭဖိၪ ထီးအၪ့ဆၧ ယၪအၥွံၪနးမံၩ့လဂ့ၩး အဂဲးဘဲၫယီၩ ကယဲဆၧယၪ အၥၭမွဲအၥွံၪလီၫ. ထီးဒၪၦလၧအအၪ့ဝ့ၫ လဂၩဂၩနီၪ မိဘၪဆၧဒ့ၪထ့ၬခွံၬဝ့ၫလီၫ.",
			"15": "<sup>15</sup> တၭဆၧလၧအၥံၫဒၪဆၧမွဲဂ့ၩ, ဆၧလၧဆၧဖိၪဆၧ ဎါအဲၪ့ၥံၫမွဲဂ့ၩ, ကယဲၦလၧအအၪ့ဝ့ၫ, ၦခးဖိၪမွဲဂ့ၩ, ၦလခီၫဘၩ့မုးဖိၪမွဲဂ့ၩ, ဘၪအၪ့ဆူၫဝၭအကီၩ့အၥိၭ, ဒဲအၪ့လူထံၫတၭ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ ထီးမုဂၪ လၩ့လီၫ. ထီးနီၪလဖၧၫ့မိဆံၫ့ထၪ့ထဲၩ့ဝ့ၫလီၫ.",
			"16": "<sup>16</sup> အ့ၪမွဲ အ့ၪလအၪ့ဆူၫဝၭဘၪ ဒဲအ့ၪလအၪ့လူဘၪထံၫတၭ, မိ ဘၪထိးအဆၧဒဲၩဘၭလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ,စံၭဝ့ၫဒၪ, ချဲၩ့ ထၪ့လၧၦအံၫစရ့လၭဖိၪတၭ,စံၭအဝ့ၫၥံၪ, ယဝ့ၫဒၪ",
			"3": "<sup>3</sup> ယီၩ,ယမွဲယဟိဝၩနၥံၪအယွၩလီၫ.- ဘဲၫၦမၩဆၧလၧ ခးအံဇံၭလၧနၥံၪအီၪယူၭလၧအဖၧၩ့အၥိၭနီၪ, ထီးမၩ လဂ့ၩ. တၭဘဲၫၦမၩဆၧလၧခးကၫနအၫ့ ထီးအလး လၧယဒုၭလ့ၩနၥံၪလၧအအီၪအၥိၭနီၪ ထီးမၩလဂ့ၩ, တၭထီးလ့ၩလၧအဝ့ၫၥံၪ အထူၫအရူၫအဖၧၩ့လဂ့ၩ.",
			"4": "<sup>4</sup> နၥံၪဘၪမၩ ယဆၧစ့ၩရၫ့လဖၪ, ဒဲထီးန့ယၥနိၫလဖၪ ဘဲၫၥိၭနၥံၪမိလ့ၩလၧအဖၧၩ့လီၫ. ယဝ့ၫဒၪယီၩ ယမွဲ",
			"5": "<sup>5</sup> ယဟိဝၩနၥံၪအယွၩလီၫ.- တၭနၥံၪဘၪထီးန့ယၥနိၫ လဖၪ, ဒဲယဆၧစ့ၩရၫ့လဖၪ လၧၦလၧအမၩဝ့ၫနီၪ မိ မၧၫ့ဝ့ၫလၧအဖၧၩ့လီၫ. ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩ လီၫ.",
			"6": "<sup>6</sup> ၦလၧနၥံၪအကျၩနီၪ, မွဲအထီးမၩဘူၭအၥၭလၧအ ဘူၭအထံးဘဲၫၥိၭအမိနဲၪဖျီၪထၪ့ အဆၧအီၪဘိၪ့နး",
			"7": "<sup>7</sup> ဂၩလဂ့ၩ, ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩလီၫ.- နဖါအ ဆၧအီၪဘိၪ့မွဲဂ့ၩ, နမိအဆၧအီၪဘိၪ့မွဲဂ့ၩ, နဲၪဖျီၪထၪ့ လဂ့ၩ, အနီၪမွဲနမိလီၫ. နဲၪဖျီၪထၪ့အဆၧအီၪဘိၪ့လ",
			"8": "<sup>8</sup> ဂ့ၩ.- နဖါအမၫအဆၧအီၪဘိၪ့နီၪ နဲၪဖျီၪထၪ့လဂ့ၩ,",
			"9": "<sup>9</sup> အဝ့ၫနီၪမွဲနဖါအဆၧအီၪဘိၪ့လီၫ.- နထၧၫ့ဖုဝဲမုၪနဖါ အဖိၪမုၪမွဲဂ့ၩ, နမိအဖိၪမုၪမွဲဂ့ၩ, အီၪဖျဲၪလၧဂံၪ့ဖၧၩ့ မွဲဂ့ၩ, အီၪဖျဲၪလၧခီၫ့မွဲဂ့ၩ, နဲၪဖျီၪထၪ့အဆၧအီၪဘိၪ့",
			"10": "<sup>10</sup> လဂ့ၩ,- နဖိၪခွၫအဖိၪမုၪမွဲဂ့ၩ, နဖိၪမုၪအဖိၪမုၪမွဲဂ့ၩ, နဲၪဖျီၪထၪ့အဆၧအီၪဘိၪ့လဂ့ၩ, အဂဲးဘဲၫယီၩအဝ့ၫ ၥံၪအဆၧအီၪဘိၪ့နီၪ, မွဲနဆၧအီၪဘိၪ့ ဒၪနဝ့ၫလီၫ.",
			"11": "<sup>11</sup> နဖါအမၫအဖိၪမုၪ, ၦလၧနဖါထၪ့ဖိၪဝ့ၫ မွဲနထၧၫ့ဖုဝဲ",
			"12": "<sup>12</sup> မုၪ, နဲၪဖျီၪထၪ့အဆၧအီၪဘိၪ့လဂ့ၩ,- နဲၪဖျီၪထၪ့န ဖါအထၧၫ့ဖုဝဲမုၪအဆၧအီၪဘိၪ့လဂ့ၩ, အဝ့ၫနီၪမွဲနဖါ",
			"13": "<sup>13</sup> အဘူၭအထံးလီၫ.- နဲၪဖျီၪထၪ့နမိအထၧၫ့ဖုဝဲမုၪ အ ဆၧအီၪဘိၪ့လဂ့ၩ. အဝ့ၫနီၪမွဲနမိအဘူၭအထံးလီၫ.",
			"14": "<sup>14</sup> နဲၪဖျီၪထၪ့နဖါ အထၧၫ့ဖုဝဲခွၫအဆၧ အီၪဘိၪ့လဂ့ၩ.",
			"15": "<sup>15</sup> မၩဘူၭအမၫလဂ့ၩ, အဝ့ၫနီၪမွဲနမိဂါလီၫ.- နဲၪဖျီၪထၪ့ နဒဲၪအဆၧ အီၪဘိၪ့လဂ့ၩ. အဝ့ၫနီၪ မွဲနဖိၪခွၫအမၫ",
			"16": "<sup>16</sup> လီၫ. နဲၪဖျီၪထၪ့အဆၧအီၪဘိၪ့လဂ့ၩ.- နဲၪဖျီၪထၪ့န ထၧၫ့ဖုဝဲခွၫအမၫ အဆၧအီၪဘိၪ့လဂ့ၩ, အဝ့ၫနီၪမွဲန",
			"17": "<sup>17</sup> ထၧၫ့ဖုဝဲခွၫအဆၧအီၪဘိၪ့လီၫ.- နဲၪဖျီၪထၪ့ၦမုၪလ ဂၩဒဲအဖိၪမုၪအဆၧအီၪဘိၪ့လဂ့ၩ, တၭမၩန့အဖိၪခွၫ အဖိၪမုၪမွဲဂ့ၩ, အဖိၪမုၪအဖိၪမုၪမွဲဂ့ၩ, ဘဲၫၥိၭနမိနဲၪ ဖျီၪထၪ့အဆၧ အီၪဘိၪ့လဂ့ၩ. အဝ့ၫနီၪ မွဲနဘူၭနထံး",
			"18": "<sup>18</sup> လီၫ. အနီၪမွဲဆၧအအၧၩ့အၥၫ့လီၫ.- ထီးမၩန့နမၫ ဘဲၫၥိၭနမိနဲၪဖျီၪထၪ့အဆၧအီၪဘိၪ့နီၪ လၧအထၧၫ့ဖု ဝဲမုၪအဖၫ့ခိၪလၧအမိမၩခိအၥၭ လၧအအီၪမၧၫ့ဒံၭအ ဘိၩ့ဘၭနီၪလဂ့ၩ.",
			"19": "<sup>19</sup> တၭလၧၦမုၪအီၪလစီၪ့ဒၪ လၧအဆၧလဆံၫ့ဘၪအ ကၠီၩ့အဘိၩ့ဘၭနီၪ, မၩဘူၭအဝ့ၫဘဲၫၥိၭနမိမၩဖျီၪ",
			"20": "<sup>20</sup> ထၪ့အဆၧအီၪဘိၪ့လဂ့ၩ.- ထီးမံၫဎုၬလၧၦလၧနနဲၩ့ ထံၭအမၫ ဘဲၫၥိၭနမိမၩၥၭလိၪ ဘၪနၥၭလၧအဝ့ၫလ",
			"21": "<sup>21</sup> ဂ့ၩ.- ဒုၭခၫ့ဂၬ နချံၫနၥၪ လၧမိလ့ၭအဂး နးဂၩလဂ့ၩ တၭ, မၩကြၩ့ထမးယွၩအမံၩ့လဂ့ၩး ယဝ့ၫဒၪယီၩယ",
			"22": "<sup>22</sup> မွဲယဟိဝၩလီၫ.- ထီးမံၫဎုၬလၧၦခွၫဘဲၫလၧၦမုၪအၥိၭ",
			"23": "<sup>23</sup> နီၪလဂ့ၩ, အနီၪမွဲဆၧဘၪၥၭလိၪလီၫ.- ထီးမံၫဎုၬလၧ ဆၧဖိၪဆၧဎါဘဲၫၥိၭနမိမၩၥၭလိၪနၥၭ လၧအဝ့ၫနးမံၩ့ လဂ့ၩ. တၭမွဲၦမုၪထီးဆၧၫ့ထုၪ့ လၧဆၧဖိၪဆၧဎါအ မ့ၬယၫဘဲၫၥိၭအမိမံၫနၩ့ လၧအဝ့ၫနးဂၩလဂ့ၩ, အ နီၪမွဲဆၧအၧၩ့ဆၧၥၫ့လီၫ.",
			"24": "<sup>24</sup> ထီးမၩစံၪစၪနၥံၪအနၫ့ဆါၥံၪ လၧဆၧနီၪလဖၪနး မံၩ့လဂ့ၩး အဂဲးဘဲၫယီၩ ၦဆၨၩလဖၪ လၧယနၫ့ထၪ့ ခွံၬလၧနၥံၪအမ့ၬယၫနီၪ လဆံၫ့ဘၪလၧဆၧလဖၪနီၪ",
			"25": "<sup>25</sup> ထီးအလူၬအဖၧၩ့လီၫ.- ထံၫၥံၪခးၥံၪလဆံၫ့ဘၪတၭ, ယမိစ့ၩရၫ့ဝ့ၫ လၧအဆၧအၧၩ့အကၠီၩ့တၭ, ခးနီၪပၠိၭ",
			"26": "<sup>26</sup> ထၪ့ခွံၬၦအီၪဝ့ၫလၧအဖၧၩ့လီၫ.- အခိးမွဲထီးန့ယၥနိၫ လဖၪ, ဒဲယဆၧစ့ၩရၫ့ လဖၪဆံၭ. တၭၦလၧနၥံၪအ ဆၨၩဒၪနၥံၪဝ့ၫမွဲဂ့ၩ, ၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪလၧ နၥံၪအကျၩမွဲဂ့ၩ, မွဲအထီးမၩဆၧၥၭလိၪနးဂၩလဂ့ၩ,",
			"27": "<sup>27</sup> (အဂဲးဘဲၫယီၩ ကယဲဆၧၥၭလိၪလဖၪနီၪ ၦခးဖိၪလၧ အအီၪယူၭ လၧနၥံၪအမ့ၬယၫမၩဝ့ၫ, ဒဲထံၫၥံၪခးၥံၪ",
			"28": "<sup>28</sup> လဆံၫ့ဘၪလီၫ.)- ဘဲၫၥိၭထီးနၥံၪ အ့ၪမၩဘၪၥၭလိၪ တၭ, ခးနီၪမွဲအထီးပၠိၭထၪ့ခွံၬနၥံၪ ဘဲၫအပၠိၭထၪ့ခွံၬ ၦဆၨၩလဖၪ လၧအအီၪ လၧနၥံၪအမ့ၬယၫ အၥိၭနီၪ လဂ့ၩ.",
			"29": "<sup>29</sup> အဂဲးဘဲၫယီၩ ကယဲၦလၧအမၩဆၧၥၭလိၪယီၩလ မံၩ့မံၩ့နီၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧအၡၩလဆၨၩ",
			"30": "<sup>30</sup> ဒၪဝ့ၫအကျၩနီၪလီၫ.- တၭထီးန့ယဆၧၥီၪ့ဆၧၥၫ့ဘဲၫ ၥိၭနၥံၪထီးမၩဆၧဘၪၥၭလိၪ အထူၫအရူၫ လၧၦလၧ နၥံၪအမ့ၬယၫမၩဝ့ၫနီၪလဂ့ၩ. ဒဲဘဲၫၥိၭ နၥံၪထီးမၩ ဘၪၥၭလိၪလၩ့နၥံၪအၥၭ လၧဆၧနီၪလဖၪလဂ့ၩ.ယ ဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩနၥံၪအယွၩလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ,စံၭဝ့ၫဒၪ, ချဲၩ့ထၪ့ လၧၦအံၫစရ့လၭဖိၪ အဆၧအီၪကီၪ့ ထီးအလူၬတၭ, စံၭအဝ့ၫၥံၪနၥံၪဘၪမွဲၦဆံၫ့ဎံၪလီၫ. အဂဲးဘဲၫယီၩယ ဝ့ၫဒၪယဟိဝၩနၥံၪအယွၩ, ယမွဲဆၧဆံၫ့ဎံၪလီၫ.",
			"3": "<sup>3</sup> နၥံၪဘၪၥၭမဲၪလဂၩအမိအဖါ, လဂၩအမိအဖါ ဆုၬဆုၬ, ဒဲထီးန့ယမးၥံၫအနံၩလဖၪလီၫ. ယဝ့ၫ ဒၪယီၩ,ယမွဲယဟိဝၩ, နၥံၪအယွၩလီၫ.",
			"4": "<sup>4</sup> ကၠၪထဲၩ့နၥံၪအၥၭလၧဆၧဂၩ့လဂ့ၩ. ထီးၥိၫ့န့ယွၩ လဖၪလၧနၥံၪအဂးလဂ့ၩး ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩ, နၥံၪအယွၩလီၫ.",
			"5": "<sup>5</sup> နၥံၪအ့ၪလုထၪ့ ဆၧလုဘၪလိၬအိၭလိၬ လၧယဟိ ဝၩတၭ, နၥံၪဘၪလုထၪ့ဆၧဘဲၫအဘၪ ဆၧအၥၭအ",
			"6": "<sup>6</sup> ၥိၭဆံၭ.- ၦဘၪအၪ့ဝ့ၫလၧမုလနံၩဎး လၧနၥံၪလုထၪ့ ဝ့ၫဒဲလၧမုဆဲၪ့ထၪ့လနံၩလီၫ. ဆၧအ့ၪအီၪလၩ့ထး ထီးမုၥၧၫ့နံၩလနံၩတၭ, ၦဘၪဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪ",
			"7": "<sup>7</sup> လီၫ.- ၥၧၫ့နံၩလနံၩနီၪ ၦၡၩအ့ၪအၪ့တၡါတၭ, မွဲဆၧ",
			"8": "<sup>8</sup> ဘၪၥၭလိၪနီၪး ဘၪဆၧအၥၭအ့ၬ.- တၭၦလၧအအၪ့ ဆၧနီၪမိဘၪထိးအဆၧဒဲၩဘၭလီၫ. အဂဲးဘဲၫယီၩမၩ ၥၭလိၪယူၭ ယဟိဝၩအဆၧဆံၫ့ဎံၪလီၫ. တၭၦလဂၩ နီၪမိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧအၡၩလဆၨၩဒၪဝ့ၫအ ကျၩနီၪလီၫ.",
			"9": "<sup>9</sup> ထီးနၥံၪကူၭနၥံၪအဂၪ့ခိၪအဝၩ့ အဘုၪတၭ, ကူၭ ဆၧလၧနဆံၬအနိၪ့တၡါနီၪလဂ့ၩ. အၪ့ထုၫ့ထၪ့ဆၧ အီၪလၩ့ထး လၧနကူၭဆၧအဖၧၩ့နီၪလဂ့ၩ.",
			"10": "<sup>10</sup> အၪ့ထုၫ့ထၪ့ ဆၧအီၪလၩ့ထး လၧနစဘံၭမုအလး ဖၧၩ့လဂ့ၩ, ဒဲအၪ့ထုၫ့ထၪ့နစဘံၭၥၪ ထီးအလူၬ လၧ နစဘံၭမုအလးဖၧၩ့လဂ့ၩ, နဘၪအီၪက့ၪလၩ့ထးဆၧ လၧၦၡၪ့ဖိၪယၬဖိၪ, ဒဲၦလခီၫဘၩ့မုးဖိၪအဂးလီၫ. ယ ဝ့ၫဒၪယီၩယမွဲယဟိဝၩ, နၥံၪအယွၩလီၫ.",
			"11": "<sup>11</sup> ထီးအၪ့ဂူၪဆၧလဂ့ၩ, ဒဲထီးအၪ့လီၫန့ ဆၧလဂ့ၩ, ဒဲထီးချဲၩ့လိၬနၥံၪအၥၭ ကဘျံၭကဘျၪ ၥကိၭၥကိၭလ",
			"12": "<sup>12</sup> ဂ့ၩ,- ထီးဆိၪလၩ့နၥံၪအၥၭ လၧယမံၩ့ဒဲအၪ့လီၫန့ဆၧ လဂ့ၩ. တၭထီးမၩကြၩ့ထမး နယွၩအမံၩ့လဂ့ၩ, ယ ဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩလီၫ.",
			"13": "<sup>13</sup> ထီးအၪ့ဘျံၭအၪ့ဘျၪ ၦလၧနနဲၩ့ထံၭ အဆၧလဂ့ၩ တၭ, ထီးအၪ့ဂူၪန့အဆၧလဂ့ၩ. ၦလၧအဒိၭအၪ့လံၩ့ အၥၭလဂၩအလံၩ့အလဲၫနီၪ ဒုၭအီၪလၧနစူၪဖၧၩ့ၥၫ့ နၩချီၩ့ထီးမုဆဲၪ့ထၪ့လဂ့ၩ.",
			"14": "<sup>14</sup> ဆိၪအၧၩ့ ၦလၧအနါအၧၩ့လဂ့ၩတၭ, အီၪက့ၪဆၧ လၩ့ထံၩဖါအလး လၧၦမ့ၬဘျီၪအမ့ၬယၫလဂ့ၩတၭ,န ဘၪၥၭမဲၪနယွၩလီၫ. ယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩလီၫ.",
			"15": "<sup>15</sup> လၧဆၧစ့ၩရၫ့အဖၧၩ့နီၪ ထီးမၩဆၧလတီၩလလီၩ့ ဘၪလဂ့ၩ, ယိမ့ၬၦၡၪ့ဖိၪယၬဖိၪလဂ့ၩတၭ, အီၪက့ၪ လၩဖၩ့ၦအဆီၪ့လဂ့ၩ, နဘၪစ့ၩရၫ့ၦလၧနနဲၩ့ထံၭလၧ ဆၧတီၩဆၧလီၩ့လီၫ.",
			"16": "<sup>16</sup> ထီးလ့ၩဝံၩ့ဝၩ့ခဲၪဆၧလၧနၥံၪ အၡၩခမျၧးအကျၩ လဂ့ၩ, ဒဲဆၧၫ့ထုၪ့လၧၦလၧနနဲၩ့ထံၭ အၥွံၪအဖၫ့ခိၪလ ဂ့ၩး ယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩလီၫ.",
			"17": "<sup>17</sup> ထီးၥၭဂဲၫ့နထၧၫ့ဖုဝဲလၧနၥၭခံဖၧၩ့လဂ့ၩတၭ, အၪ့ ၥီၪ့ၦလၧနနဲၩ့ထံၭဆံၭ. ထီးဘၪဆၧဒဲၩဘၭ လၧအဝ့ၫ ဒၪအကၠီၩ့လဂ့ၩ.",
			"18": "<sup>18</sup> ထီးမၩအၧၩ့ဆၧၫ့ဆၧလဂ့ၩ, အၪ့ဎၬယိဆၧထၫ့ဒၩ နၡၩခမျၧးဖိၪလဂ့ၩး တၭနဘၪအဲၪ ၦလၧနနဲၩ့ထံၭ ဘဲၫနနၫ့ဆါဒၪနဝ့ၫအၥိၭနီၪဆံၭ. ယဝ့ၫဒၪယီၩ ယမွဲ ယဟိဝၩလီၫ.",
			"19": "<sup>19</sup> နဘၪထီးန့ယၥနိၫလဖၪလီၫ. ဆၧဖိၪဆၧဎါနံၫမံၩ့ လၩ့မဲၩလိၬအၥၭနီၪ, ထီးဒုၭလီၩ့လိၬအၥၭ အမိအဖၫ လဂ့ၩး နဆၧချံၫကျီၪမွံၩလိၬအၥၭနီၪ, ထီးဎွံၪလၩ့လၧ နဆံၬဖၧၩ့လဂ့ၩး ဒဲကီၩ့ထၪ့ၥိၭထၪ့ဆၧ အကီၩ့အၥိၭ မၩဝ့ၫလၧလူၪဒဲၥၭကလၭလဂ့ၩ.",
			"20": "<sup>20</sup> တၭၦအ့ၪမံၫဎုၬ လၧၦမုၪလၧအမွဲဆၧအဎီးမုၪဘၪ အဲၪတၩ့လၧအဝၩ, ဒဲလဘၪဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫ တၡါမွဲ ဂ့ၩ, ဆၧလဖ့ၪလၫ့အဖျ့ၭထၪ့ဘၪမွဲဂ့ၩ, မိဘၪဆၧထး ဝ့ၫလီၫ. ဘၪဆၧမၩၥံၫအဝ့ၫၥံၪအ့ၬ, အဂဲးဘဲၫယီၩၦမုၪ",
			"21": "<sup>21</sup> နီၪမွဲၦပျီၩဖျ့ၭဖိၪအ့ၬ.- တၭၦခွၫနီၪဘၪဂဲၫဆိၬ အဆၧ လုမၪဘၪဆၧလၧယဟိဝၩအအီၪ ထီးဆၧအီၪကီၪ့အ တဲၩဆံၫ့ဎံၪအတရၫ့, ၥိၪဖၫလဒုၩလၧဆၧလုမၪဘၪ ဆၧအဂးလီၫ.",
			"22": "<sup>22</sup> တၭၦလုဆၧဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧအဂးလၧၥိၪဖၫ ဆၧမၪဘၪ ဆၧလၧယဟိဝၩအမ့ၬယၫ လၧအဆၧဒဲၩ ဘၭလၧအမၩဝ့ၫအကၠီၩ့လီၫ. တၭဆၧမိဖျါခွံၬဆၧဒဲၩ ဘၭလၧအမၩယူၭလီၫ.",
			"23": "<sup>23</sup> ထီးနၥံၪအ့ၪလ့ၩနုၬလၧခးဖၧၩ့တၭ, ၥုၪ့လၩ့ဖျၭလၩ့ ကယဲၥံၪ့ၥံၪဝၪၥံၪလၧဆၧအၪ့အဂးတၭ, နၥံၪဘၪအီၪ က့ၪအၥူၪအၥၪ လၧဆၧလဒိၭဘၪ ဆၧကူၭတရံၭနီၪ လီၫ. ၥၧၫ့နံၪ့နီၪ မိဘၪကဲၪထၪ့လၧဆၧလဒိၭဘၪ ဆၧ",
			"24": "<sup>24</sup> ကူၭတရံၭလၧနၥံၪအဂးလီၫ. ထီးအၪ့လဂ့ၩ.- လံနံၪ့ လနံၪ့နီၪကယဲအၥူၪအၥၪ မိကဲၪထၪ့ဆၧဆံၫ့ဎံၪဘၪဆဲၫ့",
			"25": "<sup>25</sup> လၧဆၧစံၭထၪ့အၪ့အူၭယဟိဝၩလီၫ.- တၭယဲနံၪ့လ နံၪ့နီၪ နၥံၪမိအၪ့ဘၪအၥူၪအၥၪ လၧအမိမၩအၪထၪ့ ဆၧလၧနၥံၪအဂးလီၫ. ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩ, နၥံၪအယွၩလီၫ.",
			"26": "<sup>26</sup> ထီးအၪ့ဆၧအီၪဒဲအၥွံၪနီၪလဂ့ၩ, အၪ့ဖၩ့ဆၧခါဆၧ လဂ့ၩ, ထီးဒုၪဆၧအဆၧၫ့အထီလဂ့ၩ.",
			"27": "<sup>27</sup> ထီးမၩဝၩ့ဖီၩ့နၥံၪအခိၪအနိၪ့လဖၪလဂ့ၩ, ဒဲထီးမၩ ဂၭဂီၩ့နၥံၪအနိၭဆီၪ့အနိၪ့လဂ့ၩ.",
			"28": "<sup>28</sup> ထီးဂ့ၬလၩ့နၥံၪအဖံၭအယၪလၧၦၥံၫ အကၠီၩ့လဂ့ၩ, ဒဲထီးမၩဆၧကွ့ၭအဆၧနဲၪ့ လၧနၥံၪအလီၩ့လဂ့ၩ, ယ ဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩလီၫ.",
			"29": "<sup>29</sup> ထီးဒုၭဂၭဂီၩ့နဖိၪမုၪ ဘဲၫၥိၭအမိကဲၪထၪ့ၦအ့ၭကံၫ မုၪလဂ့ၩ, ဘဲၫၥိၭၦခးဖိၪထီးလၩ့ဘၪ လၧဆၧလဲးဆၧ ဘျၪအဖၧၩ့, ဒဲထံၫၥံၪခးၥံၪဎွ့ၩဝ့ၫ လၧဆၧအၧၩ့ဆၧၥၫ့ နီၪလဂ့ၩ.",
			"30": "<sup>30</sup> နၥံၪဘၪထီးန့ ယမးၥံၫအနံၩလဖၪ, ဒဲယူၭယၪ့ယ လးဆံၫ့ဎံၪလီၫ. ယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩလီၫ.",
			"31": "<sup>31</sup> ထီးဒူၩယၪ့ၦအီၪလၧဆၧနၪလဖၪလဂ့ၩး ထီးအၪ့ဎူၫ အၪ့ဎၬၦလၧအၥ့ၪဆၧအူၪဆၧပီၩ လၧနၥံၪမိကဲၪထၪ့ ဆၧလဆံၫ့ဘၪလဂ့ၩး ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩ, နၥံၪအယွၩလီၫ.",
			"32": "<sup>32</sup> နဘၪဂဲထုၪ့လၧၦအခိၪဘွၩအမ့ၬယၫ, ဒဲအီၪက့ၪလၩ ဖၩ့ၦၥၭၡါအမ့ၬ, ဒဲၥၭမဲၪယွၩဆံၭ. ယဝ့ၫဒၪယီၩယမွဲ ယဟိဝၩလီၫ.",
			"33": "<sup>33</sup> ၦလခီၫဘၩ့မုးဖိၪ အ့ၪအီၪလၧနၥံၪအခးဖၧၩ့တၭ,",
			"34": "<sup>34</sup> ထီးမၩၡၪ့မၩနၭအဝ့ၫလဂ့ၩ,- တၭၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪ လၧနၥံၪအကျၩနီၪ ဘၪကဲၪထၪ့ လၧနၥံၪ အမ့ၬယၫဘဲၫၦလၧအအီၪဖျဲၪ လၧနၥံၪအကျၩအၥိၭနီၪ လီၫ. တၭနဘၪအဲၪအဝ့ၫဘဲၫနအဲၪနနၫ့ဆါဒၪနဝ့ၫအၥိၭ နီၪလီၫ. အဂဲးဘဲၫယီၩ နၥံၪမွဲယူၭၦလခီၫဘၩ့မုးဖိၪလၧ ခးအံဇံၭအဖၧၩ့လီၫ. ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩ, နၥံၪ အယွၩလီၫ.",
			"35": "<sup>35</sup> လၧစ့ၩရၫ့ဆၧအဖၧၩ့မွဲဂ့ၩ, လၧထိၪဆၧအဖၧၩ့မွဲ ဂ့ၩ,လၧဆၧလယၧးအဖၧၩ့မွဲဂ့ၩ, လၧတိၪ့ဆၧအဖၧၩ့",
			"36": "<sup>36</sup> မွဲဂ့ၩ,ထီးမၩဆၧလတီၩလလီၩ့ဘၪလဂ့ၩ,- နၥံၪဘၪ အီၪလၧခံၫ့အတီၩအလီၩ့, ဒဲခံၫ့ၥၪအတီၩအလီၩ့, အ့ ဖၭလဖျိၪ့ အတီၩအလီၩ့, ဒဲဟံၫ့လဖျိၪ့ အတီၩအလီၩ့ လီၫ. ယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩ နၥံၪအယွၩလၧအ ဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪ လၧခးအံဇံၭအဖၧၩ့လီၫ.",
			"37": "<sup>37</sup> တၭနၥံၪဘၪထီးန့ ယဆၧမၪလူၬ ထီးအလူၬ,ဒဲယ ဆၧစ့ၩရၫ့ထီးအလူၬ, ဒဲမၩအဝ့ၫၥံၪလီၫ. ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, နဘၪ စံၭဒီၭၦအံၫစရ့လၭဖိၪ, ထီးဒၪၦၡၩလၧၦအံၫစရ့လၭ ဖိၪအကျၩမွဲဂ့ၩ, ၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪဝ့ၫလၧ အံၫစရ့လၭအကျၩမွဲဂ့ၩ, လၧအဖ့ၪလၫ့အချံၫအၥၪလၧ မိလ့ၭလဂၩဂၩနီၪ, မိဘၪဆၧမၩၥံၫတၡါဝ့ၫလီၫ. ၦခး",
			"3": "<sup>3</sup> ဖိၪမိဘၪခွံၬအဝ့ၫလၧလိးလီၫ.- ယမိအီၪက့ၪထၫ့ဒၩယ မ့ၬလၧၦလဂၩနီၪအလီၩ့တၭ, ယမိဒၪ့ထ့ၬခွံၬဝ့ၫလၧ အၡၩလဆၨၩဒၪဝ့ၫအကျၩနီၪလီၫ. အဂဲးဘဲၫယီၩဖ့ၪ လၫ့ယူၭအချံၫအၥၪ လၧမိလ့ၭဘဲၫၥိၭ အမိမၩၥၭလိၪ",
			"4": "<sup>4</sup> ယလးဆံၫ့ဎံၪဒဲမၩကြၩ့ထမးယမံၩ့ဆံၫ့ဎံၪလီၫ.- ၦခး ဖိၪအ့ၪမၩဘံၭအမ့ၬ လၧၦၡၩလၧအဖ့ၪလၫ့တၡါအချံၫ",
			"5": "<sup>5</sup> အၥၪလၧမိလ့ၭနီၪ, အ့ၪလမၩၥံၫဘၪဝ့ၫတၭ,- ယမိအီၪ က့ၪထၫ့ဒၩယမ့ၬ လၧၦလဂၩနီၪအလီၩ့, ဒဲလၧအဂံၪ့ ဒီၪ့ဖိၪအလီၩ့, ဒဲကယဲၦလၧအမၩမၪဖိၬထွ့ၫအခဲၫ့လၧ အမိမၩမၪဆၧလၧမိလ့ၭထီးအလူၬလဖၪနီၪ, ယမိဒၪ့",
			"6": "<sup>6</sup> ထ့ၬခွံၬလၧအၡၩလဆၨၩဒၪဝ့ၫအကျၩနီၪလီၫ.- တၭ ၦလၧအကၠၪစိၩအၥၭ လၧၦဒၪဆၧလၧယၫလခီၫ အ အီၪ, ဒဲၦၥ့ၪဆၧအူၪဆၧပီၩ လၧအမၩဆၧလဲးဆၧဘျၪ ဖိၬအခဲၫ့လဂၩဂၩနီၪ, ယမိအီၪက့ၪထၫ့ဒၩယမ့ၬလၧၦ လဂၩနီၪအလီၩ့တၭ, ယမိဒၪ့ထ့ၬခွံၬဝ့ၫ လၧအၡၩလ",
			"7": "<sup>7</sup> ဆၨၩဒၪဝ့ၫအကျၩနီၪလီၫ.- အခိးမွဲမၩဆံၫ့ဎံၪနၥံၪအ ၥၭတၭ, ကဲၪထၪ့ၦဆံၫ့ဎံၪဆံၭ. အဂဲးဘဲၫယီၩ ယမွဲယ",
			"8": "<sup>8</sup> ဟိဝၩ, နၥံၪအယွၩလီၫ.- တၭနၥံၪဘၪထီးန့ယၥနိၫလ ဖၪ,ဒဲမၩအဝ့ၫၥံၪလီၫ. ယမွဲယဟိဝၩလၧအမၩဆံၫ့ဎံၪ နၥံၪလီၫ.",
			"9": "<sup>9</sup> အဂဲးဘဲၫယီၩ ထီးဒၪၦလၧအဆိၪအၧၩ့ အမိအဖါ လဂၩဂၩနီၪ, မိဘၪဆၧမၩၥံၫတၡါဝ့ၫလီၫ. အဝ့ၫဆိၪ အၧၩ့ယူၭအမိအဖါယူၭ, အၥွံၪမိအီၪလၧအလီၩ့လီၫ.",
			"10": "<sup>10</sup> တၭၦလၧအမၩမၪၦမၫ, လၧအမၩမၪၦလၧအနဲၩ့ ထံၭအမၫနီၪ မိဘၪဆၧမၩၥံၫဝ့ၫ, ၦလၧအမၩမၪၦမၫ ဒဲၦလၧအအဲၪဘိၩ့ အဝၩနီၪ မိဘၪဆၧမၩၥံၫတၡါဝ့ၫ လီၫ.",
			"11": "<sup>11</sup> တၭၦလၧအမံၫဎုၬလၧအဖါအမၫလဂၩနီၪ, မွဲအနဲၪ ဖျီၪထၪ့အဖါ အဆၧအီၪဘိၪ့လီၫ. အဝ့ၫၥံၪမိဘၪဆၧ မၩၥံၫဝ့ၫနံၫဂၩလူၬလီၫ. အၥွံၪမိအီၪလၧအလီၩ့ဒၪဝ့ၫ လီၫ.",
			"12": "<sup>12</sup> ၦအ့ၪမံၫဎုၬလၧအဒဲၪတၭ, အဝ့ၫၥံၪမိဘၪဆၧမၩၥံၫ တၡါနံၫဂၩလူၬလီၫ. အဝ့ၫၥံၪမၩယူၭ ဆၧအၧၩ့ယူၭး အၥွံၪမိအီၪလၧအလီၩ့လီၫ.",
			"13": "<sup>13</sup> ၦခွၫအ့ၪမံၫဎုၬ လၧၦခွၫဘဲၫအမံၫဎုၬ လၧၦမုၪအၥိၭ, ၦနံၫဂၩလူၬနီၪ မၩယူၭဆၧၥၭလိၪယူၭတၭ, မိဘၪဆၧ မၩၥံၫတၡါဝ့ၫလီၫ. အၥွံၪမိအီၪလၧအလီၩ့လီၫ.",
			"14": "<sup>14</sup> ၦအ့ၪန့အမၫဒဲအမၫအမိတၭ, မွဲဆၧအၧၩ့လီၫ. မိဘၪ ဆၧဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪ, ၦခွၫဒဲၦမုၪနံၫဂၩ, ဘဲၫၥိၭဆၧ အၧၩ့ဆၧၥၫ့ထီးအီၪ လၧနၥံၪအကျၩလဂ့ၩလီၫ.",
			"15": "<sup>15</sup> ၦခွၫအ့ၪမံၫဎုၬလၧဆၧဖိၪဆၧဎါလဒုၩတၭ, မိဘၪ ဆၧမၩၥံၫတၡါဝ့ၫလီၫ. တၭနၥံၪဘၪမၩၥံၫဆၧဖိၪဆၧ ဎါလဒုၩနီၪဆ့လီၫ.",
			"16": "<sup>16</sup> တၭၦမုၪအ့ၪမၩဘူၭအၥၭ လၧဆၧဖိၪဆၧဎါ, ဒဲမံၫ နၩ့လၧအဝ့ၫတၭ, နဘၪမၩၥံၫတၡါၦမုၪနီၪ, ဒဲဆၧဖိၪ ဆၧဎါဆ့, အဝ့ၫၥံၪ မိဘၪဆၧမၩၥံၫတၡါဝ့ၫတၭး အ ၥွံၪမိအီၪလၧအလီၩ့လီၫ.",
			"17": "<sup>17</sup> ၦၡၩအ့ၪမၩန့အထၧၫ့ဖုဝဲမုၪ, အဖါအဖိၪမုၪမွဲဂ့ၩ, အမိအဖိၪမုၪမွဲဂ့ၩ, ဒဲဒၪဘၪအဆၧအီၪဘိၪ့, ဒဲအဆၧ ဒၪဘၪၦခွၫအဆၧအီၪဘိၪ့တၭ, မွဲဆၧအၧၩ့လီၫ. တၭ အဝ့ၫၥံၪမိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧအၡၩဒၪဝ့ၫလဆၨၩ အမ့ၬယၫလီၫ. အဝ့ၫနဲၪဖျီၪထၪ့အထၧၫ့ဖုဝဲမုၪ အဆၧ",
			"18": "<sup>18</sup> အီၪဘိၪ့တၭး မိဘၪထိးအဆၧဒဲၩဘၭလီၫ.- တၭၦခွၫ အ့ၪမံၫဎုၬလၧၦမုၪ လၧအအၪ့ဆူၫဝၭအၥၭအဘိၩ့ဘၭ နီၪ,နဲၪဖျီၪထၪ့အဆၧအီၪဘိၪ့တၭ, မွဲအမၩအီၪဖျီၪအ ဆၧထၪ့ဖျိၭတၭး မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလၧအၡၩလ ဆၨၩဒၪဝ့ၫအကျၩနံၫဂၩလူၬလီၫ.",
			"19": "<sup>19</sup> နမိအထၧၫ့ဖုဝဲမုၪအဆၧအီၪဘိၪ့မွဲဂ့ၩ, နဖါအထၧၫ့ ဖုဝဲမုၪ အဆၧအီၪဘိၪ့မွဲဂ့ၩ, နဲၪဖျီၪထၪ့လဂ့ၩး အဂဲး ဘဲၫယီၩ ၦလၧအနဲၪဖျီၪထၪ့ အဘူၭအထံးအဆၧအီၪ ဘိၪ့လဖၪနီၪ, မိဘၪထိးအဆၧဒဲၩဘၭလီၫ.",
			"20": "<sup>20</sup> ၦခွၫအ့ၪမံၫဎုၬ လၧအမၩ့အမၫတၭ, မွဲအနဲၪဖျီၪထၪ့ အမၩ့ အဆၧအီၪဘိၪ့လီၫ. အဝ့ၫၥံၪမိဘၪထိးအဆၧ ဒဲၩဘၭတၭး မိၥံၫထူၬဖိၪဝ့ၫလီၫ.",
			"21": "<sup>21</sup> ၦအ့ၪမၩန့အထၧၫ့ဖုဝဲခွၫအမၫတၭ, မွဲဆၧလဆံၫ့ဘၪ တၭး နဲၪဖျီၪထၪ့အထၧၫ့ဖုဝဲခွၫ အဆၧအီၪဘိၪ့လီၫ. မိအီၪထူၬဖိၪဝ့ၫလီၫ.",
			"22": "<sup>22</sup> တၭနၥံၪဘၪထီးန့ယၥနိၫလဖၪထီးအလူၬ, ဒဲယဆၧ စ့ၩရၫ့ၥံၪထီးအလူၬ, ဒဲမၩအဝ့ၫၥံၪ, ဘဲၫၥိၭခးလၧယ ဒုၭလ့ၩနုၬနၥံၪလၧအဖၧၩ့ လၧနၥံၪမိအီၪထီးနီၪဘဲၫၥိၭ",
			"23": "<sup>23</sup> အထီးပၠိၭထၪ့ခွံၬနၥံၪလဂ့ၩလီၫ.- တၭထီးလ့ၩလၧၦ ဆၨၩလဖၪလၧယနၫ့ထၪ့ခွံၬ လၧနၥံၪအမ့ၬယၫအထူၫ အရူၫအဖၧၩ့လဂ့ၩး အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪနီၪမၩဆၧ လဖၪယီၩထီးအလူၬတၭ, ယၥၭလိၪဆၧလဖၪနီၪလီၫ.",
			"24": "<sup>24</sup> တၭယစံၭယူၭ နၥံၪယူၭ, လၧနၥံၪမိန့ဘၪၥၫခးနီၪ, ဒဲယမိဖ့ၪလၫ့ဝ့ၫဘဲၫၥိၭ နၥံၪမိမၩန့ဘၪခးလဘံၪ့ လၧ အယွၩလၩ့ဝ့ၫ လၧဆၧနူထံၫ, ဒဲန့ၫစၩ့လီၫ. ယဝ့ၫဒၪ ယီၩယမွဲယဟိဝၩနၥံၪအယွၩ လၧအမၩလၩ့မုလၩ့ဖၭ ခွံၬနၥံၪ လၧၦဆၨၩလဖၪလီၫ.",
			"25": "<sup>25</sup> တၭနၥံၪဘၪအၪ့နၩ့ဖၭ ဆၧဖိၪဆၧဎါအဆံၫ့ဒဲဆၧဖိၪ ဆၧဎါ လဆံၫ့ဘၪအဆၧၫ့, ဒဲထိၪၥံၪ လံၪၥံၪ အဆံၫ့, ဒဲထိၪၥံၪလံၪၥံၪလဆံၫ့ဘၪအဆၧၫ့လီၫ. တၭထီးမၩ ဘၪၥၭလိၪနၥံၪအၥၭ လၧဆၧဖိၪဆၧဎါမွဲဂ့ၩ, ထိၪၥံၪ လံၪၥံၪမွဲဂ့ၩ, ဆၧစွၩလၧဂၪ့ခိၪချိၫ့လမံၩ့လါလါမွဲဂ့ၩ, လၧယအီၪက့ၪ လၩ့မုလၩ့ဖၭခွံၬ လၧနၥံၪလၧဆၧလ ဆံၫ့ဘၪနီၪလဂ့ၩ.",
			"26": "<sup>26</sup> တၭနၥံၪမိဆံၫ့ဎံၪထၪ့လၧယဂးလီၫ. အဂဲးဘဲၫယီၩ ဆၧလၧယၧၩ, ယဟိဝၩယီၩ, ယမွဲဆၧဆံၫ့ဎံၪတၭ,ယ မၩလၩ့မုလၩ့ဖၭခွံၬ နၥံၪလၧၦဆၨၩလဖၪ ဘဲၫၥိၭနၥံၪ မိကဲၪထၪ့ယဆၧလီၫ.",
			"27": "<sup>27</sup> ၦခွၫမွဲဂ့ၩ, ၦမုၪမွဲဂ့ၩ, ၦလၧအအီၪလၧဆၧနၪလဖၪ မွဲဂ့ၩ, ၦလၧအၥ့ၪဆၧအူၪဆၧပီၩမွဲဂ့ၩ, မိဘၪဆၧမၩ ၥံၫတၡါဝ့ၫလီၫ. ၦၡၩဘၪခွံၬဝ့ၫလၧလိးလဖၪတၭ, အ ဝ့ၫၥံၪအၥွံၪမိအီၪလၧအလီၩ့လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> ယွၩစံၭစမိစ့ၭ, ချဲၩ့ဆၧလၧၦလုဆၧလဖၪစအၫရၧၫ့ အဖိၪခွၫၥံၪတၭ, စံၭအဝ့ၫၥံၪ, မွဲအထီးဒိၭဆၧလဆံၫ့ ဘၪလၧဆၧၥံၫအကၠီၩ့ လၧအၡၩအကျၩနးဂၩလဂ့ၩ.",
			"2": "<sup>2</sup> အ့ၪမွဲလၧအဘူၭအထံး လၧအဘူၭဝ့ၫအကၠီၩ့, လၧမိ အကၠီၩ့, ဒဲလၧဖါအကၠီၩ့, ဒဲလၧအဖိၪခွၫအကၠီၩ့, ဒဲလၧ",
			"3": "<sup>3</sup> အဖိၪမုၪအကၠီၩ့, ဒဲလၧအထၧၫ့ဖုဝဲခွၫအကၠီၩ့,- ဒဲလၧ အထၧၫ့ဖုဝဲမုၪနၩ့လၧအဘူၭဝ့ၫတၭ, အဝၩလအီၪဘၪ နီၪမိကဲၪထၪ့ဆၧလဆံၫ့ဘၪ လၧအဝ့ၫဒၪလဂၩအကၠီၩ့",
			"4": "<sup>4</sup> လီၫ.- အ့ၪမွဲလၧအကဲၪထၪ့ၦဒိၪ လၧအၡၩခမျၧးအ ကျၩအကၠီၩ့နီၪ, မွဲအထီးမၩၥၭလိၪအနၫ့ဆါဒၪဝ့ၫလ",
			"5": "<sup>5</sup> ဂ့ၩ,- မွဲအထီးမၩချၩအခိၪလဂ့ၩ, ဒဲလိၩ့အခၪဆီၪ့အ",
			"6": "<sup>6</sup> နိၪ့လဂ့ၩ, ဒဲဂ့ၬအယၪလဂ့ၩ.- မိဆံၫ့ဎံၪထၪ့လၧအဝ့ၫ ၥံၪအယွၩအဂးတၭ, မၩကြၩ့ထမး အယွၩအမံၩ့လ ဂ့ၩ. အဂဲးဘဲၫယီၩမၩဘိၪ့ ယဟိဝၩဆၧလုမၩလၧမ့ၪ, ဒဲအဝ့ၪၥံၪအယွၩအဆၧအၪ့နီၪ လုထၪ့ဝ့ၫလီၫ. အခိးမွဲ အဝ့ၫၥံၪဘၪအီၪဆံၫ့ဎံၪထၪ့လီၫ.",
			"7": "<sup>7</sup> ၦအ့ၭကံၫမုၪမွဲဂ့ၩ, ၦမုၪဂၭဂီၩ့မွဲဂ့ၩ, မွဲအထီးမၩန့ အမၫလၧအဝ့ၫလဂ့ၩ. တၭထီးမၩန့ၦမုၪ လၧအလၩ့ ၡၪလၧအဝၩ လဂၩနီၪလဂ့ၩး အဂဲးဘဲၫယီၩ ၦခွၫနီၪ ဆံၫ့ဎံၪဝ့ၫလၧယွၩအဂးလီၫ. မၩအၥၭဘဲၫနီၪတၭ န",
			"8": "<sup>8</sup> ဘၪအီၪက့ၪဆံၫ့ဎံၪ အဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫယီၩအ ဝ့ၫဒၪမၩဘိၪ့လၧကိၪဘၪဆဲၫ့ လၧနယွၩလီၫ. အဝ့ၫမိ ဘၪကဲၪထၪ့ဆၧဆံၫ့ဎံၪ လၧနၥံၪအမ့ၬယၫလီၫ. အဂဲး ဘဲၫယီၩ ဆၧလၧယၧၩယီၩ, ယဟိဝၩ လၧအမၩဆံၫ့",
			"9": "<sup>9</sup> ဎံၪနၥံၪတၭ, ယဆံၫ့ဎံၪယဝ့ၫလီၫ.- တၭၦလုဆၧအ ဖိၪမုၪလဂၩ အ့ၪမၩၥၭလိၪလၩ့အၥၭ လၧအမၩဆၧ လဲးဆၧဘျၪတၭ, မွဲအမၩၥၭလိၪအဖါလီၫ. ၦဘၪဆူၭ ထၪ့ခွံၬဝ့ၫလၧမ့ၪလီၫ.",
			"10": "<sup>10</sup> တၭၦလုဆၧအခိၪ လၧအထၧၫ့ဖုဝဲလဖၪအကျၩ လၧၦဂါလၩ့ၥိၪဂုၪဆၧလၧအခိၪအလီၩ့တၭ, အီၪက့ၪဆံၫ့ ဎံၪဝ့ၫဘဲၫၥိၭအမိကီၩ့ထၪ့ၥိၭထၪ့ ဆၧကီၩ့ဆၧၥိၭနီၪ,",
			"11": "<sup>11</sup> မၩအီၪဘိၪ့ဘၪအခိၪ, ဒဲၡၫ့ဘၪအဆဲၫ့အ့ၬ,- တၭအဝ့ၫ လ့ၩနုၬဘၪလၧဆၧၥံၫအအီၪအ့ၬ, ဒဲလၧအမိအကၠီၩ့ မွဲဂ့ၩ, လၧအဖါအကၠီၩ့မွဲဂ့ၩ, လမၩစံၪစၪဘၪ အၥၭ",
			"12": "<sup>12</sup> လီၫ.- အဝ့ၫမိစဲၪ့ထၪ့လၧအလးဆံၫ့ဎံၪအဖၧၩ့, ဒဲမၩ ၥၭလိၪအယွၩအလးဆံၫ့ဎံၪအ့ၬ. အဂဲးဘဲၫယီၩ မွဲအ ယွၩအၥိၪဂုၪဆၧအၥရဖူၩ အီၪလၧအလီၩ့လီၫ. ယဝ့ၫ",
			"13": "<sup>13</sup> ဒၪယီၩယမွဲယဟိဝၩလီၫ.- တၭအဝ့ၫဘၪမၩန့အမၫၦ",
			"14": "<sup>14</sup> မုၪနၩ့,- ၦမုၪမဲၫမွဲဂ့ၩ, ၦမုၪလၧအလၩ့ၡၪလၧအဝၩမွဲ ဂ့ၩ, ၦမုၪလၧအဂၭဂီၩ့မွဲဂ့ၩ, ၦမဲၩဎွဲၩမုၪမွဲဂ့ၩ, မွဲအ ထီးအၪ့မၩန့လဂ့ၩ, ဘၪမၩန့အမၫၦမုၪနၩ့လၧအၡၩ",
			"15": "<sup>15</sup> လဆၨၩဒၪဝ့ၫ အကျၩလီၫ.- တၭမွဲအထီးမၩဘၪၥၭ လိၪအချံၫအၥၪ လၧၦလဆၨၩဒၪဝ့ၫအကျၩလဂ့ၩ, အ ဂဲးဘဲၫယီၩ ဆၧလၧယၧၩ ယဟိဝၩယီၩ, ယမၩဆံၫ့ ဎံၪအဝ့ၫဒၪလီၫ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"16": "<sup>16</sup> ချဲၩ့ ဆၧလၧစအၫရၧၫ့တၭစံၭ, ၦလၧနချံၫနၥၪလၧအဆၨၩ အဆၬအကျၩ လၧအအီၪ လၧဆၧလလၧၫ့ လဎွ့ၩဘၪ လဂၩဂၩနီၪ, မွဲအထီးၥုၭဘူၭအၥၭ ဘဲၫၥိၭအမိမၩ",
			"18": "<sup>18</sup> ဘိၪ့အယွၩအကိၪလဂ့ၩ.- အဂဲးဘဲၫယီၩထီးဒၪၦလၧ အအီၪလၧဆၧလလၧၫ့လဎွ့ၩဘၪနီၪ ၥုၭဘူၭဘၪအၥၭ နးဂၩအ့ၬ. ၦအမ့ၬဘျီၪမွဲဂ့ၩ, ၦအခၪ့ဂၭဂီၩ့မွဲဂ့ၩ, ၦအ နၫဒၩမွဲဂ့ၩ, ၦအီၪလၧဆၧလမံၩ့မံၩ့ အၪလၨၪမွဲဂ့ၩ, ၦလၧအခၪ့ခါမွဲဂ့ၩ, ၦလၧအစူၪခါမွဲဂ့ၩ,",
			"19": "<sup>19</sup> ၦလၧအ ယးဒံၩ့ကူၭမွဲဂ့ၩ, ၦလၧအဂၩ့ဖၨၪမွဲဂ့ၩ, ၦအီၪလၧဆၧ လလၧၫ့လဎွ့ၩဘၪ, လၧအမ့ၬၥၪမွဲဂ့ၩ, ၦလၧအဘၪဆၧ လီၩ့ၥၭအအၧၩ့မွဲဂ့ၩ, ၦလၧအဖံၭလၩ့ကျိၭမွဲဂ့ၩ, ၦလၧ",
			"21": "<sup>21</sup> အဒံၪၥၪဂၭဂီၩ့မွဲဂ့ၩ,- ၦလၧအအီၪလၧဆၧလလၧၫ့လ ဎွ့ၩဘၪလၧၦလုဆၧစအၫရၧၫ့ အချံၫအၥၪအကျၩနီၪ ၥုၭဘူၭဘၪအၥၭ ဘဲၫၥိၭအမိမၩဘိၪ့ယဟိဝၩ လၧဆၧ မၩဘိၪ့မၩလၧမ့ၪနးဂၩအ့ၬး မွဲအအီၪလၧဆၧလလၧၫ့ လဎွ့ၩဘၪလီၫ. မွဲအထီးၥုၭဘူၭအၥၭ ဘဲၫၥိၭအမိမၩ",
			"22": "<sup>22</sup> ဘိၪ့ယဟိဝၩ အယွၩအကိၪလဂ့ၩ.- အဝ့ၫမိအၪ့ဘၪ အယွၩအကိၪ, ဆၧဆံၫ့ဎံၪထုၬ, ဒဲဆၧဆံၫ့ဎံၪနီၪလီၫ.",
			"23": "<sup>23</sup> အ့ၪမွဲလ့ၩနုၬလၧကလကၫလမံၩ့ လ့ၩနုၬဘၪအ့ၬ. ဒဲၥုၭ ဘူၭဘၪအၥၭ လၧဆၧလုလးအအီၪအ့ၬ. အဂဲးဘဲၫယီၩ အီၪလၧဆၧလလၧၫ့လဎွ့ၩဘၪလီၫ. ဘဲၫၥိၭအထီးမၩ ၥၭလိၪယလးဆံၫ့ဎံၪ လဖၪလဂ့ၩလီၫ. အဂဲးဘဲၫယီၩ ဆၧလၧယၧၩ, ယဟိဝၩယီၩ, ယမၩဆံၫ့ဎံၪအဝ့ၫၥံၪ လီၫ.",
			"24": "<sup>24</sup> တၭစမိစ့ၭ လီၩဘၪ စအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪ, ဒဲၦအံၫစရ့လၭဖိၪ ထီးအလူၬလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လီၩ ဘၪစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪ, လၧအဘၪမၩလၩ့မု လၩ့ဖၭအၥၭ လၧၦအံၫစရ့လၭဖိၪအဆၧဆံၫ့ဎံၪ လ ဖၪ, ဘဲၫၥိၭအထီးမၩဘၪၥၭလိၪ ယမံၩ့ဆံၫ့ဎံၪ လၧ ဆၧလၧအဝ့ၫၥံၪ အီၪက့ၪဆံၫ့ဎံၪလၧယဂးလဂ့ၩလီၫ.",
			"3": "<sup>3</sup> ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩလီၫ.- စံၭအဝ့ၫၥံၪ,ထီးဒၪ ၦလၧနၥံၪအချံၫအၥၪ လၧနၥံၪအဆၨၩအဆၬအကျၩ, လၧအအီၪလၧအဆၧလဆံၫ့ဘၪ လၧအလီၩ့တၭ, လ့ၩ လၧဆၧဆံၫ့ဎံၪလဖၪ အအီၪလၧၦအံၫစရ့လၭဖိၪအီၪ က့ၪဆံၫ့ဎံၪလၧယဟိဝၩအဂးလဂၩဂၩနီၪ, မွဲအမိဘၪ ဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလၧယမ့ၬယၫလီၫ. ယဝ့ၫဒၪယီၩယ",
			"4": "<sup>4</sup> မွဲယဟိဝၩလီၫ.- ထီးဒၪၦလၧစအၫရၧၫ့အချံၫအၥၪအ ကျၩလဂၩဂၩနီၪ, မွဲၦခံၫထူၬ ဆၫအၧၩ့မွဲဂ့ၩ, အ့ၪအီၪ လၧဆၧယွၩလၩ့မွဲဂ့ၩ, ဘိၩ့အလချႃၭဆံၫ့ထၪ့ဒံၭဘၪ တၭ,အၪ့ဘၪဆၧဆံၫ့ဎံၪလဖၪအ့ၬ. တၭထီးဒၪၦလၧ အထိၭဘၪဆၧလဆံၫ့ဘၪဆၧၥံၫမွဲဂ့ၩ, ၦလၧအချံၫစဲၪ့",
			"5": "<sup>5</sup> ထၪ့ခွံၬလၧအဖၧၩ့မွဲဂ့ၩ,- တၭၦလၧအထိၭဘၪဆၧအ စွၩလမံၩ့မံၩ့ လၧအမၩ လဆံၫ့ဘၪမွဲဂ့ၩ, ၦလၧအမိ ဘၪဆၧလဆံၫ့ဘၪ လၧအဝ့ၫ, ထီးဒၪဆၧလဆံၫ့ဘၪ",
			"6": "<sup>6</sup> လၧအအီၪလၧအဝ့ၫမွဲဂ့ၩ.- ၦလၧအထိၭဘၪဝ့ၫလဂၩ နီၪ, မိကဲၪထၪ့ဆၧလဆံၫ့ဘၪထီးမုဂၪလၩ့တၭ, အ့ၪ လၥူၫဝၭဆံၫ့ဘၪအယၪလၧထံၫတၭ, အၪ့ဘၪဆၧဆံၫ့",
			"7": "<sup>7</sup> ဎံၪလဖၪအ့ၬ.- တၭထီးမုလၩ့နုၬနီၪ မိဆံၫ့ထၪ့, ဒဲမိ အၪ့ဘၪဆၧဆံၫ့ဎံၪ လဖၪလၧခဲၫ့ထဲၩ့လီၫ. အဂဲးဘဲၫ",
			"8": "<sup>8</sup> ယီၩမွဲအဆၧအၪ့လီၫ.- ဆၧလၧအၥံၫဒၪဆၧ, ဒဲဆၧလၧ ဆၧအဲၪ့ၥံၫဝ့ၫနီၪ, ဘဲၫၥိၭအမိမၩၥၭလိၪအၥၭတၭ, မွဲ အထီးအၪ့လဂ့ၩ, ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩလီၫ.",
			"9": "<sup>9</sup> တၭအဝ့ၫၥံၪ မိဘၪထီးန့ယၥနိၫနီၪ, အ့ၪမၩကြၩ့ထမး ဝ့ၫတၭ, မိထိးဘၪခိၬဆၧဒဲၩဘၭ လၧအကၠီၩ့တၭ, ၥံၫ ဝ့ၫဒၪဘဲၫနီၪၥိၭလီၫ. ဆၧလၧယၧၩယဟိဝၩ ယီၩယ မၩဆံၫ့ဎံၪအဝ့ၫၥံၪလီၫ.",
			"10": "<sup>10</sup> ၦလခီၫဘၩ့မုးဖိၪ အၪ့ဘၪဆၧဆံၫ့ဎံၪနီၪနးဂၩအ့ၬ. ၦလၧအအီၪဝ့ၫလၧၦလုဆၧအၥိၭမွဲဂ့ၩ, ၦဒိၭအၪ့လံၩ့",
			"11": "<sup>11</sup> အၥၭမွဲဂ့ၩ, အၪ့ဘၪဆၧဆံၫ့ဎံၪနီၪဆ့အ့ၬ.- အ့ၪမွဲၦလု ဆၧလဂၩ အ့ၪဎွ့ၩၦလဂၩလၧအစ့ၩတၭ, အဝ့ၫဒၪမိ အၪ့ဘၪဝ့ၫလီၫ. ဒဲၦလၧအအီၪဖျဲၪလၧအဂံၪ့ဖၧၩ့လဖၪ",
			"12": "<sup>12</sup> နီၪမိအၪ့ဘၪအဆၧအၪ့လီၫ.- ၦလုဆၧလဂၩအဖိၪမုၪ အ့ၪန့အဝၩလၧၦလခီၫဘၩ့မုးဖိၪတၭ, အၪ့ဘၪဆၧမၩ",
			"13": "<sup>13</sup> ဘိၪ့ဆၧဆံၫ့ဎံၪနီၪဆ့အ့ၬ,- အ့ၪမွဲၦလုဆၧလဂၩအဖိၪ မုၪအ့ၪမဲၫမွဲဂ့ၩ, အ့ၪလၩ့ၡၪလၧအဝၩမွဲဂ့ၩ, အချံၫအ ၥၪလအီၪဘၪတၭ, အ့ၪထဲၩ့ထဲၩ့ လၧအဖါအဂံၪ့ဖၧၩ့ ဘဲၫလၧအၥၭဘၪ့ဒံၭအၥိၭနီၪ, မိအၪ့ဘၪအဖါအဆၧ",
			"14": "<sup>14</sup> အၪ့လီၫ. အ့ၪမွဲၦလခီၫဘၩ့မုးဖိၪအၪ့ဘၪအ့ၬ.- ၦၡၩ အ့ၪအၪ့မၪဘၪဆၧဆံၫ့ဎံၪတၭ, ဘၪအီၪက့ၪအၪထၪ့ လၧဆၧယဲပိၩ့လပိၩ့တၭ, ဖ့ၪလၫ့ဎုၬလၧဆၧဆံၫ့ဎံၪနီၪ",
			"15": "<sup>15</sup> လၧၦလုဆၧလဂၩနီၪလီၫ.- အဝ့ၫၥံၪမၩဘၪၥၭလိၪဘၪ ၦအံၫစရ့လၭဖိၪအဆၧဆံၫ့ဎံၪလဖၪ လၧအမၩဘိၪ့ယ",
			"16": "<sup>16</sup> ဟိဝၩနီၪအ့ၬ.- တၭဒုၭထိးဘၪဝ့ၫလၧအဆၧဒဲၩဘၭ ဘၪဆဲၫ့လၧအဆၧမၩ လၧအအၪ့ဘၪအဆၧဆံၫ့ဎံၪလ ဖၪအကၠီၩ့နီၪဆ့အ့ၬ. အဂဲးဘဲၫယီၩ ဆၧလၧယၧၩ, ယ ဟိဝၩယီၩ ယမၩဆံၫ့ဎံၪ အဝ့ၫၥံၪလီၫ.",
			"17": "<sup>17</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ချဲၩ့ထၪ့ လၧစအၫရၧၫ့ ဒဲအဖိၪခွၫလဖၪဒဲကယဲ ၦအံၫစရ့လၭ",
			"18": "<sup>18</sup> ဖိၪထီးအလူၬတၭ, စံၭအဝ့ၫၥံၪ,- ထီးဒၪၦလၧၦအံၫစ ရ့လၭဖိၪအကျၩမွဲဂ့ၩ, လၧၦလခီၫဘၩ့မုးဖိၪလၧၦအံၫ စရ့လၭဖိၪအကျၩမွဲဂ့ၩ, လၧအမိမၩဘိၪ့ဆၧမၩ ဘိၪ့ ဘၪဆဲၫ့လၧအဆိၪလၩ့အၥၭလမံၩ့မံၩ့, ဆၧမၩဘိၪ့ဒၪ အဆၧလမံၩ့မံၩ့, လၧအမၩဘိၪ့ယဟိဝၩ လၧဆၧလု",
			"19": "<sup>19</sup> မ့ၪအလးနီၪ,- ဘဲၫၥိၭအမိဘၪဆၧအၥၭတၭ, ဘၪမၩ ဘိၪ့ချီမွဲဂ့ၩ, ၥိၪမွဲဂ့ၩ, ဘ့ၪမွဲဂ့ၩ, ဆၧအဖၫ အလၧၫ့",
			"20": "<sup>20</sup> အဎွ့ၩလဒုၩလီၫ.- အ့ၪမွဲဆၧလၧ အလလၧၫ့ လဎွ့ၩ ဘၪနီၪ, ထီးမၩဘိၪ့နးဒုၩလဂ့ၩ, အဂဲးဘဲၫယီၩ ဘၪ",
			"21": "<sup>21</sup> ဆၧအၥၭလၧနၥံၪအဂးအ့ၬ.- တၭထီးဒၪ ၦလၧအမၩ ဘိၪ့ယဟိဝၩ လၧဆၧလုဘၪလိၬအိၭလိၬ, ဘဲၫၥိၭအ မိမၩတီၩအလူလၧအဆိၪလၩ့အၥၭမွဲဂ့ၩ, လၧအမိဖ့ၪ လၫ့ဒၪဝ့ၫမွဲဂ့ၩ, လၧချီမွဲဂ့ၩ,လၧၥိၪလၧဘ့ၪမွဲဂ့ၩ, မွဲအ ဘၪလၧၫ့ဎွ့ၩ ဘဲၫၥိၭအမိဘၪ ဆၧအၥၭတၭး ဆၧလ",
			"22": "<sup>22</sup> လၧၫ့လဎွ့ၩဘၪမိအီၪလၧအလီၩ့အ့ၬ.- ဆၧလၧအမ့ၬ ဘျီၪမွဲဂ့ၩ, ဆၧအခါမွဲဂ့ၩ, အခၪ့ဂၭဂီၩ့မွဲဂ့ၩ, လၧအ ယၪထၪ့ဖျိၭမွဲဂ့ၩ, လၧဆၧဎၬအၪ့မွဲဂ့ၩး လၧအဖံၭအိၭ ဘျူၭလၩ့မွဲဂ့ၩ, နၥံၪမၩဘိၪ့ဘၪယဟိဝၩ လၧအဝ့ၫ အ့ၬ. နၥံၪလုထၪ့ဘၪဆၧလုမၩလၧမ့ၪ လၧအဝ့ၫၥံၪ",
			"23": "<sup>23</sup> လၧဆၧလုလးအဖၫ့ခိၪ,လၧယဟိဝၩအဂးအ့ၬ.- ချီ ဖၫလဒုၩမွဲဂ့ၩ, ၥိၪဖိၪဘ့ၪဖိၪမွဲဂ့ၩ လၧအဆၧအၪလၨၪ, လမံၩ့မံၩ့မွဲဂ့ၩ, လၧအဆၧၡၩလၨၪ လမံၩ့မံၩ့မွဲဂ့ၩ, နမၩဘိၪ့ဘၪဝ့ၫ လၧနဆၧမၩဘိၪ့ ဒၪဆၧအဂးလီၫ. အ့ၪမွဲဆၧမၩဘိၪ့ဘၪဆဲၫ့ လၧဆၧဆိၪလၩ့အၥၭအဂး",
			"24": "<sup>24</sup> နီၪဘၪဆၧအၥၭအ့ၬ.- ဆၧလၧအဘၪထဲးမွဲဂ့ၩ, ဘၪ ဆၧမၩလၩ့ဘျ့ၭမွဲဂ့ၩ, ဘၪခါမွဲဂ့ၩ, ဘၪဂ့ၬမွဲဂ့ၩ, နၥံၪ မၩဘိၪ့ဘၪယဟိဝၩအ့ၬ. ဒဲနၥံၪမၩဘိၪ့ဘၪလၧနၥံၪ",
			"25": "<sup>25</sup> အခးဖၧၩ့ဆ့အ့ၬ.- တၭနၥံၪမၩဘိၪ့ဘၪနၥံၪအယွၩအ ကိၪလၧဆၧနီၪလမံၩ့မံၩ့ လၧၦလခီၫဘၩ့မုးဖိၪ အစူၪ အ့ၬ, အဂဲးဘဲၫယီၩ အဆၧအၧၩ့အီၪလၧအဖၧၩ့, အ လလၧၫ့လဎွ့ၩဘၪအီၪလၧအလီၩ့လီၫ. ဘၪဆၧအၥၭ လၧနၥံၪအဂးအ့ၬ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ,စံၭဝ့ၫဒၪ,",
			"26": "<sup>26</sup> ချီဖၫ မွဲဂ့ၩ,ၥိၪမွဲဂ့ၩ, ဘ့ၪမွဲဂ့ၩ, ဖိၪဆါဝ့ၫတၭ, မိအီၪလၧအ မိအၥိၭနွ့ၫနံၩလီၫ. တၭလၧဎိၭနံၩလနံၩ ဒဲလၧယၫနီၪ မိဘၪဆၧအၥၭ လၧဆၧလုမၩလၧမ့ၪ လၧယဟိဝၩအ ဂးလီၫ.",
			"28": "<sup>28</sup> ချီမိမွဲဂ့ၩ, ၥိၪမိမွဲဂ့ၩ, ထီးမၩၥံၫ ဒဲအဖိၪနံၫဒုၩလူၬ လၧမုလနံၩဎးလဂ့ၩး",
			"29": "<sup>29</sup> ထီးနၥံၪလုထၪ့ဆၧစံၭထၪ့အၪ့အူၭ အဆၧလုလၧယ ဟိဝၩအဂးတၭ, လုထၪ့ဘဲၫအဘၪဆၧအၥၭအၥိၭနီၪ ဆံၭ.",
			"30": "<sup>30</sup> နၥံၪဘၪအၪ့ဝ့ၫလၧမုလနံၩဎးလီၫ. နၥံၪအီၪက့ၪထး ဘၪဆၧထီးဆၧဖၩ့ထၪ့နးဆံၭအ့ၬ. ယဝ့ၫဒၪယီၩယမွဲ ယဟိဝၩလီၫ.",
			"31": "<sup>31</sup> တၭနၥံၪဘၪထီးန့ယဆၧမၪလူၬလဖၪ, ဒဲမၩအဝ့ၫ ၥံၪလီၫ. ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩလီၫ.",
			"32": "<sup>32</sup> ထီးချဲၩ့အၧၩ့ယမံၩ့ဆံၫ့ဎံၪလဂ့ၩ, ယမိထိးဆၧအီၪ က့ၪဆံၫ့ဎံၪယၧၩ လၧၦအံၫစရ့လၭဖိၪ အကျၩလီၫ. ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩ လၧအမၩဆံၫ့ဎံၪထၪ့နၥံၪ.",
			"33": "<sup>33</sup> လၧအဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪ လၧခးအံဇံၭဘဲၫၥိၭယမိကဲၪ ထၪ့နၥံၪအယွၩလီၫ. ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, ချဲၩ့ ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫၥံၪ, ဆၧလၧယ ဟိဝၩ အဆၧမၩဘိၪ့နံၩ လၧနၥံၪဘၪဒုၭဂၧၫ့ထၪ့ၥၩ လၩ့လၧအမွဲဆၧအီၪကီၪ့ဆံၫ့ဎံၪလဖၪနီၪ, အယီၩမွဲ ယဆၧမၩဘိၪ့လဖၪလီၫ.",
			"3": "<sup>3</sup> ဎူၫနံၩအထးဖၧၩ့နီၪ ၦၡၩမိမၩဘၪ အဆၧမၩလီၫ. အ့ၪမွဲနွ့ၫနံၩလနံၩနီၪ, မွဲမးၥံၫအနံၩဆၧအီၪပွံၭနီၪ, ဆၧ အီၪကီၪ့ဆံၫ့ဎံၪလီၫ. ထီးမၩဆၧလၧအဖၧၩ့နးမံၩ့လ ဂ့ၩ,မွဲယဟိဝၩအမးၥံၫအနံၩ လၧနၥံၪအီၪအလးလ စီၪ့လါလါလီၫ.",
			"4": "<sup>4</sup> အယီၩမွဲယဟိဝၩအဆၧမၩဘိၪ့လဖၪ, ဆၧအီၪကီၪ့ ဆံၫ့ဎံၪလဖၪ, လၧနၥံၪဘၪမၩဂၧၫ့ထၪ့ၥၩလၩ့ ထီးအ",
			"5": "<sup>5</sup> ဆၧၫ့အထီဘၪနီၪလီၫ.-လၧလၩခၪ့ထံၭလဘံၪ့လၩ ထၪ့လဆံၫလံနံၩလနံၩမုဂၪလၩ့နီၪ, မွဲယဟိဝၩအဆၧ",
			"6": "<sup>6</sup> လ့ၩဖၬလီၫ.- တၭလၩလဘံၪ့ဎးလၩထၪ့လဆံၫယဲနံၩ လနံၩနီၪ, မွဲဘိၪ့ကိၪလအီၪဘၪလၧမံၪလၧယဟိဝၩအ ဂးလီၫ. နွ့ၫနံၩလဖၪနီၪနၥံၪဘၪအၪ့ကိၪလအီၪဘၪ",
			"7": "<sup>7</sup> လၧမံၪလီၫ.- မုခၪ့ထံၭလနံၩနီၪနၥံၪဘၪအီၪလၧဆၧ အီၪကီၪ့ဆံၫ့ဎံၪလီၫ. ထီးမၩဆၧအဎီးအၡၩ အဆၧ",
			"8": "<sup>8</sup> မၩလၧအဖၧၩ့နးမံၩ့လဂ့ၩ.- နၥံၪဘၪလုထၪ့ဆၧလုမၩ လၧမ့ၪလၧယဟိဝၩအဂးနွ့ၫနံၩလီၫ. နွ့ၫနံၩလနံၩနီၪ မွဲဆၧအီၪကီၪ့ဆံၫ့ဎံၪလီၫ. ထီးမၩဆၧအဎီးအၡၩအ ဆၧမၩနးမံၩ့လဂ့ၩ. ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"9": "<sup>9</sup> လီၩ ဘၪဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫၥံၪ, ထီး နၥံၪလ့ၩနုၬလၧခးဖၧၩ့လၧယဖ့ၪလၫ့နၥံၪ, ဒဲနၥံၪမိကူၭ အဘုၪနီၪတၭ, နၥံၪဘၪဂဲၫဆိၬဘုၪၥၪထၪ့ဆိၫနးထူလၧ နၥံၪအဘုၪၥံၪဂူၫၥံၪအကျၩ လၧၦလုဆၧလဂၩအအီၪ",
			"11": "<sup>11</sup> နီၪလီၫ.- တၭအဝ့ၫဒၪဘၪဝံဝါဘုၪလထူလၧယဟိဝၩ အမ့ၬယၫ လၧအမိဘၪဆၧအၥၭ လၧနၥံၪအဂးလီၫ. ထီးမးၥံၫဖီၩ့ခွံၬ လနံၩနီၪ ၦလုဆၧလဂၩ ဘၪဝံဝါဝ့ၫ",
			"12": "<sup>12</sup> လီၫ.- မုလၧနၥံၪဝံဝါနၥံၪအဘုၪထူလနံၩနီၪနၥံၪဘၪလု ထၪ့ၥိၪဖၫဖိၪအလၧၫ့အဎွ့ၩလနံၪ့ဖိၪ လၧဆၧလုမ့ၪလၧ",
			"13": "<sup>13</sup> ယဟိဝၩအဂးလီၫ.- တၭအဆၧမၩဘိၪ့ကိၪမုၬနီၪ, မွဲ ကိၪမုၬနံၫအ့စရိၫလဲၩဎုၬလၧၥိၪလီၫ. မွဲဆၧလုမၩလၧ မ့ၪလၧယဟိဝၩ ဆၧနၧၫ့မၧၫ့မုၬအဂးလီၫ. တၭအဆၧ",
			"14": "<sup>14</sup> လုအီၩနီၪ မွဲစဘံၭထံၫလဟံၫ့လံပိၩ့လပိၩ့လီၫ.- မုလနံၩလၧနၥံၪဂဲၫဆိၬ ဆၧမၩဘိၪ့လၧနၥံၪအယွၩလချႃၭ ဘၪဒံၭဘၪတၭ, ကိၪမွဲဂ့ၩ, ဘုၪအၪ့ဝ့ၬ လၧမ့ၪမွဲဂ့ၩ, ဘုၪအၥံၫ့ဆ့ၬမွဲဂ့ၩ, ထီးအၪ့လဂ့ၩ, မွဲအထူၫအရူၫအ ဆိၩအကၠၪလၩ့လၧနၥံၪအဆၨၩအဆၬ လဆိၩဘၪလ ဆိၩ, လၧနၥံၪအီၪအလး လစီၪ့လါလါလီၫ.",
			"15": "<sup>15</sup> တၭလၧမးၥံၫအနံၩ ဖီၩ့ခွံၬလနံၩ, လၧမုလနံၩလၧ နၥံၪဂဲၫဆိၬနၥံၪအဆၧမၩဘိၪ့ ဝံဝါအဘုၪထူဝံဝါဝ့ၫနီၪ, နၥံၪဘၪဝံထၪ့နၬထၪ့ နွ့ၫလဖၪနွ့ၫဘျၩ့ လၧၫ့လၧၫ့ဎွ့ၩ",
			"16": "<sup>16</sup> ဎွ့ၩလၧနၥံၪအဂးလီၫ.- ထီၩ့လၩ့လၧမးၥံၫ နွ့ၫနံၩလ နံၩဖီၩ့ခွံၬလနံၩနီၪ နၥံၪမိဘၪဝံထၪ့မုနံၩ ယဲဆံၫတၭ, နၥံၪဘၪမၩဘိၪ့ကိၪမုၬအၥၫ့ လၧယဟိဝၩအဂးလီၫ.",
			"17": "<sup>17</sup> တၭနၥံၪမိဂဲၫဆိၬထၪ့ ကိၪဝံဝါဝ့ၫနံၫဖျိၪ့ အီၪလၧနံၫအ့ စရိၫလၧနၥံၪအီၪအလးဖၧၩ့လီၫ. မိဘၪဆၧမၩဝ့ၫလၧ ကိၪမုၬ ဒဲမိဘၪဆၧအၪ့ဎူဝ့ၫလၧမံၪလီၫ. မွဲဆၧၥၪဆိၫ",
			"18": "<sup>18</sup> လၧယဟိဝၩအဂးလီၫ.- တၭနၥံၪဘၪမၩဘိၪ့ၥိၪဖိၪ အလၧၫ့အဎွ့ၩ, လနံၪ့ဖိၪနွ့ၫဒုၩ, ဒဲချီဖၫဖိၪလဒုၩ, ဒဲၥိၪ ဖၫနံၫဒုၩ ဒဲကိၪနီၪလီၫ. တၭမိကဲၪထၪ့ဆၧလုမ့ၪ လၧ ယဟိဝၩအဂး, ဒဲဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲဆၧလုအီၩနီၪ, ဆၧလုမၩလၧမ့ၪ, ဆၧနၧၫ့မၧၫ့မုၬ လၧယဟိဝၩအဂး",
			"19": "<sup>19</sup> လီၫ.- ထီးနီၪလဖၧၫ့ နၥံၪဘၪလုထၪ့ဘ့ၪဖိၪလဒုၩလၧ ဆၧလုဆၧဒဲၩဘၭအဂး ဒဲၥိၪဖိၪလနံၪ့ဖိၪနံၫဒုၩလၧဆၧ",
			"20": "<sup>20</sup> လုဘၪလိၬအိၭလိၬအဂးလီၫ.- ၦလုဆၧလဂၩဘၪဝံဝါ ဝ့ၫလၧဆၧၥၪဆိၫအကိၪအၥိၭ, ဆၧမၩဘိၪ့ဝံဝါဝ့ၫလၧ ယဟိဝၩအမ့ၬယၫအီၪလၧၥိၪဖိၪနံၩဒုၩလီၫ. မိကဲၪထၪ့ ဆၧဆံၫ့ဎံၪ လၧယဟိဝၩအဂး, လၧၦလုဆၧလဂၩနီၪ",
			"21": "<sup>21</sup> အဂးလီၫ.- တၭလၧမုလနံၩဎးနီၪ နၥံၪဘၪကိၭထၪ့ဆၧ အီၪကီၪ့ဆံၫ့ဎံၪလၧနၥံၪအဂးလီၫ. မၩဆၧအဎီးအၡၩ အဆၧမၩနးမံၩ့လဂ့ၩ. အယီၩမွဲအထူၫအရူၫလၧနၥံၪ အီၪအလးထီးအလူၬအဖၧၩ့ အဆိၩဆိၩအကၠၪကၠၪ လၧနၥံၪအဆၨၩအဆၬ လဆိၩဘၪလဆိၩလီၫ.",
			"22": "<sup>22</sup> ထီးနၥံၪကူၭဘုၪလၧနၥံၪအခးဖၧၩ့တၭ, ထီးကူၭလၧ ဆံၬအနိၪ့ဖၧၩ့ထီးအလူၬလဂ့ၩ, ဒဲအၪ့ထုၫ့ထၪ့ဘုၪလၩ့ ထ့ၬ ထီးနကူၭ ဆၧနီၪလဂ့ၩ, နမိဘၪအီၪက့ၪလၩ့ထး ဝ့ၫလၧၦၡၪ့ဖိၪယၬဖိၪ, ဒဲၦလခီၫဘၩ့မုးဖိၪ အဂးလီၫ. ယဝ့ၫဒၪယီၩ ယမွဲ ယဟိဝၩ နၥံၪအယွၩလီၫ. တၭယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ,",
			"23": "<sup>23</sup> ချဲၩ့ ထၪ့လၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ, လၩနွ့ၫဘံၪ့လဘံၪ့ လၩထၪ့လနံၩနီၪ နၥံၪဘၪအီၪလၧမးၥံၫအနံၩလၧဆၧ နၪ့ထၪ့ထဲၩ့ဆၧဘၪဆဲၫ့ လၧအူၪခွ့ၩ ဆၧကိၭကီၪ့ဆံၫ့",
			"25": "<sup>25</sup> ဎံၪလီၫ.- ထီးမၩဆၧအဎီးအၡၩ အဆၧမၩနးမံၩ့လဂ့ၩ. တၭနၥံၪဘၪလုထၪ့ယဟိဝၩ လၧဆၧလုမၩလၧ မ့ၪလီၫ.",
			"26": "<sup>26</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လၧလၩနွ့ၫဘံၪ့လဘံၪ့ဆ့, လၩထၪ့ဆံၫနံၩလနံၩနီၪ, မွဲဆၧ မၩဖီၩ့ဖျ့ၭအနံၩလီၫ. မိကဲၪထၪ့ဆၧအီၪကီၪ့ဆံၫ့ဎံၪ လၧနၥံၪအဂး, ဒဲနၥံၪဘၪဆၪ့လၩ့နၥံၪအၥၭတၭ, လု",
			"28": "<sup>28</sup> ထၪ့ယဟိဝၩလၧဆၧလုမၩလၧမ့ၪလီၫ.- တၭဆၧလၧ မုလနံၩဎးနီၪ ထီးမၩဆၧနးမံၩ့လဂ့ၩး အဂဲးဘဲၫယီၩ မွဲဆၧမၩဖီၩ့ဖျ့ၭအမုနံၩ လၧအမိမၩဆၧဖီၩ့ဖျ့ၭလၧနၥံၪ",
			"29": "<sup>29</sup> အဂးလၧယဟိဝၩနၥံၪအယွၩအမ့ၬယၫလီၫ.- အဂဲး ဘဲၫယီၩလၧမုလနံၩဎးနီၪ ၦလၧအလဆၪ့လၩ့ဘၪအ ၥၭလဂၩလါလါနီၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလၧအၡၩ",
			"30": "<sup>30</sup> လဆၨၩဒၪဝ့ၫအကျၩလီၫ.- တၭကယဲၦလၧအမၩဆၧ လမံၩ့မံၩ့လၧမုလနံၩဎးနီၪ လဂၩလါလါတၭ, ယမိ မၩဂၭဂီၩ့ခွံၬၦလဂၩနီၪ လၧအဆၨၩဒၪဝ့ၫအကျၩလီၫ.",
			"31": "<sup>31</sup> နၥံၪထီးမၩကၩ နးမံၩ့လဂ့ၩ, မွဲဆၧအထူၫအရူၫ အ ဆိၩအကၠၪလၧနၥံၪအဆၨၩအဆၬ လဆိၩဘၪလဆိၩ",
			"32": "<sup>32</sup> လၧနၥံၪအီၪအလးထီးအလူၬအဖၧၩ့လီၫ.- မိကဲၪထၪ့ မးၥံၫအနံၩအဆၧအီၪပွံၭတၭ, နၥံၪဘၪဆၪ့လၩ့နၥံၪ အၥၭလီၫ. တၭလၩထၪ့ခွံၫနံၩလနံၩနီၪ နၥံၪဘၪအီၪ ပွံၭလၧမုဂၪလၩ့လခီၫ, လၧမုဂၪလၩ့ထီၩ့လၩ့လၧမုဂၪ လၩ့နီၪ, နၥံၪဘၪထီးန့နၥံၪမးၥံၫအနံၩလီၫ.",
			"33": "<sup>33</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လီၩဘၪဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ, လၩနွ့ၫဘံၪ့လ ဘံၪ့နီၪ လၩထၪ့လဆံၫယဲနံၩလနံၩ မွဲဘိၪ့တဲၩနွ့ၫနံၩ",
			"35": "<sup>35</sup> လနံၩလၧယဟိဝၩအဂးလီၫ.- မုခၪ့ထံၭနီၪ မွဲဆၧကိၭ ကီၪ့ဆံၫ့ဎံၪလီၫ. ထီးမၩဆၧအဎီးအၡၩအဆၧနးမံၩ့",
			"36": "<sup>36</sup> လဂ့ၩ.- နၥံၪဘၪလုထၪ့ယဟိဝၩလၧဆၧလုမၩလၧမ့ၪ နွ့ၫနံၩလီၫ. ဎိၭနံၩလနံၩနီၪ မွဲဆၧကိၭကီၪ့ဆံၫ့ဎံၪလၧ နၥံၪအဂးတၭ, နၥံၪဘၪလုထၪ့ယဟိဝၩ လၧဆၧလုမၩ လၧမ့ၪလီၫ. မွဲဆၧမၩဘိၪ့ဖၭဒိၪအနံၩလီၫ. ထီးမၩ",
			"37": "<sup>37</sup> အဎီးအၡၩအဆၧနးမံၩ့လဂ့ၩ.- အဝ့ၫၥံၪနီၪမွဲယဟိ ဝၩအဆၧမၩဘိၪ့လဖၪ လၧနၥံၪမိဘၪကိၭထၪ့လၧဆၧ ကိၭကီၪ့ဆံၫ့ဎံၪလဖၪ ဘဲၫၥိၭၦမိလုထၪ့ယဟိဝၩ လၧ ဆၧလုမၩလၧမ့ၪ,ဒဲဆၧမၩဘိၪ့ကိၪမုၬ, ဆၧလုထၪ့ဆၧ, ဒဲဆၧလုအီၩလဖၪ, ဒဲဆၧထီးအလူၬလၧလနံၩဒၪဝ့ၫအ",
			"38": "<sup>38</sup> ဖၧၩ့လီၫ.- လၧယဟိဝၩအမးၥံၫအနံၩလဖၪအမ့ၬယၫ, ဒဲလၧနၥံၪမၩဘိၪ့လဖၪ အမ့ၬယၫ, ဒဲလၧနၥံၪမၩဘိၪ့ ဘၪဆဲၫ့လၧနၥံၪဆိၪလၩ့ နၥံၪအၥၭထီးအလူၬ အမ့ၬ ယၫဒဲလၧနၥံၪမၩဘိၪ့ဒၪဆၧထီးအလူၬ လၧနၥံၪဖ့ၪလၫ့ ယဟိဝၩအမ့ၬယၫတၭ, ဆၧနီၪလဖၪအီၪဒံၭဆ့လီၫ.",
			"39": "<sup>39</sup> လၧလၩနွ့ၫဘံၪ့လဘံၪ့, လၩထၪ့လဆံၫယဲနံၩလနံၩနီၪ ထီးနၥံၪအၪ့ထုၫ့ဂၪ့ခိၪအၥၪဂီၩ့တၭ, နၥံၪမိဘၪမၩဘိၪ့ ဆၧလၧယဟိဝၩလီၫ. မုခၪ့ထံၭနီၪမွဲမးၥံၫအနံၩဒဲဎိၭ",
			"40": "<sup>40</sup> နံၩလနံၩနီၪမွဲမးၥံၫအနံၩလီၫ.- တၭမုခၪ့ထံၭနီၪနၥံၪ ဘၪမၩန့ၥံၪ့အဎံၫအလၩ အထဲၩ့လဖၪ ဒဲစီၩ့မလီၫ့အ ထဲၩ့, ဒဲၥံၪ့ထဲၩ့လၧအလၪအၪ, ဒဲထံၫချိၬအဝံဟၫ့လီၫ. တၭနၥံၪဘၪၥုၪ့ထိၬၥၭထိၬ လၧယဟိဝၩနၥံၪအယွၩအ",
			"41": "<sup>41</sup> မ့ၬယၫနွ့ၫနံၩလီၫ.- တၭနၥံၪဘၪမၩဝ့ၫလၧဆၧဘိၪ့လၧ ယဟိဝၩအဂးလနံၪ့ အထးဖၧၩ့နွ့ၫနံၩလီၫ. မွဲဆၧအ ထူၫအရူၫအဆိၩအကၠၪလၩ့လၧနၥံၪ အဆၨၩအဆၬ လဆိၩဘၪလဆိၩလီၫ. နၥံၪဘၪမၩဘိၪ့ဆၧနီၪ လၧ",
			"42": "<sup>42</sup> လၩနွ့ၫဘံၪ့လဘံၪ့အဖၧၩ့လီၫ.- နၥံၪဘၪအီၪလၧတဲၩ ဖၧၩ့နွ့ၫနံၩလီၫ. ကယဲၦလၧအအီၪဖျဲၪ ၦအံၫစရ့လၭ",
			"43": "<sup>43</sup> ဖိၪထီးအလူၬနီၪ ဘၪအီၪဝ့ၫလၧတဲၩဖၧၩ့,- ဘဲၫၥိၭန ၥံၪအဆၨၩအဆၬ မိၥ့ၪယၫလၧထီးယဒုၭစဲၪ့ထၪ့ခွံၬၦ အံၫစရ့လၭဖိၪ လၧခးအံဇံၭအဖၧၩ့တၭ, ယဒုၭအီၪဝ့ၫ လၧတဲၩဖၧၩ့လီၫ. ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩ နၥံၪ အယွၩလီၫ.",
			"44": "<sup>44</sup> တၭစမိစ့ၭလီၩဘၪ ၦအံၫစရ့လၭဖိၪ လၧယဟိဝၩ အဆၧမၩဘိၪ့လဖၪနီၪလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, မၪလူၬ ၦအံၫစရ့လၭဖိၪ, လၧအမိဂဲၫဆိၬန့နၧၩ လၧၥံၪ့အလဲ အိၫ့ၥိၪဆံၫ့ထီးအၥၭလၧဆၧဖၩ့အဂး, ဘဲၫၥိၭအမိဒုၭ",
			"3": "<sup>3</sup> ခဲၩထၪ့မ့ၪဒိၩ့လထံၪဎးဘီၩ့ဎးလီၫ.- တၭစအၫရၧၫ့ ဘၪတဲၩ့ဝဲၩဝ့ၫ လၧဆၧအုၩ့လၩ့ အကလကၫဘျၭထၪ့ အၥၭလၧခီၫ့ လၧဆၧအီၪကီၪ့အတဲၩဆဲၫ့ဎံၪအဖၧၩ့ လၧ မုဂၪလၩ့ထီၩ့လၧမုဂီၩ လၧယဟိဝၩအမ့ၬယၫလထံၪ ဎးဘီၩ့ဎးလီၫ. မွဲဆၧအထူၫအရူၫအဆိၩအကၠၪလၩ့",
			"4": "<sup>4</sup> လၧနၥံၪအဆၨၩအဆၬလဆိၩဘၪလဆိၩလီၫ.- မွဲအ မိဘၪတဲၩ့ဝဲၩမ့ၪဒိၩ့လဖၪ လၧမ့ၪဒိၩ့မိၡါဆံၫ့အဖၫ့ခိၪ လၧယဟိဝၩအမ့ၬယၫ လထံၪဎးဘီၩ့ဎးလီၫ.",
			"5": "<sup>5</sup> တၭနဘၪမၩန့ကိၪမုၬ ဒဲအၪ့ဎူကိၪလဆံၫနံၫဘံၪ့လၧ အဝ့ၫလီၫ. ကိၪမုၬနံၫအ့စရိၫလၧလဘံၪ့လဘံၪ့အဖၧၩ့",
			"6": "<sup>6</sup> လီၫ.- တၭနဘၪအီၪက့ၪဝ့ၫလၧနံၫပိၩ့, လပိၩ့ဎူၫဖျိၪ့, လပိၩ့ဎူၫဖျိၪ့ဒၩ့ဒိၭလိၬအၥၭနီၪ လၧစပွဲဆံၫ့ဎံၪ အဖၫ့",
			"7": "<sup>7</sup> ခိၪလၧယဟိဝၩအမ့ၬယၫလီၫ.- တၭနဘၪအီၪက့ၪလီ ဘၫ့ဆံၫ့လၧလပိၩ့လပိၩ့အဖၫ့ခိၪ, ဘဲၫၥိၭအမိအီၪလၧ ကိၪအဖၫ့ခိၪလၧဆၧနၪ့ထၪ့ထဲၩ့ဆၧအဂး, ဆၧလုမၩ",
			"8": "<sup>8</sup> လၧမ့ၪလၧယဟိဝၩအဂးလီၫ.- တၭဆၧဘၪတဲၩ့ဝဲၩ ဝ့ၫကိၭမးၥံၫအနံၩဒ့ၭ, လၧယဟိဝၩအမ့ၬယၫလထံၪ ဎးဘီၩ့ဎးနီၪ, န့ဘၪယူၭ လၧၦအံၫစရ့လၭဖိၪၥံၪလၧ",
			"9": "<sup>9</sup> ဆၧအုၩ့လၩ့အဆိၩအကၠၪအကၠီၩ့နီၪလီၫ.- တၭမိကဲၪ ထၪ့စအၫရၧၫ့ဒဲအဖိၪခွၫလဖၪအဆၧတၭ, အဝ့ၫၥံၪဘၪ အၪ့ဝ့ၫ လၧဆၧအလးဆံၫ့ဎံၪ အဖၧၩ့လီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫနီၪ မွဲဆၧဆံၫ့ဎံၪထုၬလၧအဂး လၧဆၧလု မၩလၧမ့ၪ လၧယဟိဝၩအဂးအကျၩလီၫ. မွဲဆၧအ ထူၫအရူၫအဆိၩအကၠၪလီၫ.",
			"10": "<sup>10</sup> တၭၦအံၫစရ့လၭမုၪအဖိၪခွၫ လၧအဖါမွဲၦအံဇံၭ ဖိၪလဂၩ လ့ၩထၪ့လၧၦအံၫစရ့လၭဖိၪ အကျၩလီၫ. တၭၦအံၫစရ့လၭမုၪ အဖိၪခွၫလဂၩနီၪ အဲၪ့လိၬဆိၭ ချဲၩ့လိၬအၥၭ လၧၦအံၫစရ့လၭဖိၪလဂၩ လၧၦၥုၪ့တဲၩ",
			"11": "<sup>11</sup> အလးဖၧၩ့လီၫ.- ၦအံၫစရ့လၭမုၪအဖိၪခွၫလဂၩနီၪ ဒုၪဒွ့ၪယဟိဝၩအမံၩ့, ဒဲဆိၪအၧၩ့ဆၧလီၫ. တၭအဝ့ၫ ၥံၪလ့ၩဆိၬဝ့ၫလၧစမိစ့ၭအအီၪလီၫ. (တၭအမိအမံၩ့ မွဲနးၡံလိၫမ့ၭ, စဒၫ့အဒီၪ့ဖိၪစဒံၭဘြဲၫအဖိၪမုၪလီၫ.)",
			"12": "<sup>12</sup> တၭအဝ့ၫၥံၪအီၪက့ၪဝ့ၫ လၧဆၧခိၭထၬအဖၧၩ့ ထီးဆၧ",
			"13": "<sup>13</sup> မိဒုၭနဲၪယဟိဝၩအၥၭလီၫ.- ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ",
			"14": "<sup>14</sup> တၭ,စံၭဝ့ၫဒၪ,- ဂဲၫဆိၬထၪ့ၦလၧအဆိၪအၧၩ့ဆၧလၧ ၦၥုၪ့တဲၩအလးလၧခီၫ့လခီၫတၭ, ကယဲၦလၧအနါဂၧၫ့ ဆၧနီၪမွဲအအီၪက့ၪအစူၪလၧအခိၪတၭ, ကယဲဆၧအီၪ",
			"15": "<sup>15</sup> ကီၪ့ဖိၪထီးအလူၬနီၪ, ခွံၬဝ့ၫလၧလိးဆံၭ.- တၭနဘၪ ချဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪ, စံၭ, ထီးဒၪၦလၧအဆိၪ အၧၩ့အယွၩလဂၩဂၩနီၪ မိဘၪထိးအဆၧဒဲၩဘၭလီၫ.",
			"16": "<sup>16</sup> တၭၦလၧအဒုၪဒွ့ၪယဟိဝၩအမံၩ့နီၪ မိဘၪဆၧမၩၥံၫ တၡါဝ့ၫလီၫ. ၦဆၧအီၪကီၪ့ဖိၪထီးအလူၬ မိဘၪခွံၬတ ၡါလၧလိးလီၫ. ဘဲၫၦလခီၫဘၩ့မုးဖိၪအၥိၭ ၦအီၪဖျဲၪ လၧခးဖၧၩ့ မွဲဘဲၫနီၪအၥိၭ ထီးအဒုၪဒွ့ၪဘၪယဟိဝၩ အမံၩ့တၭ, မိဘၪဆၧမၩၥံၫတၡါဝ့ၫလီၫ.",
			"17": "<sup>17</sup> တၭၦလၧအမၩၥံၫၦၡၩလဂၩဂၩနီၪ မိဘၪဆၧမၩ",
			"18": "<sup>18</sup> ၥံၫတၡါဝ့ၫလီၫ.- တၭၦလၧအမၩၥံၫဆၧဖိၪဆၧဎါအ ဒိၩ့လဒုၩနီၪ မိဘၪဖ့ၪလၫ့ထဲၩ့လဒုၩ လၧလဒုၩအဂး",
			"19": "<sup>19</sup> လီၫ.- ၦၡၩလၧအမၩဂၭဂီၩ့ ၦလၧအနဲၩ့ထံၭအခံးအ ဂၩ့လမံၩ့မံၩ့တၭ, ဘဲၫအမၩဆၧအၥိၭနီၪ ဆၧမိမၩဆၧၫ့",
			"20": "<sup>20</sup> လၧအလီၩ့ဘဲၫနီၪအၥိၭလီၫ.- ဆၧခါလၧဆၧခါအဂး, မ့ၬလတီၪ့လၧမ့ၬလတီၪ့အဂး, ၥွၪလဘံၪ့, လၧၥွၪလ ဘံၪ့အဂးလီၫ. ဘဲၫအမၩဆၧလၧၦၡၩအလီၩ့အၥိၭ",
			"21": "<sup>21</sup> နီၪ,ဆၧမိမၩလၧအလီၩ့ဒၪဝ့ၫ ဘဲၫနီၪအၥိၭလီၫ.- တၭၦ လၧအမၩၥံၫဆၧဖိၪဆၧဎါအဒိၩ့လဒုၩနီၪ ဘၪဖ့ၪလၫ့ ထဲၩ့လီၫ. တၭၦလၧအမၩၥံၫၦၡၩလဂၩနီၪ မိဘၪဆၧ",
			"22": "<sup>22</sup> မၩၥံၫဝ့ၫလီၫ.- တၭနၥံၪဘၪအီၪလၧဆၧစ့ၩရၫ့လမံၩ့ ဎး, ဘဲၫၦလခီၫဘၩ့မုးဖိၪအၥိၭ, ၦအီၪဖျဲၪလၧခးဖၧၩ့ ဘဲၫနီၪအၥိၭလီၫ. အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယီၩယမွဲယ ဟိဝၩနၥံၪအယွၩလီၫ.",
			"23": "<sup>23</sup> တၭစမိစ့ၭလီၩဘၪၦအံၫစရ့လၭဖိၪ လၧအမိဘၪဂဲၫ ဆိၬၦလၧအဆိၪအၧၩ့ဆၧလဂၩ လၧၦၥုၪ့တဲၩအလး လၧခီၫ့တၭ, ခွံၬအဝ့ၫလၧလိးလီၫ. တၭၦအံၫစရ့လၭ ဖိၪမၩဝ့ၫဘဲၫယဟိဝၩမၪလူၬ စမိစ့ၭအၥိၭနီၪလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭ လၧခိၪလီၩ့စဲနၫအလီၩ့",
			"2": "<sup>2</sup> တၭ, စံၭဝ့ၫဒၪ,- ချဲၩ့ဆၧလၧၦအံၫစရ့လၭဖိၪတၭ, စံၭ အဝ့ၫၥံၪ, ထီးနၥံၪဂဲၫနုၬလၧခး လၧယဖ့ၪလၫ့နၥံၪနီၪ တၭ,ဂၪ့ခိၪဘၪအီၪပွံၭမးၥံၫ လၧယဟိဝၩအဂးလီၫ.",
			"3": "<sup>3</sup> ဎူၫနံၪ့နီၪနမိဎွံၪဘၪဆၧလၧနဆံၬဖၧၩ့, ဒဲဎူၫနံၪ့နီၪ နမိ ဖ့ၬခိၫဆံၫ့ထၪ့ဘၪနစဘံၭမုအလး, ဒဲအၪ့ထုၫ့ကီၪ့အၥၪ",
			"4": "<sup>4</sup> လီၫ.- အ့ၪမွဲနွ့ၫနံၪ့လနံၪ့နီၪ မိကဲၪထၪ့ဆၧအီၪပွံၭအ မးၥံၫလၧဂၪ့ခိၪအဂး, မးၥံၫလၧယဟိဝၩအဂးလီၫ. ဎွံၪဆၧလၧနဆံၬဖၧၩ့လဂ့ၩ, ဒဲဖ့ၬခိၫဆံၫ့နစဘံၭမု အ",
			"5": "<sup>5</sup> လးလဂ့ၩ.- ဆၧလၧအမဲၪထၪ့ဒၪဆၧလၧနကူၭဘုၪအ လးနီၪနကူၭဘၪအ့ၬ, ဒဲနစဘံၭမုလၧနအီၪက့ၪလၩ့မဲၩ ဒၪဆၧနီၪနအၪ့မၩဘၪအၥၪအ့ၬ. မွဲဆၧအီၪပွံၭလၧနံၪ့",
			"6": "<sup>6</sup> လၧဂၪ့ခိၪအဂးလီၫ.- တၭဂၪ့ခိၪအမးၥံၫနီၪကဲၪထၪ့ ဆၧအၪ့လၧနၥံၪအဂး, ဒဲလၧနဎီးခွၫအဂး, ဒဲလၧနဎီးမုၪ အဂး, ဒဲလၧနၡၩဒိၭအၪ့လံၩ့အၥၭအဂး, ဒဲၦလခီၫဘၩ့",
			"7": "<sup>7</sup> မုးဖိၪလၧအအီၪလၧနၥိၭအဂး,- ဒဲလၧဆၧဖိၪဆၧဎါ အဒိၩ့အဂး, ဒဲဆၧဖိၪဆၧဎါအမံၩ့ လၧနခးဖၧၩ့အဂး နီၪ, ဆၧမဲၪထၪ့လဖၪ မိကဲၪထၪ့အဆၧအၪ့လီၫ.",
			"8": "<sup>8</sup> နဘၪဝံထၪ့နၬထၪ့ နွ့ၫမးၥံၫအနံၩ လဖၪအနံၪ့ၥံၪ, နွ့ၫနံၪ့နွ့ၫဘျၩ့လီၫ. တၭမးၥံၫနွ့ၫမးၥံၫ အမုနံၩလဖၪ",
			"9": "<sup>9</sup> နီၪမိကဲၪထၪ့လံဆံၫခွံၫနံၪ့လၧနဂးလီၫ.- တၭလၧလၩ နွ့ၫဘံၪ့လဘံၪ့ လၩထၪ့ဆံၫနံၩ လနံၩနီၪ နဘၪဒုၭၥီၫ ထၪ့ယုဘလံၫအခွ့ၩၥီၫဖၭဒိၪတၭး လၧဆၧမၩဖီၩ့ဖျ့ၭ အမုလနံၩနီၪ နဘၪဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ ခွ့ၩအၥီၫ လၧ",
			"10": "<sup>10</sup> နၥံၪအခးဎံၩ့ဎံၩ့လ့ၬလီၫ.- နံၪ့ယဲဆံၫအနံၪ့လနံၪ့နီၪန ၥံၪဘၪအီၪက့ၪဆံၫ့ဎံၪ, ဒဲဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ဆၧဖီၩ့ ဖျ့ၭလၧၦခးဖိၪထီးအလူၬအဂး လၧခးဖၧၩ့ထၧၫ့ခးယၫ လီၫ. မိကဲၪထၪ့ယုဘလံၫ လၧနၥံၪအဂးတၭ, နၥံၪမိ ထဲၩ့ထဲၩ့လဂၩ လၧနၥံၪအဆၧန့ၥၫဆုၬဆုၬ, ဒဲနၥံၪမိ ထဲၩ့ထဲၩ့လဂၩ လၧအဂံၪ့ဒီၪ့ဖိၪအအီၪ ဆုၬဆုၬလီၫ.",
			"11": "<sup>11</sup> ဆၧလၧနံၪ့ယဲဆံၫအနံၪ့လနံၪ့နီၪ မိကဲၪထၪ့ယုဘလံၫ လၧနၥံၪအဂးလီၫ. နၥံၪဎွံၪဘၪဆၧအ့ၬ. ဒဲနၥံၪကူၭ ဘၪဆၧလၧအမဲၪထၪ့ဒၪဆၧအ့ၬ. ဒဲအၪ့ထုၫ့ကီၪ့ဘၪန",
			"12": "<sup>12</sup> စဘံၭမုအၥၪလၧနအီၪက့ၪလၩ့မဲၩဒၪဆၧအ့ၬ.- အဂဲး ဘဲၫယီၩ မွဲယုဘလံၫအထီလီၫ. မိဘၪကဲၪထၪ့ ဆၧ ဆံၫ့ဎံၪလၧနၥံၪအဂးလီၫ. နၥံၪဘၪအၪ့အဆၧမဲၪထၪ့",
			"13": "<sup>13</sup> လၧဆၧပျၩ့ဖၧၩ့လီၫ.- လၧယုဘလံၫအနံၪ့နီၪ နၥံၪမိ ထဲၩ့ထဲၩ့လဂၩလၧအဆၧန့ၥၫ, လဂၩလၧအဆၧန့ၥၫ",
			"14": "<sup>14</sup> ဆုၬဆုၬလီၫ.- နအ့ၪအၪ့ဆၫခွံၬ ဆၧလမံၩ့မံၩ့ဒဲၦလၧန နဲၩ့ထံၭမွဲဂ့ၩ, နအ့ၪဎွ့ၩဆၧလၧၦလၧနနဲၩ့ထံၭအစူၪ ဖၧၩ့မွဲဂ့ၩ, နၥံၪမၩၡၪ့မၩနၭလိၬဘၪနၥံၪအၥၭလဂၩဒဲ",
			"15": "<sup>15</sup> လဂၩအ့ၬ.- ဘဲၫနံၪ့ဖီၩ့ခွံၬ ယုဘလံၫအထီ အဆၧဝံ ဆၧနၬအလးခဲၫ့အၥိၭနီၪ, နဘၪဎွ့ၩဆၧလၧၦလၧနနဲၩ့ ထံၭလီၫ. ဘဲၫနံၪ့လၧအဆၧၥၪအီၪအဆၧဝံ ဆၧနၬအ",
			"16": "<sup>16</sup> ၥိၭနီၪ, မိဘၪအၪ့ဆၫဆၧလၧနၧၩလီၫ.- ထီးဒၪအနံၪ့ အၪဝ့ၫအၥိၭနီၪ နဘၪမၩအၪထၪ့အဎွ့ၩလီၫ. ဒဲထီးဒၪ အနံၪ့လၩ့ၡၩအၥိၭနီၪ နဘၪမၩလၩ့ၡၩအဎွ့ၩလီၫ. အ ဂဲးဘဲၫယီၩ ထီးဒၪဆၧဝံထၪ့နၬထၪ့ အဆၧၥၪအၥိၭနီၪ မွဲအအၪ့ဆၫဝ့ၫလၧနၧၩလီၫ.",
			"17": "<sup>17</sup> နၥံၪမၩအၧၩ့လိၬဘၪနၥံၪအၥၭလဂၩ ဒဲလဂၩအ့ၬ. တၭနဘၪၥၭမဲၪနယွၩလီၫ. အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪ ယီၩယမွဲယဟိဝၩ နၥံၪအယွၩလီၫ.",
			"18": "<sup>18</sup> နၥံၪအ့ၪမၩယၥနိၫလဖၪ ဒဲထီးန့ယဆၧစ့ၩရၫ့လဖၪ",
			"19": "<sup>19</sup> ဒဲမၩဝ့ၫတၭး နၥံၪမိအီၪလၧခးဖၧၩ့နီၪခၧၫ့ခၧၫ့လီၫ.- တၭ ဂၪ့ခိၪမိဖ့ၪလၫ့အဆၧၥၪတၭ, နၥံၪမိဘျဲၩအၪ့ဒဲနၥံၪမိအီၪ လၧအဖၧၩ့ခၧၫ့ခၧၫ့လီၫ.",
			"20": "<sup>20</sup> တၭနွ့ၫနံၪ့လနံၪ့နီၪ ပမိအၪ့နီၫလဲၪနီၫလဲၪနီၪ, ယိခွါ, ပဎွံၪဘၪဆၧအ့ၬး ဒဲပအၪ့ထုၫ့ဘၪ အဆၧၥၪထၪ့နီၪ",
			"21": "<sup>21</sup> အ့ၬး နၥံၪအ့ၪစံၭတၭ,- ယမိမၪလူၬယဆၧဆိၪဂ့ၩလၧ နၥံၪအလီၩ့လၧဎူၫနံၪ့လနံၪ့အထးဖၧၩ့တၭ, မိၥၪထၪ့",
			"22": "<sup>22</sup> လၧၥၧၫ့နံၪ့အဂးလီၫ.- တၭဎိၭနံၪ့လနံၪ့နီၪနၥံၪဘၪဎွံၪ ဆၧဒဲအၪ့ဆၧၥၪလးလံၩ ထီၩ့လၧခွံၫနံၪ့လနံၪ့, ထီးအ ဆၧလချႃၭၥၪထၪ့ဒံၭဘၪတၭ, နၥံၪမိအၪ့ဘၪအလး လံၩလီၫ.",
			"23": "<sup>23</sup> ဂၪ့ခိၪဘၪဆၧအၪ့ဆၫလၩ့ဝ့ၫ အဆိၩအကၠၪအ့ၬ. အဂဲးဘဲၫယီၩ ဂၪ့ခိၪနီၪမွဲယဆၧလီၫ. တၭနၥံၪမွဲၦလ",
			"24": "<sup>24</sup> ခီၫဘၩ့မုးဖိၪ, ဒဲၦမွံၩလၧယမ့ၬယၫလီၫ.- တၭလၧဂၪ့ ခိၪလၧနၥံၪန့ဘၪထၧၫ့ဘံၪ့ယၫနီၪ, နၥံၪမိဘၪဖ့ၪလၫ့",
			"25": "<sup>25</sup> ၦဎွ့ၩန့ထဲၩ့အဂၪ့ခိၪလီၫ.- နထၧၫ့ဖုဝဲလဂၩအ့ၪလၩ့ ၡၪ့,ဒဲအၪ့ဆၫယူၭအဆၧန့ဘၪနီၪ, အဘူၭအထံးလဂၩ ဂၩအ့ၪဎွ့ၩန့ထဲၩ့ဆၧနီၪ ဘၪဎွ့ၩန့ထဲၩ့ဆၧလၧအထၧၫ့",
			"26": "<sup>26</sup> ဖုဝဲအၪ့ဆၫခွံၬဝ့ၫလီၫ.- တၭၦလဂၩနီၪအၡၩဎွ့ၩန့ထဲၩ့ ဆၧအ့ၪလအီၪဘၪ, ဒဲအနၫ့ဆါဎွ့ၩန့ထဲၩ့အ့ၪၥ့ၪတၭး",
			"27": "<sup>27</sup> ထီးနီၪလဖၧၫ့ လၧအအၪ့ဆၫဆၧလံၩလံၩနီၪ, မွဲအဝံ ထၪ့အနံၪ့အလၩ, ဒဲလၧဆၧအၪထၪ့ဒံၭအဂးနီၪ, မွဲအ ဖ့ၪလၫ့ထဲၩ့ၦၡၩ လၧအအၪ့ဆၫဒၪဆၧလၧအဝ့ၫ, ဘဲၫ",
			"28": "<sup>28</sup> ၥိၭအဝ့ၫဒၪမိန့ဘၪထဲၩ့ အဆၧဖီၪ့ထၬနီၪဆံၭ.- ဆၧအ ကြၨၭအဘၪလၧအမိဖ့ၪလၫ့ဝ့ၫနီၪ, မၩဝ့ၫအ့ၪလၥ့ၪဘၪ တၭ, ထီးနီၪလဖၧၫ့ ဆၧလၧအဘၪဆၧအၪ့ဆၫခွံၬဝ့ၫ နီၪမိအီၪ လၧၦလၧအဎွ့ၩဝ့ၫအစူၪဖၧၩ့ ထီးယုဘလံၫ အနံၪ့လီၫ. တၭလၧယုဘလံၫအနံၪ့နီၪ မိစဲၪ့ထၪ့ခွံၬ တၭ, ၦလဂၩမိန့ဘၪထဲၩ့အဆၧဒၪဝ့ၫလီၫ.",
			"29": "<sup>29</sup> ၦအ့ၪအၪ့ဆၫခွံၬ ၦအီၪဝ့ၫအဂံၪ့လဖျိၪ့ လၧဒိၩ့အီၪ လၧအခိၪဒၧၩ့အဖၧၩ့တၭ, လၧအအၪ့ဆၫဝ့ၫအလးခဲၫ့ ထၧၫ့နံၪ့ယၫနီၪဆၧအ့ၪဖ့ၪအဎွ့ၩန့ထဲၩ့ဝ့ၫလီၫ. ထၧၫ့ နံၪ့ယၫအထးဖၧၩ့နီၪ ဆၧအ့ၪဖ့ၪအဎွ့ၩန့ထဲၩ့ဝ့ၫလီၫ.",
			"30": "<sup>30</sup> အ့ၪလဎွ့ၩန့ထဲၩ့ဘၪ လၧထၧၫ့နံၪ့ယၫအထးဖၧၩ့တၭ, ထီးနီၪလဖၧၫ့ဂံၪ့လၧအအီၪလၧဒိၩ့အီၪ လၧအခိၪဒၧၩ့ လဖျိၪ့အဖၧၩ့မိအီၪဂုးအီၪခၧၫ့လၧၦလၧအဎွ့ၩန့ဝ့ၫလၩ့ လၧအဆၨၩအဆၬ လဆိၩဘၪ လဆိၩလီၫ. စဲၪ့ထၪ့",
			"31": "<sup>31</sup> ဘၪလၧယုဘလံၫအနံၪ့အ့ၬ.- အ့ၪမွဲဂံၪ့ၥံၪဎၫ့ၥံၪ အီၪဝ့ၫလၧတဝၩ့လၧအခိၪဒၧၩ့ဝၬဖီၩ့ဝ့ၫလအီၪဘၪလ ဖၪနီၪဆၧမိဘၪအီၪက့ၪဝ့ၫ ဘဲၫဆံၬၥံၪနၩၥံၪလၧခီၫ့အ ၥိၭနီၪလီၫ. ဆၧဖ့ၪၦဎွ့ၩန့ထဲၩ့ဝ့ၫတၭ, မိစဲၪ့ထၪ့လၧ",
			"32": "<sup>32</sup> ယုဘလံၫအနံၪ့လီၫ.- မွဲလါနၫ့ ၦလံဝဲၫဖိၪအဒိၩ့လ ဖၪနီၪ, ဒဲအဝ့ၫၥံၪအဂံၪ့အဎၫ့ လၧအဒိၩ့လၧအကဲၪထၪ့ အဆၧဖီၪ့ထၬနီၪ ဆၧဖ့ၪၦလံဝဲၫဖိၪဎွ့ၩန့ထဲၩ့ထီးဒၪအ",
			"33": "<sup>33</sup> ဆၧၫ့အထီဘၪလီၫ.- တၭၦအ့ၪဎွ့ၩန့ဆၧလၧၦလံဝဲၫ ဖိၪ,အဂံၪ့လၧဆၧအၪ့ဆၫဝ့ၫ, ဒဲဒိၩ့လၧအကဲၪထၪ့အ ဆၧဒၪဝ့ၫ မိဘၪစဲၪ့ထၪ့ခွံၬ လၧယုဘလံၫ အထီလီၫ. အဂဲးဘဲၫယီၩ, ဂံၪ့ၥံၪဎၫ့ၥံၪလၧၦလံဝဲၫဖိၪအဒိၩ့ဖၧၩ့ နီၪမွဲအဆၧဒၪဝ့ၫ လၧၦအံၫစရ့လၭဖိၪအကျၩလီၫ.",
			"34": "<sup>34</sup> အဆံၬအနၩ လၧအဒိၩ့နဲၩ့လဖၪနီၪ ဘၪဆၧအၪ့ဆၫ ခွံၬဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩ မွဲအဝ့ၫၥံၪအဆၧဒၪဝ့ၫအဆိၩ အကၠၪလီၫ.",
			"35": "<sup>35</sup> တၭနထၧၫ့ဖုဝဲအ့ၪလၩ့ၡၪ့, ဒဲအစူၪအ့ၪလၩ့ဆါနီၪ, မွဲၦလခီၫဘၩ့မုးဖိၪမွဲဂ့ၩ, ၦမွံၩမွဲဂ့ၩတၭ, ဘဲၫၥိၭအမိ အီၪလၧနၥိၭ, နဘၪဒုၭဆီၪ့ထၪ့ အဂဲးအဘၭလီၫ.",
			"36": "<sup>36</sup> စ့ၩအအ့ၪမွဲဂ့ၩ, ဆၧအၪထၪ့မွဲဂ့ၩ, မၩန့လၧအဝ့ၫလ ဂ့ၩ,ၥၭမဲၪယွၩ, ဒဲဒုၭမၧၫ့ထၪ့နထၧၫ့ဖုဝဲလၧနၥိၭဆံၭ.",
			"37": "<sup>37</sup> ထီးဒုၭအၪ့လီးအဝ့ၫလၧနစ့ၩ လၧဆၧအအ့ၪအဂးလ ဂ့ၩတၭ, နဘၪဖ့ၪဝ့ၫလၧနဆၧအၪ့လၧဆၧအၪထၪ့အ",
			"38": "<sup>38</sup> ဂးအ့ၬ.- ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩ နၥံၪအယွၩလၧ အဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪ လၧခးအံဇံၭအဖၧၩ့, ဘဲၫၥိၭယ မိဖ့ၪလၫ့နၥံၪ လၧခးကၫနအၫ့ ဒဲကဲၪထၪ့နၥံၪအယွၩ လီၫ.",
			"39": "<sup>39</sup> နထၧၫ့ဖုဝဲလၧနနဲၩ့ထံၭအ့ၪလၩ့ၡၪ့, ဘၪဆၧအၪ့ ဆၫဝ့ၫလၧနစူၪဖၧၩ့တၭ, နအၪ့မၧၫ့ဘၪအမၩနဎီးနၡၩ",
			"40": "<sup>40</sup> အဆၧအ့ၬ.- အ့ၪမွဲဘဲၫၦဒိၭအၪ့လံၩ့အၥၭအၥိၭနီၪ, ဘဲၫၦမွံၩအၥိၭနီၪ မိဘၪအီၪလၧနၥိၭလီၫ. မိမၩနဆၧ",
			"41": "<sup>41</sup> ထီၩ့လၧယုဘလံၫအနံၪ့လီၫ.- ထီးနီၪလဖၧၫ့ မိစဲၪ့ ထၪ့ဘၪလၧနအီၪ, အဝ့ၫနီၪဒဲအဖိၪအလံၩအီၪလၧအ ၥိၭတၭ, မိထဲၩ့ထဲၩ့ဘၪလၧအၡၩအဂံၪ့ဒီၪ့ဒၪဝ့ၫအအီၪ, ဒဲအဖါလဖၪ အဆၧဖီၪ့ထၬ အအီၪနီၪမိထဲၩ့ထဲၩ့ဘၪ",
			"42": "<sup>42</sup> ထီးနီၪလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪနီၪ မွဲယခ့ၫယ ၡၩလၧယဒုၭစဲၪ့ထၪ့ခွံၬ လၧခးအံဇံၭအဖၧၩ့နီၪလီၫ. ဘၪဆၧအၪ့ဆၫခွံၬဝ့ၫ ဘဲၫဆၧအဎီးအၡၩ အၥိၭနီၪ",
			"43": "<sup>43</sup> အ့ၬ.- နအၪ့မၧၫ့ဘၪလၧနစူၪဆီၪ့နခၪ့ဆီၪ့အ့ၬ. အ့ၪမွဲ",
			"44": "<sup>44</sup> နဘၪၥၭမဲၪနယွၩလီၫ.- နဎီးခွၫလဖၪ, ဒဲနဎီးမုၪလဖၪ လၧအမိအီၪဘၪအၥၭ လၧနစူၪဖၧၩ့နီၪ မိမွဲၦဆၨၩလ ဖၪအဖိၪလၧအအီၪဝၬဖီၩ့နၥံၪလီၫ. နၥံၪမိန့ဘၪဎီးခွၫ,",
			"45": "<sup>45</sup> ဒဲဎီးမုၪလၧအဝ့ၫၥံၪလီၫ.- နၥံၪမိန့ဘၪဆ့လၧၦဆၨၩ ဂူၫဂၩလဖၪအဖိၪလၧအအီၪဝ့ၫ လၧနၥံၪအကျၩ, ဒဲလၧ အဂံၪ့ဒီၪ့ဖိၪ လၧအအီၪလၧနၥံၪအကျၩ, လၧအထၪ့ဖိၪ လၧနၥံၪအခးဖၧၩ့တၭ, မိကဲၪထၪ့ဝ့ၫလၧနၥံၪအဆၧ",
			"46": "<sup>46</sup> လီၫ.- တၭနၥံၪမိန့ၥၫအဝ့ၫၥံၪ လၧနၥံၪအဖိၪအလံၩအ ဂးလၧနၥံၪအလးခဲၫ့နီၪ, ဘဲၫၥိၭအမိန့ၥၫဝ့ၫလၧအဆၧ ဒၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪလီၫ. အ့ၪမွဲနၥံၪအထၧၫ့ ဖုဝဲၦအံၫစရ့လၭဖိၪယီၩ နၥံၪပၧၩ့လိၬဘၪနၥံၪအၥၭ ဆုၬဆုၬလၧနၥံၪအစူၪဆီၪ့အ့ၬ.",
			"47": "<sup>47</sup> ၦလခီၫဘၩ့မုးဖိၪမွဲဂ့ၩ, ၦမွံၩမွဲဂ့ၩ,အ့ၪထူၭထၪ့လၧၫ့ ထၪ့လၧနၥံၪအနဲၩ့ထံၭတၭ, နထၧၫ့ဖုဝဲအီၪလၧအနဲၩ့ ထံၭအ့ၪၡၪ့လၩ့ ဒဲဘၪအၪ့ဆၫခွံၬအၥၭ လၧၦလခီၫ ဘၩ့မုးဖိၪမွဲဂ့ၩ, ၦမွံၩမွဲဂ့ၩ, လၧၦလခီၫဘၩ့မုးအဂံၪ့",
			"48": "<sup>48</sup> ဒီၪ့ဖိၪမွဲဂ့ၩ, အီၪလၧနနဲၩ့ထံၭတၭ,- အၪ့ဆၫလၩ့ခွံၬ အၥၭအလးခဲၫ့နီၪ, ဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫၥ့ၪဒံၭလီၫ. အထၧၫ့",
			"49": "<sup>49</sup> ဖုဝဲလဂၩဂၩမိဎွ့ၩန့ထဲၩ့ဘၪဝ့ၫလီၫ.- အမၩ့မွဲဂ့ၩ, အ မၩ့အဖိၪခွၫမွဲဂ့ၩ, မိဎွ့ၩန့ထဲၩ့ဘၪဝ့ၫလီၫ. အဘူၭအ ထံးလၧအဒီၪ့ဒၪဝ့ၫ လဂၩဂၩ မိဎွ့ၩန့ထဲၩ့ဘၪဝ့ၫလီၫ. အနၫ့ဆါမၩဝ့ၫအ့ၪၥ့ၪနီၪ မိဎွ့ၩန့ထဲၩ့လၩ့ဒၪအၥၭလီၫ.",
			"50": "<sup>50</sup> မိဘၪဝံထၪ့နၬထၪ့ဆၧလၧ ၦလၧအဎွ့ၩန့အဝ့ၫလၧအ နံၪ့လၧအအၪ့ဆၫခွံၬအၥၭနီၪ ထီၩ့လၩ့လၧယုဘလံၫ အနံၪ့တၭ, အဆၧဎွ့ၩအစ့ၩနီၪ မိမွဲဘဲၫအနံၪ့အလၩအ ၥိၭနီၪလီၫ. မိမၩအၥၭဘဲၫၦဒိၭအၪ့လံၩ့အၥၭအမုနံၩ",
			"51": "<sup>51</sup> လဖၪအၥိၭနီၪလီၫ.- အ့ၪအီၪဒံၭ အၪနံၪ့တၭး ဘဲၫ အဝ့ၫၥံၪအၥိၭနီၪ မိဘၪဖ့ၪအဆၧဎွ့ၩန့ထဲၩ့အဎွ့ၩလၧ",
			"52": "<sup>52</sup> စ့ၩအဖၧၩ့လၧဆၧဎွ့ၩဝ့ၫအဂးလီၫ.- အ့ၪအီၪဒံၭၡၩ နံၪ့ထီၩ့လၧယုဘလံၫအနံၪ့တၭ, ဘၪဝံထၪ့နၬထၪ့ဆၧ လၧအဝ့ၫတၭ, ဘဲၫအနံၪ့အီၪဝ့ၫအၥိၭနီၪမိဘၪဖ့ၪထဲၩ့",
			"53": "<sup>53</sup> အဆၧဖ့ၪထဲၩ့ အဎွ့ၩလီၫ.- ဘဲၫၦဒိၭအၪ့လံၩ့အၥၭ လၧလနံၪ့လနံၪ့အၥိၭနီၪ ဆၧမိမၩအၥၭလၧအဝ့ၫဒၪ တၭ,ပၧၩ့ဘၪဝ့ၫလၧအစူၪဆီၪ့အခၪ့ဆီၪ့ လၧနမ့ၬယၫ",
			"54": "<sup>54</sup> အ့ၬ.- အ့ၪလဎွ့ၩန့ထဲၩ့ဘၪဝ့ၫ လၧဆၧလဖၪနီၪတၭ, မိစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧယုဘလံၫအနံၪ့, အဝ့ၫနီၪ ဒဲအဖိၪ",
			"55": "<sup>55</sup> အလံၩလီၫ.- အဂဲးဘဲၫယီၩ ၦအံၫစရ့လၭဖိၪမွဲဆၧ အခ့ၫအၡၩလၧယဂးလီၫ. အဝ့ၫၥံၪနီၪမွဲယခ့ၫယၡၩ လၧယဒုၭစဲၪ့ထၪ့ခွံၬ လၧခးအံဇံၭအဖၧၩ့လီၫ. ယဝ့ၫ ဒၪယီၩယမွဲယဟိဝၩ နၥံၪအယွၩလီၫ."
		},
		"26": {
			"1": "<sup>1</sup> ဆၧဂၩ့ဆၧဖၪ့မွဲဂ့ၩ, ဆၧဂၩ့စိၭဖျၩအၥၭမွဲဂ့ၩ, ထီး တဲၩ့လၧနၥံၪအဂးလဂ့ၩတၭ, ထီးဘီၩ့ထၪ့ဆၧအထုၪ့ လဂ့ၩ. ထီးအီၪက့ၪလိး အီၪလၧဆၧဂၩ့လဖၪလၧအ လီၩ့လၧနၥံၪအခးဖၧၩ့, ဘဲၫၥိၭနၥံၪမိဘၩဝ့ၫနီၪလဂ့ၩ, အဂဲးဘဲၫယီၩ ယမွဲယဟိဝၩနၥံၪအယွၩလီၫ.",
			"2": "<sup>2</sup> နၥံၪဘၪထီးန့ယမးၥံၫအနံၩလဖၪ, ဒဲယူၭယၪ့ယလး",
			"3": "<sup>3</sup> ဆံၫ့ဎံၪလီၫ. ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩလီၫ.- နၥံၪ အ့ၪလ့ၩဆၧလၧယၥနိၫလဖၪအဖၧၩ့, ဒဲထီးန့ယဆၧ",
			"4": "<sup>4</sup> မၪလူၬၥံၪ, ဒဲမၩအဝ့ၫၥံၪတၭ,- ယမိဖ့ၪလၫ့နၥံၪလၧဆၧ ဆၧၩ့လၧအဆၧၫ့အထီဒၪဝ့ၫ, ဒဲဂၪ့ခိၪမိဖ့ၪလၫ့အဆၧ အၪထၪ့, ဒဲၥံၪ့ၥံၪဝၪၥံၪ့လၧမံၩ့လၬကျၩနီၪ အဆၧၥၪ,",
			"5": "<sup>5</sup> တၭနၥံၪပျၧၩ့ဘုၪနီၪ မိချႃၭန့ဆၧအၪ့ထုၫ့ကီၪ့စဘံၭၥၪ, ဒဲဆၧအၪ့ထုၫ့ကီၪ့စဘံၭၥၪနီၪ မိချႃၭန့ဆၧဎွံၪဆၧအ ဆၧၫ့အထီ, ဒဲနၥံၪမိဘျဲၩအၪ့ဆၧ, ဒဲအီၪလၧနၥံၪအခး",
			"6": "<sup>6</sup> ဖၧၩ့ဂုးဂုးခၧၫ့ခၧၫ့လီၫ.- ယမိအီၪက့ၪလၩ့ ဆၧဘၪလိၬ အိၭလိၬလၧထံၫၥံၪခးၥံၪအဖၧၩ့တၭ, နၥံၪမိမံၫနၩ့တၭ ၦမိမၩၥၭမဲၪၥၭဖျဲၩ့နၥံၪနးဂၩအ့ၬ. တၭယမိဒုၭစဲၪ့ထၪ့ ခွံၬဆၧဖိၪဆၧဎါအအၧၩ့ လၧနၥံၪအခးဖၧၩ့တၭ, နၭ",
			"7": "<sup>7</sup> ၥံၪဖၩ့ၥံၪမိလ့ၩဖျီၫ့ဘၪနၥံၪအခးအ့ၬ.- နၥံၪမိလီၩ့နၫ့ ထၪ့ခွံၬနၥံၪအဒုၪအဒၩတၭ, အဝ့ၫၥံၪမိလၩ့ထံၩဖါလၧ",
			"8": "<sup>8</sup> နမ့ၬယၫလၧနၥံၪအဖၩ့ၥံၪနၭၥံၪအကၠီၩ့လီၫ.- တၭယဲ ဂၩလၧနၥံၪအကျၩ မိလီၩ့နၫ့ထၪ့ခွံၬ ၦလယၩတၭ, ၦ လယၩလၧနၥံၪအကျၩမိလီၩ့နၫ့ထၪ့ခွံၬ ၦလလၬတၭ, နၥံၪအဒုၪအဒၩ မိလၩ့ထံၩဖါလၧနၥံၪအမ့ၬယၫ လၧ",
			"9": "<sup>9</sup> နၭၥံၪဖၩ့ၥံၪအကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩ ယမိကၠၪခွံၬယ မ့ၬလၧနၥံၪအအီၪတၭ, ယမိဒုၭၥၪထၪ့နၥံၪ, ဒဲမၩအၪ ထၪ့နၥံၪ, ဒဲဒုၭအီၪဂုးအီၪခၧၫ့ယဆၧအုၩ့လၩ့ၡီၩ့လၩ့",
			"10": "<sup>10</sup> လၧနၥံၪလီၫ.- တၭနၥံၪမိအၪ့ဆၧလးလံၩ, ဒဲဂဲၫဆိၬဆၧ",
			"11": "<sup>11</sup> လးလံၩလၧဆၧအၥၫ့အကၠီၩ့လီၫ.- ယမိအီၪက့ၪတဲၩ",
			"12": "<sup>12</sup> ဆံၫ့ဎံၪလၧနၥံၪအကျၩတၭ, ယၥၭလိၪနၥံၪအ့ၬ.- တၭ ယမိလ့ၩဆၧလၧနၥံၪအကျၩ, ယမိကဲၪထၪ့နၥံၪအယွၩ",
			"13": "<sup>13</sup> တၭ, နၥံၪမိကဲၪထၪ့ယၡၩခမျၧးလီၫ.- ယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩနၥံၪအယွၩ လၧအဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪလၧ ခးအံဇံၭ ဘဲၫၥိၭနၥံၪ ထီးမွဲလၧၩ့ အဎီးအၡၩလဂ့ၩ တၭ, ယမၩခါယူၭနၥံၪအနိၪယိၭဘီၩ့ယူၭ, ဒဲဒုၭလ့ၩ ဆၧၫ့ထုၪ့ယူၭနၥံၪယူၭ.",
			"14": "<sup>14</sup> အ့ၪမွဲနၥံၪအ့ၪလခိၭနၪဘၪယလူ, ဒဲလထီးန့ဘၪယ",
			"15": "<sup>15</sup> ဆၧမၪလူၬထီးအလူၬနီၪတၭ,- နၥံၪအ့ၪမၩကြၩ့ထမး ယၥနိၫလဖၪ, ဒဲနၥံၪၥၭလိၪယဆၧစ့ၩရၫ့ထီးနၥံၪလထီး န့ဘၪကယဲယဆၧမၪလူၬလဖၪ, ထီးနၥံၪလၨၪခၫ့ဖၬယ",
			"16": "<sup>16</sup> ဆၧအုၩ့လၩ့တၭ,- မွဲမၬ, ယမိမၩနၥံၪလၧဆၧယီၩ, ယမိဒုၭဘၪနၥံၪလၧဆၧၥၭမဲၩၥၭဖျဲၩ့, ဒဲဆၧဎွ့လၩ့, ဒဲ ဆၧဆူၪဂိၬခိလၧအမိမၩလူၬခွံၬနၥံၪအမ့ၬၥၪၥံၪ, ဒဲဒုၭ အီၪထၪ့ဆၧၥုၪ့အုၭၥၭအုၭတၭ, နၥံၪမိဎွံၪဆၧချံၫပျီၩ ပျီၩ, အဂဲးဘဲၫယီၩ နၥံၪအဒုၪအဒၩမိအၪ့ခွံၬဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ယမိအီၪက့ၪထၫ့ဒၩယမ့ၬ လၧနၥံၪအလီၩ့တၭ, နၥံၪ မိဘၪဆၧမၩၥံၫနၥံၪ လၧနၥံၪအဒုၪအဒၩအမ့ၬယၫလီၫ. ၦလၧအၥၭဂဲၫ့နၥံၪမိပၧၩ့နၥံၪလီၫ. ထီးၦၡၩလလီၩ့ဆီး ဘၪနၥံၪနးဂၩလါနၫ့တၭ, နၥံၪမိစဲၪ့ဖျိၭလီၫ.",
			"18": "<sup>18</sup> လၧဆၧနီၪလဖၪအကၠီၩ့ နၥံၪအ့ၪလခိၭနၪဘၪယလူ တၭ,ယမိအၪ့ၥီၪ့ဒံၭနၥံၪ လၧနၥံၪအဆၧဒဲၩဘၭအကၠီၩ့",
			"19": "<sup>19</sup> နွ့ၫဘျၩ့ဒံၭလီၫ.- တၭယမိမၩခါလၩ့ခွံၬနၥံၪအစီၩ့အ မၩ့အဆၧထၪ့ထီၫ, ဒဲအီၪက့ၪနၥံၪအမူၭခိၪဘဲၫထၭအ",
			"20": "<sup>20</sup> ၥိၭ,နၥံၪအဂၪ့ခိၪဘဲၫထီးဝီၩအၥိၭနီၪလီၫ.- တၭနၥံၪ မိလူၬဂဲးလူၬဘၭပျီၩပျီၩလီၫ. အဂဲးဘဲၫယီၩ ဂၪ့ခိၪဖ့ၪ ဘၪအဆၧအၪထၪ့အ့ၬ. ဒဲၥံၪ့ၥံၪဝၪၥံၪလၧဂၪ့ခိၪနီၪမိ ၥၪထၪ့အဆၧၥၪဆ့အ့ၬ.",
			"21": "<sup>21</sup> နၥံၪအ့ၪလ့ၩဆၧထၫ့ဒုၪဒၩယၧၩ, ဒဲလခိၭနၪဘၪယ လူတၭ, ယမိဒုၭဂဲၫထၪ့ဒံၭ ဆၧနၭဆၧၡၪ့နွ့ၫဘျၩ့ဒံၭ လၧနၥံၪအလီၩ့ ဘဲၫနၥံၪအဆၧဒဲၩဘၭအီၪဝ့ၫအၥိၭနီၪ",
			"22": "<sup>22</sup> လီၫ.- ယမိအၪ့မၧၫ့လၩ့ဆၧဖိၪဆၧဎါအမံၩ့ လၧနၥံၪ အကျၩ လၧအမိမၩန့ဆီၪ့နၥံၪအဖိၪအလံၩ, ဒဲမၩဂၭ ဂီၩ့နၥံၪအဆၧဖိၪဆၧဎါအဒိၩ့, ဒဲမၩလၩ့ၡၩနၥံၪတၭ, နၥံၪအဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭမိအီၪယူဝ့ၫလီၫ.",
			"23": "<sup>23</sup> နၥံၪအ့ၪလကၠၪလီၩ့ထဲၩ့ဘၪနၥံၪအၥၭ လၧဆၧနီၪ လဖၪအကၠီၩ့, ဒဲလ့ၩဆၧထၫ့ဒုၪဒၩယၧၩတၭ, ယမိ",
			"24": "<sup>24</sup> လ့ၩဆၧထၫ့ဒုၪဒၩနၥံၪ,- ဒဲအၪ့ၥီၪ့ဒံၭနၥံၪလၧနၥံၪအ",
			"25": "<sup>25</sup> ဆၧဒဲၩဘၭအကၠီၩ့နွ့ၫဘျၩ့ဒံၭလီၫ.- တၭယမိဒုၭလ့ၩ နုၬနၭလၧနၥံၪအကျၩ, လၧအမိမၩအၧၩ့ဆၧၫ့ဆၧလၧ ယဆၧအုၩ့လၩ့အကၠီၩ့လီၫ. ထီးနၥံၪအီၪကိၩ့အီၪကီၪ့ လၧနၥံၪအဒိၩ့လဖၪအဖၧၩ့တၭ, ယမိအၪ့မၧၫ့လၩ့ဆၧ ၥံၫချဲၫ့လၧနၥံၪအကျၩလီၫ. တၭဆၧမိဖ့ၪလၫ့ခွံၬနၥံၪ",
			"26": "<sup>26</sup> လၧနၥံၪအဒုၪအဒၩအစူၪဖၧၩ့လီၫ.- ထီးယမၩခါနၥံၪ အကိၪအနိၪထိၭဘီၩ့တၭ, ၦမုၪဆံၫဂၩမိအၪ့ဎူကိၪလၧ ဖံၫ့ချၪဖၧၩ့ လဖၧၫ့ဎးတၭ, ၦမိဖ့ၪလၫ့နၥံၪအကိၪလၧ အခံၫ့ဝ့ၫတၭ, နၥံၪမိအၪ့ဘၪတၭ, ဘျဲၩအၪ့အ့ၬ.",
			"27": "<sup>27</sup> တၭလၧဆၧထီးအလူၬအကၠီၩ့နီၪ နၥံၪအ့ၪလခိၭနၪ",
			"28": "<sup>28</sup> ဒံၭဘၪယလူ, အ့ၪမွဲလ့ၩဆၧထၫ့ဒုၪဒၩယၧၩတၭး- ယ မိလ့ၩထၫ့ဒုၪဒၩနၥံၪဆ့, လၧဆၧၥၭထၪ့ဆီၪ့တၭ, ယ မိအၪ့ၥီၪ့နၥံၪ, ယဝ့ၫဒၪလဂၩယမိအၪ့ၥီၪ့နၥံၪလၧနၥံၪ",
			"29": "<sup>29</sup> အဆၧဒဲၩဘၭအကၠီၩ့နွ့ၫဘျၩ့လီၫ.- တၭနၥံၪအဖိၪခွၫ လဖၪအယၪ, ဒဲနၥံၪအဖိၪမုၪလဖၪအယၪနီၪနၥံၪမိအၪ့",
			"30": "<sup>30</sup> ဝ့ၫလီၫ.- တၭယမိမၩဂၭဂီၩ့နၥံၪအလးထၪ့ထီၫ,ဒဲယ မိခူၬလၩ့ခွံၬနၥံၪအဆၧဂၩ့လဖၪ, ဒဲယမိခွံၬၡိၭခွံၬနၥံၪ",
			"31": "<sup>31</sup> အစွၪလၧနၥံၪအဆၧဂၩ့မိၡါအဖၫ့ခိၪ, ဒဲယမိၥၭလိၪန ၥံၪလီၫ. တၭယမိမၩအီၪယူနၥံၪအဒိၩ့လဖၪ, ဒဲမၩဂၭ ဂီၩ့နၥံၪအလးဆံၫ့ဎံၪတၭ, ယမိနၧၫ့နၥံၪ အဆၧနၧၫ့",
			"32": "<sup>32</sup> မၧၫ့မုၬနီၪဆ့အ့ၬ.- ယမိမၩအီၪယူထံၫၥံၪခးၥံၪတၭ, နၥံၪအဒုၪအဒၩလၧအအီၪ လၧအဖၧၩ့နီၪမိအီၪက့ၪအ",
			"33": "<sup>33</sup> ၥၭထီၫမံၫထီၫမၪလီၫ.- ယမိဎွံၪနၥံၪလၧၦဆၨၩဂူၫဂၩ အကျၩတၭ, ယမိထုၭထၪ့နၭလဘံၪ့ လၧနၥံၪအလးခဲၫ့ တၭ, နၥံၪအခးမိအီၪယူ, ဒဲနၥံၪအဒိၩ့လဖၪ မိဂၭဂီၩ့",
			"34": "<sup>34</sup> လီၫ.- ထီးနီၪလဖၧၫ့ထံၫၥံၪခးၥံၪ မိမုၬလၩဝ့ၫလၧအမး ၥံၫအနံၩလဖၪ, လၧကယဲမုနံၩ လၧအအီၪယူဒဲနၥံၪမိ အီၪလၧနၥံၪအဒုၪအဒၩအခးဖၧၩ့လီၫ. ထီးနီၪလဖၧၫ့ ထံၫၥံၪခးၥံၪ, မိအီၪပွံၭ, ဒဲမုၬလၩလၧအမးၥံၫအနံၩ",
			"35": "<sup>35</sup> လဖၪအဖၧၩ့လီၫ.- လၧခးအီၪယူအဘိၩ့ဘၭနီၪမိအီၪ ပွံၭဝ့ၫ,လၧအလအီၪပွံၭဘၪ လၧနၥံၪမးၥံၫအနံၩလၧ နၥံၪအီၪလၧအဖၧၩ့ အဘိၩ့ဘၭနီၪအကၠီၩ့လီၫ.",
			"36": "<sup>36</sup> ၦလၧအအီၪလၩ့ထးလၧနၥံၪအကျၩနီၪ ယမိဒုၭလၩ့ ဘဲၩအၥၭလၧအဒုၪအဒၩအခးဖၧၩ့တၭ, ၥံၪ့လၪဝၭအ ၥီၫမိလီၩ့နၫ့ထၪ့ခွံၬဝ့ၫတၭ, အဝ့ၫၥံၪမိစဲၪ့ဖျိၭဘဲၫလၧ အစဲၪ့ဖီၩ့နၭလဘံၪ့အၥိၭတၭ, ထီးၦလလီၩ့ဆီးဘၪနး",
			"37": "<sup>37</sup> ဂၩလါနၫ့နီၪ, အဝ့ၫၥံၪမိလၩ့ထံၩဖါဝ့ၫဒၪလီၫ.- ထီးၦ လလီၩ့ဆီးဘၪနးဂၩလါနၫ့တၭ, အဝ့ၫၥံၪမိလၩ့ထံၩဖါ လိၬအၥၭလဂၩလၧလဂၩအဖၫ့ခိၪ, ဘဲၫအအီၪလၧနၭ ၥံၪဖၩ့ၥံၪအမ့ၬယၫအၥိၭနီၪလီၫ. တၭနၥံၪမိဆၧၫ့ထုၪ့",
			"38": "<sup>38</sup> လၧနၥံၪအဒုၪအဒၩအမ့ၬယၫ လကဲၪဘၪလီၫ.- နၥံၪ မိထီၩ့လၧဆၧဂၭဂီၩ့ဂၭစၪ လၧၦဆၨၩဂူၫဂၩလဖၪအ ကျၩတၭ, နၥံၪအဒုၪအဒၩအခးနီၪ မိအၪ့ခွံၬနၥံၪလီၫ.",
			"39": "<sup>39</sup> တၭၦလၧအအီၪလၩ့ထး လၧနၥံၪအကျၩလဖၪမိဎွ့လၩ့ ခွံၬလၧအဆၧဒဲၩဘၭအဖၧၩ့, လၧနၥံၪအဒုၪအဒၩအခး ဖၧၩ့, ဒဲလၧအဖါလဖၪ အဆၧဒဲၩဘၭအဖၧၩ့ဆ့, မိဎွ့",
			"40": "<sup>40</sup> လၩ့ခွံၬဝ့ၫလၧအဝ့ၫလီၫ.- အဝ့ၫၥံၪအ့ၪလီၩလၩ့အဆၧ ဒဲၩဘၭ, ဒဲအဖါလဖၪအဆၧဒဲၩဘၭ, ဒဲအဆၧမၪလၧအ",
			"41": "<sup>41</sup> မၩမၪယၧၩ, ဒဲလၧအလ့ၩထၫ့ဒုၪဒၩယၧၩ,- ဒဲယဝ့ၫဒၪ ဆ့ယလ့ၩထၫ့ဒုၪဒၩအဝ့ၫၥံၪ ဒဲဒုၭလ့ၩဝ့ၫ လၧအဒုၪအ ဒၩအခးဖၧၩ့တၭး ထီးနီၪလဖၧၫ့ အၥၭ လၧအလဒိၭ ဘၪဆၧကူၭတရံၭ အ့ၪဆၪ့လၩ့အၥၭတၭ, ထိးဆၧၫ့",
			"42": "<sup>42</sup> အဆၧစ့ၩရၫ့လၧအလၩ့ဘၪဝ့ၫနီၪ,- ထီးနီၪလဖၧၫ့ယ မိနၪ့ထၪ့ထဲၩ့ယဆၧအုၩ့လၩ့ လၧစယၫကူၭ ဒဲယဆၧ အုၩ့လၩ့လၧစအံစၭဆ့, ဒဲယဆၧအုၩ့လၩ့ လၧစအၫ ဘြဟၫ့ဆ့တၭ, ယမိနၪ့ထၪ့ထဲၩ့ဝ့ၫ, ဒဲယမိနၪ့ထၪ့ထဲၩ့ ထံၫၥံၪခးၥံၪဆ့လီၫ.",
			"43": "<sup>43</sup> ထံၫၥံၪခးၥံၪမိဂၭဖျ့ၭခွံၬ လၧအဝ့ၫၥံၪအစူၪဖၧၩ့ဒဲမိ မုၬလၩဆၧလၧအမးၥံၫအနံၩလဖၪအဖၧၩ့, လၧအအီၪ ယူဝ့ၫထီးအဝ့ၫၥံၪလအီၪဘၪနီၪတၭ, အဝ့ၫၥံၪဘၪထိး ဆၧၫ့ဆၧစ့ၩရၫ့လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဒၪလ့ၬမၩ ကြၩ့ထမး ယဆၧစ့ၩရၫ့လဖၪ, ဒဲအီၪက့ၪၥၭလိၪယ",
			"44": "<sup>44</sup> ၥနိၫလဖၪလီၫ.- မွဲလါနၫ့ထီးအအီၪ လၧအဒုၪအဒၩ အခးဖၧၩ့တၭ, ယခွံၬၡိၭခွံၬယဝ့ၫအ့ၬး ဒဲယမိၥၭလိၪ ဝ့ၫထီးယမိမၩဂၭဂီၩ့ဝ့ၫထီးအလူၬ, ဒဲမၩဂၭဂီၩ့ယဆၧ အုၩ့လၩ့လၧအဝ့ၫၥံၪအ့ၬ. အဂဲးဘဲၫယီၩ ယမွဲယဟိ",
			"45": "<sup>45</sup> ဝၩအဝ့ၫၥံၪအယွၩလီၫ.- တၭလၧအဝ့ၫၥံၪအဂးနီၪယမိ နၪ့ထၪ့ထဲၩ့အဆၨၩအထံၭ အဆၧအုၩ့လၩ့လၧယဒုၭ စဲၪ့ထၪ့ခွံၬလၧခးအံဇံၭအဖၧၩ့ လၧၦဆၨၩလဖၪအမ့ၬ ယၫဘဲၫၥိၭယမိကဲၪထၪ့အဝ့ၫၥံၪအယွၩလီၫ. ယဝ့ၫဒၪ ယီၩယမွဲယဟိဝၩလီၫ.",
			"46": "<sup>46</sup> အနီၪမွဲဆၧအထူၫအရူၫဒဲဆၧစ့ၩရၫ့, ဒဲဆၧၥနိၫလ ဖၪလၧယဟိဝၩအီၪက့ၪလၩ့ လၧအနၫ့ဆါဒၪဝ့ၫ,ဒဲၦ အံၫစရ့လၭဖိၪအဘိၩ့ဆၧၩ့ လၧစမိစ့ၭအစူၪဖၧၩ့လၧ ခိၪလီၩ့စဲနၫအလီၩ့လီၫ."
		},
		"27": {
			"1": "<sup>1</sup> ယဟိဝၩချဲၩ့ဆၧလၧစမိစ့ၭတၭ, စံၭဝ့ၫဒၪ, လီၩ ဘၪၦအံၫစရ့လၭဖိၪတၭ, စံၭအဝ့ၫၥံၪ, ထီးၦၡၩဆိၪ လၩ့အၥၭလၩ့မဲၩဒၪဆၧတၭ, ထီးဒၪနအီၪက့ၪအဎွ့ၩ",
			"3": "<sup>3</sup> နီၪ,ၦလဂၩမိအီၪလၧယဟိဝၩအဂးလီၫ.- နအ့ၪအီၪ က့ၪၦခွၫလၧအၥၭၡါ အနံၪ့နံၫဆံၫလံၩလံၩထီၩ့လၧအ ၥၭၡါအနံၪ့ဎူၫဆံၫအဎွ့ၩတၭ, နဘၪအီၪက့ၪအဎွ့ၩလၧ စ့ၩၡက့လၭယဲဆံၫ, ဘဲၫဆၧအလးဆံၫ့ဎံၪအၡက့လၭ",
			"4": "<sup>4</sup> အၥိၭနီၪလီၫ.- တၭအ့ၪမွဲၦမုၪလဂၩနီၪ, နဘၪအီၪက့ၪ",
			"5": "<sup>5</sup> အဎွ့ၩၡက့လၭၥၧၫ့ဆံၫလီၫ.- ခီၫဒၪလၧအၥၭအီၪယဲ နံၪ့လံၩလံၩထီၩ့လၧအၥၭအီၪအနံၪ့ နံၫဆံၫတၭ, နဘၪ အီၪက့ၪၦခွၫအဎွ့ၩၡက့ၭလၭနံၫဆံၫ ဒဲၦမုၪၡက့လၭလ",
			"6": "<sup>6</sup> ဆံၫလီၫ.- လၧအၥၭအီၪ လၩလဘံၪ့ထီၩ့ လၧအၥၭ အီၪယဲနံၪ့တၭ, နဘၪအီၪက့ၪၦခွၫအဎွ့ၩ လၧစ့ၩယဲၡ က့လၭ, ဒဲနဘၪအီၪက့ၪ ၦမုၪအဎွ့ၩ လၧစ့ၩ ၥၧၫ့ၡက့",
			"7": "<sup>7</sup> လၭလီၫ.- အ့ၪမွဲလၧအၥၭၡါအနံၪ့ဎူၫဆံၫ ဒဲလၧအဖၫ့ ခိၪဒံၭတၭ, နဘၪအီၪက့ၪၦခွၫအဎွ့ၩ လၧလဆံၫယဲၡ",
			"8": "<sup>8</sup> က့လၭ, ဒဲၦမုၪလၧၡက့လၭလဆံၫလီၫ.- အ့ၪၡၪ့အ့ၪ ယၬနဲၪ့အဎွ့ၩလၧနအီၪက့ၪဝ့ၫနီၪတၭ, မိဘၪဒုၭဖျီၪအ ၥၭလၧၦလုဆၧလဂၩအမ့ၬယၫတၭ, ၦလုဆၧမိဘၪ အီၪက့ၪအဎွ့ၩလီၫ. ဘဲၫၦလၧအဆိၪလၩ့အၥၭမၩဒၪ ဆၧမိၥ့ၪအၥိၭနီၪ, ၦလုဆၧလဂၩနီၪ မိဘၪအီၪက့ၪအ ဎွ့ၩလီၫ.",
			"9": "<sup>9</sup> ဆၧလၧၦမၩဘိၪ့ယဟိဝၩ လၧဆၧလမံၩ့လါလါအ့ၪ မွဲဆၧဖိၪဆၧဎါတၭ, ကယဲဆၧလၧၦမၩဘိၪ့ယဟိဝၩ",
			"10": "<sup>10</sup> ထီးအလူၬနီၪမိကဲၪထၪ့ဆၧဆံၫ့ဎံၪလီၫ.- ထီးအီၪက့ၪ ဆၧဂူၫဂၩလၧအလးမွဲဂ့ၩ, အၪ့လဲၩမွဲဂ့ၩလဂ့ၩ. အ ဂ့ၩလဒုၩလၧအလဂ့ၩဘၪလဒုၩ အဂးမွဲဂ့ၩ, လဂ့ၩ ဘၪလဒုၩလၧအဂ့ၩအဂးမွဲဂ့ၩ, အၪ့လဲၩဘၪဝ့ၫအ့ၬ. တၭအၪ့လဲၩလဒုၩလၧလဒုၩအဂးတၡါတၭ, အဝ့ၫလ ဒုၩဒဲဆၧလၧအအၪ့လဲၩဝ့ၫလဒုၩ မိကဲၪထၪ့ဆၧအဆံၫ့",
			"11": "<sup>11</sup> ဎံၪနံၫဒုၩလူၬလီၫ.- တၭအ့ၪမွဲဆၧဖိၪဆၧဎါ လဆံၫ့ ဘၪလဒုၩဒုၩလၧၦလမၩဘိၪ့ဘၪ လၧဆၧလုထၪ့ယဟိ ဝၩအဂးတၭ, မိဘၪအီၪက့ၪဆၧဖိၪဆၧဎါ လဒုၩနီၪ",
			"12": "<sup>12</sup> လၧၦလုဆၧလဂၩအမ့ၬယၫလီၫ.- တၭဂ့ၩမွဲဂ့ၩ, အၧၩ့ မွဲဂ့ၩ, ၦလုဆၧလဂၩနီၪမိဘၪအီၪက့ၪအဎွ့ၩလီၫ. ဘဲၫ ၦလုဆၧလဂၩနီၪ အီၪက့ၪအဎွ့ၩအၥိၭနီၪ မိဘၪအီၪဝ့ၫ",
			"13": "<sup>13</sup> လီၫ.- အ့ၪမွဲၦၡၩ အ့ၪဎွ့ၩန့ထဲၩ့တၡါတၭ, ဘၪအီၪ က့ၪအၪထၪ့အဎွ့ၩယဲပိၩ့လပိၩ့ လၧဆၧလၧနအီၪက့ၪ အဎွ့ၩနီၪလီၫ.",
			"14": "<sup>14</sup> ထီးၦၡၩ အီၪက့ၪဆံၫ့ဎံၪအဂံၪ့လဖျိၪ့လၧယဟိဝၩ အဂးတၭ, ဂ့ၩမွဲဂ့ၩ, အၧၩ့မွဲဂ့ၩ, ၦလုဆၧလဂၩဘၪ အီၪက့ၪအဎွ့ၩလီၫ. ဘဲၫၦလုဆၧလဂၩနီၪအီၪက့ၪအ",
			"15": "<sup>15</sup> ဎွ့ၩအၥိၭမိအီၪဂုးအီၪခၧၫ့လီၫ.- ၦလၧအအီၪက့ၪဆံၫ့ ဎံၪဝ့ၫ, အ့ၪမိဎွ့ၩန့ထဲၩ့အဂံၪ့တၭ, ဆၧလၧနအီၪက့ၪ အဎွ့ၩအစ့ၩယဲပိၩ့လပိၩ့ မိဘၪအီၪက့ၪအၪထၪ့လၧအ",
			"16": "<sup>16</sup> ဖၫ့ခိၪလီၫ. အနီၪတၭမိကဲၪထၪ့ထဲၩ့အဆၧလီၫ.- ၦၡၩ အ့ၪအီၪက့ၪဆံၫ့ဎံၪလၧအဆံၬလကဲၩ့ လၧအအီၪလၧ အစူၪဖၧၩ့ လၧယဟိဝၩအဂးတၭ, နဘၪအီၪက့ၪဆၧ အဎွ့ၩဘဲၫဆၧချံၫအၥိၭနီၪလီၫ. ဘုၪမုယီၩအချံၫလဟိ",
			"17": "<sup>17</sup> မၧၫ ဎဎိၭနၬၭ အဎွ့ၩမွဲစ့ၩအၡက့လၭယဲဆံၫလီၫ.- အ့ၪ အီၪက့ၪဆံၫ့ဎံၪ အဆံၬၥံၪနၩၥံၪ လၧယုဘလံၫ အနံၪ့",
			"18": "<sup>18</sup> တၭ,ဘဲၫနအီၪက့ၪအဎွ့ၩအၥိၭနီၪ မိအီၪခၧၫ့လီၫ.- အ့ၪ အီၪက့ၪဆံၫ့ဎံၪအဆံၬ လၧယုဘလံၫအထီအလးခဲၫ့နီၪ တၭ, ၦလုဆၧလဂၩ ဘၪဝံထၪ့နၬထၪ့စ့ၩ လၧအဂး, ဘဲၫနံၪ့လၧအဂး, ဘဲၫနံၪ့လဖၪလၧအအီၪလၩ့ထး,ထီး ဒၪလ့ၬလၧယုဘလံၫအနံၪ့လီၫ. တၭမိဘၪဆၧထုၭခွံၬ",
			"19": "<sup>19</sup> ဝ့ၫလၧနအီၪက့ၪအဎွ့ၩအဖၧၩ့လီၫ.- ၦလၧအအီၪက့ၪ ဆံၫ့ဎံၪဆံၬၥံၪနၩၥံၪနီၪ အ့ၪမိဎွ့ၩန့ထဲၩ့ဘၪအၥၭတၡါ တၭ,ဘၪအီၪက့ၪအၪထၪ့စ့ၩ လၧနအီၪက့ၪအဎွ့ၩယဲ",
			"20": "<sup>20</sup> ပိၩ့လပိၩ့တၭ, မိလၩ့ထံးလၧအဂးလီၫ.- ၦအ့ၪလဎွ့ၩ န့ထဲၩ့ဘၪဆံၬမွဲဂ့ၩ, အ့ၪအၪ့ဆၫခွံၬ လၧဂူၫဂၩမွဲဂ့ၩ",
			"21": "<sup>21</sup> တၭ,ၦဎွ့ၩန့ထဲၩ့လၧၩ့ဝ့ၫအ့ၬ.- အ့ၪမွဲထီးဆံၬနီၪအ့ၪ စဲၪ့ထၪ့လၧယုဘလံၫအထီတၭ, မိကဲၪထၪ့ဆၧဆံၫ့ဎံၪ လၧယဟိဝၩအဂး, ဘဲၫဆံၬလၧဆၧဆိၪလၩ့အၥၭလၧ အကၠီၩ့အၥိၭနီၪလီၫ. ၦလုဆၧလဂၩ မိန့ဘၪဝ့ၫလၧ အဂးလီၫ.",
			"22": "<sup>22</sup> ဂၪ့ခိၪလဝၩ့လၧၦၡၩဎွ့ၩဝ့ၫလစီၪ့နီၪ အ့ၪမိအီၪက့ၪ ဆံၫ့ဎံၪဘၪအၥၭလၧယဟိဝၩအဂးတၭ, လမွဲဘၪဆၧ",
			"23": "<sup>23</sup> လၧအန့ၥၫတၭ,- ၦလုဆၧလဂၩ ဘၪဝံထၪ့နၬထၪ့အ ဎွ့ၩလၧနအီၪက့ၪထီၩ့လၧယုဘလံၫအနံၪ့တၭ, ဘၪဖ့ၪ လၫ့အဎွ့ၩ လၧနအီၪက့ၪဆၧလၧမုလနံၩလၧဆၧဆံၫ့ဎံၪ",
			"24": "<sup>24</sup> လၧယဟိဝၩအဂးလီၫ.- တၭလၧယုဘလံၫအနံၪ့နီၪ ဂၪ့ခိၪလဝၩ့နီၪမိထဲၩ့ထဲၩ့လၧၦလၧအဎွ့ၩဝ့ၫလၧၦလၧ",
			"25": "<sup>25</sup> အမွဲဂၪ့ခိၪနီၪအဆၧဖီၪ့ထၬလီၫ.- တၭနအီၪက့ၪအဎွ့ၩ ထီးအလူၬနီၪ မိဘၪဘဲၫဆၧအလးဆံၫ့ဎံၪ အၡက့လၭ အၥိၭနီၪလီၫ. ဂ့ရၫနံၫဆံၫနီၪ မွဲလၡက့လၭ ဎလဘၭၭ",
			"26": "<sup>26</sup> လီၫ.- အ့ၪမွဲဆၧဖိၪဆၧဎါအဝဲၡါ လၧအမွဲယဟိဝၩ အဆၧဝဲၡါနီၪ, ၦၡၩအီၪက့ၪဆံၫ့ဎံၪဘၪနးဂၩအ့ၬ. ချီ မွဲဂ့ၩ, ၥိၪမွဲဂ့ၩ, ဘ့ၪမွဲဂ့ၩ, မွဲယဟိဝၩအဆၧလီၫ.",
			"27": "<sup>27</sup> အ့ၪမွဲဆၧဖိၪဆၧဎါလဆံၫ့ဘၪတၭ, ထီးနီၪလဖၧၫ့မွဲ အမိဘၪဎွ့ၩန့ထဲၩ့ဝ့ၫ ဘဲၫနအီၪက့ၪအဎွ့ၩ အၥိၭနီၪ, ဒဲမိဘၪအီၪက့ၪအၪထၪ့ ယဲပိၩ့လပိၩ့နီၪလီၫ. တၭအ့ၪ လဎွ့ၩန့ထဲၩ့ဘၪနီၪ, ဘၪအၪ့ဆၫခွံၬဝ့ၫ, ဘဲၫနအီၪက့ၪ အဎွ့ၩအၥိၭနီၪလီၫ.",
			"28": "<sup>28</sup> မွဲလါနၫ့ဆၧလၧၦၡၩဆိၪလၩ့အၥၭ အီၪက့ၪဝ့ၫလၧ ယဟိဝၩအဂး, လၧကယဲဆၧဖိၪဆၧလံၩအကျၩ, ၦၡၩ ဒဲဆၧဖိၪဆၧဎါ, ဒဲဆံၬၥံၪနၩၥံၪ လၧအမွဲအဆၧဒၪဝ့ၫ တၭ,ဆၧအၪ့ဆၫခွံၬဘၪအ့ၬ. ဆၧဎွ့ၩန့ထဲၩ့ဘၪဝ့ၫနး မံၩ့အ့ၬ. ကယဲဆၧလၧၦဆိၪလၩ့အၥၭတၭ အီၪက့ၪဝ့ၫ",
			"29": "<sup>29</sup> နီၪ, မွဲဆၧဆံၫ့ဎံၪထုၬလၧယဟိဝၩအဂးလီၫ.- ဆၧ လၧၦၡၩအီၪက့ၪဝ့ၫ လၧဆၧဆိၪလၩ့အၥၭအကၠီၩ့နီၪ, ၦၡၩဎွ့ၩန့ထဲၩ့ဘၪနးဂၩအ့ၬး မိဘၪမၩၥံၫတၡါဝ့ၫလီၫ.",
			"30": "<sup>30</sup> ဂၪ့ခိၪအဆၧချံၫမွဲဂ့ၩ,ၥံၪ့အၥၪမွဲဂ့ၩ, ကယဲဆၧဘၪ ဆဲၫ့လၧဂၪ့ခိၪဆံၫပိၩ့လပိၩ့နီၪ မွဲယဟိဝၩအဆၧလီၫ.",
			"31": "<sup>31</sup> မွဲဆံၫ့ဎံၪလၧယဟိဝၩအဂးလီၫ.- ၦၡၩအ့ၪဎွ့ၩန့ထဲၩ့ အဆၧဆံၫပိၩ့လပိၩ့လမံၩ့မံၩ့တၭ, မိဘၪအီၪက့ၪအၪ",
			"32": "<sup>32</sup> ထၪ့လၧအနီၪယဲပိၩ့လပိၩ့လီၫ.- တၭကယဲချီဆံၫဒုၩမွဲ ဂ့ၩ, ၥိၪဒဲဘ့ၪဆံၫဒုၩမွဲဂ့ၩ, ထီးဒၪဆၧလၧအလ့ၩဝ့ၫ လၧနိၪထိၭဘီၩ့အဖၫ့လၬ ထီးအလူၬ, ဆံၫဒုၩလဒုၩမိ",
			"33": "<sup>33</sup> ကဲၪထၪ့ဆၧဆံၫ့ဎံၪလၧယဟိဝၩအဂးလီၫ.- မွဲအဂ့ၩ ဧၪ,မွဲအအၧၩ့ဧၪနီၪ, အၪ့ဎၬဘၪအ့ၬ. အ့ၪအၪ့လဲၩ ဝ့ၫတၡါတၭ, အဝ့ၫနီၪဒဲဆၧလၧအအၪ့လဲၩလၧအလး နီၪမိကဲၪထၪ့ဆၧဆံၫ့ဎံၪလီၫ. ဆၧဎွ့ၩန့ထဲၩ့ ဘၪဝ့ၫ အ့ၬ.",
			"34": "<sup>34</sup> ဆၧလဖၪနီၪမွဲဆၧမၪလူၬလဖၪ လၧယဟိဝၩမၪလူၬ စမိစ့ၭ လၧၦအံၫစရ့လၭဖိၪအဂး လၧခိၪလီၩ့စဲနၫအ လီၩ့နီၪလီၫ."
		}
	}
};
module.exports = book;